(126, '2014-09-26 13:50:46', '<p>Perlu ditambah ketertarikan anda, seperti untuk apa pembedaan ulosnya, kemudian klasifikasi, dan beberapa kelebihan JST. (lihat form)</p>\r\n', '2014-10-10 12:06:06', 637, 'R', 6, 50, 117, 'IMPLEMENTASI METODE DETEKSI TEPI CANNY DAN ALGORITMA MULTILAYER PERCEPTRON \r\nUNTUK PENGENALAN POLA ULOS\r\n', 'IMPLEMENTASI METODE DETEKSI TEPI CANNY DAN ALGORITMA MULTILAYER PERCEPTRON \r\nUNTUK PENGENALAN POLA ULOS\r\n', '22104924', 'T', 7, 13, 'T'),
(127, '2014-09-26 13:51:29', '<p>Latar belakang perlu ditambah tentang batik Yogyakarta. Rumusan masalah belum jelas. Metode penelitian tidak jelas sama sekali, belum ada operasional hingga analisisnya. (Lihat form penilaian)</p>\r\n', '2014-11-12 11:49:09', 625, 'R', 50, 18, 128, 'PENGENALAN JENIS BATIK YOGYAKARTA BERDASARKAN POLA GARIS MENGGUNAKAN ZHANG-SUEN & LEARNING VECTOR', 'KLASIFIKASI JENIS BATIK YOGYAKARTA BERDASARKAN POLA GARIS MENGGUNAKAN ZHANG-SUEN & LEARNING VECTOR', '22104828', 'Y', 7, 13, 'T'),
