(129, '2014-09-26 13:52:37', '<ul>\r\n	<li>Rumusan masalah terlalu bias, perlu untuk difokuskan</li>\r\n	<li>Tujuan juga perlu dipertegas</li>\r\n	<li>Tinjauan pustakan masih terlalu umum, sebaiknya dikaitkan langsung dengan penelitian serupa dengan reinforcement learning</li>\r\n	<li>metode evaluasi tidak ada</li>\r\n	<li>referensi perlu ditambah dengan beberapa jurnal terkait<br />\r\n	&nbsp;</li>\r\n</ul>\r\n', '2014-11-11 14:39:47', 625, 'R', 19, 13, 119, 'IMPLEMENTASI REINFORCEMENT LEARNING UNTUK MENENTUKAN TINGKAT KECERDASAN NON-PLAYER-CHARACTER PADA PERMAINAN BALAP MOBIL', 'IMPLEMENTASI REINFORCEMENT LEARNING UNTUK MENENTUKAN TINGKAT KECERDASAN NON-PLAYER-CHARACTER PADA PERMAINAN BALAP MOBIL', '71110164', 'Y', 10, 14, 'T'),
(130, '2014-09-26 13:53:07', '<ul>\r\n	<li>landasan teori ditambahkan</li>\r\n	<li>evaluasi perlu diperjelas</li>\r\n	<li>bagaimana repositori foto dan pembentukan RDF dapat dibangun?</li>\r\n	<li>metodologi penelitian perlu diperjelas</li>\r\n	<li>blok diagram sistem tidak ada/tidak jelas</li>\r\n</ul>\r\n', '2014-11-12 15:11:00', 661, 'R', 8, 39, 113, 'REPOSITORY FOTO BERBASIS RDF', 'REPOSITORY FOTO BERBASIS RDF', '71110146', 'Y', 17, 12, 'T'),
(131, '2014-09-26 13:53:43', '<p>Ukuran efisiensi persediaan barang belum ditentukan dengan jelas</p>\r\n\r\n<p>Bagaimana proses pemrograman non linear diimplementasikan kedalam software?</p>\r\n', '2014-11-12 11:05:32', 661, 'R', 8, 14, 103, 'MAXIMAL PROFIT ITEM SELECTION UNTUK SISTEM PERSEDIAAN BARANG DENGAN PERTIMBANGAN \r\nCROSS SELLING\r\nSTUDI KASUS: TOKO KAMERAD\r\n', 'MAXIMAL PROFIT ITEM SELECTION UNTUK SISTEM PERSEDIAAN BARANG DENGAN PERTIMBANGAN \r\nCROSS SELLING\r\nSTUDI KASUS: TOKO KAMERAD\r\n', '71110144', 'Y', 16, 16, 'T'),
(132, '2014-09-26 13:54:26', '<ul>\r\n	<li>fokus penelitiannya belum terarah, terutama karena modul sistem informasi desa</li>\r\n	<li>daftar pustaka kurang</li>\r\n	<li>tinjauan pustaka perlu ditambah dari jurnal</li>\r\n</ul>\r\n', '2014-10-09 14:59:19', 661, 'R', 8, 13, 107, 'Implementasi Semantic Web Dalam Sistem Informasi Desa Tlogoadi Kabupaten Sleman', 'Implementasi Semantic Web Dalam Sistem Informasi Desa Tlogoadi Kabupaten Sleman', '22084563', 'T', 13, 12, 'T'),
(133, '2014-09-26 13:57:39', '<p>Belum jelas kasusnya.</p>\r\n\r\n<p>Kurang banyak aspek yang bisa diteliti.</p>\r\n\r\n<p>Diganti ke judul yang memiliki banyak aspek, misalnya sistem informasi perekrutan asisten dosen.</p>\r\n', '2014-10-10 12:21:01', 637, 'K', 41, NULL, 129, 'PENERAPAN METODE GOAL DIRECTED DESIGN PADA PEMBUATAN ANTARMUKA APLIKASI “LIGHT BAG”', 'PENERAPAN METODE GOAL DIRECTED DESIGN PADA PEMBUATAN ANTARMUKA APLIKASI “LIGHT BAG”', '71110039', 'T', 50, 13, 'T'),
(134, '2014-09-26 14:03:20', '<p>Lama waktu untuk proses smoothing tidak perlu diteliti</p>\r\n\r\n<p>Tidak boleh menggunakan matlab</p>\r\n\r\n<p>Data minimla 30 file image</p>\r\n', '2014-11-12 14:38:14', 661, 'R', 5, 7, 127, 'IMAGE SMOOTHING MENGGUNAKAN METODE GAUSSIAN FILTERING DAN BILATERAL FILTER', 'IMAGE SMOOTHING MENGGUNAKAN METODE GAUSSIAN FILTERING DAN BILATERAL FILTER', '22104926', 'Y', 16, 16, 'T'),
(135, '2014-09-26 14:10:08', '<ul>\r\n	<li>parameter layak tidaknya itu apa saja?</li>\r\n	<li>hasil penelitian diolah menggunakan pendekatan statistik dan divisualisasikan</li>\r\n	<li>jurnal masih tidak lengkap</li>\r\n	<li>tinjauan metodologi yang digunakan juga perlu untuk diperjelas</li>\r\n</ul>\r\n', '2014-11-12 08:59:20', 639, 'R', 1, 10, 121, 'VOICE OVER INTERNET PROTOCOL (VoIP) PADA JARINGAN IPCAM UKDW DENGAN CODEC GSM DAN iLBC', 'VOICE OVER INTERNET PROTOCOL (VoIP) PADA JARINGAN IPCAM UKDW DENGAN CODEC GSM DAN iLBC', '71110056', 'Y', 20, 14, 'T'),
(136, '2014-09-26 14:10:44', '<ul>\r\n	<li>Rumusan masalah harus difokuskan ke arah optimalisasi streaming menggunakan IPCamera dengan metode apa?</li>\r\n	<li>parameter evaluasi perlu didetilkan dan dijelaskan: alat ukurnya, satuan ukurannya, nilai-nilai ambang normal apa yang semuanya digunakan untuk optimalisasi</li>\r\n	<li>data diolah dengan pendekatan statistik dan divisualisasikan<br />\r\n	&nbsp;</li>\r\n</ul>\r\n', '2014-11-12 12:24:00', 639, 'R', 1, 10, 110, 'IMPLEMENTASI LAYANAN VIDEO STREAMING DALAM JARINGAN INTRANET IP CAMERA UNIVERSITAS KRISTEN DUTA WACANA', 'IMPLEMENTASI LAYANAN VIDEO STREAMING DALAM JARINGAN INTRANET IP CAMERA UNIVERSITAS KRISTEN DUTA WACANA', '71110036', 'Y', 20, 14, 'T'),
