(138, '2014-09-26 14:19:40', '<ul>\r\n	<li>apa sebenarnya yang ingin anda ketahui/teliti terkait algoritma bee colony dan Maze.</li>\r\n	<li>metode penelitian belum mencerminkan tahapan penyelesaian masalah.</li>\r\n	<li>silahkan lihat catatan di proposal.</li>\r\n</ul>\r\n', '2014-11-12 13:14:31', 661, 'R', 16, 14, 123, 'Implementasi Algoritma Artificial Bee Colony sebagai Solver dalam Permainan Maze', 'Implementasi Algoritma Artificial Bee Colony sebagai Solver dalam Permainan Maze', '22084568', 'Y', 19, 12, 'T'),
(139, '2014-09-26 14:20:25', '<ul>\r\n	<li>Rumusan masalah diperjelas</li>\r\n	<li>rancangan hasil aplikasi diperjelas fungsinya untuk :\r\n	<ul>\r\n		<li>visualisasi yang akan dibuat terkait dengan informasi apa?</li>\r\n		<li>protokol-protokol apa saja yang akan di ambil dan diolah?</li>\r\n		<li>resume hasil monitoring</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n', '2014-10-13 09:38:57', 639, 'R', 7, 10, 131, 'IMPLEMENTASI  JPCAP DALAM PEMBUATAN APLIKASI PENGANALISA TRAFFIC PADA JARINGAN KOMPUTER', 'IMPLEMENTASI  JPCAP DALAM PEMBUATAN APLIKASI PENGANALISA TRAFFIC PADA JARINGAN KOMPUTER', '22104878', 'T', 1, 14, 'T'),
