(390, '2015-04-23 13:33:47', '<ol>\r\n	<li>belum jelas yang mau diteliti, bagaimana cara mengukur efektif?</li>\r\n	<li>program yg dibuat seperti apa? apakah buat aplikasi sendiri atau pakai yg sudah jadi? yg baru dijelaskan hanya servernya saja</li>\r\n	<li>harus dibuat metode yg jelas untuk mengukur efektif, mungkin bisa dengan kuisioner dan statistik.&nbsp; Harus ada rumus statistik dan contoh kuisionernya</li>\r\n	<li>format sitasi salah, pustaka belum urut, dan belum menggunakan APA</li>\r\n	<li>diagram blok penelitian tidak tepat</li>\r\n	<li>revisi 1 minggu, tgl 7 Mei 2015 pukul 15:00</li>\r\n</ol>\r\n', '2015-04-30 09:30:54', 625, 'R', 15, NULL, 388, 'Analisis Efektivitas Belajar Dalam Penerapan Virtual Classroom di Universitas Kristen Duta Wacana ', 'Analisis Efektivitas Belajar Dalam Penerapan Virtual Classroom di Universitas Kristen Duta Wacana ', '22074237', 'T', 17, 33, 'T'),
