(731, '2015-10-21 14:19:43', '<ol>\r\n	<li>Metode yang digunakan belum ada</li>\r\n	<li>Metodologi penelitian belum jelas</li>\r\n	<li>Contoh kasus belum ada</li>\r\n	<li>Total 310 (revisi minor)</li>\r\n</ol>\r\n', '2015-11-05 11:40:43', 625, 'R', 2, NULL, 738, 'IMPLEMENTASI PERMAINAN BATU-KERTAS-GUNTING\r\nDENGAN MENGGUNAKAN DETEKSI DAN PENGENALAN ISYARAT TANGAN SECARA REAL TIME\r\n', 'IMPLEMENTASI PERMAINAN BATU-KERTAS-GUNTING\r\nDENGAN MENGGUNAKAN DETEKSI DAN PENGENALAN ISYARAT TANGAN SECARA REAL TIME\r\n', '22104878', 'Y', 13, 40, 'T'),
(732, '2015-10-21 14:25:25', '<ol>\r\n	<li>Belum ada teori tentang usability testing</li>\r\n	<li>Bagaimana cara testing usabilitynya? kuisionernya bagaimana?</li>\r\n	<li>Daftar pustaka belum diurutkan abjad</li>\r\n	<li>Perangkingan itu tujuannya untuk apa? kriteria masing2 parameter perangkingan apa?</li>\r\n	<li>Skor 300 (rev minor)</li>\r\n</ol>\r\n', '2015-10-23 12:26:18', 625, 'R', 13, NULL, 745, 'PENGUJIAN ASPEK USABILITY SITUS LAYANAN RESERVASI HOTEL', 'PENGUJIAN ASPEK USABILITY SITUS LAYANAN RESERVASI HOTEL', '22074389', 'T', 17, 40, 'T'),
(733, '2015-10-21 14:25:53', '<ol>\r\n	<li>Rumusan tidak jelas, terkait efisien, efektif, dan puas, harus bisa diukur</li>\r\n	<li>Parameter pengujian bias</li>\r\n	<li>Metodologi tidak jelas</li>\r\n	<li>Skor 230 (revisi mayor)</li>\r\n</ol>\r\n', '2015-10-27 08:12:50', 625, 'R', 13, NULL, 743, 'EVALUASI USABILITY PADA WEBSITE  UNIVERSITAS KRISTEN DUTA WACANA \r\n', 'EVALUASI USABILITY PADA WEBSITE  UNIVERSITAS KRISTEN DUTA WACANA \r\n', '22074264', 'T', 8, 40, 'T'),
(734, '2015-10-21 14:26:19', '<ol>\r\n	<li>Belum ada kutipan referensi sama sekali di teori</li>\r\n	<li>Urutan teori disesuaikan</li>\r\n	<li>Tambah teori tentang usability testing, usability khusus pada perangkat mobile</li>\r\n	<li>Batasan masalah diperbaiki</li>\r\n	<li>Berikan contoh kuisioner yang rencana akan dibuat</li>\r\n	<li>Lihat catatan pada proposal</li>\r\n	<li>Skor 265 (revisi mayor)</li>\r\n</ol>\r\n', '2015-10-23 06:46:40', 625, 'R', 13, NULL, 740, 'EVALUASI USABILITY PADA APLIKASI MOBILE JEJARING SOSIAL', 'EVALUASI USABILITY PADA APLIKASI MOBILE JEJARING SOSIAL', '22074230', 'T', 17, 40, 'T'),
(735, '2015-10-21 14:33:58', '<p>- Judul tidak jelas<br />\r\n- Latar belakang tidak jelas<br />\r\n- Game/subyek tidak jelas<br />\r\n- Tidak ada tinjauan pustaka<br />\r\n- Tidak ada blok diagram<br />\r\n- Tidak ada referensi jurnal SATU pun!<br />\r\n- Penulisan daftar pustaka salah, tidak sesuai APA</p>\r\n\r\n<p>- Skor 160 (DITOLAK)</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2015-10-23 15:35:38', 625, 'K', 13, NULL, 747, 'Perancangan Ulang Interface Game Cangkulan Berdasarkan Inspeksi Usability Menggunakan Heuristic Evaluation', 'Perancangan Ulang Interface Game Cangkulan Berdasarkan Inspeksi Usability Menggunakan Heuristic Evaluation', '71110021', 'T', 50, 41, 'T'),
(736, '2015-10-21 14:34:59', '<p>&gt; Belum ada tinjauan pustaka yang memperlihatkan penelitian sejenis dan pembeda penelitian anda dengan penelitian sebelumnya.<br />\r\n&gt; Citra rambu petunjuk seperti apa yang akan digunakan belum diperlihatkan</p>\r\n\r\n<p>Skor 200 (rev mayor)</p>\r\n', '2015-11-11 11:54:46', 625, 'R', 42, NULL, 744, 'PENGENALAN RAMBU PERINTAH BERBASIS BENTUK DENGAN METODE ZERNIKE MOMENTS DAN K NEAREST NEIGHBOUR', 'PENGENALAN RAMBU PERINTAH BERBASIS BENTUK DENGAN METODE ZERNIKE MOMENTS DAN K NEAREST NEIGHBOUR', '71120064', 'Y', 53, 42, 'T'),
(737, '2015-10-21 14:39:10', '<ol>\r\n	<li>Tujuan penelitian diperjelas lagi</li>\r\n	<li>Landasan teori perlu uraian rumus yg akan digunakan dan diberikan contoh konkrit perhitungan dan algoritmanya</li>\r\n	<li>Diperdalam dan diperbanyak lagi konsep tentang trend analysis</li>\r\n	<li>Berikan contoh untuk perhitungan metode backpropagation</li>\r\n	<li>Skor 175 (rev mayor)</li>\r\n</ol>\r\n', '2015-10-23 13:28:44', 625, 'R', 8, NULL, 741, 'TREND ANALISIS PADA DATA GEMPA BUMI DI WILAYAH PANTAI SELATAN JAWA UNTUK PREDIKSI GEMPA BUMI  ', 'TREND ANALISIS PADA DATA GEMPA BUMI DI WILAYAH PANTAI SELATAN JAWA UNTUK PREDIKSI GEMPA BUMI  ', '22094746', 'T', 16, 42, 'T'),
(738, '2015-10-21 14:49:25', '<p>&gt; Kalau sebatas membangun aplikasi android, sudah banyak, apa yang menjadi pembeda? Sisi kebaruannya?<br />\r\n&gt; Tidak menjelaskan metode/ algoritma yang akan digunakan. Di mana sisi penelitiannya?<br />\r\n&gt; Belum adanya tinjauan pustaka yang memperlihatkan perkembangan penelitian topik sejenis sampai saat ini</p>\r\n\r\n<p>Skor 120 (tolak)</p>\r\n', '2015-10-25 20:08:27', 625, 'K', 50, NULL, 742, 'Membangun aplikasi permainan alat musik kecapi berbasis Android. ', 'Membangun aplikasi permainan alat musik kecapi berbasis Android. ', '22084536', 'T', 53, 42, 'T'),
(739, '2015-10-21 14:50:06', '<p>Buku Introduction to GUI Design belum ada tahun</p>\r\n\r\n<p>Metodologi dilengkapi dengan langkah-langkah yang lengkap, termasuk bagaimana proses pengujian</p>\r\n\r\n<p>Flowchart diperbaiki (melangkah Level 2 duplikasi)</p>\r\n\r\n<p>Tambahkan teori tentang IMK sebelum masuk ke GDD</p>\r\n', '2015-11-11 10:18:57', 772, 'R', 42, NULL, 749, 'PERANCANGAN APLIKASI GAME EDUKASI SEMAPHORE DENGAN PENDEKATAN GOAL DIRECTED DESIGN', 'PERANCANGAN APLIKASI GAME EDUKASI SEMAPHORE DENGAN PENDEKATAN GOAL DIRECTED DESIGN', '22094665', 'T', 15, 42, 'T'),
(740, '2015-10-21 14:54:46', '<ol>\r\n	<li>Latar belakang membingungkan</li>\r\n	<li>Banyak kesalahan dalam penulisan (typographical error)</li>\r\n	<li>Tujuan tidak jelas</li>\r\n	<li>Tidak ada tinjauan pustaka</li>\r\n	<li>Referensi out of date</li>\r\n	<li>Tidak ada contoh kasus</li>\r\n	<li>Parameter evaluasi?</li>\r\n	<li>Cara evaluasi?</li>\r\n	<li>Skor 100 (ditolak)</li>\r\n</ol>\r\n', '2015-10-27 14:16:30', 625, 'K', 8, NULL, 748, 'PEMANFAATAN ALGORITMA APRIORI SEBAGAI ALAT BANTU MENJAWAB INFERENCE QUESTIONS PADA TOEFL READING TEST', 'PEMANFAATAN ALGORITMA APRIORI SEBAGAI ALAT BANTU MENJAWAB INFERENCE QUESTIONS PADA TOEFL READING TEST', '71120011', 'T', 13, 40, 'T'),
(741, '2015-10-21 14:56:07', '<ol>\r\n	<li>Dalam proposal ini belum dituliskan seberapa efektif animasi ini? uji efektivitas bagaimana?</li>\r\n	<li>Ukuran parameter &quot;lebih jelas, lebih singkat, lebih mudah dan lebih menyenangkan&quot; dibandingkan dengan apa?</li>\r\n	<li>Bagaimana proses mengukur keberhasilan sistem di akhir penelitian ?<br />\r\n	Skor 255 (rev mayor)</li>\r\n</ol>\r\n', '2015-10-23 13:38:12', 625, 'R', 34, NULL, 731, 'PEMBELAJARAN DASAR KANJI SEDERHANA MENGGUNAKAN JUMLAH CORETAN KANJI BERBASIS ANIMASI TURORIAL', 'PEMBELAJARAN DASAR KANJI SEDERHANA MENGGUNAKAN JUMLAH CORETAN KANJI BERBASIS ANIMASI TURORIAL', '71150147', 'T', 16, 42, 'T'),
(742, '2015-10-21 14:57:40', '<p>Revisi Mayor (Nilai: 240)</p>\r\n\r\n<p>- Metode perancangan sebaiknya memilih metode perancangan yang anda pelajari di mata kuliah desain game untuk simulasi pembelajaran. Apabila tetap menggunakan usability testing, apakah ada metode usability testing yang khusus untuk pembuatan game? kalau ada, ya boleh saja menggunakan ini.</p>\r\n\r\n<p>- kalau metode perancangannya sudah bagus, metode pengujian bisa mengunakan GEQ (Game Experience Questioner)</p>\r\n\r\n<p>- blok diagram belum bisa menggambarkan tentang langkah-langkah anda akan mendesain game anda. anda bisa menambahkan sedikit gambaran apa yang akan anda buat langkah demi langkah dengan contoh kasus anda</p>\r\n\r\n<p>- metode penelitian bisa anda perjelas dengan kalimat-kalimat metode penelitian, langkah demi langkah.</p>\r\n\r\n<p>Semoga berhasil memperbaiki proposal anda.&nbsp;</p>\r\n', '2016-02-16 14:48:48', 637, 'R', 19, NULL, 746, 'PERANCANGAN MOBILE GAME SIMULASI BERKEBUN SEBAGAI MEDIA EDUKASI', 'PERANCANGAN MOBILE GAME SIMULASI BERKEBUN SEBAGAI MEDIA EDUKASI', '22104906', 'T', 7, 41, 'T'),
