(1016, '2016-09-16 13:22:18', '<p>Apakah topik tidak terlalu luas: monitoring dan feedback report?</p>\r\n\r\n<p>Definisi &quot;monitoring ketersediaan&quot; kurang jelas.</p>\r\n\r\n<p>Hubungan antara &quot;Object Tracking&quot; vs. lahan kosong/slot parkir?</p>\r\n\r\n<p>Apakah pencacahan mobil tidak ada cara yang lebih sederhana?<br />\r\n&nbsp;</p>\r\n', '2016-10-11 16:18:13', 772, 'R', 53, NULL, 1044, 'SISTEM MONITOR PARKIR MOBIL BERBASIS IOT DENGAN RASPBERRY PI DI KAMPUS UKDW', 'SISTEM MONITOR PARKIR MOBIL BERBASIS IOT DENGAN RASPBERRY PI DI KAMPUS UKDW', '71130100', 'Y', 14, 53, 'T'),
