(1038, '2016-09-16 14:21:45', '<p>Latar belakang kurang jelas. Perlu menambahkan keterkaitan dengan penelitian sebelumnya.</p>\r\n\r\n<p>Banyak salah ketik, konsistensi penulisan perlu diperbaiki, perlu menyesuaikan dengan format standar penulisan tabel, gambar, dsb.</p>\r\n\r\n<p>Perlu ditambahkan penjelasan lebih lengkap pada algoritma Rocchio, feature selection dan perlu ditambahkan contoh kasus untuk algoritma utama.</p>\r\n', '2016-09-23 11:02:10', 772, 'K', 17, NULL, 1064, 'KLAISIFIKASI SENTIMEN DATASET PEMILU MENGGUNAKAN ALGORITMA ROCCHIO', 'KLASIFIKASI SENTIMEN DATASET PEMILU MENGGUNAKAN ALGORITMA ROCCHIO', '22104906', 'T', 2, 54, 'T'),
