(1128, '2016-10-14 11:29:15', '<p>1. Judul diganti saja, manhattan distance diganti klasifikasi KNN karena KNN ada di latar belakang</p>\r\n\r\n<p>2. Landasan teori kurang untuk algoritma KNN, beri contoh. Teori Manhattan Distance dimasukkan ke dalam KNN saja</p>\r\n\r\n<p>3. Blok diagram masih salah, mohon untuk diperbaiki, ekstraksi fitur belum masuk. Manhattan distance dihapus saja. Langkah-langkah juga tidak dijelaskan di bawahnya</p>\r\n\r\n<p>4. Tinjauan pustaka &nbsp;kurang</p>\r\n\r\n<p>5. Jenis aksara jawa tidak hanya satu sumber(MS Word, scan buku cetak)</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-11-07 13:31:30', 945, 'R', 42, NULL, 1188, 'Pengenalan Aksara Jawa Menggunakan Geometric Moment Invariant dan Manhattan Distance', 'Pengenalan Aksara Jawa Menggunakan Geometric Moment Invariant dan Manhattan Distance', '71120071', 'Y', 3, 57, 'T'),
