(1158, '2016-10-14 13:57:31', '<p>- Rumusan masalah kurang tepat</p>\r\n\r\n<p>- Pengumpulan data kurang spesifik</p>\r\n\r\n<p>- Apa hubungan antara f-pattern dengan usability metrics?</p>\r\n\r\n<p>- Belum dijelaskan cara menganalisa f-pattern</p>\r\n', '2016-10-21 10:40:51', 636, 'R', 42, NULL, 1208, 'PENERAPAN F-PATTERN WEB DESIGN PADA WEBSITE UNIVERSITAS KRISTEN DUTA WACANA BERBASIS RESPONSIVE DESIGN WEB\r\n', 'PENERAPAN F-PATTERN WEB DESIGN PADA WEBSITE UNIVERSITAS KRISTEN DUTA WACANA BERBASIS RESPONSIVE DESIGN WEB\r\n', '22104859', 'T', 50, 58, 'T'),
