(1160, '2016-10-14 14:05:22', '<p>Biasanya cukup dengan KP (karena tidak ada analisis dan kurang jelas permasalahan apa yang akan dipecahkan).</p>\r\n', '2016-11-07 15:00:57', 638, 'R', 1, NULL, 1180, 'MANAJEMEN WIRELESS MENGGUNAKAN SERVER RADIUS PADA RUMAH SAKIT PANTI RAPIH', 'MANAJEMEN WIRELESS MENGGUNAKAN SERVER RADIUS PADA RUMAH SAKIT PANTI RAPIH', '71120074', 'Y', 10, 59, 'T'),
(1161, '2016-10-14 14:05:59', '<ul>\r\n	<li>Pada latar belakang masalah tambahkan dengan penelitian-penelitian sebelumnya dari jurnal/sumber lainnya.</li>\r\n	<li>Pada landasan teori penjelasan metode yang diterapkan dengan gambar, penjelasan protokol dan analisisnya</li>\r\n	<li>Berikan contoh kasus</li>\r\n	<li>Pada bagian metodologi tambahkan penjelasan.&nbsp; Misalnya: ambil data.&nbsp; Ambil data apa?</li>\r\n	<li>Pada bagian studi pustaka/referensi tambahkan buku jaringan komputer</li>\r\n</ul>\r\n', '2016-11-07 10:20:23', 638, 'R', 1, NULL, 1179, 'IMPLEMENTASI JARINGAN WIRELESS ROAMING DENGAN FITUR TUNNELING MENGGUNAKAN VIRTUAL INTERFACE EOIP DI MIKROTIK PADA RUMAH SAKIT PANTI RAPIH', 'IMPLEMENTASI JARINGAN WIRELESS ROAMING DENGAN FITUR TUNNELING MENGGUNAKAN VIRTUAL INTERFACE EOIP DI MIKROTIK PADA RUMAH SAKIT PANTI RAPIH', '71120037', 'Y', 10, 59, 'T'),
(1162, '2016-10-14 14:32:00', '<ol>\r\n	<li>Typografi error - banyak sekali</li>\r\n	<li>Banyak tulisan copy paste dari tulisan orang lain dan tidak diedit sama sekali</li>\r\n	<li>Latar belakang lemah, tidak ada data pendukung / rujukan</li>\r\n	<li>Ada banyak gambar yang tidak ada</li>\r\n	<li>Gambar tidak dijelaskan sama sekali</li>\r\n	<li>Metode peneltiian tidak jelas</li>\r\n</ol>\r\n', '2016-10-21 10:55:04', 625, 'R', 9, NULL, 1216, 'DESAIN WEBSITE AGEN TRAVEL YANG  USER FRIENDLY DAN USABLE BAGI PENDERITA BUTA WARNA ', 'DESAIN WEBSITE AGEN TRAVEL YANG  USER FRIENDLY DAN USABLE BAGI PENDERITA BUTA WARNA ', '71110040', 'T', 13, 56, 'T'),
