(1261, '2017-02-13 14:52:03', '<p>Tidak diterima (190)</p>\r\n\r\n<ul>\r\n	<li>Sudah banyak skripsi/penelitian terkait topik.</li>\r\n	<li>Apa perbedaan/keunikan dengan penelitian yang akan dilakukan? Harus diperjelas agar tidak terindikasi sebagai plagiasi.</li>\r\n	<li>Catatan detail dapat dilihat pada proposal yang sudah di-review.</li>\r\n</ul>\r\n', '2017-02-17 11:10:43', 638, 'K', 13, NULL, 1298, 'PERANCANGAN SISTEM PAKAR UNTUK DIAGNOSA PENYAKIT JANTUNG DENGAN METODE FORWARD CHAINING', 'PERANCANGAN SISTEM PAKAR UNTUK DIAGNOSA PENYAKIT JANTUNG DENGAN METODE FORWARD CHAINING', '71130097', 'T', 19, 63, 'T'),
(1262, '2017-02-13 14:52:35', '<p>Latar Belakang Tidak Jelas<br />\r\nRumusan Masalah Tidak jelas<br />\r\nPustaka Kacau<br />\r\nTopik Penelitian Sama Sekali Tidak Logis, harap mencari topik lain</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SKOR: 125 (TOLAK)</p>\r\n', '2017-02-17 13:01:08', 772, 'K', 42, NULL, 1297, ' \r\nAnalisis Usability Testing Pada Game Dota 2\r\n', ' \r\nAnalisis Usability Testing Pada Game Dota 2\r\n', '71120097', 'T', 50, 64, 'T'),
(1263, '2017-02-13 14:53:02', '<p>Perbaikan Rumusan Masalah</p>\r\n\r\n<p>Manfaat penelitian disesuaikan dengan fokus penelitian</p>\r\n\r\n<p>Tidak ada citasi dalam landasan teori sama sekali</p>\r\n\r\n<p>Penomoran gambar masih salah</p>\r\n\r\n<p>Penulisan daftar pustaka masih belum sesuai format APA</p>\r\n\r\n<p>Coba ditambahkan daftar pustaka penelitian dengan judul &quot;Performance Analysis of AODV, AOMDV, DSR, DSDV Routing Protocols in Vehicular Ad Hoc Network&quot; dan &quot;Implementing and Evaluaing The DYMO Routing Protocol&quot;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SKOR: 260 (Revisi Mayor)</p>\r\n', '2017-03-03 14:02:37', 772, 'R', 1, NULL, 1294, 'ANALISIS PERBANDINGAN UNJUK KERJA PROTOKOL ROUTING REAKTIF (DYMO) TERHADAP PROTOKOL ROUTING PROAKTIF (DSDV) DI JARINGAN VANET', 'ANALISIS PERBANDINGAN UNJUK KERJA PROTOKOL ROUTING REAKTIF (DYMO) TERHADAP PROTOKOL ROUTING PROAKTIF (DSDV) DI JARINGAN VANET', '71120104', 'Y', 15, 64, 'T'),
(1264, '2017-02-13 14:54:24', '<p>Revisi Mayor (290)</p>\r\n\r\n<ul>\r\n	<li>Tidak ada blok diagram.</li>\r\n	<li>Program di MATLAB sejauh apa? Sekompleks apa? Perlu dijelaskan lebih lanjut.</li>\r\n	<li>Format penulisan diperbaiki.</li>\r\n</ul>\r\n', '2017-03-03 12:35:10', 638, 'R', 15, NULL, 1276, 'PERBANDINGAN CITRA HASIL STEGANOGRAFI MENGGUNAKAN METODE LSB DAN DWT', 'PERBANDINGAN CITRA HASIL STEGANOGRAFI MENGGUNAKAN METODE LSB DAN DWT', '71130029', 'Y', 39, 63, 'T'),
(1265, '2017-02-13 14:55:10', '<p>LBM, Referensi Penelitian VPN Sebelumnya?</p>\r\n\r\n<p>Rumusan Masalah Kurang Tepat, sumber analisis yang sesuai topik?</p>\r\n\r\n<p>Dukungan penjelasan gambar?</p>\r\n\r\n<p>Blog Diagram Proses yang jelas</p>\r\n\r\n<p>Format Penulisan proposal dan Bahasa Indonesia yang EYD</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SKOR: 200 (Revisi Mayor)</p>\r\n', '2017-03-03 11:30:59', 772, 'R', 1, NULL, 1284, 'IMPLEMENTASI REGISTRASI JARAK JAUH DENGAN MENGGUNAKAN VPN SITE-TO-SITE PADA JARINGAN AGAPE, LOGOS, DAN SETURAN', 'IMPLEMENTASI REGISTRASI JARAK JAUH DENGAN MENGGUNAKAN VPN SITE-TO-SITE PADA JARINGAN AGAPE, LOGOS, DAN SETURAN', '71130125', 'Y', 10, 64, 'T'),
