(1403, '2017-09-15 08:56:00', '<p>study kasus sistem pakar terlalu sempit rule, usulan diperluas penyakit anjing, penjelasan penelitian sebelumnya belum, pustaka, gambar alur penjelasan FC belum ada, metode penelitian dijelaskan sesuai studi kasus, pustaka lebih baru ya,</p>\r\n\r\n<p>skor 235 rev mayor</p>\r\n', '2017-10-11 08:54:49', 625, 'R', 19, NULL, 1474, 'SISTEM PAKAR UNTUK MENDIAGNOSA PENYAKIT KULIT PADA ANJING MENGGUNAKAN METODE FORWARD CHAINING BERBASIS WEB', 'SISTEM PAKAR UNTUK MENDIAGNOSA PENYAKIT KULIT PADA ANJING MENGGUNAKAN METODE FORWARD CHAINING BERBASIS WEB', '71120080', 'Y', 10, 73, 'T'),
(1404, '2017-09-15 09:07:25', '<p>Belum terlihat pentingnya penelitian. Rumusan Masalah kurang tepat. Tujuan Penelitian kurang kuat. Tidak ada tinjauan pustaka.</p>\r\n\r\n<p>Sebaiknya merubah objek penelitian yang lebih mudah dalam eksplorasi mengenai permasalahan yang ada.</p>\r\n\r\n<p>Skor : 160</p>\r\n', '2017-09-26 13:29:47', 625, 'K', 9, NULL, 1491, 'PERANCANGAN USER INTERFACE SISTEM INFORMASI WISATA TRAVELPANGANDARAN.COM BERBASIS WEB MENGGUNAKAN USER CENTERED DESIGN', 'PERANCANGAN USER INTERFACE SISTEM INFORMASI WISATA TRAVELPANGANDARAN.COM BERBASIS WEB MENGGUNAKAN USER CENTERED DESIGN', '71120105', 'T', 42, 75, 'T'),
(1405, '2017-09-15 09:14:33', '<ol>\r\n	<li>Belum disebutkan pengguna/user untuk sistem ini</li>\r\n	<li>Perlu diberikan contoh kongkrit untuk penggunaan metode K-means clustering!</li>\r\n	<li>Perlu diberikan contoh kongkrit untuk proses penghitungan purity!</li>\r\n	<li>Mengapa transaksi data yang digunakan hanya 1 tahun? &nbsp;Seharusnya 2 tahun supaya ada perbedaan pola kelihatan.</li>\r\n</ol>\r\n', '2017-10-11 13:45:48', 1209, 'R', 8, NULL, 1459, 'Analisa pola transaksi pelanggan menggunakan Metode K-Means Clustering', 'Analisa pola transaksi pelanggan menggunakan Metode K-Means Clustering', '71140038', 'Y', 16, 74, 'T'),
(1406, '2017-09-15 09:36:05', '<ol>\r\n	<li>Contoh kasus untuk algoritma utama tidak ada</li>\r\n	<li>Referensi masih kurang, sumbernya lebih baik dari sumber utama</li>\r\n	<li>Corpus yang akan dipakai dicantumkan nama dan sumbernya secara lengkap. Juga ada cuplikan corpus yang dipakai dalam landasan teori.</li>\r\n</ol>\r\n', '2017-10-10 18:27:36', 1209, 'R', 17, NULL, 1469, 'KLASIFIKASI ENQUIRY SPAM PADA SITUS\r\nSENIORHOUSINGONLINE DENGAN METODE ENHANCED K-NEAREST NEIGHBOR USING INFORMATION GAIN AND CLUSTERING', 'KLASIFIKASI ENQUIRY SPAM PADA SITUS\r\nSENIORHOUSINGONLINE DENGAN METODE ENHANCED K-NEAREST NEIGHBOR USING INFORMATION GAIN AND CLUSTERING', '71140050', 'Y', 2, 74, 'T'),
