(1408, '2017-09-15 10:25:44', '<ol>\r\n	<li>Skor 300 revisi minor</li>\r\n	<li>Revisi penulisan</li>\r\n</ol>\r\n', '2017-10-03 10:49:53', 625, 'R', 7, NULL, 1467, 'WEB BASED GAME BILIAR DENGAN MENGIMPLEMENTASIKAN EFEK SQUIRT DAN SWERVE', 'WEB BASED GAME BILIAR DENGAN MENGIMPLEMENTASIKAN EFEK SQUIRT DAN SWERVE', '71140003', 'Y', 14, 74, 'T'),
(1409, '2017-09-15 10:34:35', '<ol>\r\n	<li>Rumusan masalah diperbaiki! Tujuan diperbaiki!</li>\r\n	<li>Landasan teori dicantumkan sumbernya!</li>\r\n	<li>Blok diagram diperbaiki.</li>\r\n	<li>Metode penelitian mengikuti metode pengembangan sistem pakar!</li>\r\n	<li>Terdapat penelitian yang sama sebelumnya (Browsing!)</li>\r\n	<li>Tolong ditambah tinjauan pustaka untuk memperjelas penelitian yang akan dilakukan.</li>\r\n</ol>\r\n', '2017-09-22 10:35:58', 1209, 'K', 3, NULL, 1486, 'Sistem Pakar Diagnosa Kerusakan Kamera DSLR( Digital Single Lens Reflex) Menggunakan Metode Forward Chaining', 'Sistem Pakar Diagnosa Kerusakan Kamera DSLR( Digital Single Lens Reflex) Menggunakan Metode Forward Chaining', '71130047', 'T', 19, 74, 'T'),
