(1418, '2017-09-15 11:19:34', '<ol>\r\n	<li>Judul menekankan pada metode UCD tetapi dalam metode penelitian tidak tampak penerapan UCD</li>\r\n	<li>Keakuratan data (informasi) dipikirkan supaya tidak menyesatkan pengguna (Mendapatkan data waktu jalur rempah dari mana, versi apa? Hanya 1 versi buku saja?). Dighum = mengolah pengetahuan dari berbagai sumber (lisan, tertulis, praktis, dll) dan mengubah menjadi bentuk digital</li>\r\n	<li>Lihat catatan dalam proposal</li>\r\n</ol>\r\n\r\n<p>Catatan : Judul yang mirip Yoshua Stefan&nbsp;(71130053), Lea Destiany Taniwel (71140093)</p>\r\n', '2017-10-11 12:10:42', 1209, 'R', 3, NULL, 1502, 'IMPLEMENTASI METODE USER CENTERED DESIGN DALAM PERANCANGAN ANTARMUKA SITUS SEJARAH JALUR REMPAH INDONESIA', 'IMPLEMENTASI METODE USER CENTERED DESIGN DALAM PERANCANGAN ANTARMUKA SITUS SEJARAH JALUR REMPAH INDONESIA', '71130061', 'Y', 9, 74, 'T'),
