(1422, '2017-09-15 11:31:09', '<ul>\r\n	<li>\r\n	<ul>\r\n		<li>\r\n		<p>Secara umum, ide bisa ditangkap dan cukup jelas. &nbsp;Ide ditulis dengan cukup baik, meskipun hal-hal teknis masih sangat perlu diperjelas dan dirancang dengan lebih baik dan detil</p>\r\n		</li>\r\n		<li>\r\n		<p>Bahasa yang digunakan formal dan menggunakan aturan penulisan dalam Bahasa Indonesia</p>\r\n		</li>\r\n		<li>\r\n		<p>Batasan masalah: &nbsp;bisa diisi dengan cakupan daerah di Palangkaraya, jenis dan jumlah data yang akan diolah</p>\r\n		</li>\r\n		<li>\r\n		<p>Tujuan penelitian: &nbsp;tujuan penelitian hanya ada satu, yang lain berupa sub tujuan.</p>\r\n		</li>\r\n		<li>\r\n		<p>Metodologi penelitian perlu diperjelas dengan lebih detil, termasuk alat ukur yang akan digunakan dalam evaluasi.</p>\r\n		</li>\r\n		<li>\r\n		<p>Ada cukup banyak <em>typographical error</em></p>\r\n		</li>\r\n		<li>\r\n		<p>Semua gambar dan tabel harus disebutkan dalam teks dan dijelaskan</p>\r\n		</li>\r\n		<li>\r\n		<p>Ada beberapa kalimat yang menggantung</p>\r\n		</li>\r\n		<li>\r\n		<p>skor 215 rev mayor</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n', '2017-10-11 09:23:09', 625, 'R', 42, NULL, 1516, 'PERANCANGAN DASHBOARDS UNTUK PEMANTAUAN LOSSES DISTRIBUSI ENERGI LISTRIK DENGAN METODE USER-CENTERED DESIGN\r\n(STUDI KASUS :  PT. PLN AREA PALANGKARAYA)\r\n', 'PERANCANGAN DASHBOARDS UNTUK PEMANTAUAN LOSSES DISTRIBUSI ENERGI LISTRIK DENGAN METODE USER-CENTERED DESIGN\r\n(STUDI KASUS :  PT. PLN AREA PALANGKARAYA)\r\n', '71130081', 'Y', 13, 72, 'T'),
(1423, '2017-09-15 11:58:35', '<ul>\r\n	<li>\r\n	<p>Banyak yg mirip dengan algoritma yang digunakan, kemudian diganti dengan jalan digabungkan? apa gunanya?</p>\r\n	</li>\r\n	<li>\r\n	<p>Belum ada contoh kasus nyata bagaimana metode akan digunakan dalam studi kasus</p>\r\n	</li>\r\n	<li>\r\n	<p>Banyak yang belum disebutkan referensinya (belum diacu dalam tulisan)</p>\r\n	</li>\r\n	<li>\r\n	<p>Algoritma DFS belum ada di tinjauan pustaka</p>\r\n	</li>\r\n	<li>\r\n	<p>Skor 315, revisi</p>\r\n	</li>\r\n</ul>\r\n', '2017-09-20 08:01:55', 625, 'R', 19, NULL, 1473, 'IMPLEMENTASI ALGORITMA DEPTH-FIRST SEARCH DAN BACKTRACK DALAM PERMAINAN TEKA-TEKI HITORI', 'IMPLEMENTASI ALGORITMA DEPTH-FIRST SEARCH DAN BACKTRACK DALAM PERMAINAN TEKA-TEKI HITORI', '71120029', 'T', 17, 72, 'T'),
