(1435, '2017-09-15 12:41:06', '<ul>\r\n	<li>\r\n	<p>Idenya adalah membangun sebuah sistem pakar, tapi ide ini masih sangat mentah</p>\r\n	</li>\r\n	<li>\r\n	<p>Secara teknis, ide ini belum dapat diimplementasikan karena belum jelas sama sekali apa yang akan dilakukan, mis.:</p>\r\n\r\n	<ul>\r\n		<li>\r\n		<p>Metode representasi apa yang akan digunakan</p>\r\n		</li>\r\n		<li>\r\n		<p>Apa yang dimaksud dengan metode forward chaining dan bagaimana mengimplementasikannya</p>\r\n		</li>\r\n		<li>\r\n		<p>Berapa banyak pakar yang akan terlibat dan siapa saja</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p>Format penulisan tidak sesuai, terutama tentang referensi</p>\r\n	</li>\r\n	<li>\r\n	<p>Latar belakang masalah: &nbsp;ide-ide yang tertuang belum terkoneksi dengan baik</p>\r\n	</li>\r\n	<li>\r\n	<p>Rumusan masalah: &nbsp;belum menyinggung tentang sistem yang akan dibangun</p>\r\n	</li>\r\n	<li>\r\n	<p>Batasan masalah: &nbsp;tidak ada penjelasan tentang mengapa batasan tersebut dipilih</p>\r\n	</li>\r\n	<li>\r\n	<p>Tujuan penelitian: &lsquo;hanya&rsquo; merancang sistem?</p>\r\n	</li>\r\n	<li>\r\n	<p>Blok diagram sistem perlu dijelaskan dan gambarnya perlu disebut dalam teks</p>\r\n	</li>\r\n	<li>\r\n	<p>Metodologi penelitian:</p>\r\n\r\n	<ul>\r\n		<li>\r\n		<p>Metode implementasi &ldquo;tidak sama&rdquo; dengan metode pengambilan keputusan</p>\r\n		</li>\r\n		<li>\r\n		<p>Tahapan pengembangan &lsquo;waterfa&rsquo; itu apa saja dan bagaimana itu diterapakan dalam penelitian?</p>\r\n		</li>\r\n		<li>\r\n		<p>Metode evaluasi: alat ukur apa yang akan digunakan dan bagaimana evaluasi akan dilakukan</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>skor 140 (tolak)</li>\r\n</ul>\r\n', '2017-09-22 12:01:17', 625, 'K', 19, NULL, 1503, 'Sistem Pakar Rekomendasi Menu Makanan Untuk Diet Penurunan Berat Badan Bagi Penderita Kolesterol', 'Sistem Pakar Rekomendasi Menu Makanan Untuk Diet Penurunan Berat Badan Bagi Penderita Kolesterol', '71140053', 'T', 13, 72, 'T'),
