(1627, '2018-02-14 14:02:00', '<p>Nilai Akhir: 225 (Revisi Mayor)</p>\r\n\r\n<p>Latar belakang belum mendeskripsikan masalah secara spesifik, terutama terkait objek dan metode.</p>\r\n\r\n<p>Belum ada tinjauan pustaka/penelitian orang lain.</p>\r\n\r\n<p>Alur penelitian dan metode penelitian belum mencerminkan penerapan metode.</p>\r\n\r\n<p>Apakah UEQ mencukupi untuk user requirement?</p>\r\n\r\n<p>Apakah UEQ sesuai dengan Metode Participatory?</p>\r\n\r\n<p>Belum ada pustaka yang berhubungan dengan metode yang diterapkan.</p>\r\n', '2018-03-08 13:51:48', 642, 'R', 42, NULL, 1708, 'PERANCANGAN ANTARMUKA PADA WEBSITE CINEMAXX DENGAN MEMPERHATIKAN METODE PARTICIPATORY DESIGN', 'PERANCANGAN ANTARMUKA PADA WEBSITE CINEMAXX DENGAN MEMPERHATIKAN METODE PARTICIPATORY DESIGN', '71140051', 'Y', 19, 87, 'T'),
(1628, '2018-02-14 14:02:32', '<ol>\r\n	<li>bahasa : gunakan padanan kata bhs indonesia dan jangan terlalu banyak mencampur bhs indonesia dan inggris</li>\r\n	<li>belum ada kejelasan tentang desain situs yang akan dibangun</li>\r\n	<li>skor 215 (rev mayor)</li>\r\n</ol>\r\n', '2018-03-08 09:48:23', 625, 'R', 42, NULL, 1706, 'EVALUASI TAMPILAN WEBSITE CGV.ID DENGAN USABILITY TESTING', 'EVALUASI TAMPILAN WEBSITE CGV.ID DENGAN USABILITY TESTING', '71140020', 'Y', 12, 85, 'T'),
(1629, '2018-02-14 14:03:03', '<p>Nilai Akhir: 200 (Revisi Mayor)</p>\r\n\r\n<p>Jelaskan perbedaan secara substansial dengan judul yang diajukan Nikson Stevanof (71140089).</p>\r\n', '2018-03-08 13:55:54', 642, 'R', 42, NULL, 1710, 'PERANCANGAN WEB CINEMAXX INDONESIA MENGGUNAKAN METODE GOAL DIRECTED DESIGN', 'PERANCANGAN WEB CINEMAXX INDONESIA MENGGUNAKAN METODE GOAL DIRECTED DESIGN', '71140069', 'Y', 54, 87, 'T'),
(1630, '2018-02-14 14:04:14', '<p>- Judul seperti tugas mata kuliah, bukan skripsi, sehingga kurang berbobot<br />\r\n- Masalah tidak jelas<br />\r\n- Tujuan &amp; Manfaat tidak jelas<br />\r\n- Terkesan Asal-asalan dalam membuat proposal</p>\r\n\r\n<p>skor: 160</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2018-02-23 11:25:06', 636, 'K', 42, NULL, 1691, 'PERANCANGAN ANTARMUKA APLIKASI FORUM MASYARAKAT YOGYAKARTA BERBASIS MOBILE \r\n', 'PERANCANGAN ANTARMUKA APLIKASI FORUM MASYARAKAT YOGYAKARTA BERBASIS MOBILE \r\n', '71140026', 'T', 50, 88, 'T'),
(1631, '2018-02-14 14:05:30', '<p>Tuliskan di Latar Belakang tentang penelitian sebelumnya yang pernah ada</p>\r\n\r\n<p>Penulisan di rumusan masalah, batasan dan tujuan dirapikan</p>\r\n\r\n<p>Jelaskan blok diagram dan metodologi penelitian</p>\r\n\r\n<p>Referensi textbook yang sesuai dan cukup baru</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Skor: 250 (Revisi Major)</p>\r\n', '2018-03-08 10:45:21', 772, 'R', 1, NULL, 1715, 'Perbandingan Performa Wireless Distribution System Topologi Point-To-Point Dengan Point-To-Multipoint', 'Perbandingan Performa Wireless Distribution System Topologi Point-To-Point Dengan Point-To-Multipoint', '71120134', 'Y', 10, 86, 'T'),
(1632, '2018-02-14 14:05:53', '<p>Nilai Akhir: 205 (Revisi Mayor)</p>\r\n\r\n<p>Ukuran keakuratan BAM menggunakan rumus apa?</p>\r\n\r\n<p>Berikan contoh konkrit dalam proposal ini (yang berhubungan dengan penggunaan metode BAM).</p>\r\n\r\n<p>Bagaimana mengukur pengaruh metode BAM dalam mengenali tanda tangan?</p>\r\n', '2018-02-23 11:20:35', 642, 'R', 6, NULL, 1702, 'PENGENALAN TANDA TANGAN MENGGUNAKAN METODE BIDIRECTIONAL ASSOCIATIVE MEMORY', 'PENGENALAN TANDA TANGAN MENGGUNAKAN METODE BIDIRECTIONAL ASSOCIATIVE MEMORY', '71120103', 'T', 16, 87, 'T'),
(1633, '2018-02-14 14:06:26', '<p>Latar belakang diperbaiki</p>\r\n\r\n<p>Rumusan masalah, tujuan diperbaiki</p>\r\n\r\n<p>Diperjelas proses pelaksanaan penelitian Anda</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Skor: 240: (Revisi Mayor)</p>\r\n', '2018-03-08 12:15:27', 772, 'R', 1, NULL, 1699, 'IMPLEMENTASI VRRP UNTUK OPTIMALISASI JALUR INTERNET ASRAMA BABADAN DAN ASRAMA SETURAN', 'IMPLEMENTASI VRRP UNTUK OPTIMALISASI JALUR INTERNET ASRAMA BABADAN DAN ASRAMA SETURAN', '71130075', 'Y', 53, 86, 'T'),
(1634, '2018-02-14 14:07:03', '<p>Tanggapan umum:</p>\r\n\r\n<p>SKOR 240 rev&nbsp; mayor</p>\r\n\r\n<ul>\r\n	<li>Bahasa yang digunakan secara umum cukup baik. Hanya, sering kali idenya melompat-lompat, sehingga korelasi antar paragraf membingungkan.</li>\r\n	<li>Perlu diberi nomor halaman.</li>\r\n	<li>Bahasa asing dituliskan miring (<em>italic</em>)</li>\r\n	<li>Penulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. &#39;di dominasi&#39; harus ditulis &#39;didominasi&#39;.</li>\r\n	<li>Rumus: &quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu</li>\r\n</ul>\r\n\r\n<p>Tanggapan khusus:</p>\r\n\r\n<p>1.Latar Belakang</p>\r\n\r\n<ul>\r\n	<li>-Ide antar paragraf terasa berdiri sendiri dan melompat-lompat.</li>\r\n	<li>-Perhatikan cara menulis rujukan/sitasi. Gunakan APA <em>Style</em> yang baik dan benar.</li>\r\n	<li>-Paragraf ke-3 berisi tentang data kuantitatif untuk menunjukkan kondisi saat ini. Ini sangat baik. Paragraf ini bisa jadi paragraf pembuka latar belakang masalah. Lalu dihubungkan dengan sistem pakar untuk penyakit difteri yang saat ini (mungkin) belum ada.</li>\r\n</ul>\r\n\r\n<p><br />\r\n2.Rumusan Masalah<br />\r\n-Rumusan masalah belum menyebutkan metode representasi pengetahuan yang akan digunakan!<br />\r\n<br />\r\n3.Batasan Masalah</p>\r\n\r\n<ul>\r\n	<li>-Apa yang dimaksud dengan &#39;data primer&#39; dan &#39;data sekunder&#39;?</li>\r\n	<li>-Perlu dijelaskan, mengapa sistem hanya untuk pengguna berusia sekitar 12 tahun?</li>\r\n	<li>-Di bagian matasan masalah, bisa disebutkan komponen-komponen dalam sistem pakar yang tidak termasuk dalam penelitian, misalnya komponen penjelasan (<em>explanation facility</em>) atau komponen akuisisi, dll.</li>\r\n</ul>\r\n\r\n<p><br />\r\n4.Tujuan penelitian<br />\r\n-Sebenarnya tujuannya adalah &#39;membangun sistem&#39; atau &#39;mengembangkan sistem&#39;?<br />\r\n<br />\r\n5.Manfaat Penelitian</p>\r\n\r\n<ul>\r\n	<li>-Manfaat penelitian berisi &#39;manfaat/kegunaan&#39; dari penelitian. Jika penelitian ini dilakukan maka gunanya adalah ...... bagi ....</li>\r\n	<li>-Setiap manfaat/kegunaan ditulis dengan lebih detil, misalnya berdasarkan penerima manfaat (bagi ilmu pengetahuan, bagi pengguna tertentu, dll.)</li>\r\n</ul>\r\n\r\n<p><br />\r\n6.Landasan Teori</p>\r\n\r\n<ul>\r\n	<li>-Bagian &quot;Tinjauan Pustaka&quot; : Penelitian terkait perlu dijelaskan dengan lebih baik, tentang apa, bagaimana, dan hasil yang didapat. Lalu, apa hubungannya dengan penelitian yang saat ini dilakukan?</li>\r\n	<li>-Ada kalimat yang membingungkan, tidak jelas maksudnya. Ada juga kalimat yang dituliskan tanpa subjek, predikat, atau objek.</li>\r\n	<li>-Ada bagian yang ditulis berulang; sudah ditulis di bagian depan, diulang lagi di bagian belakang.</li>\r\n	<li>-Ada bagian yang tidak ada rujukan/sitasinya. Hati-hati, jangan sampai menjadi plagiasi.</li>\r\n	<li>-Contoh kasus perlu diberi pengantar dan dijelaskan dengan lebih baik, terutama bagaimana metode inferensi <em>forward chaining</em> berjalan?</li>\r\n	<li>-Label untuk tabel perlu mengikuti tata cara penulisan yang baik.</li>\r\n</ul>\r\n\r\n<p><br />\r\n7.Blok Diagram Sistem</p>\r\n\r\n<ul>\r\n	<li>-Proses dalam blok diagram perlu dijelaskan, tidak ditinggal pergi begitu saja.</li>\r\n	<li>-Gambar perlu diberi label dan harus disebutkan di dalam teks.</li>\r\n	<li>-Pada gambar, <em>User</em> meng-<em>input</em>-kan penyakit?</li>\r\n</ul>\r\n\r\n<p><br />\r\n8.Metodologi Penelitian</p>\r\n\r\n<ul>\r\n	<li>-Setiap tahapan dalam metode spiral dijelaskan dengan lebih <em>real</em> dihubungkan dengan penelitian yang akan dilakukan. Penjelasan yang ada di proposal terlalu umum.</li>\r\n	<li>-Di bagian &quot;perencanaan&quot;, data apa yang dibutuhkan dalam penelitian Anda, apa yang akan dibuat dan dihasilkan pada tahap ini?</li>\r\n	<li>-Di bagian &quot;<em>knowledge acquisition&quot;, </em>pengetahuan apa yang akan Anda ambil dari pakar? Apakah ada metode tertentu yang akan digunakan dalam tahap ini?</li>\r\n	<li>-Di bagian &quot;<em>coding</em>&quot;, perlu disebutkan semua <em>tools</em> yang akan digunakan dalam penelitian Anda, misalnya bahasa pemrograman dan mungkin <em>libraries</em> yang akan digunakan.</li>\r\n	<li>-Di bagian &quot;evaluating the expert system&quot;, perlu dijelaskan bagaiamana caranya mengevaluasi sistem yang akan dibangun? Lalu, data apa yang didapat dari hasil evaluasi dan bagaimana data tersebut akan dianalisis?</li>\r\n</ul>\r\n\r\n<p><br />\r\n9.Daftar Pustaka</p>\r\n\r\n<ul>\r\n	<li>-Tuliskan semua literatur yang digunakan dan disebutkan dalam teks proposal di bagian &#39;Daftar Pustaka&#39;.</li>\r\n	<li>-Gunakan <em>APA style</em>!</li>\r\n	<li>-Semua literatur yang ditulis di Daftar Pustaka harus digunakan dalam teks proposal.</li>\r\n	<li>-Ada fakta dari literatur yang hilang.</li>\r\n</ul>\r\n', '2018-03-07 20:58:28', 625, 'R', 19, NULL, 1698, 'Pengembangan Sistem Pakar Diagnosis Penyakit Difteri pada Anak  Berbasis Rule Based ', 'Pengembangan Sistem Pakar Diagnosis Penyakit Difteri pada Anak  Berbasis Rule Based ', '71130161', 'Y', 13, 0, 'T'),
(1635, '2018-02-14 14:07:41', '<p>Kejelasan teori hingga ke implementasi belum ada kejelasan</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SKOR: 225 (Revisi Major)</p>\r\n', '2018-02-23 10:57:43', 772, 'R', 53, NULL, 1688, 'IMPLEMENTASI METODE FORWARD-CHAINING UNTUK MENGETAHUI KEBUTUHAN AIR DALAM TUBUH MANUSIA PADA PERANCANGAN SMART WATER DISPENSER\r\n', 'IMPLEMENTASI METODE FORWARD-CHAINING UNTUK MENGETAHUI KEBUTUHAN AIR DALAM TUBUH MANUSIA PADA PERANCANGAN SMART WATER DISPENSER\r\n', '71130111', 'T', 20, 86, 'T'),
(1636, '2018-02-14 14:08:12', '<p>- Perlu diskusi lebih lanjut untuk pembedaan dengan penelitian sebelumnya. Sekaligus pembahasan metode yang digunakan dalam penelitian</p>\r\n\r\n<p>skor: 275</p>\r\n', '2018-03-08 10:35:12', 636, 'R', 12, NULL, 1714, 'VISUALISASI RELASI REMPAH-REMPAH DALAM MASAKAN NUSANTARA DENGAN NODE INFOGRAFIS INTERAKTIF', 'VISUALISASI RELASI REMPAH-REMPAH DALAM MASAKAN NUSANTARA DENGAN NODE INFOGRAFIS INTERAKTIF', '71140047', 'Y', 42, 88, 'T'),
(1637, '2018-02-14 14:10:29', '<p>Nilai Akhir: 205 (Revisi Mayor)</p>\r\n\r\n<p>Proposal menggunakan bahasa populer, perlu diperbaiki.</p>\r\n\r\n<p>Landasan teori: Apa hubungan Data Mining dengan Pemetaan Digital?</p>\r\n\r\n<p>Koherensi latar belakang - rumusan masalah - dasar teori masih kurang.</p>\r\n', '2018-02-23 11:23:02', 642, 'R', 12, NULL, 1713, 'PEMETAAN DIGITAL MASA KEJAYAAN KERAJAAN MATARAM ISLAM BERBASIS TIMELINE', 'PEMETAAN DIGITAL MASA KEJAYAAN KERAJAAN MATARAM ISLAM BERBASIS TIMELINE', '71140032', 'T', 9, 87, 'T'),
(1638, '2018-02-14 14:14:24', '<ol>\r\n	<li>belum ada penelitian sebelumnya menggunakan algoritma promethee</li>\r\n	<li>tidak dijelaskan mengapa menggunakan algoritma tsb</li>\r\n	<li>kajian pustaka terlalu sedikit, contoh: algoritma tidak dijelaskan sebelumnya</li>\r\n	<li>tolak ukur &#39;lama&#39; dalam latar belakang</li>\r\n	<li>metodologi penelitian tidak detail</li>\r\n	<li>diagram alur penelitian tidak dibuat</li>\r\n	<li>skor 200 (rev mayor)</li>\r\n</ol>\r\n', '2018-03-08 15:14:55', 625, 'R', 17, NULL, 1703, 'Penggunaan Algoritma Promethee Dalam Menentukan Staff Part Timer Fakultas Teknologi Informasi Universitas Kristen Duta Wacana', 'Penggunaan Algoritma Promethee Dalam Menentukan Staff Part Timer Fakultas Teknologi Informasi Universitas Kristen Duta Wacana', '71120094', 'Y', 55, 85, 'T'),
(1639, '2018-02-14 14:15:14', '<p>Nilai Akhir: 200 (Revisi Mayor)</p>\r\n\r\n<p>Antarmuka dibangun dalam bahasa apa?&nbsp;</p>\r\n\r\n<p>Usia lansia batasnya berapa tahun?</p>\r\n\r\n<p>Langkah penelitian belum jelas, apa yang mau dilakukan.</p>\r\n', '2018-02-23 11:06:21', 642, 'R', 9, NULL, 1711, 'PERANCANGAN ANTAR MUKA PADA MENU MESIN CUCI UNTUK ORANG LANJUT USIA', 'PERANCANGAN ANTAR MUKA PADA MENU MESIN CUCI UNTUK ORANG LANJUT USIA', '71130140', 'T', 54, 87, 'T'),
(1640, '2018-02-14 14:15:38', '<p>- Gunakan metode yang sesuai untuk kasus yang akan diselesaikan</p>\r\n\r\n<p>- Berikan penjelasan berupa blok diagram yang lebih baik</p>\r\n\r\n<p>skor: 145</p>\r\n', '2018-02-23 11:26:46', 636, 'K', 50, NULL, 1721, 'PENGUKURAN PANJANG ANTRIAN KENDARAAN PADA LAMPU LALU LINTAS MENGGUNAKAN METODE THRESHOLD', 'PENGUKURAN PANJANG ANTRIAN KENDARAAN PADA LAMPU LALU LINTAS MENGGUNAKAN METODE THRESHOLD', '71140075', 'T', 18, 88, 'T'),
(1641, '2018-02-14 14:16:10', '<p>Nilai Akhir: 250 (Revisi Mayor)</p>\r\n\r\n<p>Ternary Relationship hanyalah fase konseptual. Implementasinya tetap menjadi 1:M Binary Relationship.</p>\r\n\r\n<p>Sehingga perlu dicari kebaruannya di mana? Apa yang bisa diteliti lebih lanjut?</p>\r\n', '2018-02-22 09:46:43', 642, 'R', 19, NULL, 1712, 'PERANCANGAN SISTEM BASIS DATA UNTUK REGISTRASI MAHASISWA BERBASIS TERNARY RELATIONSHIP\r\n', 'PERANCANGAN SISTEM BASIS DATA UNTUK REGISTRASI MAHASISWA BERBASIS TERNARY RELATIONSHIP\r\n', '71130164', 'T', 39, 87, 'T'),
