(1643, '2018-02-14 14:18:23', '<p>Fokus kurang jelas, usability test dimana?</p>\r\n\r\n<p>Referensi ilmiah sangat kurang</p>\r\n\r\n<p>Metodologi penelitian tidak ada, terutama tahapan usabilitynya?</p>\r\n\r\n<p>Tujuan, Rumusan Masalah tidak sesuai dengan judul</p>\r\n\r\n<p>Secara judul bisa, namun harus direvisi</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SKOR: 140: (Ditolak)</p>\r\n', '2018-02-23 11:29:47', 625, 'K', 17, NULL, 1718, 'Usability Test Software Parser Plist untuk Membantu Mengkonfigurasi Clover Menggunakan Bahasa Pemrograman Java', 'Usability Test Software Parser Plist untuk Membantu Mengkonfigurasi Clover Menggunakan Bahasa Pemrograman Java', '71130027', 'T', 2, 86, 'T'),
(1644, '2018-02-14 14:19:53', '<p>Skor : 165 tolak</p>\r\n\r\n<ol>\r\n	<li>Secara judul diperbolehkan untuk skripsi, namun penulisan proposal sangat kurang, masih belum jelas bentuk dashboardnya bagaimana? cara mengujinya bagaimana? bentuk mockup nya bagaimana?</li>\r\n	<li>Teorinya ttg dashboard dan saham kurang sekali</li>\r\n	<li>Harus konsultasi lagi agar proposal dimajukkan lagi ke periode berikutnya</li>\r\n</ol>\r\n', '2018-02-22 07:40:38', 625, 'K', 2, NULL, 1707, 'Usability Testing Pada Website Dashboard Saham', 'Usability Testing Pada Website Dashboard Saham', '71140009', 'T', 17, 85, 'T'),
(1645, '2018-02-14 14:20:25', '<p>Nilai Akhir: 105 (Belum Lolos)</p>\r\n\r\n<p>Latar belakang tidak fokus, belum ada masalah spesifik yang dikemukakan terhadap objek.</p>\r\n\r\n<p>Rumusan masalah diperjelas.</p>\r\n\r\n<p>Banyak judul yang sama di internet. Mohon dianalisis dan dirujuk.</p>\r\n', '2018-02-23 11:31:56', 642, 'K', 42, NULL, 1709, 'ANALISIS DAN PERANCANGAN WEB USABILITY TERHADAP SITUS JUAL BELI ONLINE STUDY KASUS : JD.ID\r\n', 'ANALISIS DAN PERANCANGAN WEB USABILITY TERHADAP SITUS JUAL BELI ONLINE STUDY KASUS : JD.ID\r\n', '71140044', 'T', 19, 87, 'T'),
