(1649, '2018-02-14 14:23:57', '<p>Referensi tinjauan pustaka masih sangat kurang, terutama sumber dari jurnal</p>\r\n\r\n<p>Jangan melakukan copy verbatim, gunakan parafrase pada bagian landasan teori</p>\r\n\r\n<p>Referensi gambar belum ada pada teks paragraf</p>\r\n\r\n<p>Flowchart != Peta</p>\r\n\r\n<p>Skema yang akan digunakan dalam pengujian sebaiknya dijelaskan lebih detail</p>\r\n\r\n<p>Teori tentang VPN masih sangat minim</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Skor: 270 (Revisi Major)</p>\r\n', '2018-03-08 14:03:20', 772, 'R', 10, NULL, 1701, 'ANALISIS PENGARUH IMPLEMENTASI TUNNEL LAYER TERHADAP PERFORMA VoIP', 'ANALISIS PENGARUH IMPLEMENTASI TUNNEL LAYER TERHADAP PERFORMA VoIP', '71140012', 'Y', 15, 86, 'T'),
(1650, '2018-02-14 14:24:35', '<p>Skor 300 rev minor</p>\r\n\r\n<ol>\r\n	<li>Akasara jawa atau bahasa jawa?</li>\r\n	<li>Pentingnya penelitian di bagian apa? perlu diperjelas<br />\r\n	&nbsp;</li>\r\n</ol>\r\n', '2018-03-08 11:52:01', 625, 'R', 12, NULL, 1719, 'PERANCANGAN GAME EDUKASI BAHASA JAWA MENGGUNAKAN CONSTRUCT 2 UNTUK SMA KELAS 10', 'PERANCANGAN GAME EDUKASI BAHASA JAWA MENGGUNAKAN CONSTRUCT 2 UNTUK SMA KELAS 10', '71140037', 'Y', 14, 86, 'T'),
(1651, '2018-02-14 14:25:01', '<p>- Temui Bapak Nugroho untuk mendapat penjelasan tambahan informasi fitur yang digunakan</p>\r\n\r\n<p>skor: 200</p>\r\n', '2018-02-23 11:28:48', 636, 'R', 18, NULL, 1720, 'PENGENALAN HURUF HIRAGANA MENGGUNAKAN METODE K-NEAREST NEIGHBOR', 'PENGENALAN HURUF HIRAGANA MENGGUNAKAN METODE K-NEAREST NEIGHBOR', '71140058', 'T', 7, 88, 'T'),
(1652, '2018-02-14 14:25:41', '<ol>\r\n	<li>untuk inventaris sebaiknya tidak berbasis web, apalagi aplikasi</li>\r\n	<li>kasusnya koq cuma di 1 sma saja?</li>\r\n	<li>skor 250 rev mayor</li>\r\n</ol>\r\n', '2018-04-11 13:54:10', 625, 'R', 50, NULL, 1690, 'PENERAPAN METODE USER CENTERED DESIGN DALAM  PEMBUATAN  APLIKASI INVENTORY LABORATORIUM KIMIA BERBASIS WEBSITE ', 'PENERAPAN METODE USER CENTERED DESIGN DALAM  PEMBUATAN  APLIKASI INVENTORY LABORATORIUM KIMIA BERBASIS WEBSITE ', '71140054', 'Y', 12, 85, 'T'),
(1653, '2018-02-14 14:26:19', '<ol>\r\n	<li>skor 155 (tolak)</li>\r\n	<li>apakah CMS itu metode?</li>\r\n	<li>preservasi gamelan jawa = nada, buku lagu, video, sound, knowledge ok, kalau ini tentang apa? apa yg dipreservasi?</li>\r\n	<li>karena apa perlu dipreservasi? jelaskan!</li>\r\n	<li>kalaupun arahnya ke pengarsipan, harus jelas pengarsipannya</li>\r\n	<li>tdk ada rujukan daftar pustaka</li>\r\n	<li>secara judul masih bisa tapi proposalnya harus dikonsultasikan dan direvisi total</li>\r\n</ol>\r\n', '2018-02-26 20:24:42', 625, 'K', 12, NULL, 1700, 'IMPELEMENTASI METODE CONTENT MANAGEMENT SYSTEM (CMS ) PADA PERANCANGAN ANTARMUKA SITUS MENGENAI GAMELAN JAWA ', 'IMPELEMENTASI METODE CONTENT MANAGEMENT SYSTEM (CMS ) PADA PERANCANGAN ANTARMUKA SITUS MENGENAI GAMELAN JAWA ', '71130062', 'T', 3, 88, 'T'),
(1654, '2018-02-14 14:27:48', '<p>Pada latar belakang tuliskan penelitian sebelumnya sebagai dasar pengembangan ide judul ini</p>\r\n\r\n<p>Penulisan yang sesuai EYD di rumusan masalah, batasan, dan tujuan</p>\r\n\r\n<p>Penulisan rumus CF yang benar dan baik</p>\r\n\r\n<p>Contoh kasus dan implementasi CF perlu ditambahkan</p>\r\n\r\n<p>Referensi dirapikan dan diupdate yang terbaru (untuk diktat)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Skor: 245 (Revisi Major)</p>\r\n', '2018-03-07 09:20:39', 772, 'R', 19, NULL, 1717, 'Sistem Pakar Deteksi Perkembangan Motorik Anak Dengan Menggunakan Metode Certainty Factor\r\n', 'Sistem Pakar Deteksi Perkembangan Motorik Anak Dengan Menggunakan Metode Certainty Factor\r\n', '71120042', 'Y', 10, 86, 'T'),
(1655, '2018-02-14 14:29:56', '<p>Nilai Akhir: 300 (Revisi Minor)</p>\r\n\r\n<p>Perlu ditambah bagaimana penerapan Simple Additive Weighting pada kasus pemilihan calon mahasiswa baru.</p>\r\n', '2018-02-23 11:04:26', 642, 'R', 19, NULL, 1704, 'PENERAPAN METODE SIMPLE ADDIVITE WEIGHTING UNTUK MEMBANTU KEPUTUSAN PEMILIHAN CALON MAHASISWA BARU PROGRAM STUDI FAKULTAS TEKNOLOGI INFORMASI BERBASIS WEBSITE', 'PENERAPAN METODE SIMPLE ADDIVITE WEIGHTING UNTUK MEMBANTU KEPUTUSAN PEMILIHAN CALON MAHASISWA BARU PROGRAM STUDI FAKULTAS TEKNOLOGI INFORMASI BERBASIS WEBSITE', '71120044', 'T', 5, 87, 'T'),
(1656, '2018-02-14 14:31:52', '<p>- Latar belakang belum sesuai dan belum terlihat pentingnya penelitian serta usulan untuk membantu permasalahan yang ada</p>\r\n\r\n<p>- Rumusan masalah perlu diperbaiki</p>\r\n\r\n<p>- Batasan masalah perlu dibahas lebih lanjut dengan dosen pembimbing</p>\r\n\r\n<p>- Teori dan metodologi penelitian belum menyebutkan metode yang digunakan untuk pembuatan dashboard</p>\r\n\r\n<p>skor: 250</p>\r\n', '2018-03-08 11:20:28', 636, 'R', 9, NULL, 1723, 'PENERAPAN REPORTING DASHBOARD \r\nSEBAGAI ALAT BANTU PENDUKUNG KEPUTUSAN\r\nMETODE PROMOSI UNIT ADMISI DAN PROMOSI\r\nUNIVERSITAS KRISTEN DUTA WACANA \r\n', 'PENERAPAN REPORTING DASHBOARD \r\nSEBAGAI ALAT BANTU PENDUKUNG KEPUTUSAN\r\nMETODE PROMOSI UNIT ADMISI DAN PROMOSI\r\nUNIVERSITAS KRISTEN DUTA WACANA \r\n', '71130084', 'Y', 42, 88, 'T'),
(1657, '2018-02-14 14:33:20', '<p>Tanggapan umum:</p>\r\n\r\n<ul>\r\n	<li>Secara umum, topik penelitian yang diajukan bisa dikerjakan / dilanjutkan hanya penulisan dalam proposal masih kurang jelas. Penggunaan leksikon dalam penelitian sedikit diberi gambaran, tapi penggunaan panjang kata sama sekali tidak dijelaskan di mana pun</li>\r\n	<li>Bahasa yang digunakan dalam penulisan proposal membingungkan. Kalimat sering kehilangan subjek, predikat, atau objek, sehingga kalimat tidak lengkap. Atau, satu kalimat terdiri dari beberapa topik menjadi satu, sehingga maksud dari kalimat menjadi tidak jelas.</li>\r\n	<li>Penulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. &#39;di identifikasi&#39; ditulis &#39;diidentifikasi&#39;.</li>\r\n	<li>Rumus: &quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu</li>\r\n	<li>Bahasa asing dituliskan miring (<em>italic</em>)</li>\r\n	<li>Semua rumus atau persamaan yang ada perlu dijelaskan maksudnya.</li>\r\n</ul>\r\n\r\n<p>1.Latar Belakang</p>\r\n\r\n<ul>\r\n	<li>Apa yang dimaksud dengan &#39;sumber daya&#39;, &#39;bahasa digital&#39;, leksikon?</li>\r\n	<li>Bahasa yang digunakan membingungkan</li>\r\n	<li>Bagian ini bisa dimulai dengan menjelaskan lebih detil tentang &#39;Identifikasi Bahasa&#39; secara umum; dari definisi sampai ke contoh aplikasi, termasuk penelitian-penelitian yang pernah dilakukan. Dari penelitian-penelitian tersebut bisa dijelaskan hasil dan metode yang digunakan, termasuk masalah-masalah yang timbul dalam penelitian.</li>\r\n	<li>Kemudian, bisa mulai fokus ke penelitian tentang identifikasi bahasa menggunakan algoritma panjang kata dan leksikon.</li>\r\n</ul>\r\n\r\n<p>2.Rumusan Masalah</p>\r\n\r\n<ul>\r\n	<li>Rumusan no. 1: Kata &#39;Apakah&#39; diganti &#39;Bagaimana&#39;</li>\r\n	<li>Rumusan no. 2: Kata &#39;Seberapa akurat untuk&#39; diganti &#39;Bagaimana akurasi sistem&#39;</li>\r\n</ul>\r\n\r\n<p>3.Batasan Masalah</p>\r\n\r\n<ul>\r\n	<li>Bisa diawali dengan menjelaskan bahwa Indonesia memiliki begitu banyak bahasa daerah. Setelah itu, sebutkan bahasa yang akan digunakan dalam penelitian.</li>\r\n	<li>Bisa diawali dengan menjelaskan tentang skala identifikasi. Setelah itu, sebutkan skala identifikasi yang akan digunakan dalam penelitian.</li>\r\n	<li>Bisa diawali dengan menjelaskan tentang korpus bahasa Jawa yang ada. Setelah itu, sebutkan korpus yang akan digunakan dalam penelitian.</li>\r\n	<li>Perlu ditambahkan tentang tipe/bentuk data, mis. teks, gambar, atau video?</li>\r\n	<li>Bagian ini bisa dibuat dalam bentuk paragraf.</li>\r\n</ul>\r\n\r\n<p>4.Tujuan penelitian</p>\r\n\r\n<ul>\r\n	<li>Tujuan penelitian cukup 1 saja. Yang lain, kemungkinan adalah &#39;sub tujuan&#39; yang perlu dilakukan dalam rangka mencapai tujuan yang ditentukan.</li>\r\n	<li>Bagian ini bisa dibuat dalam bentuk paragraf.</li>\r\n</ul>\r\n\r\n<p>5.Manfaat Penelitian<br />\r\nManfaat penelitian bisa dibuat lebih detil, misalnya berdasarkan penerima manfaat (bagi ilmu pengetahuan, bagi pengguna tertentu, dll.)<br />\r\n<br />\r\n6.Landasan Teori<br />\r\nPenulisan &#39;6.1&#39;, &#39;6.2&#39;, dst. rata kiri.</p>\r\n\r\n<p>SKOR 180 TOLAK, silahkan direvisi dan dikonsultasikan</p>\r\n', '2018-02-27 08:54:40', 625, 'K', 12, NULL, 1725, 'IDENTIFIKASI BAHASA JAWA VS INDONESIA DENGAN ALGORITMA PANJANG KATA BERBASIS LEKSIKON\r\n', 'IDENTIFIKASI BAHASA JAWA VS INDONESIA DENGAN ALGORITMA PANJANG KATA BERBASIS LEKSIKON\r\n', '71140022', 'T', 13, 85, 'T'),
(1658, '2018-02-14 14:33:39', '<p>Kenapa protokol yang diujikan hanya SIP dan H.323?</p>\r\n\r\n<p>Apa yang membedakan penelitian ini dengan Penelitian dari Aria dan Purnomo sebelumnya?</p>\r\n\r\n<p>Lihat kembali tata cara penulisan proposal skripsi</p>\r\n\r\n<p>Banyak istilah asing yang belum ditulis dalam bentuk italic</p>\r\n\r\n<p>Belum cukup banyak tinjauan jurnal, terutama jurnal internasional</p>\r\n\r\n<p>Bagaimana bentuk simulasi yang akan digunakan untuk data uji?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Skor: 255 (Revisi major)</p>\r\n', '2018-03-08 12:29:33', 772, 'R', 1, NULL, 1722, 'Analisis Performa VoIP pada Jaringan GRE Tunnel', 'Analisis Performa VoIP pada Jaringan GRE Tunnel', '71140014', 'Y', 15, 86, 'T'),
(1659, '2018-02-14 14:39:39', '<ol>\r\n	<li>skor 155 (tolak)</li>\r\n	<li>Semua yang nilainya 1 pada penilaian proposal diperbaiki</li>\r\n	<li>Judulnya bisa untuk skripsi tapi metode assignment itu belum jelas, diperbaiki teorinya</li>\r\n	<li>Masih banyak konstrain lain yang perlu diperhatikan dalam pembuatan jadwal seperti waktu-waktu dosen tertentu tidak bisa</li>\r\n	<li>Silahkan konsultasi ke yang berwenang dlm menentukan jadwal agar requirement jelas</li>\r\n	<li>Silahkan diajukan lagi dan diperbaiki untuk periode 2</li>\r\n</ol>\r\n', '2018-02-22 07:43:11', 625, 'K', 50, NULL, 1724, 'IMPLEMENTASI METODE ASSIGNMENT UNTUK SISTEM PENJADWALAN DOSEN', 'IMPLEMENTASI METODE ASSIGNMENT UNTUK SISTEM PENJADWALAN DOSEN', '71140039', 'T', 17, 85, 'T'),
(1660, '2018-02-14 14:40:14', '<p>Nilai Akhir: 260 (Revisi Mayor)</p>\r\n\r\n<p>Karakteristik pengguna seperti apa sehingga perlu mendapat penekanan dalam perancangannya?</p>\r\n\r\n<p>Penulisan tidak EYD (Google-translated)</p>\r\n', '2018-03-08 15:22:49', 642, 'R', 19, NULL, 1726, 'PENGEMBANGAN SISTEM PENGARSIPAN DOKUMEN INSPEKTORAT DIY DENGAN PENDEKATAN HUMAN CENTERED DESIGN', 'PENGEMBANGAN SISTEM PENGARSIPAN DOKUMEN INSPEKTORAT DIY DENGAN PENDEKATAN HUMAN CENTERED DESIGN', '71120061', 'Y', 9, 87, 'T'),
(1661, '2018-02-14 14:43:43', '<ol>\r\n	<li>ganti tools bukan oracle warehouse builder</li>\r\n	<li>teori data warehouse sangat kurang</li>\r\n	<li>tdk ada diagram alur proses</li>\r\n	<li>ETL dan sumber data tidak jelas</li>\r\n	<li>skor 200 rev mayor</li>\r\n</ol>\r\n', '2018-02-28 10:28:55', 625, 'R', 13, NULL, 1727, 'PEMBANGUNAN DATA WAREHOUSE UNTUK ANALISIS REKAM JEJAK AKTIFITAS MAHASISWA\r\n', 'PEMBANGUNAN DATA WAREHOUSE UNTUK ANALISIS REKAM JEJAK AKTIFITAS MAHASISWA\r\n', '71140048', 'T', 8, 85, 'T'),
(1662, '2018-02-14 14:52:07', '<p>SKOR: 365 (Diterima)</p>\r\n', '2018-02-23 11:25:12', 625, 'T', 10, 15, 1728, 'OPTIMALISASI INTERNET DENGAN MEMANFAATKAN MANAJEMEN BANDWIDTH DI UNIVERSITAS KRISTEN DUTA WACANA YOGYAKARTA\r\n', 'OPTIMALISASI INTERNET DENGAN MEMANFAATKAN MANAJEMEN BANDWIDTH DI UNIVERSITAS KRISTEN DUTA WACANA YOGYAKARTA\r\n', '71140078', 'T', 1, 86, 'T'),
(1663, '2018-02-15 07:48:18', '<ol>\r\n	<li>Skor 300 (rev minor)</li>\r\n	<li>Membangun dan mengembangkan website? situsnya sudah ada atau belum?</li>\r\n	<li>Arsitektur informasi belum jelas, harus diperjelas!</li>\r\n</ol>\r\n', '2018-02-28 09:31:15', 625, 'R', 8, NULL, 1730, 'PENGEMBANGAN ARSITEKTUR INFORMASI UNTUK WEBSITE STUDI KASUS GEREJA KATOLIK ST.YOSEPH BAMBU PEMALI MERAUKE', 'PENGEMBANGAN ARSITEKTUR INFORMASI UNTUK WEBSITE STUDI KASUS GEREJA KATOLIK ST.YOSEPH BAMBU PEMALI MERAUKE', '71120053', 'T', 14, 86, 'T'),
(1664, '2018-02-15 13:19:07', '<p>SKOR 210 (REV MAYOR)</p>\r\n\r\n<p>Tanggapan umum:&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<ul>\r\n	<li>Bahasa asing dituliskan miring (italic)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</li>\r\n	<li>Metode production rules perlu disebutkan dan dijelaskan sedikit di latar belakang masalah atau rumusan masalah.&nbsp; Sehingga, tidak serta merta muncul dalam pernyataan di rumusan masalah.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</li>\r\n	<li>&quot;Penulisan &quot;&quot;di&quot;&quot; sebagai imbuhan atau &quot;&quot;di&quot;&quot; sebagai kata depan, perlu diperhatikan.&nbsp; Mis. &#39;di bimbing&#39; ditulis &#39;dibimbing&#39;. &nbsp;</li>\r\n	<li>Rumus:&nbsp; &quot;&quot;imbuhan di/ke + kata_dasar&quot;&quot; ditulis jadi satu&quot;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</li>\r\n</ul>\r\n\r\n<p>Tanggapan khusus:&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n1.&nbsp;&nbsp; &nbsp;Latar Belakang&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<ul>\r\n	<li>Perlu ditambahkan data pendukung, misalnya data angka statistik yang menunjukkan pertumbuhan jumlah pengidap PMS, jumlah wisatawan di Bali (domestik dibandingkan dengan asing), dll.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</li>\r\n	<li>Setiap pernyataan yang menunjukkan data, perlu didukung dengan rujukan/sitasi yang jelas.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;</li>\r\n</ul>\r\n\r\n<p>2.&nbsp;&nbsp; &nbsp;Rumusan Masalah&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n3.&nbsp;&nbsp; &nbsp;Batasan Masalah&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<ul>\r\n	<li>Bahasa pemrograman tidak dimunculkan di bagian ini, karena di penelitian ini ia bukan batasan masalah yang akan diteliti, tapi tools pendukung yang digunakan dalam penelitian. &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</li>\r\n	<li>Penjelasan tentang dokter yang bekerja sama dalam penelitian diletakkan di bagian &#39;Metodologi Penelitian&#39;.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</li>\r\n	<li>Aturan produksi bukan batasan masalah, tetapi salah satu metode yang memang akan diterapkan dalam penelitian, sehingga ia bukan menjadi batasan masalah.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</li>\r\n	<li>Apa yang dimaksud dengan &quot;... PMS yang lain&quot;?&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</li>\r\n	<li>Batasan masalah bisa ditambahkan dengan jenis gejala atau jenis penyakit PMS yang akan dimasukkan sebagai basis pengetahuan dalam sistem.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;</li>\r\n</ul>\r\n\r\n<p>4.&nbsp;&nbsp; &nbsp;Tujuan penelitian&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<ul>\r\n	<li>Tujuan penelitian cukup 1 saja.&nbsp; Yang lain, kemungkinan adalah &#39;sub tujuan&#39; yang perlu dilakukan dalam rangka mencapai tujuan yang ditentukan.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</li>\r\n	<li>Bagian ini bisa dibuat dalam bentuk paragraf.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</li>\r\n	<li>Pernyataan no. 1 &amp; 2 bisa digabung.&nbsp; Penryataan no. 3 lebih kepada manfaat penelitian.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;</li>\r\n</ul>\r\n\r\n<p>5.&nbsp;&nbsp; &nbsp;Manfaat Penelitian&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Manfaat &quot;penelitian&quot; bukan manfaat &quot;penulisan&quot;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n6.&nbsp;&nbsp; &nbsp;Landasan Teori&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<ul>\r\n	<li>Bagian &#39;6.1&#39; bukan tinjauan pustaka, isi bagian itu lebih ke landasan teori; teori tentang HIV-AIDS.</li>\r\n	<li>Belum ada &#39;Tinjauan Pustaka&#39;. Tinjauan pustaka berisi tentang penelitian-penelitian terkait topik penelitian.</li>\r\n	<li>Penulisan sub bab &#39;6.2&#39;, &#39;6.2.1&#39;, dst. dituliskan rata kiri.</li>\r\n	<li>Ada bagian yang berulang: komponen utama basis pengetahuan, yaitu fakta dan aturan.</li>\r\n	<li>Ada bagian-bagian yang belum dituliskan rujukan/sitasinya.</li>\r\n	<li>Perlu ditambahakan contoh kasus. Kalau perlu data dummy dibuat sendiri hanya untuk menjelaskan proses yang akan terjadi di dalam sistem, terutama untuk implementasi basis pengetahuan dan mesin inferensi yang dipilih.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;</li>\r\n</ul>\r\n\r\n<p>7.&nbsp;&nbsp; &nbsp;Blok Diagram Sistem&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<ul>\r\n	<li>Cara menggambarkan <em>conditional statement </em>(IF-THEN)<em> </em>dan proses iterasi salah!</li>\r\n	<li>Proses dalam blok diagram perlu dijelaskan, tidak ditinggal pergi begitu saja.</li>\r\n	<li>Label &quot;Gambar 7.1&quot; perlu disebutkan di dalam teks. &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;</li>\r\n</ul>\r\n\r\n<p>8.&nbsp;&nbsp; &nbsp;Metodologi Penelitian&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<ul>\r\n	<li>&quot;Metodologi&quot; bukan &quot;Metodelogi&quot;</li>\r\n	<li>Jika tidak melakukan hal khusus terkait studi pustaka, tidak perlu menyebutkan metode &quot;studi pustaka&quot; secara khusus. Karena studi pustaka adalah hal umum yang dilakukan di semua penelitian.</li>\r\n	<li>Apa yang akan diobservasi dan diwawancara? Data apa yang dibutuhkan dan didapat dengan cara observasi dan wawancara?</li>\r\n	<li>Metode apa yang akan digunakan dalam wawancara?</li>\r\n	<li>Dalam &quot;perancangan sistem&quot; perlu dijelaskan dengan lebih detil tentang hal-hal yang berkaitan dengan perancangan sistem yang akan dilakukan, terutama tentang bagaimana cara membangun basis pengetahuan dan inferensi sistem.</li>\r\n	<li>Dalam &quot;pembangunan sistem&quot; perlu dijelaskan tentang bahasa pemrograman yang akan digunakan, termasuk <em>libraries </em>yang akan digunakan.</li>\r\n	<li>Dalam &quot;pengujian dan analisis&quot; perlu dijelaskan cara melakukan pengujian dan analisis yang akan dilakukan.&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;</li>\r\n</ul>\r\n\r\n<p>9.&nbsp;&nbsp; &nbsp;Daftar Pustaka&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<ul>\r\n	<li>Tuliskan semua literatur yang digunakan dan disebutkan dalam teks proposal di bagian &#39;Daftar Pustaka&#39;.</li>\r\n	<li>Gunakan <em>APA style</em>!-Semua literatur yang ditulis di Daftar Pustaka harus digunakan dalam teks proposal. &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;</li>\r\n</ul>\r\n', '2018-02-27 06:38:04', 625, 'R', 10, NULL, 1732, 'Sistem Pakar Mendiagnosis Gejala-Gejala Penyakit HIV-AIDS \r\nDengan Menggunakan Metode Production Rules\r\n', 'Sistem Pakar Mendiagnosis Gejala-Gejala Penyakit HIV-AIDS \r\nDengan Menggunakan Metode Production Rules\r\n', '71130153', 'T', 13, 85, 'T'),
(1665, '2018-02-19 09:05:46', '<p>Nilai akhir: 165 (Belum Lolos)</p>\r\n\r\n<p>Materi proposal masih belum lengkap. Detail yang mau dikerjakan belum jelas.</p>\r\n', '2018-02-22 09:35:05', 642, 'K', 17, NULL, 1731, 'PENGEMBANGAN ARSITEKTUR INFORMASI UNTUK WEBSITE STUDI KASUS GEREJA RPOTESTANT INDONESIA PETRA MULI MERAUKE', 'PENGEMBANGAN ARSITEKTUR INFORMASI UNTUK WEBSITE STUDI KASUS GEREJA PROTESTANT INDONESIA PETRA MULI MERAUKE', '71110139', 'T', 39, 87, 'T'),
