(1693, '2018-03-19 10:38:15', '<ol>\r\n	<li>Judul diganti Sistem Pakar untuk Mendeteksi Gangguan Lensa Mata Berbasis Teorema Bayes</li>\r\n	<li>Gambar, tabel, rumus tidak perlu dipisah letaknya</li>\r\n	<li>Contoh kasus belum jelas</li>\r\n	<li>Teori sistem pakar masih kurang</li>\r\n	<li>Blok diagram salah!</li>\r\n	<li>Daftar pustaka diperbaiki</li>\r\n	<li>Lihat revisi dan catatan lain di proposal</li>\r\n	<li>Rev mayor (skor 265)</li>\r\n</ol>\r\n', '2018-04-11 13:24:50', 1315, 'R', 19, NULL, 1772, 'Implementasi Teorema Bayes untuk Mendeteksi \r\nGangguan Lensa Mata\r\n', 'Sistem Pakar untuk Mendeteksi Gangguan Lensa Mata Berbasis Teorema Bayes\r\n', '71130104', 'Y', 17, 90, 'T'),
(1694, '2018-03-19 11:17:51', '<ol>\r\n	<li>Judul harus dibetulkan</li>\r\n	<li>Belum konsultasi perbaikan proposal!</li>\r\n	<li>tidak ada metode yang digunakan dalam pembangunan AI</li>\r\n	<li>masih sangat kurang</li>\r\n	<li>perlu diskusi intensif dan keseriusan mahasiswa</li>\r\n	<li>Rev Mayor (260)</li>\r\n</ol>\r\n', '2018-03-27 08:32:09', 1315, 'R', 3, NULL, 1775, 'MEMBANGUN DAN MENGEMBANGAN ARSITEKTUR INFORMASI UNTUK WEBSITE GEREJA', 'MEMBANGUN DAN MENGEMBANGAN ARSITEKTUR INFORMASI UNTUK WEBSITE GEREJA', '71120053', 'T', 8, 90, 'T'),
(1695, '2018-03-19 11:48:13', '<p>Nilai akhir: 180 (Tolak)</p>\r\n\r\n<ul>\r\n	<li>Orang lanjut usia melihat icon-icon? Lebih baik buat 1 tombol lalu selesai. Gunakan isstem cerdas.</li>\r\n	<li>Ini dulu sudah pernah digunakan. Bagian mena yang direvisi dari&nbsp;masukan sebelumnya?</li>\r\n</ul>\r\n', '2018-03-23 09:47:33', 642, 'K', 9, NULL, 1770, 'PERANCANGAN INTERFACE  PADA MENU PENGOPERASIAN MESIN CUCI UNTUK \r\nORANG LANJUT USIA\r\n', 'PERANCANGAN INTERFACE PADA MENU PENGOPERASIAN MESIN CUCI UNTUK ORANG LANJUT USIA\r\n', '71130140', 'T', 54, 92, 'T'),
(1696, '2018-03-19 11:54:27', '<p>Nilai Akhir: 300 (Revisi Minor)</p>\r\n\r\n<p>Perlu penjelasan tentang bagaimana cara menerapkan Simple Additive Weighting pada kasus yang dihadapi.</p>\r\n', '2018-04-12 10:58:55', 642, 'R', 19, NULL, 1764, 'PENERAPAN METODE SIMPLE ADDIVITE WEIGHTING UNTUK MEMBANTU KEPUTUSAN PEMILIHAN CALON MAHASISWA BARU PROGRAM STUDI FAKULTAS TEKNOLOGI INFORMASI BERBASIS WEBSITE', 'PENERAPAN METODE SIMPLE ADDIVITE WEIGHTING UNTUK MEMBANTU KEPUTUSAN PEMILIHAN CALON MAHASISWA BARU PROGRAM STUDI FAKULTAS TEKNOLOGI INFORMASI BERBASIS WEBSITE', '71120044', 'Y', 5, 92, 'T'),
(1697, '2018-03-19 12:08:46', '<p>Konsistensi penulisan istilah asing perlu ditingkatkan</p>\r\n\r\n<p>Perlu ditambahkan sitasi pada teori atau tinjauan pustaka</p>\r\n\r\n<p>metodologi perlu dijelaskan dengan lebih detail, terutama pengukurannya</p>\r\n\r\n<p>bagian topologi bisa ditambahkan penjelasan</p>\r\n\r\n<p>landasan teori sangat minim</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SKOR: 230 (Revisi Mayor)</p>\r\n', '2018-04-12 09:13:31', 772, 'R', 1, NULL, 1773, 'ANALISIS PERFORMA VoIP PADA VPN MENGGUNAKAN POINT-TO-POINT TUNNELING PROTOKOL PADA JARINGAN WIRELESS MIKROTIK', 'ANALISIS PERFORMA VoIP PADA VPN MENGGUNAKAN POINT-TO-POINT TUNNELING PROTOKOL PADA JARINGAN WIRELESS MIKROTIK', '71140045', 'Y', 15, 91, 'T'),
(1698, '2018-03-19 12:21:27', '<p>Nilai Akhir: 185 (Ditolak)</p>\r\n\r\n<ul>\r\n	<li>Agar bisa diterima, penulis perlu menambahkan keterangan untuk mengukur keakuratan Bidirectional Associative Memory menggunakan?</li>\r\n	<li>Agar bisa diterima, penulis perlu menambahkan contoh konkrit cara perhitungan BAM.</li>\r\n	<li>Agar bisa diterima, penulis perlu menambahkan literatur-literatur yang berhubungan dengan BAM &amp; pengenalan tanda tangan; sebagai tinjauan pustaka supaya lebih lengkap.</li>\r\n	<li>Agar bisa diterima, penulis perlu menambahkan keterangan pada Blok Diagram supaya lengkap.</li>\r\n	<li>Agar bisa diterima, penulis perlu menambahkan informasi bahwa sistem akan dibuat dengan menggunakan bahasa pemrograman apa dan alasan pemilihannya.</li>\r\n</ul>\r\n', '2018-03-23 10:26:31', 642, 'K', 6, NULL, 1776, 'PENGENALAN TANDA TANGAN MENGGUNAKAN METODE BIDIRECTIONAL ASSOCIATIVE MEMORY', 'PENGENALAN TANDA TANGAN MENGGUNAKAN METODE BIDIRECTIONAL ASSOCIATIVE MEMORY', '71120103', 'T', 16, 92, 'T'),
(1699, '2018-03-19 12:26:12', '<p>Masih banyak yang harus diperbaiki</p>\r\n\r\n<p>Latar belakang tidak jelas, masalah tidak dipaparkan secara jelas</p>\r\n\r\n<p>Metode penelitian belum terlihat bagaimana dilakukannya</p>\r\n\r\n<p>Tidak ada tinjauan pustaka</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SKOR: 105 (Ditolak)</p>\r\n', '2018-03-23 11:59:01', 772, 'K', 1, NULL, 1762, 'ANALISIS PERBANDINGAN PENGGUNAAN IPSEC PADA JARINGAN VIDEO CONFERENCE', 'ANALISIS PERBANDINGAN PENGGUNAAN IPSEC PADA JARINGAN VIDEO CONFERENCE', '71140007', 'T', 53, 91, 'T'),
(1701, '2018-03-19 14:10:49', '<p>Rumusan masalah diperbaiki</p>\r\n\r\n<p>Tambahkan tabel ringkasan dari tinjauan pustaka</p>\r\n\r\n<p>Perhatikan penulisan dalam bahasa Indonesia</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SKOR: 310 (Revisi Minor)</p>\r\n', '2018-04-12 09:09:49', 772, 'R', 13, NULL, 1780, 'IMPLEMENTASI METODE FORWARD-CHAINING PADA PERANCANGAN SMART WATER DISPENSER\r\n', 'IMPLEMENTASI METODE FORWARD-CHAINING PADA PERANCANGAN SMART WATER DISPENSER\r\n', '71130111', 'Y', 53, 91, 'T'),
(1702, '2018-03-19 14:11:41', '<p>1. Pada metodologi penelitian, mohon diperjelas untuk input, output, dam metodenya pada tiap langkah.</p>\r\n\r\n<p>2. Apakah pemerintah Kabupaten Sumba Barat membutuhkan website? Mengapa tidak ada alasan yang disebutkan pada latar belakang?</p>\r\n\r\n<p>3. E-gov sangat luas. Di mana titik berat ata fokus utamanya dalam penelitian ini?</p>\r\n\r\n<p>4. Siapa yang akan diminta evaluasi sistem? Berapa orang</p>\r\n\r\n<p>5. Lihat revisi dan catatan lain di proposal</p>\r\n\r\n<p>6. Rev mayor (skor 240)</p>\r\n', '2018-04-11 08:18:13', 1315, 'R', 9, NULL, 1769, 'PERANCANGAN WEBSITE  PEMERINTAH DAERAH KABUPATEN SUMBA BARAT', 'PERANCANGAN WEBSITE  PEMERINTAH DAERAH KABUPATEN SUMBA BARAT', '71140089', 'Y', 55, 90, 'T'),
(1703, '2018-03-19 14:12:01', '<ul>\r\n	<li>Latar belakang: tidak terdapat keterkaitan dengan penelitian sebelumnya</li>\r\n	<li>Tujuan penelitian: dibuat lebih riil, kegunaan untuk awam</li>\r\n	<li>Landasan teori belum menunjukkan alur CBIR dan keterkaitan GLCM atau bagaimana fungsinya dalam CBIR</li>\r\n	<li>Tidak ada contoh perhitungan, baik diagram kurang detil</li>\r\n</ul>\r\n\r\n<p>Daftar pustaka tidak sinkron dengan kutipan</p>\r\n', '2018-04-11 13:54:07', 637, 'R', 18, NULL, 1781, 'SISTEM REKOMENDASI BAJU PADA ONLINE SHOP MENGGUNAKAN CONTENT-BASED IMAGE RETRIEVAL', 'SISTEM REKOMENDASI BAJU PADA ONLINE SHOP MENGGUNAKAN CONTENT-BASED IMAGE RETRIEVAL', '71140058', 'Y', 3, 93, 'T'),
