(1709, '2018-03-19 14:14:38', '<ol>\r\n	<li>Referensi belum ditulis di proposal bagian teori (sitasi belum ada)</li>\r\n	<li>Daftar pustaka belum APA</li>\r\n	<li>Teori Hungarian kurang, contoh kasus tidak boleh capture dari slide.</li>\r\n	<li>Belum ada referensi penelitian-penelitian sejenis</li>\r\n	<li>Lihat komentar pada proposal</li>\r\n	<li>Perubahan judul skripsi</li>\r\n	<li>Rev mayor (skor 285)</li>\r\n</ol>\r\n', '2018-04-11 13:44:41', 1315, 'R', 50, NULL, 1784, 'IMPLEMENTASI METODE HUNGARIAN UNTUK SISTEM PENJADWALAN DOSEN TEKNIK INFORMATIKA', 'IMPLEMENTASI METODE HUNGARIAN UNTUK SISTEM PENJADWALAN DOSEN INFORMATIKA UKDW', '71140039', 'Y', 17, 90, 'T'),
(1710, '2018-03-19 14:21:38', '<p>Nilai Akhir: 225 (Revisi Mayor)</p>\r\n\r\n<ol>\r\n	<li>Apakah peneliti mempunyai latar belakang bahasa isyarat untuk kelancaran penelitian?</li>\r\n	<li>Pengungkapan latar belakang masalah, rumusan masalah, batasan dan tujuan belum tepat.</li>\r\n	<li>Banyak kutipan yang tidak ada daftar pustakanya.</li>\r\n	<li>Metodologi/langkah-langkah penelitian belum sesuai dengan metode yang dipilih (UCD).</li>\r\n	<li>Landasan teori perlu dikuasai, tidak asal copy paste.</li>\r\n</ol>\r\n', '2018-04-11 13:27:01', 642, 'R', 42, NULL, 1767, 'Desain Antarmuka Pengguna Media Pembelajaran \r\nPengenalan Kosakata bagi anak Tunarungu dengan Metode User Design Center (UCD) \r\n', 'DESAIN ANTARMUKA PENGGUNA MEDIA PEMBELAJARAN PENGENALAN KOSAKATA BAGI ANAK TUNARUNGU DENGAN METODE USER CENTERED DESIGN (UCD)', '71140093', 'Y', 39, 92, 'T'),
(1711, '2018-03-19 14:22:02', '<p>Rev mayor (skor <strong>250</strong>)</p>\r\n\r\n<p>Tanggapan umum:</p>\r\n\r\n<ul>\r\n	<li>Secara umum, topik penelitian yang diajukan <strong>bisa dikerjakan / dilanjutkan</strong> hanya penulisan dalam proposal masih kurang jelas. Penggunaan leksikon dalam penelitian sedikit diberi gambaran, tapi penggunaan panjang kata sama sekali tidak dijelaskan di mana pun</li>\r\n	<li><strong>Penulisan proposal sudah lebih baik</strong>, meskipun beberapa kalimat yang digunakan dalam penulisan masih ada yang membingungkan.</li>\r\n	<li>Penulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. &#39;di tokenisasi&#39; harus ditulis &#39;ditokenisasi&#39;.<br />\r\n	Rumus: &quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu</li>\r\n	<li>Label untuk gambar dan tabel: &quot;Tabel [nomor]. JudulTabel&quot; atau &quot;Gambar [nomor]. JudulGambar&quot;. Contoh: &quot;Tabel 1. JudulTabel&quot;, &quot;Tabel 2. JudulTabel&quot;</li>\r\n</ul>\r\n\r\n<p>Tanggapan khusus:</p>\r\n\r\n<ol>\r\n	<li>Latar Belakang\r\n	<ul>\r\n		<li>Masih ada beberapa typographical error</li>\r\n		<li>Beberapa kalimat perlu direvisi agar lebih mudah dimengerti. Untuk ini, silakan lihat proposal Anda.</li>\r\n		<li>Mohon diperhatikan cara menulis rujukan di dalam teks, terutama ketika rujukan tersebut berfungsi sebagai subjek atau objek dalam kalimat.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Rumusan Masalah\r\n	<ul>\r\n		<li>Rumusan no. 2: Kata &#39;diantaranya&#39; diganti &#39;yaitu&#39;</li>\r\n	</ul>\r\n	</li>\r\n	<li>Batasan Masalah\r\n	<ul>\r\n		<li>Perlu ditambahkan tentang tipe/bentuk data, mis. teks, gambar, atau video?</li>\r\n		<li>Kalimat &quot;Indonesia memiliki begitu banyak bahasa daerah&quot; =&gt; bisa diganti dengan &quot;Indonesia memiliki .... bahasa daerah&quot;. Data diambil dari artikel ilmiah atau buku milik pakar bahasa.</li>\r\n		<li>Lihat proposal untuk kesalahan penulisan.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Tujuan penelitian\r\n	<ul>\r\n		<li>Perlu ditambahkan kata-kata &quot;.... membangun sebuah sistem yang .....&quot; dalam kalimat.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Manfaat Penelitian\r\n	<ul>\r\n		<li>Lihat proposal.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Landasan Teori\r\n	<ul>\r\n		<li>Judul sub bab 6.1.2 dihilangkan saja. Penjelasan tentang tokenisasi bisa dimasukkan dalam sub bab 6.1.</li>\r\n		<li>Ada banyak kalimat membingungkan di bagian ini. Detilnya silakan lihat di proposal.</li>\r\n		<li>Sudah sangat baik karena disertai dengan contoh. Tapi, penjelasan contoh perlu diperjelas dan menggunakan kalimat yang baik.</li>\r\n		<li>Gunakan kalimat-kalimat sederhana dengan format: subjek + predikat + objek + keterangan</li>\r\n		<li>Setiap tabel dan gambar harus dijelaskan dan disebutkan dalam teks.</li>\r\n		<li>Setiap rumus perlu dijelaskan maksudnya, termasuk maksud dari setiap variabel atau konstanta di dalamnya</li>\r\n	</ul>\r\n	</li>\r\n	<li>Blok Diagram Sistem\r\n	<ul>\r\n		<li>Blok diagram sistem membingungkan. Diagram tersebut bisa dibuat lebih sederhana dengan mengelompokkan proses berdasarkan skala identifikasi. Lalu, proses dalam setiap skala identifikasi diperjelas dengan flowchart. tersendiri</li>\r\n	</ul>\r\n	</li>\r\n	<li>Metodologi Penelitian\r\n	<ul>\r\n		<li>Jika tidak melakukan hal khusus terkait studi literatur, tidak perlu menyebutkan metode &quot;studi literatur&quot; secara khusus. Karena studi literatur adalah hal umum yang dilakukan di semua penelitian.</li>\r\n		<li>Bagian ke-1, mungkin lebih tepat jika menjelaskan tentang data yang digunakan, misalnya tentang leksikon, korpus, atau jenis data penelitian yang akan dianalisis. Informasi yang diberikan, misalnya, nama korpus, jumlah dokumen dalam setiap korpus</li>\r\n		<li>Bagian pembangunan sistem bisa diisi dengan langkah-langkah penelitian, termasuk bahasa pemrograman dan <em>libraries</em> yang mungkin akan digunakan dalam penelitian.</li>\r\n		<li>Bagian &quot;Metode Evaluasi Sistem&quot; sebaiknya dipindahkan ke &#39;Landasan Teori&#39; dengan penjelasan lebih detil dan contoh perhitungan.</li>\r\n		<li>Bagian &#39;Implementasi dan Testing&#39;, bisa diisi dengan menyebutkan bahwa evaluasi akan dilakukan dengan cara bagaimana dan menggunakan rumus yang mana</li>\r\n	</ul>\r\n	</li>\r\n	<li>Daftar Pustaka\r\n	<ul>\r\n		<li>Dari 7 literatur, hanya ada 3 pustaka yang digunakan dan ditulis dalam proposal. Yang lainnya dipakai di mana?</li>\r\n		<li>Ada 2 literatur yang ditulis di dalam teks proposal tapi tidak dimasukkan di Daftar Pustaka.</li>\r\n		<li><strong>Semua literatur yang ditulis di Daftar Pustaka harus digunakan dalam teks proposal.</strong></li>\r\n	</ul>\r\n	</li>\r\n</ol>\r\n', '2018-04-11 14:02:01', 1315, 'R', 12, NULL, 1768, 'IDENTIFIKASI BAHASA JAWA VS INDONESIA DENGAN ALGORITMA PANJANG KATA BERBASIS LEKSIKON\r\n', 'IDENTIFIKASI BAHASA JAWA VS INDONESIA DENGAN ALGORITMA PANJANG KATA BERBASIS LEKSIKON\r\n', '71140022', 'Y', 13, 90, 'T'),
