(1714, '2018-03-19 14:35:15', '<ol>\r\n	<li>Model Kuesioner yang rencananya akan digunakan --&gt; MetPen</li>\r\n	<li>Metode bukan berarti definisi, melainkan deskripsi teknik dan cara melakukan</li>\r\n	<li>Data untuk tabel 8.1 perlu dijelaskan didapat dari mana</li>\r\n	<li>Topik: cakupannya masih terlalu sempit</li>\r\n	<li>Rev mayor (skor 255)</li>\r\n</ol>\r\n', '2018-03-23 10:51:12', 1315, 'R', 50, NULL, 1787, 'PENERAPAN METODE USER CENTERED DESIGN DALAM  PEMBUATAN  APLIKASI INVENTORY LABORATORIUM BERBASIS DESKTOP', 'PENERAPAN METODE USER CENTERED DESIGN DALAM  PEMBUATAN  APLIKASI INVENTORY LABORATORIUM BERBASIS DESKTOP', '71140054', 'T', 12, 90, 'T'),
(1715, '2018-03-19 14:35:39', '<p>- Judul sama persis dengan penelitian yg sudah ada</p>\r\n\r\n<p>- Latar belakang tidak menceritakan masalah yang ada</p>\r\n\r\n<p>- Kurang berbobot untuk skripsi</p>\r\n\r\n<p>Skor: 130</p>\r\n', '2018-03-23 15:50:13', 636, 'K', 42, NULL, 1786, 'ANALISIS USABILITY WEBSITE KABUPATEN WONOGIRI  ', 'ANALISIS USABILITY WEBSITE KABUPATEN WONOGIRI  ', '71140035', 'T', 50, 93, 'T'),
(1717, '2018-03-19 14:58:39', '<ul>\r\n	<li>latar belakang: keterkaitan dengan penelitian sebelumnya tidak ada, dan bukan hal baru</li>\r\n	<li>rumusan dapat dilaksanakan, tetapi seharusnya landasan teori dari IMK/DEA</li>\r\n	<li>CMS bukan metode/teori, dasar DigHum juga kurang tepat di sini</li>\r\n	<li>Tidak ada kutipan /acuan sumber teori</li>\r\n	<li>Teori IMK/DEA untuk merancang tampilan web tidak ada</li>\r\n	<li>Tidak ada metode survei untuk menunjang teori imk/dea</li>\r\n	<li>Daftar pustaka dan kutipan tidak cocok</li>\r\n</ul>\r\n', '2018-03-26 13:37:07', 637, 'K', 12, NULL, 1788, 'IMPELEMENTASI METODE CONTENT MANAGEMENT SYSTEM (CMS ) PADA PERANCANGAN ANTARMUKA SITUS MENGENAI GAMELAN JAWA ', 'IMPELEMENTASI METODE CONTENT MANAGEMENT SYSTEM (CMS ) PADA PERANCANGAN ANTARMUKA SITUS MENGENAI GAMELAN JAWA ', '71130062', 'T', 3, 93, 'T'),
(1718, '2018-03-20 11:20:12', '<p>Nilai Akhir: 205 (Revisi Mayor)</p>\r\n\r\n<ol>\r\n	<li>Latar Belakang, Rumusan Masalah, Tujuan dan Batasan diperbaiki sesuai saran (tercantum di Proposal).</li>\r\n	<li>Semua tulisan pada Pustaka harus memiliki acuan/referensi.</li>\r\n	<li>Belum ada review/ulasan terhadap penelitian sebelumnya.</li>\r\n	<li>Metode GDD tidak diulas pada Latar Belakang dan Rumusan Masalah.</li>\r\n	<li>Blok Diagram cukup satu saja.</li>\r\n	<li>Kata &quot;Manusia&quot; dan &quot;Berbasis Android&quot; sebaiknya dihilangkan pada judul.</li>\r\n</ol>\r\n', '2018-04-16 10:31:26', 642, 'R', 13, NULL, 1771, 'RANCANG BANGUN ANTARMUKA SISTEM PAKAR UNTUK TES KEPRIBADIAN MANUSIA BERBASIS ANDROID', 'RANCANG BANGUN ANTARMUKA SISTEM PAKAR UNTUK TES KEPRIBADIAN MANUSIA BERBASIS ANDROID', '71110026', 'Y', 19, 92, 'T'),
