(1720, '2018-03-20 12:54:42', '<p>Nilai Akhir: 210 (Revisi Mayor)</p>\r\n\r\n<ul>\r\n	<li>Belum dijelaskan apa yang disebut keuntungan maksimal? Keuntungan maksimal dibandingkan dengan keuntungan apa?</li>\r\n	<li>Bagaimana ktia tahu keuntungan maksimal dan kerugian minimal dari suatu trading?</li>\r\n	<li>Belum ada contoh perhitungan Stochastic Oscillator; belum ada rumus tentang RSI, belum ada rumus tentang Elliot Wave yang dihubungkan dengan Fractal.</li>\r\n	<li>Metodologi penelitiannya perlu ditambahkan supaya lebih lengkap. Kelihatannya metodologi penelitiannya sangat umum sekali.</li>\r\n</ul>\r\n', '2018-04-12 11:13:41', 642, 'R', 2, NULL, 1790, 'SISTEM ANALISA FOREX MENGGUNAKAN TEKNIK ANALISIS BERBASIS INDIKATOR SMA, XMA, STOCHASTIC, RSI DAN FRACTALS ', 'SISTEM ANALISA FOREX MENGGUNAKAN TEKNIK ANALISIS BERBASIS INDIKATOR SMA, XMA, STOCHASTIC, RSI DAN FRACTALS ', '71120131', 'Y', 16, 92, 'T'),
