(1746, '2018-09-07 08:15:38', '<ul>\r\n	<li>Jika judul ini merupakan penelitian maka metodologi diperbaiki, dilengkapi dengan cara menguji parameter dan cara pengolahannya untuk pengambilan kesimpulan, maka silahkan lanjut.</li>\r\n	<li>Namun jika judul ini merupakan implementasi di satu komputer, dan hanya menuliskan cara cara konfigurasi lebih baik ganti judul atau judul di tolak, bobot kurang sesuai.</li>\r\n</ul>\r\n', '2018-09-14 11:40:10', 625, 'R', 10, NULL, 1810, 'IMPLEMENTASI SQUID SEBAGAI REVERSE PROXY UNTUK KEPERLUAN BACKUP SERVER', 'IMPLEMENTASI SQUID SEBAGAI REVERSE PROXY UNTUK KEPERLUAN BACKUP SERVER', '71150015', 'T', 1, 96, 'T'),
(1747, '2018-09-07 08:41:45', '<p>Skor: 160</p>\r\n\r\n<p>- Tidak ada tinjauan pustaka</p>\r\n\r\n<p>- Rumusan masalah no 1 -&gt; bukan rumusan masalah</p>\r\n\r\n<p>- Tujuan penelitian -&gt; mencapai apa dengan membuat ini, apa yang ingin diteliti?</p>\r\n\r\n<p>- Apa yang ingin anda teliti dari sini?</p>\r\n\r\n<p>- Tidak ada blok diagram, hanya ada use case</p>\r\n', '2018-09-14 14:09:18', 636, 'K', 17, NULL, 1846, 'PENGEMBANGAN APLIKASI WEB LOGBOOK TUGAS AKHIR DENGAN FRAMEWORK CODEIGNITER DAN PATTERN HMVC', 'PENGEMBANGAN APLIKASI WEB LOGBOOK TUGAS AKHIR DENGAN FRAMEWORK CODEIGNITER DAN PATTERN HMVC', '71140088', 'T', 3, 98, 'T'),
