(1749, '2018-09-07 08:59:09', '<p>rumusan, tujuan dan batasan masalah diperjelas keterkaitannya dengan kasus&nbsp;</p>\r\n\r\n<p>contoh kasus baik, penjelasan saja dipertegas&nbsp;</p>\r\n\r\n<p>LB belum dijelaskan</p>\r\n\r\n<p>Metode penelitian:&nbsp;sudah ada, penyajian dirapikan&nbsp;</p>\r\n\r\n<p>referensi sudah cukup, hanya perhatikan text book yang baru&nbsp;</p>\r\n\r\n<p>perbaikan tata cara penulisan proposal yang baik dan baku seusai panduan</p>\r\n\r\n<p>susunan kalimat perlu ditingkatkan lebih baik dan rapi</p>\r\n', '2018-10-02 14:38:11', 625, 'R', 13, NULL, 1847, 'Sistim Pakar pendiagnosis penyakit hewan ternak di pulau Sumba  ', 'Sistim Pakar pendiagnosis penyakit hewan ternak di pulau Sumba  ', '71120110', 'Y', 10, 96, 'T'),
