(1751, '2018-09-07 09:25:27', '<ul>\r\n	<li>skor 165 tolak</li>\r\n	<li>\r\n	<p>Tanggapan umum:</p>\r\n	Topik serupa sudah cukup banyak dijadikan topik penelitian. Apa bedanya dengan penelitian Anda?<br />\r\n	-Bagaimana cara menentukan tipe kepribadiannya? Jika &quot;hanya&quot; berdasarkan hasil alat tes tertentu, tidak cukup dikatakan sebagai &quot;Sitem Pakar&quot;<br />\r\n	-Jika akan membangun sistem pakar, siapa pakar yang akan bekerja sama dalam penelitian ini?<br />\r\n	-Jika akan membangun sistem pakar, metode representasi pengetahuan yang akan digunakan apa?<br />\r\n	-Masih ada beberapa <em>typographical error . </em>Untuk lebih jelasnya, lihat proposal yang sudah dinilai.<em> </em><br />\r\n	-Penulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. &#39;didalam&#39; harus ditulis &#39;di dalam&#39;.<br />\r\n	Rumus: &quot;di/ke + kata_tempat&quot; ditulis terpisah<br />\r\n	-Penulisan paragraf baru selalu diawali dengan cara penulisan yang menjorok ke dalam. Mohon konsisten dengan itu dari awal sampai akhir proposal.<br />\r\n	-Perlu diberi nomor halaman\r\n	<p>Tanggapan khusus:</p>\r\n	1.Latar Belakang<br />\r\n	-Pernyataan2 yang ada perlu didukung dengan literatur yang sesuai, berkualitas, dan jelas keberadaannya.<br />\r\n	2.Batasan Masalah<br />\r\n	-Salah satu komponen dalam Sistem Pakar adalah mekanisme inferensi dan &#39;Forward Chaining&#39; adalah metode mekanisme inferensi yang akan digunakan dalam penelitian. Jadi, ini bukan batasan masalah. Ini seperti &quot;Anda bertujuan untuk membuat meja, lalu batasan masalahnya adalah membuat meja yang memiliki kaki meja&quot;<br />\r\n	-Batasan masalah adalah hal-hal yang TIDAK dilakukan/digunakan dalam penelitian, padahal seharusnya dilakukan/dikerjakan<br />\r\n	3.Tujuan Penelitian<br />\r\n	-Perlu ditambahkan kata-kata &quot;.... sistem pakar .....&quot; dalam kalimat, jika ingin membuat sistem pakar<br />\r\n	4.Manfaat Penelitian<br />\r\n	-Sistem yang ingin dibangun bertujuan untuk identifikasi tipe kepribadian, tapi manfaatnya adalah &#39;mengembangkan kemampuan&#39;. Hubungannya bagaimana?<br />\r\n	5.Landasan Teori<br />\r\n	-Penulisan sub judul (6.1, 6.2, dst.) rata kiri.<br />\r\n	-Semua gambar dan tabel harus memiliki label, disebutkan, dan dijelaskan dalam teks. Tidak boleh ditinggal pergi begitu saja.<br />\r\n	-Perhatikan nomor gambar<br />\r\n	-Beri literatur yang sesuai<br />\r\n	-Dalam satu halaman tidak boleh ada ruang kosong di bagian bawah.<br />\r\n	-Penjelasan tentang berbagai macam teori perlu didukung dengan rujukan yang jelas. Contoh: penjelasan tentang tipe2 kepribadian, tidak ada rujukannya<br />\r\n	-Tidak ada penjelasan tentang metode representasi pengetahuan yang akan digunakan!<br />\r\n	-Perlu ditambahkan penjelasan tentang Metode Linear yang digunakan dalam pengembangan sistem<br />\r\n	6.Blok Diagram Sistem<br />\r\n	-Semua gambar dan tabel perlu disebutkan dan dijelaskan dalam teks. Tidak boleh ditinggal pergi begitu saja.<br />\r\n	7.Metodologi Penelitian<br />\r\n	-Dalam &#39;Metodologi Penelitian&#39;, minimal menjelaskan 3 hal, yaitu: terkait data yang digunakan, tahapan/kegiatan yang dilakukan dalam pengembangan sistem/aplikasi/penelitian, dan metode evaluasi &amp; analisis yang akan dilakukan<br />\r\n	-Penjelasan umum tentang tahapan metode Linear diletakkan di Landasan Teori.<br />\r\n	-Di &#39;Metodologi Penelitian&#39; isi dari setiap tahapan metode Linear adalah penjelasan detil tentang apa yang akan Anda lakukan dalam penelitian Anda<br />\r\n	-Belum ada penjelasan tentang metode evaluasi &amp; analisis yang akan digunakan sama sekali<br />\r\n	7.Daftar Pustaka<br />\r\n	-Semua literatur yang ditulis di Daftar Pustaka harus digunakan dalam teks proposal.<br />\r\n	-Ada 2 literatur yang ditulis di dalam Daftar Pustaka, tapi tidak disebutkan di teks proposal</li>\r\n</ul>\r\n', '2018-09-14 20:51:23', 625, 'K', 19, NULL, 1852, 'Sistem Pakar untuk Menentukan Tipe Kepribadian Melankolis, Sanguins, Plegmatis, dan Koleris.', 'Sistem Pakar untuk Menentukan Tipe Kepribadian Melankolis, Sanguins, Plegmatis, dan Koleris.', '71140093', 'T', 13, 95, 'T'),
