(1788, '2018-09-07 12:07:06', '<p>N=260</p>\r\n\r\n<ul>\r\n	<li>Bagian yang terpenting dalam penilitian ini belum dituliskan yaitu bagaimana metode klasifikasi Decision Tree dengan algoritma ID3 dapat digunakan untuk memprediksi?</li>\r\n	<li>Perlu dicantumkan contoh kongkrit dari ID3; sehingga kelihatan jelas pada waktu diimplementasikan</li>\r\n</ul>\r\n', '2018-09-14 11:12:27', 642, 'R', 2, NULL, 1875, 'PREDIKSI PERGERAKAN HARGA SAHAM DENGAN METODE KLASIFIKASI DECISION TREE ALGORITMA ID3 PADA PERUSAHAAN LQ45', 'PREDIKSI PERGERAKAN HARGA SAHAM DENGAN METODE KLASIFIKASI DECISION TREE ALGORITMA ID3 PADA PERUSAHAAN LQ45', '71140048', 'T', 16, 97, 'T'),
(1789, '2018-09-07 12:10:29', '<p>Bagaimana sistem bekerja? hub antara IPS dan DT?</p>\r\n\r\n<p>implementasi seperti apa?</p>\r\n\r\n<p>Baca referensi penelitian pak Yuan dan Pak Anton</p>\r\n\r\n<p>Tidak ada prototipe dan kasus sesuai yang akan diteliti<br />\r\nDitolak bukan berarti ganti judul</p>\r\n', '2018-09-14 12:05:35', 625, 'K', 50, NULL, 1854, 'IMPLEMENTASI DECISION TREE J48 UNTUK PENGINGAT LOKASI PARKIR KENDARAAN PADA APLIKASI ANDROID', 'IMPLEMENTASI DECISION TREE J48 UNTUK PENGINGAT LOKASI PARKIR KENDARAAN PADA APLIKASI ANDROID', '71150040', 'T', 53, 96, 'T'),
(1790, '2018-09-07 12:11:10', '<p>Kurangnya penjelasan ttg cara kerja sistem. Kaitannya antara wifi IPS dan tempat parkir<br />\r\nTujuan diperbaiki, cari referensi ttg penelitian IPS punya pak Yuan dan pak Anton</p>\r\n\r\n<p>Jika membuat prototipe, bagaimana prototipe itu dibentuk</p>\r\n\r\n<p>Metode yang diajukan tidak sesuai dengan Landasan Teori yang ditulis.</p>\r\n\r\n<p>Ditolak bukan berarti ganti judul</p>\r\n', '2018-09-14 12:10:42', 625, 'K', 50, NULL, 1818, 'IMPLEMENTASI K-NEAREST NEIGHBORS UNTUK PENGINGAT LETAK PARKIR PADA APLIKASI ANDROID ', 'IMPLEMENTASI K-NEAREST NEIGHBORS UNTUK PENGINGAT LETAK PARKIR PADA APLIKASI ANDROID ', '71150021', 'T', 53, 96, 'T'),
