(1792, '2018-09-07 12:13:22', '<ul>\r\n	<li>ini hanya pengembangan antarmuka: front end?</li>\r\n	<li>lalu backendnya bagaimana? tidak bisa sistem dialog kalau cuma antarmuka</li>\r\n	<li>sistem dialog web tidak bisa dipisahkan dengan backendnya</li>\r\n	<li>topiknya blm cukup untuk membangun skripsi</li>\r\n	<li>skor 175 ditolak</li>\r\n</ul>\r\n', '2018-09-14 11:45:51', 625, 'K', 13, NULL, 1874, 'PENGEMBANGAN ANTARMUKA SISTEM DIALOG PERWALIAN OTOMATIS MENGGUNAKAN REGULAR EXPRESSION DAN FINITE STATE TRANSDUCERS', 'PENGEMBANGAN ANTARMUKA SISTEM DIALOG PERWALIAN OTOMATIS MENGGUNAKAN REGULAR EXPRESSION DAN FINITE STATE TRANSDUCERS', '71140009', 'T', 12, 95, 'T'),
(1793, '2018-09-07 12:14:03', '<ul>\r\n	<li>Data IG sudah pernah dibuat dan diuji dengan SVM, harus ada perbedaanya</li>\r\n	<li>Usulan gunakan metode lain seperti SVM modified, jangan murni atau cari yang lain</li>\r\n	<li>Data IG ambil darimana? berapa jumlahnya? bagaimana pengambilannya?</li>\r\n	<li>Sudah pernah dilakukan penelitian seperti ini menggunakan SVM, Naive Bayes, dan K-NN</li>\r\n	<li>Skor 325 rev minor</li>\r\n</ul>\r\n', '2018-09-28 08:39:33', 625, 'R', 54, NULL, 1869, 'Klasifikasi Sentimen Komentar Instagram Menggunakan Support Vector Machine', 'Klasifikasi Sentimen Komentar Instagram Menggunakan Support Vector Machine', '71150017', 'Y', 17, 95, 'T'),
(1794, '2018-09-07 12:14:50', '<p>N=340</p>\r\n\r\n<ul>\r\n	<li>Perbaiki rumusan masalah.</li>\r\n	<li>Pengingat visual vs. alarm masih kurang dijelaskan. Belum terlihat jelas perbedaan &amp; kebaruannya.</li>\r\n	<li>Landasan teori kurang lengkap.</li>\r\n</ul>\r\n', '2018-10-03 11:29:04', 642, 'R', 9, NULL, 1834, 'PEMBUATAN APLIKASI MOBILE PENGINGAT MINUM OBAT UNTUK ORANG TUA', 'PEMBUATAN APLIKASI MOBILE PENGINGAT MINUM OBAT UNTUK ORANG TUA', '71150042', 'Y', 39, 97, 'T'),
(1795, '2018-09-07 12:15:27', '<ul>\r\n	<li>Teori SVM dll masih belum detail</li>\r\n	<li>Penelitian sebelumnya harus dituliskan jg di pendahuluan</li>\r\n	<li>Why SVM? tolong dijelaskan alasannya. Harus dibandingkan dgn SVM lainnya</li>\r\n	<li>Cara pengumpulan dataset dijelaskan agak detail, bagaimana dengan pelabelannya? berapa buah?</li>\r\n	<li>Skor 275 rev mayor</li>\r\n</ul>\r\n', '2018-10-03 13:54:14', 625, 'R', 12, NULL, 1838, 'Analisis Sentimen Pada Komentar Video Ulasan Smartphone di Youtube', 'Analisis Sentimen Pada Komentar Video Ulasan Smartphone di Youtube', '71150046', 'Y', 17, 95, 'T'),
(1796, '2018-09-07 12:27:24', '<p>Tanggapan umum:<br />\r\n-Masih ada beberapa <em>typographical error . </em>Untuk lebih jelasnya, lihat proposal yang sudah dinilai.<em> </em><br />\r\n-Penulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. &#39;di desain&#39; harus ditulis &#39;didesain&#39;.<br />\r\nRumus: &quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu<br />\r\n-Penulisan paragraf baru selalu diawali dengan cara penulisan yang menjorok ke dalam. Mohon konsisten dengan itu dari awal sampai akhir proposal.</p>\r\n\r\n<p>Tanggapan khusus:<br />\r\n1.Latar Belakang<br />\r\n-Ada kalimat yang tidak selesai.<br />\r\n2.Batasan Masalah<br />\r\n-Beri pengantar untuk masuk bagian &#39;Batasan Masalah&#39;<br />\r\n-Literatur yang digunakan sebagai acuan diberi keterangan yang lain, minimal pengarangnya<br />\r\n3.Tujuan penelitian<br />\r\n-Perlu ditambahkan kata-kata &quot;.... menggunakan metode Methontology .....&quot; dalam kalimat.<br />\r\n4.Tinjauan Pustaka<br />\r\n-Cara menulis tinjauan pustaka perlu diubah<br />\r\n-Tujuan utama &quot;Tinjauan Pustaka&quot; adalah menunjukkan posisi penelitian Anda di antara penelitian2 serupa yang sudah dilakukan orang lain.<br />\r\n-Cara:<br />\r\n1. Buat dulu daftar artikel penelitian serupa yang Anda punya dalam tabel. Lalu Anda bisa jelaskan penelitian2 tersebut dari beberapa sisi, misalnya &#39;waktu&#39;, &#39;topik penelitian&#39;, &#39;metode yang digunakan&#39;, &#39;hasil penelitiannya&#39;<br />\r\n2. Tekankan perbedaan penelitian2 yang sudah ada tadi dengan penelitian yang sedang Anda kerjakan.<br />\r\n<br />\r\n5.Landasan Teori<br />\r\n-Buat kalimat menggunakan aturan Bahasa Indonesia yang formal: Subjek + Predikat + Objek + Keterangan<br />\r\n-Beberapa kalimat kehilangan Subjek-nya<br />\r\n-Semua gambar dan tabel perlu disebutkan dan dijelaskan dalam teks. Tidak boleh ditinggal pergi<br />\r\n<br />\r\n6.Metodologi Penelitian<br />\r\n-Dalam &#39;Metodologi Penelitian&#39;, minimal menjelaskan 3 hal, yaitu: terkait data yang digunakan, tahapan/kegiatan yang dilakukan dalam pengembangan sistem/aplikasi/penelitian, dan metode evaluasi &amp; analisis yang akan dilakukan<br />\r\n-Penjelasan umum tentang tahapan Menthotology diletakkan di Landasan Teori.<br />\r\n-Pada bagian &quot;8.2&quot;, perlu diperjelas tahapannya disesuaikan dengan aktivitas yang akan Anda lakukan dalam penelitian Anda. Kalau perlu diberi contoh.<br />\r\n-Belum ada penjelasan tentang metode evaluasi &amp; analisis yang akan digunakan sama sekali<br />\r\n<br />\r\n7.Daftar Pustaka<br />\r\n-Semua literatur yang ditulis di Daftar Pustaka harus digunakan dalam teks proposal.<br />\r\n-Ada 1 literatur yang ditulis di dalam Daftar Pustaka, tapi tidak disebutkan di teks proposal<br />\r\n-Semua literatur yang ditulis di Daftar Pustaka harus digunakan dalam teks proposal.</p>\r\n\r\n<p>Skor 255 rev mayor</p>\r\n', '2018-10-03 12:02:57', 625, 'R', 8, NULL, 1883, 'Representasi Pengetahuan Berbasis Web Ontology Language (OWL) untuk Objek Pakaian Adat Indonesia', 'Representasi Pengetahuan Berbasis Web Ontology Language (OWL) untuk Objek Pakaian Adat Indonesia', '71150007', 'Y', 13, 95, 'T'),
(1797, '2018-09-07 12:33:56', '<p>Skor: 305</p>\r\n\r\n<p>- Tambahkan contoh solusi untuk antarmuka bagi lansia yang sudah ada, dan apa ide anda yang ingin dibawa dalam penelitian ini -&gt; bisa dalam bentuk landasan teori mengenai solusi antarmuka bagi lansia</p>\r\n', '2018-10-01 14:20:20', 636, 'R', 9, NULL, 1882, 'PERANCANGAN ANTARMUKA APLIKASI SOSIAL MEDIA UNTUK  LANSIA BERBASIS MOBILE', 'PERANCANGAN ANTARMUKA APLIKASI SOSIAL MEDIA UNTUK  LANSIA BERBASIS MOBILE', '71150130', 'Y', 3, 98, 'T'),
