(1799, '2018-09-07 12:59:52', '<p>N=300</p>\r\n\r\n<ul>\r\n	<li>Perlu diperjelas apa yang dimaksud dengan &quot;pengaruh karakter kata sandi&quot; dan bagaimana mengukur &quot;pengaruh&quot; tersebut dalam hubungan keamanan.</li>\r\n</ul>\r\n', '2018-10-03 11:06:05', 642, 'R', 50, NULL, 1894, 'PENGARUH KARAKTERISTIK KATA SANDI PADA OTENTIKASI ONE – TIME PASSWORD MENGGUNAKAN SMS GATEWAY   ', 'PENGARUH KARAKTERISTIK KATA SANDI PADA OTENTIKASI ONE-TIME PASSWORD MENGGUNAKAN SMS GATEWAY   ', '71150052', 'Y', 5, 97, 'T'),
