(1801, '2018-09-07 13:01:12', '<p>N=200</p>\r\n\r\n<ul>\r\n	<li>Tuliskan matakuliah pendukung &amp; syarat (bidang minat).</li>\r\n	<li>Latar belakang: masalah apa yang ada di website saat ini sehingga perlu diteliti?</li>\r\n	<li>Bedakan batasan masalah vs. metodologi penelitian.</li>\r\n</ul>\r\n', '2018-09-14 11:37:53', 642, 'R', 17, NULL, 1889, 'ANALISIS DAN EVALUASI INTERFACE WEBSITE \r\nSARANWISATA.COM \r\nMENGGUNAKAN METODE USABILITY TESTING', 'ANALISIS DAN EVALUASI INTERFACE WEBSITE SARANWISATA.COM MENGGUNAKAN METODE USABILITY TESTING', '71120091', 'T', 9, 97, 'T'),
(1802, '2018-09-07 13:02:02', '<p>N=300</p>\r\n\r\n<ul>\r\n	<li>Perlu ditambahkan tentang perbedaan pengelolaan informasi di dinas tenaga kerja dibandingkan berbasis SMS Gateway di banyak tempat yang telah menggunakannya.</li>\r\n</ul>\r\n', '2018-10-03 08:36:37', 642, 'R', 1, NULL, 1880, 'PENGELOLAAN INFORMASI TENAGA KERJA PADA DINAS TENAGA KERJA DAN TRANSMIGRASI KULON PROGO BERBASIS SMS GATEWAY', 'PENGELOLAAN INFORMASI TENAGA KERJA PADA DINAS TENAGA KERJA DAN TRANSMIGRASI KULON PROGO BERBASIS SMS GATEWAY', '71140004', 'Y', 5, 97, 'T'),
(1803, '2018-09-07 13:03:16', '<ul>\r\n	<li>judul &quot;beberapa&quot; dibuang</li>\r\n	<li>rumus kurang lengkap</li>\r\n	<li>tinjauan pustaka masih kurang</li>\r\n	<li>metodologi juga kurang</li>\r\n	<li>skor 300 rev minor</li>\r\n</ul>\r\n', '2018-10-03 14:02:29', 625, 'R', 13, NULL, 1871, 'Pemodelan Beberapa Pelaku Seni di Indonesia Berbasis OWL Dengan Pendekatan CYC', 'Pemodelan Beberapa Pelaku Seni di Indonesia Berbasis OWL Dengan Pendekatan CYC', '71150018', 'Y', 8, 95, 'T'),
