(1805, '2018-09-07 13:09:56', '<p>Banyak sekali typo yang mengganggu</p>\r\n\r\n<p>Judul bisa diganti sedikit, sesuai dengan yang disarankan</p>\r\n\r\n<p>penjelasan tentang sinkronisasi masih sangat kurang, sehingga tidak jelas sampai dimana tingkat kesulitan dari penelitian ini</p>\r\n\r\n<p>Jelaskan arsitektur sistem yang akan dibuat</p>\r\n', '2018-10-10 11:21:11', 625, 'K', 8, NULL, 1850, 'MEMBANGUN SISTEM SINKRONISASI PADA SISTEM INFORMASI SINODE WILAYAH (SISWA) GKI JAWA TENGAH', 'MEMBANGUN SISTEM SINKRONISASI PADA SISTEM INFORMASI SINODE WILAYAH (SISWA) GKI JAWA TENGAH', '71150033', 'T', 2, 96, 'T'),
(1806, '2018-09-07 13:10:39', '<ul>\r\n	<li>Skor 200 rev mayor</li>\r\n	<li>\r\n	<p>Tanggapan umum:</p>\r\n	-<strong>Metode pembangunan desain </strong><em>dashboardnya apa? =&gt; </em><strong>perlu ditentukan dan disebutkan sejak latar belakang masalah</strong><br />\r\n	-<strong>Metode yang akan digunakan perlu dijelaskan di &#39;Landasan Teori&#39;, lalu tahapan detil yang akan dilakukan di penelitian ini perlu dijelaskan di &#39;Metodologi Penelitian&#39;. Tahapan perancangan dan pembuatan </strong><em>dashboard</em><strong> bisa mengacu ke metode yang sudah dipilih</strong><br />\r\n	-Masih ada beberapa <em>typographical error . </em>Untuk lebih jelasnya, lihat proposal yang sudah dinilai.<em> </em><br />\r\n	-Penulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. &#39;dilingkungan&#39; harus ditulis &#39;di lingkungan&#39;, sedangkan &#39;di desain&#39; harus ditulis &#39;didesain&#39;.<br />\r\n	Rumus:<br />\r\n	&quot;di/ke + kata_tempat&quot; ditulis terpisah<br />\r\n	&quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu<br />\r\n	-Buat kalimat menggunakan aturan Bahasa Indonesia yang formal: Subjek + Predikat + Objek + Keterangan<br />\r\n	-Bahasa asing ditulis miring (<em>italic</em>)</li>\r\n	<li>Tanggapan khusus:<br />\r\n	1.Latar Belakang<br />\r\n	-Pernyataan2 yang ada perlu didukung dengan literatur yang sesuai, berkualitas, dan jelas keberadaannya.<br />\r\n	-Perlu ditambahkan &#39;masalah&#39; yang dihadapi oleh prodi, misalnya terkait jumlah dan kompleksitas dari data<br />\r\n	2.Batasan Masalah<br />\r\n	-Perlu dihubungkan dengan metode pengembangan <em>dashboard </em>yang dipilih<br />\r\n	3.Tujuan Penelitian<br />\r\n	-Tujuan hanya satu.<br />\r\n	4.Manfaat Penelitian<br />\r\n	-Perlu diperjelas dilihat dari beberapa sudut pandang, misalnya: bagi institusi, bagi target pengguna, bagi mahasiswa<br />\r\n	5.Tinjauan Pustaka<br />\r\n	-Judul penelitian dari rujukan yang ditulis di teks tidak perlu disebutkan.<br />\r\n	6.Landasan Teori<br />\r\n	-Penulisan sub judul (7.1, 7.2, dst.) rata kiri.<br />\r\n	-Semua gambar dan tabel harus memiliki label, disebutkan, dan dijelaskan dalam teks. Tidak boleh ditinggal pergi begitu saja.<br />\r\n	-Perhatikan nomor gambar!<br />\r\n	-Beri literatur yang sesuai<br />\r\n	-Ada banyak literatur yang disebutkan di bagian ini tapi tidak ditulis di Daftar Pustaka<br />\r\n	-Tidak ada penjelasan tentang metode perancangan <em>dashboard</em> yang akan digunakan!<br />\r\n	7.Blok Diagram Sistem<br />\r\n	-Semua gambar dan tabel perlu disebutkan dan dijelaskan dalam teks. Tidak boleh ditinggal pergi begitu saja.<br />\r\n	8.Metodologi Penelitian<br />\r\n	-Dalam &#39;Metodologi Penelitian&#39;, minimal menjelaskan 3 hal, yaitu: terkait data yang digunakan, tahapan/kegiatan yang dilakukan dalam pengembangan sistem/aplikasi/penelitian, dan metode evaluasi &amp; analisis yang akan dilakukan<br />\r\n	-Di &#39;Metodologi Penelitian&#39; isi dari setiap tahapan dari metode perancangan <em>dashboard</em> yang dipilih adalah penjelasan detil tentang apa yang akan Anda lakukan dalam penelitian Anda<br />\r\n	-Belum ada penjelasan tentang metode evaluasi &amp; analisis yang akan digunakan sama sekali<br />\r\n	9.Daftar Pustaka<br />\r\n	-Semua literatur yang ditulis di Daftar Pustaka harus digunakan dalam teks proposal.<br />\r\n	-Ada 3 literatur yang ditulis di dalam Daftar Pustaka, tapi tidak disebutkan di teks proposal<br />\r\n	-Ada 5 literatur yang ditulis di dalam teks proposal tapi tidak dimasukkan di Daftar Pustaka.<br />\r\n	-Daftar pustaka ditulis urut abjad</li>\r\n</ul>\r\n', '2018-10-02 22:23:14', 625, 'R', 42, NULL, 1896, 'PEMBANGUNAN STRATEGIC DASHBOARD UNTUK ANALISIS AKADEMIK BERDASARKAN EVALUASI AKADEMIK PRODI', 'PEMBANGUNAN STRATEGIC DASHBOARD UNTUK ANALISIS AKADEMIK BERDASARKAN EVALUASI AKADEMIK PRODI', '71150156', 'Y', 13, 95, 'T'),
(1807, '2018-09-07 13:11:21', '<ul>\r\n	<li>Referensi penelitian sebelumnya masih kurang...</li>\r\n	<li>Perbedaan antara penelitian sebelumnya harus ditulis dengan jelas termasuk alasannya</li>\r\n	<li>Contoh kasus untuk confusion matrix juga harus dibuat sesuai contoh kasus yg sdh anda buat</li>\r\n	<li>Skor 310 (rev minor)</li>\r\n</ul>\r\n', '2018-10-02 13:55:19', 625, 'R', 16, 17, 1887, 'PERBANDINGAN ALGORITMA C4.5 DAN K-MEANS DALAM MEMPREDIKSI KATEGORI INDEKS PRESTASI MAHASISWA', 'PERBANDINGAN ALGORITMA C4.5 DAN K-MEANS DALAM MEMPREDIKSI KATEGORI INDEKS PRESTASI MAHASISWA', '71150064', 'Y', 17, 95, 'T'),
