(1896, '2018-10-10 12:03:25', '<p>- Untuk data training nya lebih baik menggunakan data selama 3 tahun. sedangkan data ujinya 6 bulan</p>\r\n\r\n<p>- Prediksi untuk keakuratan harga saham menggunakan metode apa?</p>\r\n\r\n<p>- Judul ditambah menjadi &quot;Prediksi pergerakan harga saham dengan metode klasifikasi decision tree algoritmn C5.0 pada saham LQ45&quot;</p>\r\n\r\n<p>295 (Rev Mayor)</p>\r\n', '2018-10-29 14:12:25', 1178, 'R', 2, NULL, 1974, 'PREDIKSI PERGERAKAN HARGA SAHAM DENGAN METODE KLASIFIKASI DECISION TREE ALGORITMA C5.0 PADA PERUSAHAAN LQ45 ', 'PREDIKSI PERGERAKAN HARGA SAHAM DENGAN METODE KLASIFIKASI DECISION TREE ALGORITMA C5.0 PADA SAHAM LQ45 ', '71140048', 'Y', 16, 102, 'T'),
