(1900, '2018-10-10 13:09:16', '<p>- Bagaimana mengukur performa random forest? metode apa yang digunakan untuk mengukurnya?</p>\r\n\r\n<p>- Untuk datanya lebih baik 3 tahun untuk data training, dan 6 bulan untuk data testing. Untuk data mining jika datanyanya terlalu sedikit kurang bagus untuk penelitian.</p>\r\n\r\n<p>- berikan contoh konkrit untuk random forest classifier, supaya lebih jelas diimplementasi</p>\r\n\r\n<p>305 (Rev Minor)</p>\r\n', '2018-10-29 14:32:04', 1178, 'R', 2, NULL, 1972, 'Sistem Prediksi Harga Saham LQ45 Dengan Random Forest Classifier', 'Sistem Prediksi Harga Saham LQ45 Dengan Random Forest Classifier', '71150151', 'Y', 16, 102, 'T'),
(1902, '2018-10-10 14:17:36', '<ul>\r\n	<li>Metode yang digunakan sudah sangat banyak dipakai, apa kebaruannya?</li>\r\n	<li>Bedanya hanya di canny dan sobel saja dari judul sebelumnya</li>\r\n	<li>Silahkan diskusi lebih lanjut dengan evaluator</li>\r\n	<li>Skor 100 (tolak)</li>\r\n</ul>\r\n', '2018-10-17 10:00:30', 625, 'K', 6, NULL, 1987, 'IMPLEMENTASI METODE DETEKSI TEPI SOBEL DAN BACKPROPAGATION UNTUK MENGENALI LOGO MEREK MOBIL', 'IMPLEMENTASI METODE DETEKSI TEPI SOBEL DAN BACKPROPAGATION UNTUK MENGENALI LOGO MEREK MOBIL', '71120103', 'T', 20, 103, 'T'),
(1903, '2018-10-10 14:18:15', '<ol>\r\n	<li>Referensi perlu dituliskan di dalam tinjauan pustaka dan beberapa teori masih kurang lengkap</li>\r\n	<li>Sumber data corpusnya harus diputuskan, pakai kompas atau perpustakaan?</li>\r\n	<li>Apakah penelitian ini akan membuat plugin? kenapa ada di tujuan / manfaat?</li>\r\n	<li>Tuliskan contoh data SKOS dari Himawan di teori SKOS</li>\r\n	<li>Tuliskan rumus / prosedur VSM pada teori VSM</li>\r\n	<li>Font pada daftar pustaka harus sama</li>\r\n	<li>Skor 315 revisi minor<br />\r\n	&nbsp;</li>\r\n</ol>\r\n', '2018-10-29 13:37:00', 625, 'R', 13, NULL, 1984, 'Pengembangan Sistem Information Retrieval Untuk Bahasa Indonesia Berbasis Web Menggunakan Vector Space Model', 'Pengembangan Sistem Information Retrieval Untuk Bahasa Indonesia Berbasis Web Menggunakan Vector Space Model', '71130027', 'Y', 17, 100, 'T'),
(1904, '2018-10-10 14:19:09', '<p>Tanggapan umum:</p>\r\n\r\n<ul>\r\n	<li>-Secara umum, proposal ini terkesan tidak disiapkan dengan baik karena tidak jelas sama sekali. Oleh karena itu, proposal ini <strong>ditolak.</strong></li>\r\n	<li>-Tidak ada literatur atau penelitian pendukung yang diungkapkan sama sekali.</li>\r\n	<li>-Masih ada beberapa <em>typographical error . </em>Untuk lebih jelasnya, lihat proposal yang sudah dinilai.<em> </em></li>\r\n	<li>-Penulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. &#39;diatas&#39; harus ditulis &#39;di atas&#39;.<br />\r\n	Rumus:\r\n	<ul>\r\n		<li>&quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu</li>\r\n		<li>&quot;di/ke + kata_tempat&quot; ditulis terpisah</li>\r\n	</ul>\r\n	</li>\r\n	<li>Penulisan paragraf baru selalu diawali dengan cara penulisan yang menjorok ke dalam. Mohon konsisten dengan itu dari awal sampai akhir proposal.</li>\r\n</ul>\r\n\r\n<p>Tanggapan khusus:</p>\r\n\r\n<ol>\r\n	<li>Latar Belakang\r\n	<ul>\r\n		<li>Pada bagian ini, masalah yang diungkapkan tidak jelas, bahkan tidak berhubungan satu dengan yang lain</li>\r\n	</ul>\r\n	</li>\r\n	<li>Rumusan dan Batasan Masalah\r\n	<ul>\r\n		<li>Karena latar belakang tidak jelas, rumusan dan batasan masalah juga menjadi membingungkan.</li>\r\n		<li>Masalah yang ingin diselesaikan tidak sesuai dengan masalah yang dibahas.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Tujuan penelitian\r\n	<ul>\r\n		<li>Sama sekali tidak jelas. Apalagi jika dihubungkan dengan latar belakang, rumusan, dan batasan masalah.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Tinjauan Pustaka\r\n	<ul>\r\n		<li>Tidak ada tinjauan pustaka yang dibahas sama sekali</li>\r\n	</ul>\r\n	</li>\r\n	<li>Landasan Teori\r\n	<ul>\r\n		<li>Apakah &quot;<em>Goal Centered Design</em>&quot; sama dengan &quot;<em>Goal Directed Design</em>&quot;?</li>\r\n		<li>Di bagian awal disebutkan kalau kuesioner SUS akan digunakan dalam tahap <em>design research, </em>tapi di bagian belakang disebutkan kalau kuesioner SUS akan digunakan dalam evaluasi. Kalau pun akan digunakan di dua bagian tersebut, bagaimana caranya? Terutama di bagian <em>design research</em>?</li>\r\n		<li>Teori yang perlu dijelaskan di bagian ini jadi tidak jelas, karena latar belakang sampai tujuan penelitian tidak jelas.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Metodologi Penelitian\r\n	<ul>\r\n		<li>Metodologi penelitian sama sekali tidak jelas. Terlalu umum dan tidak menjelaskan apa yang akan dilakukan secara khusus dalam penelitian.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Daftar Pustaka\r\n	<ul>\r\n		<li>Semua literatur yang ditulis di Daftar Pustaka harus digunakan dalam teks proposal.</li>\r\n		<li>Dari 3 literatur, ada 2 literatur yang ditulis di dalam Daftar Pustaka, tapi tidak disebutkan di teks proposal</li>\r\n		<li>Cara penulisan di proposal tidak mengikuti cara penulisan APA Style</li>\r\n		<li>Minimal terdiri dari 5 literatur!</li>\r\n	</ul>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Score: 120</p>\r\n', '2018-10-17 08:05:05', 1315, 'K', 9, NULL, 1969, 'PERANCANGAN ANTARMUKA SISTEM PENCARIAN JUDUL LAGU ROHANI BAHASA INGGRIS MENGGUNAKAN METODE GOAL DIRECTED DESIGN', 'PERANCANGAN ANTARMUKA SISTEM PENCARIAN JUDUL LAGU ROHANI BAHASA INGGRIS MENGGUNAKAN METODE GOAL DIRECTED DESIGN', '71130062', 'T', 13, 100, 'T'),
