(2004, '2019-03-22 13:14:43', '<p>Revisi Mayor:<br />\r\n1. Latar belakang masih sangat kurang<br />\r\n2. rencana desain batik yang diharapkan belum ada<br />\r\n3. tinjauan pustaka tidak ada sama sekali, adanya hanya dasar teori yang sangat sedikit<br />\r\n4. Harap menemui pak Nugroho atau bu Widi untuk berbincang lebih dalam untuk mendapatkan masukan lebih banyak.</p>\r\n\r\n<p>Skor 200</p>\r\n', '2019-04-01 13:56:14', 625, 'R', 18, NULL, 2074, 'Implementasi Metode L-System untuk Membangun Desain Motif Batik', 'Implementasi Metode L-System untuk Membangun Desain Motif Batik', '71150045', 'T', 7, 110, 'T'),
(2005, '2019-03-22 13:28:09', '<p>Ditolak; Banyak paragraf yang hanya terdiri dari 1-2 kalimat; Kurang berbobot jika hanya menguji saja, tanpa mengusulkan perbaikan; Formatting sangat kacau, padahal sudah ada template; Tidak ada alasan yang kuat mengapa web ini perlu diteliti.</p>\r\n\r\n<p>Skor 165</p>\r\n', '2019-03-29 07:36:06', 625, 'K', 9, NULL, 2090, 'ANALISIS USER INTERFACE WEBSITE RALALI.COM DENGAN USABILITY TESTING', 'ANALISIS USER INTERFACE WEBSITE RALALI.COM DENGAN USABILITY TESTING', '71150001', 'T', 50, 110, 'T'),
(2006, '2019-03-22 13:28:40', '<p>Tanggapan umum:<br />\r\n-Secara umum, proposal ini terkesan tidak disiapkan dengan baik karena tidak jelas sama sekali. Oleh karena itu, proposal ini <strong>ditolak.</strong><br />\r\n-Kompleksitas permasalahan sangat kurang untuk level Skripsi.<br />\r\n-Masih ada beberapa <em>typographical error </em> dan kalimat yang membingungkan karena kehilangan subyek, predikat, atau objek.<em> </em>Untuk lebih jelasnya, lihat proposal yang sudah dinilai.<em> </em><br />\r\n-Penulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. &#39;diatas&#39; harus ditulis &#39;di atas&#39;.<br />\r\nRumus:<br />\r\n- &quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu<br />\r\n- &quot;di/ke + kata_tempat&quot; ditulis terpisah</p>\r\n\r\n<p>Tanggapan khusus:</p>\r\n\r\n<p>1.Latar Belakang<br />\r\n-Permasalahn yang diangkat terlalu umum. Perlu menentukan studi kasus untuk masalah yang akan dibahas.<br />\r\n2.Rumusan dan Batasan Masalah<br />\r\n-Karena latar belakang sangat umum, maka rumusan masalahnya pun sangat umum.<br />\r\n3.Tujuan penelitian<br />\r\n-Sama sekali tidak jelas. Penelitian ini butuh studi kasus sehingga implementasi metode yang ingin diterapkan menjadi jelas.<br />\r\n4.Tinjauan Pustaka<br />\r\n-Hanya ada 1 penelitian terkait yang dibahas.<br />\r\n5.Landasan Teori<br />\r\n-Teori yang dibahas hanya tentang PWA.<br />\r\n-Tidak ada pembahasan lain, misalnya terkait metode evaluasi yang akan digunakan.<br />\r\n6.Metodologi Penelitian<br />\r\n-Metodologi penelitian sama sekali tidak jelas. Terlalu umum dan tidak menjelaskan apa yang akan dilakukan secara khusus dalam penelitian.<br />\r\n7.Daftar Pustaka<br />\r\n-Semua literatur yang ditulis di Daftar Pustaka harus digunakan dalam teks proposal.<br />\r\n-Dari 6 literatur, ada 1 literatur yang ditulis di dalam Daftar Pustaka, tapi tidak disebutkan di teks proposal<br />\r\n-Cara penulisan di proposal tidak mengikuti cara penulisan APA Style<br />\r\n-Minimal terdiri dari 5 literatur yang berupa artikel penelitian</p>\r\n\r\n<p>SKOR 180 DITOLAK</p>\r\n\r\n<p>Silahkan hubungi dan diskusi dengan evaluator</p>\r\n', '2019-03-30 20:16:56', 625, 'K', 9, NULL, 2093, 'RANCANGAN WEB APPS SEDERHANA DENGAN KONSEP PROGRSSIVE WEB APPS (PWA)', 'RANCANGAN WEB APPS SEDERHANA DENGAN KONSEP PROGRSSIVE WEB APPS (PWA)', '71150155', 'T', 13, 111, 'T'),
(2007, '2019-03-22 13:29:06', '<p>Revisi: Pola citra yang diinginkan belum dituliskan. Harap menemui pak Nugroho atau bu Widi untuk berbincang lebih dalam untuk mendapatkan masukan lebih banyak.</p>\r\n\r\n<p>skor 300 rev minor</p>\r\n', '2019-04-15 10:48:48', 625, 'R', 18, NULL, 2091, 'PEMODELAN POLA CITRA DIGITAL MENGGUNAKAN METODE LINDENMAYER SYSTEM (L-SYSTEM)', 'PEMODELAN POLA CITRA DIGITAL MENGGUNAKAN METODE LINDENMAYER SYSTEM (L-SYSTEM)', '71150022', 'Y', 7, 110, 'T'),
(2008, '2019-03-22 13:29:34', '<p>Revisi Mayor; Latar belakang masalah perlu diperbaiki bagian referensi studi kasus, masih kurang; Rumusan masalah diperjelas sesuai tahap pengembangan; Manfaat bisa dijelaskan sesuai fungsi SP; Jelaskan contoh kasusnya; Referensi teori yang dipakai perlu dijelaskan; Perlu menambahkan referensi SP yang baru.</p>\r\n\r\n<p>Skor 260 rev mayor</p>\r\n', '2019-04-15 14:28:41', 625, 'R', 19, NULL, 2073, 'SISTEM PAKAR UNTUK DIAGNOSA PENYAKIT TONSILITIS MENGGUNAKAN METODE FORWARD CHAINING BERBASIS WEB', 'SISTEM PAKAR UNTUK DIAGNOSA PENYAKIT TONSILITIS MENGGUNAKAN METODE FORWARD CHAINING BERBASIS WEB', '71140034', 'Y', 10, 110, 'T'),
(2009, '2019-03-22 13:46:01', '<p>Revisi Minor; Perumusan masalah/pertanyaan penelitian masih kurang tepat. Apa saja KPI secara spesifik, pada sub bagian 8.2 masih kurang tepat.</p>\r\n\r\n<p>Skor 320</p>\r\n', '2019-04-15 11:20:04', 625, 'R', 13, NULL, 2089, 'PEMBANGUNAN STRATEGIC DASHBOARD BERBASIS WEB UNTUK KEGIATAN PENUNJANG DOSEN ', 'PEMBANGUNAN STRATEGIC DASHBOARD BERBASIS WEB UNTUK KEGIATAN PENUNJANG DOSEN ', '71150117', 'Y', 39, 110, 'T'),
