(2012, '2019-03-22 14:36:25', '<ol>\r\n	<li>teori amplitudo yang implementatif dengan IT masih kurang.&nbsp; Bagaimana cara mengambil amplitudo?</li>\r\n	<li>referensi tolong diubah agar menggunakan jurnal yang berkaitan saja dgn IT, tambah jurnal lagi</li>\r\n	<li>beberapa simbol flowchart salah</li>\r\n	<li>penjelasan k-nn kurang jelas, contoh kasus diperjelas</li>\r\n	<li>tolong disebutkan berapa fitur (feature) yang akan digunakan pada penelitian ini untuk klasifikasi? bagaimana cara mendapatkannya?</li>\r\n	<li>skor 260 (rev mayor)</li>\r\n</ol>\r\n', '2019-04-15 12:37:02', 625, 'R', 50, NULL, 2092, 'KLASIFIKASI GENRE MUSIK BERDASARKAN DATA AMPLITUDO DENGAN MENGGUNAKAN METODE\r\nK-NEAREST NEIGHBOR(KNN)\r\n', 'KLASIFIKASI GENRE MUSIK BERDASARKAN DATA AMPLITUDO DENGAN MENGGUNAKAN METODE\r\nK-NEAREST NEIGHBOR(KNN)\r\n', '71140041', 'Y', 17, 111, 'T'),
