(2030, '2019-09-06 07:57:09', '<p><strong>Latar Belakang:</strong> OK</p>\r\n\r\n<p><strong>Rumusan masalah:</strong></p>\r\n\r\n<ul>\r\n	<li>a, b, dan c dapat digabung menjadi 1 rumusan saja</li>\r\n	<li>mengapa menggunakan k-nn? perlu dijelaskan di latar belakang. k-nn kan sudah lama, mengapa tidak menggunakan algoritma modified k-nn?</li>\r\n</ul>\r\n\r\n<p><strong>Batasan masalah:</strong> OK</p>\r\n\r\n<p><strong>Tujuan:</strong> OK</p>\r\n\r\n<p><strong>Teori:</strong></p>\r\n\r\n<ul>\r\n	<li>Apa bedanya dengan atmoko? mengapa tidak dijelaskan? Atmoko kan clustering, anda menggunakan k-nn (klasifikasi?)</li>\r\n	<li>Kalau klasiffikasi mengapa ada purity?</li>\r\n	<li>K-mens digunakan untuk apa? knn dulu baru k-means? jelaskan!</li>\r\n</ul>\r\n\r\n<p><strong>Daftar pustaka:</strong> OK<strong>.&nbsp; Skor 325 rev minor</strong></p>\r\n', '2019-10-01 12:56:41', 625, 'R', 12, NULL, 2122, 'PEMILIHAN FITUR UNTUK AUTHOR VERIFICATION DENGAN METODE CLUSTERING K-MEANS PADA TEKS BERBAHASA INDONESIA', 'PEMILIHAN FITUR UNTUK AUTHOR VERIFICATION DENGAN METODE CLUSTERING K-MEANS PADA TEKS BERBAHASA INDONESIA', '71160018', 'Y', 17, 113, 'T'),
(2031, '2019-09-06 07:57:59', '<p>Tanggapan umum:<br />\r\n-Masih ada beberapa <em>typographical error </em> dan kalimat yang membingungkan karena kehilangan subyek, predikat, atau objek.<em> </em>Untuk lebih jelasnya, lihat proposal yang sudah dinilai.<em> </em><br />\r\n-Penulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. &#39;diatas&#39; harus ditulis &#39;di atas&#39;.<br />\r\nRumus:<br />\r\n- &quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu<br />\r\n- &quot;di/ke + kata_tempat&quot; ditulis terpisah<br />\r\n-Tidak boleh ada bagian halaman yang hanya terisi sebagian.<br />\r\n-Semua gambar, tabel, dan rumus harus disebutkan dalam teks dan dijelaskan.<br />\r\n-Semua kata berbahasa asing perlu dicetak miring.<br />\r\n-Gunakan bahasa yang formal, mis. &quot;dilabeli&quot; seharusnya &quot;diberi label&quot; atau &quot;dilabelkan&quot;<br />\r\n<br />\r\nTanggapan khusus:<br />\r\n1.Latar Belakang<br />\r\n-Perlu menyebutkan jenis fitur stilometri dengan rujukannya.<br />\r\n<br />\r\n2.Rumusan dan Batasan Masalah<br />\r\n-Batasan masalah yang disebutkan perlu dijelaskan, misalnya: alasan pemilihannya.<br />\r\n-Manfaat penelitian bisa ditambahkan: dilihat dari beberapa sudut pandang, misalnya dari kelompok orang tertentu, berdasarkan bidang tertentu, dsb.<br />\r\n<br />\r\n3.Tujuan penelitian<br />\r\n-Tujuan penelitian hanya satu dan dapat dijelaskan oleh kalimat-kalimat yang lain.<br />\r\n-Gunakan kalimat sederhana. Kalimat itu bisa dipecah jadi 3 kalimat.<br />\r\n<br />\r\n4.Tinjauan Pustaka<br />\r\n-Perhatikan cara penulisan sitasi menggunakan APA.<br />\r\n-Perhatikan format penulisan proposal.<br />\r\n-Judul artikel publikasi tidak perlu disebutkan dalam teks.<br />\r\n<br />\r\n5.Landasan Teori<br />\r\n-Perhatikan format penulisan proposal.<br />\r\n-Ada rujukan yang disebutkan di dalam teks tapi tidak ada di Daftar Pustaka.<br />\r\n<br />\r\n6.Metodologi Penelitian<br />\r\n-Blok diagram sistem perlu dijelaskan.<br />\r\n-Belum ada penjelasan tentang metode evaluasi yang digunakan.<br />\r\n-Dalam proses pembangunan, apakah daftar tersebut adalah daftar metode atau daftar fitur?<br />\r\n-Perlu ditambahkan contoh kasus dan penjelasan per tahapannya.<br />\r\n<br />\r\n7.Daftar Pustaka<br />\r\n-Informasi terkait literatur tidak lengkap, misalnya: tidak ada informasi tentang tempat publikasi.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nilai:<strong>290</strong></p>\r\n', '2019-10-01 12:34:49', 1315, 'R', 12, NULL, 2117, 'ANALISA FITUR STILOMETRI DAN STRATEGI SEGMENTASI TEKS BERBAHASA INDONESIA PADA SISTEM DETEKSI PLAGIASI INTRINSIK', 'ANALISA FITUR STILOMETRI DAN STRATEGI SEGMENTASI TEKS BERBAHASA INDONESIA PADA SISTEM DETEKSI PLAGIASI INTRINSIK', '71160016', 'Y', 13, 113, 'T'),
(2032, '2019-09-06 08:50:46', '<p>Tanggapan umum:<br />\r\n-Masih ada beberapa <em>typographical error </em> dan kalimat yang membingungkan karena kehilangan subyek, predikat, atau objek.<em> </em>Untuk lebih jelasnya, lihat proposal yang sudah dinilai.<em> </em><br />\r\n-Penulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. &#39;diatas&#39; harus ditulis &#39;di atas&#39;.<br />\r\nRumus:<br />\r\n- &quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu<br />\r\n- &quot;di/ke + kata_tempat&quot; ditulis terpisah<br />\r\n-Tidak boleh ada bagian halaman yang hanya terisi sebagian.<br />\r\n-Semua gambar dan tabel harus disebutkan dalam teks dan dijelaskan.<br />\r\n-Semua kata berbahasa asing perlu dicetak miring.<br />\r\n&nbsp;</p>\r\n\r\n<p>Tanggapan khusus:<br />\r\n1.Latar Belakang<br />\r\n-Kurang menjelaskan latar belakang dari penelitian yang akan dilakukan.<br />\r\n-Perlu menampilkan data, bukan asumsi, dibuktikan dengan rujukan/sitasi yang sesuai.<br />\r\n-Tiba-tiba menyebutkan metode yang akan digunakan &quot;forward chaining&quot;, tanpa penjelasan apapun.<br />\r\n<br />\r\n2.Rumusan dan Batasan Masalah<br />\r\n-Rumusan masalah tiba-tiba muncul. Tidak ada kaitannya dengan latar belakang.<br />\r\n-Batasan masalah yang disebutkan di laporan adalah hal-hal yang memang akan dilakukan. Perlu menyebutkan fokus dari penelitian dan juga hal-hal yang tidak akan dilakukan di penelitian ini.<br />\r\n<br />\r\n3.Tujuan penelitian<br />\r\n-Tujuan penelitian hanya satu dan dapat dijelaskan oleh kalimat-kalimat yang lain.<br />\r\n<br />\r\n4.Tinjauan Pustaka<br />\r\n-Perhatikan cara penulisan sitasi menggunakan APA.<br />\r\n-Judul artikel publikasi tidak perlu disebutkan dalam teks.<br />\r\n<br />\r\n5.Landasan Teori<br />\r\n-Tidak perlu teori tentang &quot;Kecerdasan Buatan&quot;. Langsung masuk ke &quot;Sistem Pakar&quot; saja.<br />\r\n-Ada rujukan yang disebutkan di teks tapi tidak ada di Daftar Pustaka.<br />\r\n-Contoh yang diberikan perlu ditulis dengan baik dan benar.<br />\r\n-Label gambar dan penyebutannya di dalam teks tidak sesuai.<br />\r\n<br />\r\n6.Metodologi Penelitian<br />\r\n-Metodologi penelitian sama sekali tidak jelas. Terlalu umum dan kurang menjelaskan apa yang akan dilakukan secara khusus dalam penelitian.<br />\r\n-Dalam &#39;Metodologi Penelitian&#39;, minimal menjelaskan 3 hal, yaitu: terkait data yang digunakan, tahapan/kegiatan yang dilakukan dalam pengembangan sistem/aplikasi/penelitian, dan metode evaluasi &amp; analisis yang akan dilakukan.<br />\r\n-Perlu menjelaskan dan menyebutkan pakar yang akan digunakan.<br />\r\n-Belum ada penjelasan tentang metode evaluasi yang digunakan.<br />\r\n<br />\r\n7.Daftar Pustaka<br />\r\n-Semua literatur yang ditulis di Daftar Pustaka harus digunakan dalam teks proposal.<br />\r\n-Cara penulisan di proposal tidak mengikuti cara penulisan APA Style.<br />\r\n-Informasi terkait literatur tidak lengkap, misalnya: tidak ada informasi tentang tempat publikasi.<br />\r\n-Ada 1 literatur yang sama ditulis 2 kali.</p>\r\n\r\n<p>Nilai: <strong>205</strong></p>\r\n', '2019-10-02 14:10:31', 1315, 'R', 12, NULL, 2132, 'Sistem Pakar untuk Deteksi Tipe Diet Ideal berbasis Web dengan Metode Forward Chaining', 'Sistem Pakar untuk Deteksi Tipe Diet Ideal berbasis Web dengan Metode Forward Chaining', '71160090', 'Y', 13, 113, 'T'),
(2033, '2019-09-06 08:51:46', '<p>Nilai: 270 (Revisi mayor)</p>\r\n\r\n<ul>\r\n	<li>Penjelasan pada latar belakang terlalu panjang, dapat mengakibatkan ketidakjelasan pada aspek keamanan gedung atau pengawasan satpam?</li>\r\n	<li>Lihat catatan di proposal</li>\r\n</ul>\r\n', '2019-10-01 11:49:29', 638, 'R', 53, NULL, 2120, 'Penerapan Desain Jaringan LoRa Berbasis Aplikasi IoT pada Sistem Monitoring  Keamanan Gedung', 'Penerapan Desain Jaringan LoRa Berbasis Aplikasi IoT pada Sistem Monitoring  Keamanan Gedung', '71160087', 'Y', 2, 117, 'T'),
(2034, '2019-09-06 08:52:36', '<ol>\r\n	<li>latar belakang tidak adanya toko buku + perpustakaan umu krg sesuai dgn yg dibuat -&gt; class management</li>\r\n	<li>penelitian menggunakan UCD -&gt; kebutuhan hrs berdasarkan hasil penelitian jgn dibatasi</li>\r\n	<li>harus diperjelas apa yg dimaksud dgn eclass</li>\r\n	<li>skor 210 rev mayor</li>\r\n</ol>\r\n', '2019-10-01 15:49:00', 625, 'R', 50, NULL, 2123, 'PERANCANGAN WEBSITE E-CLASS DENGAN MENGGUNAKAN METODE USER CENTERED DESIGN PADA SMK NEGERI 1 DOBO\r\n', 'PERANCANGAN WEBSITE E-CLASS DENGAN MENGGUNAKAN METODE USER CENTERED DESIGN PADA SMK NEGERI 1 DOBO\r\n', '71150150', 'Y', 9, 115, 'T'),
(2035, '2019-09-06 09:34:02', '<p>Nilai: 345 (Revisi minor)</p>\r\n\r\n<ul>\r\n	<li>Rumusan masalah diperbaiki</li>\r\n	<li>Tambahkan tinjauan pustaka</li>\r\n	<li>Aspek pengujian perlu diulas di muka</li>\r\n</ul>\r\n', '2019-09-13 11:27:16', 638, 'R', 17, NULL, 2128, 'MEMBANGUN APLIKASI WEB LOGBOOK TUGAS AKHIR DENGAN FRAMEWORK CODEIGNITER DAN PATTERN HMVC', 'MEMBANGUN APLIKASI WEB LOGBOOK TUGAS AKHIR DENGAN FRAMEWORK CODEIGNITER DAN PATTERN HMVC', '71140088', 'T', 39, 117, 'T'),
(2036, '2019-09-06 09:41:16', '<p>1. Apa itu Linux Container? Pakai framework container apa?</p>\r\n\r\n<p>2. Kalau hanya waktu tidak penting, karena waktu hanyalah salah satu muara dari parameter aplikasi lain</p>\r\n\r\n<p>3. Terlalu sederhana</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nilai: 140</p>\r\n\r\n<p>Silakan menemui evaluator</p>\r\n', '2019-09-13 11:22:21', 1315, 'K', 15, NULL, 2111, 'ANALISA PERFORMA LIVE MIGRATION PADA SISTEM OPERASI PROXMOX DAN VIRTUAL MACHINE', 'ANALISA PERFORMA LIVE MIGRATION PADA SISTEM OPERASI PROXMOX DAN VIRTUAL MACHINE', '71150015', 'T', 8, 113, 'T'),
(2037, '2019-09-06 09:51:41', '<p>Skor 310</p>\r\n\r\n<p>- Latar belakang mencantumkan kutipan dari paper yang serupa</p>\r\n\r\n<p>- Blok diagram sedikit diperbaiki pada penghubung antara pelatihan dan pengenalan (jadi satu diagram saja)</p>\r\n', '2019-10-11 13:00:24', 636, 'R', 6, NULL, 2112, 'IMPLEMENTASI METODE BACKPROPAGATION UNTUK PENGENALAN JENIS KERTAS', 'IMPLEMENTASI METODE BACKPROPAGATION UNTUK PENGENALAN JENIS KERTAS', '71140010', 'T', 3, 116, 'T'),
