(2039, '2019-09-06 09:55:59', '<p>Batasan area penerapan dipertegas pada bagian 5B</p>\r\n\r\n<p>Gambar alur proses penelitian</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SKOR: 370 (Diterima)</p>\r\n', '2019-09-13 21:03:27', 625, 'T', 1, 10, 2116, 'ANALISA PERBANDINGAN KUALITAS PENGIRIMAN DATA VOIP MENGGUNAKAN METODE L2TP/IPSEC DENGAN OPENVPN MELALUI JARINGAN PUBLIK', 'ANALISA PERBANDINGAN KUALITAS PENGIRIMAN DATA VOIP MENGGUNAKAN METODE L2TP/IPSEC DENGAN OPENVPN MELALUI JARINGAN PUBLIK', '71160005', 'T', 10, 114, 'T'),
(2040, '2019-09-06 09:56:51', '<p><strong>Latar Belakang:</strong></p>\r\n\r\n<p>Cara menulis referensi tidak ditulis dikutip dari researchgate, cukup dikutip APA style di daftar pustaka</p>\r\n\r\n<p><strong>Rumusan masalah:</strong></p>\r\n\r\n<p>Pertanyaan perumusan, bagaimana mengimplementasikan push notif? apakah memang sulit? kalau semua pakai library lalu?</p>\r\n\r\n<p><strong>Batasan masalah:</strong> OK</p>\r\n\r\n<p><strong>Tujuan:</strong></p>\r\n\r\n<p>Tujuan adalah tujuan penelitian, bukan manfaat dan tujuan pembuatan program. Apa kontribusi tujuan penelitian ini?</p>\r\n\r\n<p><strong>Manfaat:</strong></p>\r\n\r\n<p>Berarti hrs ada uji kemanfaatan sistem ini</p>\r\n\r\n<p><strong>Teori:</strong></p>\r\n\r\n<p>Tinjauan pustaka:</p>\r\n\r\n<ul>\r\n	<li>Cara menuliskan tinjauan pustaka kurang detail. Jelaskan juga perbedaan dan relasi antar penelitian, termasuk dgn penelitian anda</li>\r\n	<li>Apakah semua pakai library? datanya mau pakai data apa?</li>\r\n	<li>Jelakan juga algoritma yang digunakan dalam penyampaian push notification, apakah tidak ada processing sama sekali?</li>\r\n	<li>Cara evaluasinya gimana?</li>\r\n</ul>\r\n\r\n<p><strong>Daftar pustaka</strong> : OK</p>\r\n\r\n<p>Perlu bertemu untuk diskusi dan revisi.&nbsp; Skor 285 rev mayor</p>\r\n', '2019-09-20 08:42:51', 625, 'R', 50, NULL, 2138, 'IMPLEMENTASI PUSH NOTIFICATION PADA BROADCAST PENGUMUMAN BERBASIS MOBILE DAN WEB SERVICE DI UKDW', 'IMPLEMENTASI PUSH NOTIFICATION PADA BROADCAST PENGUMUMAN BERBASIS MOBILE DAN WEB SERVICE DI UKDW', '71160020', 'Y', 17, 113, 'T'),
(2041, '2019-09-06 10:07:19', '<ol>\r\n	<li>topik bisa saja digunakan kembali dgn memperbaiki propsal di bagian yg sdh saya koreksi/tandai di proposalnya</li>\r\n	<li>di bagian yg nilainya rendah harus diperbaiki</li>\r\n	<li>skor 165 tolak<br />\r\n	&nbsp;</li>\r\n</ol>\r\n', '2024-03-22 22:10:10', 625, 'K', 50, NULL, 2130, 'EVALUASI KEBERGUNAAN WEBSITE KABUPATEN KLATEN MENGGUNAKAN METODE USABILITY TESTING', 'EVALUASI KEBERGUNAAN WEBSITE KABUPATEN KLATEN MENGGUNAKAN METODE USABILITY TESTING', '71140043', 'T', 12, 0, 'T'),
