(2043, '2019-09-06 10:44:04', '<ul>\r\n	<li>Pembelajaran matematika sangat luas, topik apa? untuk SD tingkat berapa?</li>\r\n	<li>Perlu dicantumkan pembelajaran matematika &amp; contoh - contoh?</li>\r\n	<li>Perlu dicantumkan hanya larya ilmiah ttg proses pembelajaran dgn IT</li>\r\n	<li>Perlu diberikan sampel thp 60 siswa SD</li>\r\n	<li>Perlu diberikan sampel thp 10 guru SD bidang matematika</li>\r\n	<li>Skor 250 rev mayor</li>\r\n</ul>\r\n', '2019-10-11 08:09:03', 625, 'R', 19, NULL, 2137, 'PERANCANGAN PROGRAM PEMBELAJARAN MATEMATIKA SD BERBASIS WEB MENGGUNAKAN METODE USER CENTERED DESIGN', 'PERANCANGAN PROGRAM PEMBELAJARAN MATEMATIKA SD BERBASIS WEB MENGGUNAKAN METODE USER CENTERED DESIGN', '71130062', 'T', 16, 115, 'T'),
(2044, '2019-09-06 11:03:55', '<ul>\r\n	<li>Contoh kasusnya lebih baik menggunakan jenis makanan jgn malah menggunakan pemilihan kepala desa terbaik.&nbsp; Contoh sangat menyimpang</li>\r\n	<li>Metode penelitian perlu dilengkapi secara lebih spesifik (jgn terlalu umum)</li>\r\n	<li>Dijelaskan cara dan langkah dalam pengumpulan data.&nbsp; Apakah data responden atau data makanan. Data responden dan data makanan hrs komplit.&nbsp; Jenis makanan harus berbagai macam: makanan ringan, makanan untuk siang hari/malam, kue2, roti2 dsb</li>\r\n	<li>Skor 265 rev mayor</li>\r\n</ul>\r\n', '2019-09-26 13:27:01', 625, 'R', 3, NULL, 2141, 'SISTEM PENDUKUKUNG KEPUTUSAN PEMILIHAN MAKANAN PADA APLIKASI PESAN ANTAR MAKANAN ONLINE MENGGUNAKAN METODE AHP', 'SISTEM PENDUKUKUNG KEPUTUSAN PEMILIHAN MAKANAN PADA APLIKASI PESAN ANTAR MAKANAN ONLINE MENGGUNAKAN METODE AHP', '71150074', 'Y', 16, 115, 'T'),
(2045, '2019-09-06 11:11:23', '<p>Skor 170</p>\r\n\r\n<p>- Gunakan bahasa formal, jangan bahasa &#39;majalah&#39;</p>\r\n\r\n<p>- Tinjauan pustaka tidak ada</p>\r\n\r\n<p>- Permasalahan sangat tidak kuat, karena masyarakat saat ini pun sudah dapat belajar melalui informasi yang didapat dari Google atau melalui Youtube, lalu untuk apa perlu dibangun website baru?</p>\r\n', '2019-09-13 10:45:25', 636, 'K', 9, NULL, 2127, 'PERANCANGAN INTERFACE WEBSITE INFORMATIF TENTANG KOPI MENGGUNAKAN METODE GOAL DIRECTED DESIGN', 'PERANCANGAN INTERFACE WEBSITE INFORMATIF TENTANG KOPI MENGGUNAKAN METODE GOAL DIRECTED DESIGN', '71150155', 'T', 50, 116, 'T'),
(2046, '2019-09-06 11:12:34', '<ol>\r\n	<li>latar belakang terlalu panjang -&gt; teori</li>\r\n	<li>variabel usability yg diukur blm jelas, SUS masih kurang</li>\r\n	<li>skor 305 rev minor</li>\r\n</ol>\r\n', '2019-09-23 11:41:07', 625, 'R', 19, NULL, 2142, 'Pengaruh Desain Antarmuka Detail Produk Terhadap Usability Pengguna Pada Aplikasi E-Commerce Berbasis Android', 'Pengaruh Desain Antarmuka Detail Produk Terhadap Usability Pengguna Pada Aplikasi E-Commerce Berbasis Android', '71150014', 'Y', 9, 115, 'T'),
(2047, '2019-09-06 11:14:17', '<p>1. untuk revisi bisa dilihat di proposal</p>\r\n\r\n<p>2. Perbaikan proposal harus konsultasi ke dosen Evaluator minimal 5x</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nilai: 235</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2019-10-02 13:07:35', 1315, 'R', 3, NULL, 2124, 'PEMETAAN DIGITAL KERAJAAN MATARAM ISLAM HINGGA KRATON YOGYAKARTA BERBASIS TIMELINE DAN MAPS DI YOGYAKARTA', 'PEMETAAN DIGITAL KERAJAAN MATARAM ISLAM HINGGA KRATON YOGYAKARTA BERBASIS TIMELINE DAN MAPS DI YOGYAKARTA', '71140032', 'Y', 12, 113, 'T'),
