(2054, '2019-09-06 12:19:59', '<p>Parameter apa yang digunakan untuk mengukur tingkat keamanan algoritma enkripsi yang akan diujikan?</p>\r\n\r\n<p>AES dan RSA sudah menjadi standar keamanan, apa lagi yang mau dibuktikan dari sisi keamanannya?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SKOR: 240 (REVISI MAYOR)</p>\r\n', '2019-09-13 07:08:17', 772, 'R', 39, NULL, 2162, 'ANALISIS KEAMANAN SISTEM PENGUMUMAN GEREJA MARIA ASSUMPTA BERDASARKAN KOMPARASI ALGORITMA AES-256, RSA-256, DAN RSA-512', 'ANALISIS KEAMANAN SISTEM PENGUMUMAN GEREJA MARIA ASSUMPTA BERDASARKAN KOMPARASI ALGORITMA AES-256, RSA-256, DAN RSA-512', '71160080', 'T', 15, 114, 'T'),
(2055, '2019-09-06 12:20:31', '<p>Dishub Yogya sudah punya sistemnya tetapi masih untuk kalangan sendiri. Untuk lebih memperkuat latar belakang, bisa berkoordinasi/survei ke dishub Yogya terlebih dahulu.</p>\r\n\r\n<p>Permasalahan ini sudah menjadi permasalahan umum, dan pasti sudah banyak yang mengembangkan, sehingga apa yang membedakan dengan penelitian sebelumnya</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SKOR: 255 (REVISI MAYOR)</p>\r\n', '2019-10-02 09:31:26', 772, 'R', 50, NULL, 2139, 'IMPLEMENTASI WEB SERVICE REST UNTUK PEMANTAUAN POSISI AKTUAL BUS TRANSJOGJA BERBASIS GPS', 'IMPLEMENTASI WEB SERVICE REST UNTUK PEMANTAUAN POSISI AKTUAL BUS TRANSJOGJA BERBASIS GPS', '71160010', 'Y', 53, 114, 'T'),
