(2059, '2019-09-06 12:29:19', '<p>Apa yang mau diteliti dalam penelitian ini?</p>\r\n\r\n<p>Metode pembuatan aplikasi apa yang Anda gunakan?</p>\r\n\r\n<p>Masalah belum tertangkap dengan jelas</p>\r\n\r\n<p>Skala level skripsi bukan sekedar merancang dan membuat, tetapi ada yang diteliti dengan metode tertentu</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SKOR: 140 (TOLAK)</p>\r\n', '2019-09-13 10:20:21', 772, 'K', 50, NULL, 2155, 'Perancangan Aplikasi Pembuatan dan Pengelolaan Surat Berbasis Web pada Ilmu Keperawatan Universitas Gadjah Mada', 'Perancangan Aplikasi Pembuatan dan Pengelolaan Surat Berbasis Web pada Ilmu Keperawatan Universitas Gadjah Mada', '71160028', 'T', 53, 114, 'T'),
(2060, '2019-09-06 12:29:50', '<p>Skor 215</p>\r\n\r\n<p>- Latar belakang belum menyebutkan kekurangan dari sistem serupa yang sudah ada</p>\r\n\r\n<p>- Penulisan teori &amp; tinjauan pustaka masih salah</p>\r\n\r\n<p>- Blok diagram &amp; flowchart masih salah</p>\r\n', '2019-10-02 10:40:43', 636, 'R', 53, NULL, 2146, 'PERANCANGAN SISTEM MONITORING PRAKIRA CUACA LOKAL BERBASIS WEBSITE DI KOTA YOGYAKARTA', 'PERANCANGAN SISTEM MONITORING PRAKIRA CUACA LOKAL BERBASIS WEBSITE DI KOTA YOGYAKARTA', '71160014', 'Y', 50, 116, 'T'),
(2061, '2019-09-06 12:30:23', '<p>Perlu diperjelas implementasi dalam perancangan ini dalam bentuk model/prototipe atau diimplementasikan secara langsung di kelas?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SKOR: 365 (TERIMA)</p>\r\n', '2019-09-15 07:30:03', 625, 'T', 53, 1, 2148, 'PERANCANGAN SISTEM KONTROL KELAS PINTAR\r\nBERBASIS NODEMCU ESP8266  \r\nDI UNIVERSITAS KRISTEN DUTA WACANA\r\n', 'PERANCANGAN SISTEM KONTROL KELAS PINTAR\r\nBERBASIS NODEMCU ESP8266  \r\nDI UNIVERSITAS KRISTEN DUTA WACANA\r\n', '71160059', 'T', 1, 114, 'T'),
(2062, '2019-09-06 12:30:54', '<p>Nilai: 210 (Revisi mayor)</p>\r\n\r\n<ul>\r\n	<li>Judul sudah OK, isi harus revisi total</li>\r\n	<li>Jelaskan tentang WebQual?</li>\r\n	<li>Metode yang akan diimplementasikan tidak ada? Berikan diagram dan penjelasannya</li>\r\n</ul>\r\n', '2019-10-02 14:00:20', 638, 'R', 39, NULL, 2163, 'ANALISIS KEMAMPUAN FUNGSI SISTEM INFORMASI PENGUMUMAN GEREJA MARIA ASSUMPTA BERBASIS WEB DENGAN METODE WEBQUAL', 'ANALISIS KEMAMPUAN FUNGSI SISTEM INFORMASI PENGUMUMAN GEREJA MARIA ASSUMPTA BERBASIS WEB DENGAN METODE WEBQUAL', '71160084', 'Y', 57, 117, 'T'),
(2063, '2019-09-06 12:31:20', '<ol>\r\n	<li>penelitian melakukan uji usabilitas thp aplikasi jika hasilnya buruk diberikan rekomendasi perbaikan.&nbsp; Jika hasilnya baik?</li>\r\n	<li>apakah peneliti membuat aplikasi atau hanya melakukan uji usabilitas</li>\r\n	<li>skor 240 rev mayor</li>\r\n</ol>\r\n', '2019-10-02 13:41:48', 625, 'R', 39, NULL, 2166, 'ANALISIS DAN REKOMENDASI APLIKASI ANDROID WARTA JEMAAT DENGAN MENGGUNAKAN METODE USABILITY TESTING', 'ANALISIS DAN REKOMENDASI APLIKASI ANDROID WARTA JEMAAT DENGAN MENGGUNAKAN METODE USABILITY TESTING', '71160023', 'Y', 9, 115, 'T'),
