(2066, '2019-09-06 12:34:10', '<ol>\r\n	<li>lihat catatan pada proposal</li>\r\n	<li>skor 225 rev mayor</li>\r\n</ol>\r\n', '2019-10-11 12:37:43', 625, 'R', 17, NULL, 2170, 'IMPLEMENTASI METODE RAD \r\nPADA APLIKASI E-COMMERCE SEKTOR PERTANIAN BERBASIS ANDROID\r\n', 'IMPLEMENTASI METODE RAD PADA APLIKASI E-COMMERCE SEKTOR PERTANIAN BERBASIS ANDROID\r\n', '71160074', 'T', 19, 115, 'T'),
