(2086, '2019-09-06 14:45:19', '<p>Skor 175</p>\r\n\r\n<p>- Sudah banyak penelitian aksara jawa menggunakan SVM, silakan cari faktor pembedanya, atau ganti judul lain</p>\r\n\r\n<p>- Catatan lain silakan cek berkas proposal</p>\r\n', '2019-09-13 10:42:53', 636, 'K', 12, NULL, 2183, 'PEMBANGUNAN WEBSITE PENGENALAN AKASARA JAWA MENGGUKAN METODE SUPPORT VECTOR MACHINE   ', 'PEMBANGUNAN WEBSITE PENGENALAN AKASARA JAWA MENGGUKAN METODE SUPPORT VECTOR MACHINE   ', '71150120', 'T', 50, 116, 'T'),
(2087, '2019-09-06 14:47:28', '<p>Nilai: 210 (Revisi mayor)</p>\r\n\r\n<ul>\r\n	<li>Metode penelitian seperti apa?</li>\r\n	<li>Perbedaan dengan candi.perpusnas.go.id selain dari jumlah dan regional?</li>\r\n	<li>Visualisasinya seperti apa?</li>\r\n	<li>Klasifikasi berdasarkan apa?</li>\r\n	<li>Model digitalisasinya?</li>\r\n	<li>Usability testing untuk apa?</li>\r\n	<li>Diagram alur penelitian mana?</li>\r\n	<li>Visualisasi mobile based bagaimana?</li>\r\n</ul>\r\n', '2019-09-13 11:39:30', 638, 'R', 12, NULL, 2125, 'Visualisasi Persebaran Candi di Daerah Istimewa Yogyakarta', 'Visualisasi Persebaran Candi di Daerah Istimewa Yogyakarta', '71130003', 'T', 57, 117, 'T'),
(2088, '2019-09-06 14:48:22', '<p>Nilai: 250 (Revisi mayor)</p>\r\n\r\n<ul>\r\n	<li>Penjadwalan atau perencanaan studi?</li>\r\n	<li>Metode yang digunakan dimatangkan konsepnya (proposed method yang sesuai dengan kasus anda)</li>\r\n	<li>Lihat catatan pada proposal</li>\r\n</ul>\r\n', '2019-10-01 20:44:27', 638, 'R', 9, NULL, 2180, 'PERANCANGAN DESAIN ANTARMUKA  PENJADWALAN\r\nSTUDI PRODI INFORMATIKA\r\n', 'PERANCANGAN DESAIN ANTARMUKA  PENJADWALAN STUDI PRODI INFORMATIKA\r\n', '71160072', 'Y', 57, 117, 'T'),
(2089, '2019-09-06 14:48:54', '<p>1. Masalah terlalu khusus, seperti project KP. Apakah aplikasi K-13 yang diberikan pemerintah juga bermasalah di tempat lain sehingga anda merasa perlu untuk memperbaiki tampilannya?</p>\r\n\r\n<p>2. Penelitian tidak menjawab permasalahan yang disebutkan di latar belakang.&nbsp; Misal: masalahnya aplikasi K-13 terlalu lama, tp yg diubah hanya antarmuka</p>\r\n\r\n<p>3. Typo, gunakan bahasa Indonesia yang baik</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nilai: 180</p>\r\n\r\n<p>Silakan menemui evaluator</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2019-09-13 11:47:32', 1315, 'K', 9, NULL, 2179, 'ANALISIS DAN PEMBAHARUAN ANTARMUKA APLIKASI RAPORT K-13 SDN 85 AMBOYO UTARA\r\n', 'ANALISIS DAN PEMBAHARUAN ANTARMUKA APLIKASI RAPORT K-13 SDN 85 AMBOYO UTARA\r\n', '71160068', 'T', 55, 113, 'T'),
