(2095, '2019-09-06 15:03:36', '<p>Nilai: 215 (Revisi mayor)</p>\r\n\r\n<ul>\r\n	<li>Bagian yang diberi nilai 0 harap dilengkapi/diisi</li>\r\n	<li>Latar belakang belum selesai</li>\r\n	<li>Rumusan masalah kurang tepat. Hindari kata &quot;Bagaimana membuat&quot;, karena jawabannya di Bab 3 &amp; 4, padahal seharusnya di Bab 5 (Kesimpulan)</li>\r\n</ul>\r\n', '2019-09-13 11:25:44', 638, 'R', 17, NULL, 2174, 'IMPLEMENTASI TEKNIK SCRAPING UNTUK DATA GRABBER PADA MEDIA SOSIAL INSTAGRAM\r\n', 'IMPLEMENTASI TEKNIK SCRAPING UNTUK DATA GRABBER PADA MEDIA SOSIAL INSTAGRAM\r\n', '71160066', 'T', 39, 117, 'T'),
