(2099, '2019-09-06 15:07:31', '<p>1. Apa KPI yang digunakan? tidak ada KPI sama sekali!</p>\r\n\r\n<p>2. Tidak paham terkait dashboard</p>\r\n\r\n<p>3. Referensi penelitian serupa tidak menguatkan</p>\r\n\r\n<p>Nb:</p>\r\n\r\n<p>Nilai: 180</p>\r\n\r\n<p>Silakan menemui evaluator</p>\r\n', '2019-09-13 11:19:03', 1315, 'K', 9, NULL, 2182, 'PENGEMBANGAN DASHBOARD DINAS KEBUDAYAAN DAN PARIWISATA TORAJA UTARA MENGGUNAKAN METODE USER CENTERED DESIGN', 'PENGEMBANGAN DASHBOARD DINAS KEBUDAYAAN DAN PARIWISATA TORAJA UTARA MENGGUNAKAN METODE USER CENTERED DESIGN', '71150162', 'T', 8, 113, 'T'),
(2100, '2019-09-06 15:08:33', '<p>1. SeedDMS itu apa? Anda membuat aplikasi baru atau merombak yang sudah ada?</p>\r\n\r\n<p>2. Tujuan penelitiannya apa? Pembuatan sistem mungkin tujuan penelitian yang kesekian.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nilai 285</p>\r\n', '2019-10-02 11:52:57', 1315, 'R', 8, NULL, 2178, 'Penerapaan Sistem Pengelolaan Workflow Untuk Mendukung Surat Menyurat', 'Penerapaan Sistem Pengelolaan Workflow Untuk Mendukung Surat Menyurat', '71160002', 'Y', 55, 113, 'T'),
(2101, '2019-09-06 15:09:23', '<ol>\r\n	<li>metode penelitiannya dicari atau sudah ada metode yg dipilih? mana?</li>\r\n	<li>silahkan diperbaiki proposalnya.</li>\r\n</ol>\r\n', '2019-09-16 08:26:21', 625, 'K', 9, NULL, 2186, 'PERANCANGAN ANTARMUKA SISTEM INFORMASI PENCATATAN SIDANG UNTUK SINODE GKJ', 'PERANCANGAN ANTARMUKA SISTEM INFORMASI PENCATATAN SIDANG UNTUK SINODE GKJ', '71160036', 'T', 14, 117, 'T'),
(2102, '2019-09-06 15:09:53', '<p>Perlu dipertegas analisa QoS -&gt; Akses alat seperti apa prosesnya</p>\r\n\r\n<p>Permasalah perlu diperjelas di latar belakang, rumusan masalah, batasan, dan tujuan</p>\r\n\r\n<p>Tambahkan hasil penelitian sebelumnya, referensi buku landasan teori, penjelasan QoS lengkap</p>\r\n\r\n<p>Pada proposal tuliskan sumber referensi yang sesuai dengan daftar pustaka</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SKOR: 255 (Revisi Mayor)</p>\r\n', '2019-09-13 07:10:26', 772, 'R', 1, NULL, 2189, 'Analisis Quality of Service Jaringan Wireless LAN pada Universitas Kristen Duta Wacana (UKDW) ', 'Analisis Quality of Service Jaringan Wireless LAN pada Universitas Kristen Duta Wacana (UKDW) ', '71160064', 'T', 10, 114, 'T'),
(2103, '2019-09-06 15:10:41', '<p>1. Latar Belakang tidak sesuai dengan apa ayng mau diteliti</p>\r\n\r\n<p>2. Landasan Teori sangat kurang, misal UCD belum ada</p>\r\n\r\n<p>3. Yang diteliti belum jelas</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nilai: 205</p>\r\n', '2019-09-13 12:04:00', 1315, 'R', 9, NULL, 2188, 'PERANCANGAN ANTARMUKA APLIKASI MOBILE UNTUK LANSIA', 'PERANCANGAN ANTARMUKA APLIKASI MOBILE UNTUK LANSIA', '71160042', 'T', 55, 113, 'T'),
(2104, '2019-09-06 15:11:22', '<p>Skor 220</p>\r\n\r\n<p>- Katar belakang mencantumkan paper-paper serupa dan di akhir paragraf (1-2 paper) menyebutkan keunggulan/perbaikan yang diajukan oleh penelitian anda</p>\r\n\r\n<p>- Tujuan: mengetahui manfaat?</p>\r\n\r\n<p>- Tinjauan pustaka = pengembangan latar belakang, tapi ditambah paper (4-5 paper) dan dijelaskan</p>\r\n\r\n<p>- Daftar pustaka kurang</p>\r\n', '2019-10-02 13:20:40', 636, 'R', 8, NULL, 2184, 'Pemanfaatan Protokol WebDAV untuk Sistem Arsip', 'Pemanfaatan Protokol WebDAV untuk Sistem Arsip', '71160017', 'Y', 3, 116, 'T'),
(2105, '2019-09-06 15:12:05', '<ol>\r\n	<li>latar belakang blm jelas website apa yang akan dibangun</li>\r\n	<li>revisi detail dan menyeluruh dapat dilihat pada proposal</li>\r\n	<li>skor 200 rev mayor</li>\r\n</ol>\r\n', '2019-09-13 10:56:17', 625, 'R', 9, NULL, 2185, 'PERANCANGAN WEBSITE SEKOLAH DENGAN MENGGUNAKAN METODE USER CENTER DESIGN STUDI KASUS SMA 8 AMBON', 'PERANCANGAN WEBSITE SEKOLAH DENGAN MENGGUNAKAN METODE USER CENTER DESIGN STUDI KASUS SMA 8 AMBON', '71120108', 'T', 19, 115, 'T'),
(2106, '2019-09-06 15:12:46', '<p>metode georeferencing belum dijadikan fokus yang detail</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SKOR: 290: REVISI MAYOR)</p>\r\n', '2019-10-02 10:57:06', 772, 'R', 12, NULL, 2121, 'VISUALISASI PEMETAAN BIJI KOPI NUSANTARA DENGAN METODE GEOREFERENCING', 'VISUALISASI PEMETAAN BIJI KOPI NUSANTARA DENGAN METODE GEOREFERENCING', '71140034', 'Y', 20, 114, 'T'),
(2107, '2019-09-06 15:13:14', '<p>Metode georeferencing belum jalan</p>\r\n\r\n<p>jumlah candi di Yogyakarta tidak memadai</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SKOR: 275 (REVISI MAYOR)</p>\r\n', '2019-10-02 11:01:28', 772, 'R', 12, NULL, 2171, 'PEMETAAN CANDI di YOGYAKARTA DENGAN METODE GEOREFERENCING', 'PEMETAAN CANDI di YOGYAKARTA DENGAN METODE GEOREFERENCING', '71140031', 'Y', 20, 114, 'T'),
(2108, '2019-09-06 15:13:46', '<p>Tanggapan umum:<br />\r\n-Masih ada beberapa <em>typographical error </em> dan kalimat yang membingungkan karena kehilangan subyek, predikat, atau objek.<em> </em>Untuk lebih jelasnya, lihat proposal yang sudah dinilai.<em> </em><br />\r\n-Penulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. &#39;diatas&#39; harus ditulis &#39;di atas&#39;.<br />\r\nRumus:<br />\r\n- &quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu<br />\r\n- &quot;di/ke + kata_tempat&quot; ditulis terpisah<br />\r\n-Tidak boleh ada bagian halaman yang hanya terisi sebagian.<br />\r\n-Semua gambar dan tabel harus disebutkan dalam teks dan dijelaskan.<br />\r\n-Semua kata berbahasa asing perlu dicetak miring.<br />\r\n<br />\r\nTanggapan khusus:<br />\r\n1.Latar Belakang<br />\r\n-Permasalahan yang diangkat perlu dipertegas. Situs web yang akan diperbaiki adalah situs web untuk jual/beli atau hanya sebagai galeri toko.<br />\r\n-Tidak ada penjelasan tentang keterkaitan dengan penelitian lain yang pernah dilakukan sebelumnya.<br />\r\n<br />\r\n2.Rumusan dan Batasan Masalah<br />\r\n-Rumusan masalah berisi fokus masalah yang akan diangkat, misalnya: situs web yang akan dibangun memiliki fungsi apa saja atau seberapa kompleks.<br />\r\n-Batasan masalah perlu ditambahkan selain terkait &quot;responden&quot;.<br />\r\n<br />\r\n3.Tujuan penelitian<br />\r\n-Tujuan penelitian hanya satu dan dapat dijelaskan oleh kalimat-kalimat yang lain.<br />\r\n<br />\r\n4.Tinjauan Pustaka<br />\r\n-Perhatikan cara penulisan sitasi menggunakan APA.<br />\r\n-Penulisan paragraf baru selalu diawali dengan cara penulisan yang menjorok ke dalam. Mohon konsisten dengan hal itu dari awal sampai akhir proposal.<br />\r\n<br />\r\n5.Landasan Teori<br />\r\n-Perlu ditambahkan landasan teori tentang metode perancangan antarmuka dan metode evaluasi yang akan digunakan.<br />\r\n-Setiap tulisan yang diambil dari literatur tertentu perlu ditambahkan stiasi/rujukannya.<br />\r\n-Perhatikan cara penulisan dalam landasan teori.<br />\r\n<br />\r\n6.Metodologi Penelitian<br />\r\n-Metodologi penelitian sama sekali tidak jelas. Terlalu umum dan tidak menjelaskan apa yang akan dilakukan secara khusus dalam penelitian.<br />\r\n-Dalam &#39;Metodologi Penelitian&#39;, minimal menjelaskan 3 hal, yaitu: terkait data yang digunakan, tahapan/kegiatan yang dilakukan dalam pengembangan sistem/aplikasi/penelitian, dan metode evaluasi &amp; analisis yang akan dilakukan.<br />\r\n-Belum ada penjelasan tentang metode evaluasi yang digunakan.<br />\r\n<br />\r\n7.Daftar Pustaka<br />\r\n-Semua literatur yang ditulis di Daftar Pustaka harus digunakan dalam teks proposal.<br />\r\n-Ada 6 literatur yang ditulis di dalam Daftar Pustaka, tapi tidak disebutkan di teks proposal<br />\r\n-Cara penulisan di proposal tidak mengikuti cara penulisan APA Style.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nilai: 205</p>\r\n', '2019-09-13 12:34:53', 1315, 'R', 9, NULL, 2187, 'PENERAPAN USABILITY TESTING DALAM EVALUASI DAN PERANCANGAN ANTARMUKA WEB TOKO PUSKAT YOGYAKARTA', 'PENERAPAN USABILITY TESTING DALAM EVALUASI DAN PERANCANGAN ANTARMUKA WEB TOKO PUSKAT YOGYAKARTA', '71130093', 'T', 13, 113, 'T'),
