(2157, '2019-10-11 09:39:24', '<p>Tanggapan umum:<br />\r\n- Masih ada beberapa typographical error, mis. &quot;matakuliah&quot; ditulils &quot;mata kuliah&quot;, &quot;manfaat&quot; tertulis<br />\r\n&quot;manfaan&quot;, atau subjudul ditulis tanpa huruf kapital di setiap awal katanya.<br />\r\n- Ada cukup banyak kalimat yang membingungkan karena kehilangan subyek, predikat, atau objek. Untuk<br />\r\nlebih jelasnya, lihat proposal yang sudah dinilai.<br />\r\n- Penulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. &quot;di fokuskan&quot;<br />\r\nharus ditulis&quot;&#39;difokuskan&quot; karena &quot;di&quot; dalam &quot;difokuskan&quot; adalah imbuhan.<br />\r\nRumus:<br />\r\n- &quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu<br />\r\n- &quot;di/ke + kata_tempat&quot; ditulis terpisah<br />\r\n- Tidak boleh ada bagian halaman yang hanya terisi sebagian.<br />\r\n- Semua gambar &amp; tabel harus memiliki label, disebutkan dalam teks, dan dijelaskan.<br />\r\n- Semua kata berbahasa asing perlu dicetak miring.<br />\r\n- Judul tidak merepresentasikan penelitian yang akan dilakukan.<br />\r\nTanggapan khusus:<br />\r\n1. Latar Belakang<br />\r\nLatar belakang belum menggambarkan permasalahan yang ingin/perlu diselesaikan dengan penelitian.<br />\r\nMasalah yang dijelaskan lebih menyinggung tentang pentingnya sebuah sistem perencanaan<br />\r\npengambilan mata kuliah peminatan bagi mahasiswa. Padahal, sepertinya fokus dari penelitian ini lebih<br />\r\nke antar muka dari sistem tersebut.<br />\r\n- Tidak ada penjelasan tentang keterkaitan dengan penelitian lain yang pernah dilakukan sebelumnya.<br />\r\n2. Rumusan Masalah<br />\r\n- Rumusan masalah berisi fokus masalah yang akan diangkat.<br />\r\n- Berdasarkan latar belakang masalah, penelitian ini akan membangun 2 hal, yaitu: 1) sistem perencanaan<br />\r\npengambilan mata kuliah peminatan bagi mahasiswa; dan 2) antar muka yang ramah untuk digunakan.<br />\r\n3. Batasan Masalah<br />\r\n- Jika tujuannya adalah membuat sistem terkait Prodi Informatika, maka Prodi Informatika bukan batasan<br />\r\nmasalah.<br />\r\n4. Tujuan penelitian<br />\r\n- Tujuan penelitian tidak menggambarkan penelitian yang ingin dilakukan.<br />\r\n5. Manfaat penelitian<br />\r\n- Dalam penulisan, subjudul diikuti dengan paragraf. Jadi, beri kalimat pengantar sebelum masuk ke items<br />\r\n- Manfaat bisa dilihat dari beberapa aspek atau sudut pandang, misalnya dari sudut pandang keilmuan,<br />\r\natau dari sudut pandang aplikatif.<br />\r\n6. Tinjauan Pustaka<br />\r\n- Perhatikan cara penulisan sitasi menggunakan APA.<br />\r\n- Bagian ini perlu ditulis menggunakan parafrase yang baik dan benar.<br />\r\n7. Landasan Teori<br />\r\n- Perhatikan cara penulisan sitasi menggunakan APA.<br />\r\n- Perlu ditambahkan landasan teori tentang metode evaluasi yang akan digunakan.<br />\r\n- Setiap tulisan yang diambil dari literatur tertentu perlu ditambahkan stiasi/rujukannya.<br />\r\n- Perhatikan cara penulisan dalam landasan teori.<br />\r\n8. Blok Diagram Sistem<br />\r\n- Apa hubungan antara blok diagram sistem yang dibangun dengan metode design thinking yang ingin<br />\r\ndiimplementasikan?<br />\r\n9. Metodologi Penelitian<br />\r\n- Bagian penjelasan tentang metode design thinking seharusnya diletakkan di landasan teori.<br />\r\n- Metodologi penelitian dalam proposal tidak menjelaskan apa yang akan dilakukan secara khusus dalam<br />\r\npenelitian. Bagian ini terkesan merupakan gabungan dari beberapa tulisan/penelitian lain yang pernah<br />\r\ndilakukan.<br />\r\n- Dalam &#39;Metodologi Penelitian&#39;, minimal menjelaskan 3 hal, yaitu: terkait data yang digunakan,<br />\r\ntahapan/kegiatan yang dilakukan dalam pengembangan sistem/aplikasi/penelitian, dan metode evaluasi<br />\r\n&amp; analisis yang akan dilakukan.<br />\r\n- Metode evaluasi yang dijelaskan dalam proposal tidak sesuai dengan tujuan penelitian yang<br />\r\ndiungkapkan di bagian depan.<br />\r\n10. Daftar Pustaka<br />\r\n- Cara penulisan di proposal tidak mengikuti cara penulisan APA Style.<br />\r\n- Semua literatur yang ditulis di Daftar Pustaka harus digunakan dalam teks proposal.<br />\r\n&nbsp;</p>\r\n', '2019-10-17 09:06:16', 625, 'K', 9, NULL, 2252, 'Desain Antarmuka Perencanaan Pengambilan Matakuliah Peminatan Bagi  Mahasiswa  Prodi Informatika Menggunakan Metode Design Thinking', 'Desain Antarmuka Perencanaan Pengambilan Matakuliah Peminatan Bagi  Mahasiswa  Prodi Informatika Menggunakan Metode Design Thinking', '71160068', 'T', 13, 119, 'T'),
(2158, '2019-10-11 09:39:59', '<p>Skor 375</p>\r\n\r\n<p>- Revisi blok diagram sistem</p>\r\n', '2019-10-22 12:15:23', 625, 'T', 39, 6, 2253, 'RANCANG BANGUN SISTEM INFORMASI PENGELOLAAN BANK SAMPAH GEREJA MARIA ASSUMPTA KLATEN BERBASIS WEBSITE', 'RANCANG BANGUN SISTEM INFORMASI PENGELOLAAN BANK SAMPAH GEREJA MARIA ASSUMPTA KLATEN BERBASIS WEBSITE', '71160078', 'T', 18, 120, 'T'),
(2159, '2019-10-11 12:07:23', '<p>N=110</p>\r\n\r\n<ul>\r\n	<li>Proposal sangat minim isi dan tidak jelas.</li>\r\n	<li>Topik yang akan diteliti cenderung ke arah statistik/matematis tapi tidak ada pembahasan metode pengolahan data yang akan dipakai.</li>\r\n	<li>Untuk apa membuat aplikasi yang sebenarnya sudah ada? Apa bedanya?</li>\r\n	<li>Lihat catatan pada proposal untuk lebih lengkapnya.</li>\r\n</ul>\r\n', '2019-10-17 11:03:28', 642, 'K', 9, NULL, 2240, 'PENGARUH GAME BERGENRE “TYPING” DENGAN KEMAMPUAN MENGETIK PEMAINNYA DALAM LINGKUNGAN MAHASISWA UKDW', 'PENGARUH GAME BERGENRE “TYPING” DENGAN KEMAMPUAN MENGETIK PEMAINNYA DALAM LINGKUNGAN MAHASISWA UKDW', '71160036', 'T', 2, 122, 'T'),
(2160, '2019-10-11 12:11:02', '<ol>\r\n	<li>skor 350 terima</li>\r\n</ol>\r\n', '2019-10-22 10:34:33', 625, 'T', 17, 19, 2241, 'MEMBANGUN DASHBOARD PENERIMAAN SISWA BARU SMAN 1 PANDIH BATU MENGGUNAKAN METODE USER CENTERED DESIGN (UCD)', 'MEMBANGUN DASHBOARD PENERIMAAN SISWA BARU SMAN 1 PANDIH BATU MENGGUNAKAN METODE USER CENTERED DESIGN (UCD)', '71150050', 'T', 15, 121, 'T'),
(2161, '2019-10-11 12:11:35', '<p>Tanggapan umum:<br />\r\n- Penulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. &#39;dibagian&#39; harus<br />\r\nditulis &#39;di bagian&#39;.<br />\r\nRumus:<br />\r\n- &quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu<br />\r\n- &quot;di/ke + kata_tempat&quot; ditulis terpisah<br />\r\n- Tidak boleh ada bagian halaman yang hanya terisi sebagian.<br />\r\n- Semua gambar &amp; tabel harus memiliki label, disebutkan dalam teks, dan dijelaskan.<br />\r\n- Semua kata berbahasa asing perlu dicetak miring.<br />\r\n- Judul tidak merepresentasikan penelitian yang akan dilakukan.<br />\r\nTanggapan khusus:<br />\r\n1. Latar Belakang<br />\r\n- Latar belakang belum menggambarkan permasalahan yang ingin/perlu diselesaikan dengan penelitian.<br />\r\n- Tidak ada penjelasan tentang keterkaitan dengan penelitian lain yang pernah dilakukan sebelumnya.<br />\r\nRumusan Masalah<br />\r\n- Dalam penulisan, subjudul diikuti dengan paragraf. Jadi, beri kalimat pengantar sebelum masuk ke items<br />\r\n- Rumusan masalah berisi fokus masalah yang akan diangkat. Karena latar belakang belum<br />\r\nmenggambarkan masalah yang akan diangkat, isi pada bagian ini juga jadi membingungkan.<br />\r\n3. Batasan Masalah<br />\r\n- Jika tujuannya adalah membuat sistem dengan penerapan algoritma Greedy, maka penerapan algoritma<br />\r\nGreedy bukan batasan masalah.<br />\r\n4. Tujuan penelitian<br />\r\n- Tujuan penelitian hanya satu dan dapat dijelaskan oleh kalimat-kalimat yang lain.<br />\r\n5. Manfaat penelitian<br />\r\n- Dalam penulisan, subjudul diikuti dengan paragraf. Jadi, beri kalimat pengantar sebelum masuk ke items<br />\r\n- Manfaat bisa dilihat dari beberapa aspek atau sudut pandang, misalnya dari sudut pandang keilmuan,<br />\r\natau dari sudut pandang aplikatif.<br />\r\n6. Tinjauan Pustaka<br />\r\n- Tidak ada tinjauan pustaka dalam proposal ini.<br />\r\n7. Landasan Teori<br />\r\n- Perlu ditambahkan landasan teori tentang metode evaluasi yang akan digunakan.<br />\r\n- Setiap tulisan yang diambil dari literatur tertentu perlu ditambahkan stiasi/rujukannya.<br />\r\n- Perhatikan cara penulisan dalam landasan teori.<br />\r\n8. Blok Diagram Sistem<br />\r\n- Semua gambar &amp; tabel harus memiliki label, disebutkan dalam teks, dan dijelaskan.<br />\r\n9. Metodologi Penelitian<br />\r\n- Metodologi penelitian sama sekali tidak jelas. Terlalu umum dan tidak menjelaskan apa yang akan<br />\r\ndilakukan secara khusus dalam penelitian.<br />\r\n- Dalam &#39;Metodologi Penelitian&#39;, minimal menjelaskan 3 hal, yaitu: terkait data yang digunakan,<br />\r\ntahapan/kegiatan yang dilakukan dalam pengembangan sistem/aplikasi/penelitian, dan metode evaluasi<br />\r\n&amp; analisis yang akan dilakukan.<br />\r\n- Secara khusus, belum ada penjelasan tentang bagaimana sistem akan dibangun dan metode evaluasi<br />\r\nyang akan digunakan.<br />\r\n10. Daftar Pustaka<br />\r\n- Semua literatur yang ditulis di Daftar Pustaka harus digunakan dalam teks proposal.<br />\r\n- Ada 8 literatur yang ditulis di dalam Daftar Pustaka, tapi tidak ada satupun yang disebutkan di teks<br />\r\nproposal<br />\r\n- Cara penulisan di proposal tidak mengikuti cara penulisan APA Style.<br />\r\nSKOR 120 tolak</p>\r\n', '2019-10-17 09:00:10', 625, 'K', 16, NULL, 2242, 'Analisis Perbandingan Manusia Dengan Kecerdasan Buatan yang Menggunakan Greedy Algorithm Pada Permainan Planarity', 'Analisis Perbandingan Manusia Dengan Kecerdasan Buatan yang Menggunakan Greedy Algorithm Pada Permainan Planarity', '71150045', 'T', 13, 119, 'T'),
