(2182, '2019-10-11 13:47:17', '<p>N=335</p>\r\n\r\n<ul>\r\n	<li>Rumusan masalah diperbaiki.</li>\r\n	<li>Penjelasan <em>Chrome Extension&nbsp;</em>ditambah.</li>\r\n	<li>Penjelasan&nbsp;<em>XPath&nbsp;</em>ditambah.</li>\r\n	<li>Gunakan fitur <em><strong>references </strong></em>pada Microsoft Word.</li>\r\n	<li>Lihat catatan di naskah proposal.</li>\r\n</ul>\r\n', '2019-11-01 12:57:04', 642, 'R', 17, NULL, 2259, 'CHROME EXTENSION UNTUK DATA GRABBER MEDIA SOSIAL TWITTER DENGAN METODE XPATH SELECTOR', 'CHROME EXTENSION UNTUK DATA GRABBER MEDIA SOSIAL TWITTER DENGAN METODE XPATH SELECTOR', '71160073', 'Y', 2, 122, 'T'),
