(2185, '2019-10-11 15:11:41', '<p>Skor 185</p>\r\n\r\n<p>Landasan teori kurang lengkap, sifatnya harusnya memberikan penjelasan gamblang mengenai teori yang digunakan, misal mengenai visualisasi. Sudah konsultasi dengan dosen yang diajukan sebagai pembimbing 1? Kok proposalnya tidak mencerminkan hal tersebut</p>\r\n', '2019-10-17 12:28:46', 636, 'K', 12, NULL, 2271, 'VISUALISASI PERSEBARAN MANUSKRIP JAWA DI YOGYAKARTA DAN SOLO DENGAN METODE NODE INFOGRAFIS', 'VISUALISASI PERSEBARAN MANUSKRIP JAWA DI YOGYAKARTA DAN SOLO DENGAN METODE NODE INFOGRAFIS', '71150001', 'T', 3, 120, 'T'),
