(2205, '2020-02-19 12:53:43', '<p>Nilai : 160</p>\r\n\r\n<p>Catatan evaluator:</p>\r\n\r\n<ol>\r\n	<li>Tidak ada KPI yang digambarkan sebagai dasar analisis</li>\r\n	<li>Tidak ada gambaran model dimensi abstract untuk data warehouse</li>\r\n	<li>Rumus sangat lemah</li>\r\n</ol>\r\n\r\n<p>Silakan temui evaluator</p>\r\n', '2020-02-28 12:14:57', 1315, 'K', 16, NULL, 2294, 'ANALISIS PROFILE SISWA SMA PANGUDI LUHUR SANTO YOHANES KETAPANG KALIMANTAN BARAT MENGGUNAKAN DASHBOARD', 'ANALISIS PROFILE SISWA SMA PANGUDI LUHUR SANTO YOHANES KETAPANG KALIMANTAN BARAT MENGGUNAKAN DASHBOARD', '71150092', 'T', 8, 124, 'T'),
(2206, '2020-02-21 08:57:08', '<p>1. Judul diganti menggunakan Bahasa Indonesia</p>\r\n\r\n<p>2. Format halaman, penomoran halaman, typo, format pengetikan</p>\r\n\r\n<p>3. Permasalahan diperjelas pada latar belakang</p>\r\n\r\n<p>4. Rumusan masalah dirumuskan ulang</p>\r\n\r\n<p>5. Tujuan, manfaat dirumuskan ulang</p>\r\n\r\n<p>6. Tinjauan pustakan diperbaharui (sumber, susunan)</p>\r\n\r\n<p>Perbaikan Menyeluruh</p>\r\n\r\n<p><strong>NILAI AKHIR = 205</strong></p>\r\n', '2020-02-28 12:45:32', 1486, 'R', 6, NULL, 2295, 'PENERAPAN FUZZY MULTI CRITERIAN DECISION MAKING\r\nDALAM MENDIAGNOSA PENYAKIT TUBERKULOSIS (TBC)\r\n', 'PENERAPAN FUZZY MULTI CRITERIAN DECISION MAKING\r\nDALAM MENDIAGNOSA PENYAKIT TUBERKULOSIS (TBC)\r\n', '71130142', 'T', 19, 127, 'T'),
(2207, '2020-02-21 09:32:41', '<p>Skor&nbsp;270</p>\r\n\r\n<p>- Ganti Kasus. Kasus Jadwal Rapat dosen terlalu sederhana karena kriteria/variabel yang diolah terlalu sedikit, mohon diganti kasus dengan variabel yang lebih banyak</p>\r\n', '2020-03-12 23:52:13', 636, 'R', 16, NULL, 2297, 'Penerapan Algoritma Hopcroft-Karp pada Program Penjadwalan Rapat Dosen', 'Penerapan Algoritma Hopcroft-Karp pada Program Penjadwalan Rapat Dosen', '71150045', 'Y', 7, 125, 'T'),
(2208, '2020-02-21 09:50:55', '<p>N = 290</p>\r\n\r\n<ul>\r\n	<li>Landasan teori tentang HCI dan ODD masih kurang</li>\r\n	<li>Rumusan masalah masih belum fokus tentang persoalan yang mau dianalisis/diselesaikan</li>\r\n	<li>Perlu data pengguna Internet dan data jumlah pengepul sampah di daerah penelitian</li>\r\n</ul>\r\n', '2020-03-12 10:47:34', 642, 'R', 9, NULL, 2309, 'PEMBANGUNAN WEBSITE PENGEPUL SEBAGAI SARANA MASYARAKAT', 'PEMBANGUNAN WEBSITE PENGEPUL SEBAGAI SARANA MASYARAKAT', '71150105', 'Y', 15, 126, 'T'),
(2209, '2020-02-21 10:06:55', '<p>1. Pada batasan masalah seharusnya dihubungkan dengan apotik supaya tahu daftar obat yang tersedia diapoyik.</p>\r\n\r\n<p>2. Landasan teori tentang sistem informasi puskesmas belum ada.</p>\r\n\r\n<p>3. Contoh kongkrit perlu diberikan supaya alur diagram lebih konkrti dan jelas.</p>\r\n\r\n<p>4.Perlu dijelaskan sistem ini berbasis web atau berbasis android.</p>\r\n\r\n<p>5.Tambahan daftar pustaja supaya komplit</p>\r\n\r\n<p><strong>NILAI AKHIR = 220</strong></p>\r\n', '2020-03-16 09:28:34', 1486, 'R', 17, NULL, 2303, 'PERANCANGAN SISTEM INFORMASI PELAYANAN PUSKESMAS SAMBAS BERBASIS WEB', 'PERANCANGAN SISTEM INFORMASI PELAYANAN PUSKESMAS SAMBAS BERBASIS WEB', '71150043', 'Y', 16, 127, 'T'),
(2210, '2020-02-21 10:07:43', '<p>1. Harus dilakukan analisa awa, apakah memang website perlu dirancang ulang ?</p>\r\n\r\n<p>2. Perbedaan pembuatan website untuk Kerja Praktek dan Skripsi adalah pada penekanan penelitian, apa yang akan diteliti ?</p>\r\n\r\n<p><strong>NILAI AKHIR = 235</strong></p>\r\n', '2020-03-13 12:27:32', 1486, 'R', 17, NULL, 2304, ' Analisis dan Rancang Ulang UI / UX pada Sistem Informasi Website Sekolah SMP N 1 Halmahera Utara', ' Analisis dan Rancang Ulang UI / UX pada Sistem Informasi Website Sekolah SMP N 1 Halmahera Utara', '71150049', 'Y', 9, 127, 'T'),
(2211, '2020-02-21 10:24:55', '<p>Nilai: 275</p>\r\n\r\n<p>Catatan:</p>\r\n\r\n<ol>\r\n	<li>Bagaimana anda tahu bahwa website tidak selaras secara visi?</li>\r\n	<li>Penelitian != penelitihan</li>\r\n	<li>Tiap landasan harus ada referensi</li>\r\n	<li>Lebih enak jika sudah tau siapa yang akan diwawancara</li>\r\n</ol>\r\n', '2020-03-12 19:45:44', 1315, 'R', 50, NULL, 2313, 'PERANCANGAN ULANG WEBSITE INSTANUSANTARA.COM DENGAN MENGGUNAKAN METODE GOAL-DIRECTED DESIGN', 'PERANCANGAN ULANG WEBSITE INSTANUSANTARA.COM DENGAN MENGGUNAKAN METODE GOAL-DIRECTED DESIGN', '71150095', 'Y', 55, 124, 'T'),
(2212, '2020-02-21 10:25:40', '<p>N = 280</p>\r\n\r\n<ul>\r\n	<li>Latar belakang kurang&nbsp;<em>to the point.</em></li>\r\n	<li>Landasan teori dibuat lebih jelas terkait teori yang dibutuhkan.</li>\r\n	<li>Block diagram perlu ditambahkan.</li>\r\n	<li>Apakah&nbsp;sudah ada perjanjian dengan pihak pedukuhan terkait pembuatan sistem ini?</li>\r\n</ul>\r\n', '2020-03-13 07:33:33', 642, 'R', 9, NULL, 2308, 'DESAIN ANTARMUKA DASHBOARD PROFIL PADUKUHAN MENGGUNAKAN METODE USER CENTERED DESIGN\r\n(Studi Kasus Padukuhan Duwet III, Kalibawang, Kulon Progo)\r\n', 'DESAIN ANTARMUKA DASHBOARD PROFIL PADUKUHAN MENGGUNAKAN METODE USER CENTERED DESIGN\r\n(Studi Kasus Padukuhan Duwet III, Kalibawang, Kulon Progo)\r\n', '71160055', 'Y', 53, 126, 'T'),
(2213, '2020-02-21 10:26:59', '<p>Nilai: <strong>210</strong></p>\r\n\r\n<p>CATATAN REVIEWER:</p>\r\n\r\n<p>Tanggapan umum:</p>\r\n\r\n<p>-Penulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. &#39;dibagian&#39; harus ditulis &#39;di bagian&#39;.<br />\r\nRumus:<br />\r\n- &quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu<br />\r\n- &quot;di/ke + kata_tempat&quot; ditulis terpisah<br />\r\n-Tidak boleh ada bagian halaman yang hanya terisi sebagian.<br />\r\n-Semua gambar &amp; tabel harus memiliki label, disebutkan dalam teks, dan dijelaskan.<br />\r\n-Semua kata berbahasa asing perlu dicetak miring.<br />\r\n-Judul tidak merepresentasikan penelitian yang akan dilakukan.<br />\r\n-&quot;Mata kuliah&quot; ditulis terpisah, bukan &quot;matakuliah&quot;</p>\r\n\r\n<p>- Ada<em> typographical error </em>di beberapa tempat. Contoh yang betul: kuesioner</p>\r\n\r\n<p><br />\r\nTanggapan khusus:</p>\r\n\r\n<p>1.Latar Belakang<br />\r\n-Latar belakang belum menggambarkan permasalahan yang ingin/perlu diselesaikan dengan penelitian.<br />\r\n-Tidak ada penjelasan tentang keterkaitan dengan penelitian lain yang pernah dilakukan sebelumnya.<br />\r\n<br />\r\n2.Rumusan Masalah<br />\r\n-Latar belakang yg kurang jelas membuat Rumusan Masalah menjadi ambigu.<br />\r\n-dari aplikasi yang ingin dibangun kurang tegas,<br />\r\n<br />\r\n3.Batasan Masalah<br />\r\n-Perlu dijelaskan tentang alasan pemilihan 5 kriteria, batasan SKS tempuh minimal, dll.<br />\r\n<br />\r\n4.Tujuan penelitian<br />\r\n-Tujuan penelitian hanya satu dan dapat dijelaskan oleh kalimat-kalimat yang lain.</p>\r\n\r\n<p>5.Manfaat penelitian<br />\r\n-Manfaat bisa dilihat dari beberapa aspek atau sudut pandang, misalnya dari sudut pandang keilmuan, atau dari sudut pandang aplikatif.</p>\r\n\r\n<p>6.Tinjauan Pustaka<br />\r\n-Tidak ada tinjauan pustaka dalam proposal ini.<br />\r\n<br />\r\n7.Landasan Teori<br />\r\n-Perlu ditambahkan landasan teori tentang metode evaluasi yang akan digunakan.<br />\r\n-Setiap tulisan yang diambil dari literatur tertentu perlu ditambahkan stiasi/rujukannya.<br />\r\n-Perhatikan cara penulisan dalam landasan teori.<br />\r\n-Perhatikan penulisan &quot;Persamaan&quot;.<br />\r\n-&quot;Contoh Kasus&quot; bukan &quot;Contoh Soal&quot;.<br />\r\n-Dari contoh kasus, lalu kesimpulannya apa? Apa hubungan antara hasil perhitungan dengan bidang minat mahasiswa?<br />\r\n<br />\r\n8. Blok Diagram Sistem</p>\r\n\r\n<p>-Tidak ada blok diagram sistem yang dibuat (???)<br />\r\n<br />\r\n9.Metodologi Penelitian<br />\r\n-Tidak ada metodologi penelitian yang ditulis (???)<br />\r\n<br />\r\n10.Daftar Pustaka<br />\r\n-Semua literatur yang ditulis di Daftar Pustaka <em>harus </em>digunakan dalam teks proposal.<br />\r\n-Cara penulisan di proposal tidak mengikuti cara penulisan APA Style.</p>\r\n', '2020-02-28 13:20:01', 1315, 'R', 16, NULL, 2296, 'PERANCANGAN APLIKASI PENJURUSAN BIDANG MINAT MAHASISWA INFORMATIKA UKDW DENGAN METODE PROMETHEE', 'PERANCANGAN APLIKASI PENJURUSAN BIDANG MINAT MAHASISWA INFORMATIKA UKDW DENGAN METODE PROMETHEE', '71150054', 'T', 13, 124, 'T'),
(2214, '2020-02-21 10:31:45', '<p>Nilai: 215</p>\r\n\r\n<p>Catatan Evaluator:</p>\r\n\r\n<ol>\r\n	<li>Di latar belakang dan rumusan masalah belum tersiratkan perlunya perancangan ulang- mengapa? a research problem mising</li>\r\n	<li>evakuasi yang digunakan hanya kuisioner SUS, perlu ditambahkan alat dan skenario evaluasi situs yang didesain ulang perlu juga dibandingkan dengan situs awal</li>\r\n	<li>Daftar pustaka perlu diperbaharui (10 tahun terakhir)</li>\r\n	<li>Lihat catatan pada proposal</li>\r\n</ol>\r\n', '2020-02-28 12:06:53', 1315, 'R', 13, NULL, 2316, 'Perancangan Ulang Antarmuka Situs Musik Tradisional Dan Film Indonesia Berbasis Mobile Website', 'Perancangan Ulang Antarmuka Situs Musik Tradisional Dan Film Indonesia Berbasis Mobile Website', '71150075', 'T', 12, 124, 'T'),
(2215, '2020-02-21 10:32:41', '<p>1. Bagaimana cara ukur web yang di bangun dapat membantu&nbsp;jemaat ?</p>\r\n\r\n<p>2. Judul tidak mencerminkan apa penelitiannya ?</p>\r\n\r\n<p>3. Masalah kurang kuat / tidak jelas</p>\r\n\r\n<p><strong>NILAI = 220</strong></p>\r\n', '2020-03-12 10:51:37', 1486, 'R', 9, NULL, 2298, 'SISTEM INFORMASI GEREJA BERBASIS WEB PADA GEREJA BAIT’EL KOTA GORONTALO ', 'SISTEM INFORMASI GEREJA BERBASIS WEB PADA GEREJA BAIT’EL KOTA GORONTALO ', '71150122', 'Y', 54, 127, 'T'),
(2216, '2020-02-21 10:33:20', '<p>Nilai: 280</p>\r\n\r\n<p>Catatan Evaluator:</p>\r\n\r\n<ol>\r\n	<li>desain teman diabetes perlu ditampilkan dan perlu analisis dengan menampilkan fitur desain mana yang perlu didesain ulang</li>\r\n	<li>Lihat catatan di proposal</li>\r\n</ol>\r\n', '2020-03-13 08:39:37', 1315, 'R', 9, NULL, 2315, 'ANALISA DAN PERANCANGAN ULANG ANTARMUKA APLIKASI TEMAN DIABETES TERHADAP LANSIA', 'ANALISA DAN PERANCANGAN ULANG ANTARMUKA APLIKASI TEMAN DIABETES TERHADAP LANSIA', '71150091', 'Y', 12, 124, 'T'),
(2217, '2020-02-21 10:40:59', '<p>Skor 205</p>\r\n\r\n<p>- Rumusan, batasan masalah masih salah</p>\r\n\r\n<p>- Penulisan landasan teori perlu diperbaiki total</p>\r\n\r\n<p>- Penulisan daftar pustaka salah</p>\r\n\r\n<p>- Judul terlalu panjang</p>\r\n', '2020-03-12 12:51:05', 636, 'R', 15, NULL, 2312, 'PERANCANGAN SISTEM MONITORING NILAI AKADEMIK SISWA BERBASIS WEB DENGAN METODE USER CENTERED DESIGN\r\nDI SDN 03 CIPAYUNG\r\n', 'PERANCANGAN SISTEM MONITORING NILAI AKADEMIK SISWA BERBASIS WEB DENGAN METODE USER CENTERED DESIGN\r\nDI SDN 03 CIPAYUNG\r\n', '71150060', 'Y', 50, 125, 'T'),
(2218, '2020-02-21 10:43:48', '<p>Nilai: 325</p>\r\n\r\n<p>Catatan:</p>\r\n\r\n<ol>\r\n	<li>Kenapa di batasan masalah,&nbsp; menjadi customer care (perawat dan non perawat)</li>\r\n	<li>pada latar belakang dilatakan &quot;menciptakan&quot;? apakah benar dalam proposal ini kan menciptakan proses bisnis baru?</li>\r\n	<li>untuk tinjuan pustaka lebih bagus lakukan perbandingan dengan penelitian anda sendiri</li>\r\n</ol>\r\n', '2020-03-12 23:35:08', 1315, 'R', 8, NULL, 2319, 'Perancangan Aplikasi Sistem Tunjangan Customer Care di PT.Sinarmas dengan menerapkan metode BPMN', 'Perancangan Aplikasi Sistem Tunjangan Customer Care di PT.Sinarmas dengan menerapkan metode BPMN', '71160131', 'Y', 55, 124, 'T'),
(2219, '2020-02-21 10:45:26', '<p>N = 190</p>\r\n\r\n<ul>\r\n	<li>Masih kurang jelas akan melakukan apa.&nbsp;</li>\r\n	<li>Implementasi WebDAV yang seperti apa?</li>\r\n	<li>Blok diagram sistem kurang jelas.</li>\r\n	<li>Latar belakang, referensi dan metode tidak jelas/tidak ada.</li>\r\n	<li>Tinjauan pustaka perlu menambahkan penelitian-penelitian sejenis. Sudah banyak dan mudah dicari.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '2020-02-28 11:57:59', 642, 'K', 8, NULL, 2310, 'Pemanfaatan Protokol WebDAV untuk Sistem Arsip', 'Pemanfaatan Protokol WebDAV untuk Sistem Arsip', '71160017', 'T', 2, 126, 'T'),
(2220, '2020-02-21 11:00:04', '<p>Skor 225</p>\r\n\r\n<p>- Diperjelas kriteria dan subkriteria<br />\r\n- Diperjelas responden yang akan mengevaluasi dan yang menentukan kriteria<br />\r\n- Sinkronisasi daftar pustaka<br />\r\n- Typo dibetulkan</p>\r\n', '2020-02-28 12:43:33', 636, 'R', 50, NULL, 2318, 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN PROGRAM STUDI DI UKDW BERBASIS ANDROID', 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN PROGRAM STUDI DI UKDW BERBASIS ANDROID', '71160127', 'T', 18, 125, 'T'),
(2221, '2020-02-21 11:00:52', '<p>N = 245</p>\r\n\r\n<ul>\r\n	<li>Apakah tidak/belum ada sistem yang berlaku secara nasional?</li>\r\n	<li>Rumusan masalah tidak menyentuh instrumen pengukuran penelitian.</li>\r\n	<li>Tinjauan Pustaka masih kurang.</li>\r\n	<li>Landasan teori belum membahas&nbsp;<em>heuristic evaluation</em>.</li>\r\n</ul>\r\n', '2020-02-27 12:55:58', 642, 'R', 9, NULL, 2320, 'DESAIN ANTARMUKA SISTEM ADMINISTRASI KEPENDUDUKAN DAN INFORMASI DESA BERBASIS WEB', 'DESAIN ANTARMUKA SISTEM ADMINISTRASI KEPENDUDUKAN DAN INFORMASI DESA BERBASIS WEB', '71160097', 'T', 39, 126, 'T'),
