(2223, '2020-02-21 11:08:45', '<p>Skor 135</p>\r\n\r\n<p>- Judul terlalu panjang, max 14 kata</p>\r\n\r\n<p>- Tata bahasa perlu diperbaiki, karena bahasa yang digunakan sangat tidak formal, lihat contoh latar belakang yang digarisbawah</p>\r\n\r\n<p>- Belum ada tinjauan pustaka</p>\r\n\r\n<p>- Landasan teori terlalu sedikit</p>\r\n\r\n<p>- Referensi terlalu sedikit</p>\r\n\r\n<p>- Masalah dan solusi tidak ada hubungannya, dibutuhkan solusi di sisi teknis, bukan di sisi antarmuka</p>\r\n', '2020-02-28 12:09:08', 636, 'K', 13, NULL, 2305, 'PERANCANGAN ANTARMUKA SISTEM HITUNG LIVE STATISTIK SEPAKBOLA BAGI DATA KOLEKTOR MENGGUNAKAN METODE USER CENTER DESIGN', 'PERANCANGAN ANTARMUKA SISTEM HITUNG LIVE STATISTIK SEPAKBOLA BAGI DATA KOLEKTOR MENGGUNAKAN METODE USER CENTER DESIGN', '71140032', 'T', 50, 125, 'T'),
