(2228, '2020-02-21 12:07:25', '<p>205 - Revisi Mayor<br />\r\n(1) Bagaimana cara visualisasi data, belum diterangkan dengan jelas: rancangan, literatur pendukung teori rancangan, alur penerapan usability testing terhadap rancangan visualisasi yang dibuat.<br />\r\n(2) Mohon hal-hal di atas dilengkapi setelah berkonsultasi dengan dosen pembimbing yang dipilih.</p>\r\n', '2020-03-02 20:35:45', 625, 'R', 12, NULL, 2307, 'Visualisasi Persebaran Candi di Daerah Istimewa Yogyakarta', 'Visualisasi Persebaran Candi di Daerah Istimewa Yogyakarta', '71130003', 'T', 3, 125, 'T'),
(2229, '2020-02-21 12:55:10', '<p>1. Jika hanya akan merancang antarmuka (bukan aplikasinya) harus ditunjukkan kompleksitas masalah yang akan diteliti</p>\r\n\r\n<p>2. Apakah ada perbedaan serius di Yamaha dengan di tempat lain ? Jika tidak bisa dibuat umum</p>\r\n\r\n<p>3. Untuk penelitian antarmuka tidak cukup hanya menggunakan kuisioner dan observasi&nbsp;</p>\r\n\r\n<p><strong>NILAI AKHIR = 195</strong></p>\r\n', '2020-02-28 12:45:00', 1486, 'K', 50, NULL, 2306, 'PERANCANGAN ANTARMUKA APLIKASI ANTRIAN SERVIS DEALER YAMAHA MENGGUNAKAN METODE USER CENTERED DESIGN BERBASIS ANDROID', 'PERANCANGAN ANTARMUKA APLIKASI ANTRIAN SERVIS DEALER YAMAHA MENGGUNAKAN METODE USER CENTERED DESIGN BERBASIS ANDROID', '71140035', 'T', 9, 127, 'T'),
(2230, '2020-02-21 13:18:55', '<p>1. Pada bagian tinjauan pustaka dan landasan teori peru diperbaiki.&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;6.1 Tabel, 6.2 Gambar 6.3 masih copy paste dengan penulisan FISIP Universitas Brawijaya&nbsp;</p>\r\n\r\n<p>2. Tambahan daftar pustaka yang memuat software yang digunakan untuk pembangunan aplikasi.</p>\r\n\r\n<p>3. Tambahkan teori tentang sistem informasi jemaat gereja supaya lebih cocok&nbsp;</p>\r\n\r\n<p><strong>NILAI AKHIR = 225</strong></p>\r\n', '2020-03-12 14:06:48', 1486, 'R', 9, NULL, 2333, 'PEMBUATAN WEB SISTEM INFORMASI JEMAAT PADA\r\nGEREJA GKI IMANNUEL SERUI KOTA \r\n', 'PEMBUATAN WEB SISTEM INFORMASI JEMAAT PADA GEREJA GKI IMANNUEL SERUI KOTA \r\n', '71150059', 'Y', 16, 127, 'T'),
(2231, '2020-02-21 13:19:33', '<p>1. Latar belakang diperjelas antara permasalahan dan solusi</p>\r\n\r\n<p>2. Rumusan tujuan, manfaat diperbaiki</p>\r\n\r\n<p>3. Tinjauan Pusataka &amp; Landasan teori diperbaiki (penulisan dan isi)</p>\r\n\r\n<p>4. Metode yang digunakan diperjelas dari awal (latar belakang)</p>\r\n\r\n<p><strong>NILAI AKHIR = 250</strong></p>\r\n', '2020-03-13 13:58:25', 1486, 'R', 9, NULL, 2323, 'PEMBANGUNAN PERFORMANCE DASHBOARD ADMINISTRASI AKADEMIK SDN 85 AMBOYO UTARA', 'PEMBANGUNAN PERFORMANCE DASHBOARD ADMINISTRASI AKADEMIK SDN 85 AMBOYO UTARA', '71160068', 'Y', 19, 127, 'T'),
