(2285, '2020-03-23 10:17:50', '<p>Dalam latar belakang dikatakan pengelolaan data manual &lsquo;nyaris mustahil dilakukan secara cepat, akurat, dan terintegrasi&rsquo;. Jadi selama ini bagaimana? Adakah data yang mendukung pernyataan itu?;&nbsp; Sebaiknya dijelaskan masalah riil yang dihadapi saat ini, apakah masalahnya adalah ketersediaan data atau pencarian data atau representasi data?;&nbsp; Profile siswa seperti apa yang akan divisualisasikan?; Dalam Rumusan masalah disebutkan bahwa metode yang digunakan adalah prototyping, tetapi pada bagian metodologi tidak ada prototyping;&nbsp; Judul penelitian adalah analisis profile siswa SMA, mengapa dibatasi hanya data angkatan siswa masuk sekolah?;&nbsp; Tinjauan pustaka harus menunjukkan keterkaitan dengan penelitian yang akan dilakukan.</p>\r\n\r\n<p>Skor 230</p>\r\n', '2020-04-24 10:18:10', 625, 'R', 16, NULL, 2375, 'ANALISIS PROFILE SISWA SMA PANGUDI LUHUR SANTO YOHANES KETAPANG KALIMANTAN BARAT MENGGUNAKAN DASHBOARD', 'ANALISIS PROFILE SISWA SMA PANGUDI LUHUR SANTO YOHANES KETAPANG KALIMANTAN BARAT MENGGUNAKAN DASHBOARD', '71150092', 'Y', 9, 130, 'T'),
(2286, '2020-03-30 17:25:06', '<p>Okey, sudah melakukan perbaikan dan sudah mengganti kasus. Skor 350</p>\r\n', '2020-04-07 21:11:03', 625, 'T', 16, 7, 2376, 'Penerapan Algoritma Hopcroft-Karp pada Program Penjadwalan Praktikum', 'Penerapan Algoritma Hopcroft-Karp pada Program Penjadwalan Praktikum', '71150045', 'T', 7, 130, 'T'),
(2287, '2020-04-01 13:14:52', '<p>N = 225</p>\r\n\r\n<ol>\r\n	<li>Format proposal diperbaiki&nbsp;(proposal <strong>tidak </strong>mengandung Bab I sampai Bab V)</li>\r\n	<li>Latar Belakang diperbaiki</li>\r\n	<li>Pustaka ditulis sumber referensinya (semua bagian pustaka belum ada sumbernya)</li>\r\n	<li>Typo diperbaiki</li>\r\n	<li>Pustaka dicantumkan yang digunakan pada proposal</li>\r\n</ol>\r\n', '2020-04-03 10:22:05', 642, 'R', 6, NULL, 2377, 'Sistem Pakar Diagnosis Penyakit Tuberkulosis Berbasis Fuzzy Multy criteria decision Making', 'SISTEM PAKAR DIAGNOSIS PENYAKIT TUBERKULOSIS BERBASIS FUZZY MULTICRITERIA DECISION MAKING', '71130142', 'T', 19, 129, 'T'),
(2288, '2020-04-02 08:54:48', '<p>N = 260</p>\r\n\r\n<p><strong>Tanggapan umum:</strong></p>\r\n\r\n<blockquote>\r\n<p>Topik ini telah diangkat di beberapa penelitian.&nbsp; Lalu, apa yang membedakan penelitian yang akan dilakukan dengan penelitian2 serupa sebelumnya?</p>\r\n</blockquote>\r\n\r\n<p><strong>Tanggapan khusus:</strong></p>\r\n\r\n<p>1. Latar Belakang</p>\r\n\r\n<ul>\r\n	<li>Latar belakang cukup menggambarkan permasalahan yang ingin/perlu diselesaikan dengan penelitian.&nbsp; Meskipun demikian, metode yang akan diimplementasikan tidak disinggung sama sekali.</li>\r\n	<li>Amalia dan Wibowo (2017) sudah mengerjakan topik yang serupa dengan studi kasus Politeknik Negeri Malang.&nbsp; Lalu apa bedanya dengan topik penelitian yang akan dilakukan?</li>\r\n</ul>\r\n\r\n<p>2. Batasan Masalah</p>\r\n\r\n<ul>\r\n	<li>Pada &#39;Latar Belakang&#39; maupun &#39;Rumusan Masalah&#39; idak ada penjelasan atau pernyataan terkait metode yang akan diimplementasikan.</li>\r\n</ul>\r\n\r\n<p>3. Batasan Masalah</p>\r\n\r\n<ul>\r\n	<li>Pernyataan berikut &quot;Penggunaan aplikasi hanya untuk penyeleksian Beasiswa Akademik UKDW&quot; bukan merupakan batasan masalah, karena hal ini yang akan dibuat.</li>\r\n</ul>\r\n\r\n<p>4. Tujuan penelitian</p>\r\n\r\n<ul>\r\n	<li>Pernyataan tujuan serupa dengan pernyataan pada manfaat penelitian.</li>\r\n</ul>\r\n\r\n<p>5. Manfaat penelitian</p>\r\n\r\n<ul>\r\n	<li>Manfaat bisa dilihat dari beberapa aspek atau sudut pandang, misalnya dari sudut pandang keilmuan, atau dari sudut pandang aplikatif.</li>\r\n</ul>\r\n\r\n<p>6. Tinjauan Pustaka</p>\r\n\r\n<ul>\r\n	<li>Amalia dan Wibowo (2017) sudah mengerjakan topik yang serupa dengan studi kasus Politeknik Negeri Malang.</li>\r\n</ul>\r\n\r\n<p>7. Landasan Teori</p>\r\n\r\n<ul>\r\n	<li>Setiap tulisan yang diambil dari literatur tertentu perlu ditambahkan stiasi/rujukannya.</li>\r\n	<li>Pada &#39;Contoh Kasus&#39;, apa yg menjadi dasar pemberian bobot untuk setiap item pada setiap kriteria?</li>\r\n</ul>\r\n\r\n<p>8. Blok Diagram Sistem</p>\r\n\r\n<ul>\r\n	<li>Langkah 3 &amp; 4 sama?</li>\r\n</ul>\r\n\r\n<p>9. Metodologi Penelitian: -</p>\r\n\r\n<p>10. Daftar Pustaka</p>\r\n\r\n<ul>\r\n	<li>Masih ada literatur dalam Daftar Pustaka yang tidak digunakan dalam teks proposal.</li>\r\n	<li>Masih ada penulisan literatur yang tidak mengikuti cara penulisan APA Style.</li>\r\n</ul>\r\n', '2020-04-23 10:51:04', 642, 'R', 16, NULL, 2378, 'PEMBUATAN APLIKASI PENERIMAAN BEASISWA AKADEMIK UKDW DENGAN METODE PROMETHEE', 'PEMBUATAN APLIKASI PENERIMAAN BEASISWA AKADEMIK UKDW DENGAN METODE PROMETHEE', '71150054', 'Y', 13, 129, 'T'),
(2289, '2020-04-02 08:55:46', '<p>&quot;- rumusan masalah harusnya berisi tentang masalah, bukan solusinya - proposal tidak menyebutkan metode yang akan diteliti, termasuk cara pengujiannya - penulisan tinjauan pustaka salah total - penulisan daftar pustaka salah dan tidak ada yang benar-benar relevan dengan penelitian - tolong pelajari lagi cara membuat proposal penelitian yang benar karena hampir seluruhnya salah total, seharusnya sudah diajarkan di mata kuliah RTI&quot;</p>\r\n\r\n<p>Skor 155</p>\r\n', '2020-04-07 21:14:18', 625, 'K', 12, NULL, 2380, 'VISUALISASI PENYEBARAN BENDA ARTEFAK ZAMAN PRASEJARAH DI MUSEUM YOGYAKARTA', 'VISUALISASI PENYEBARAN BENDA ARTEFAK ZAMAN PRASEJARAH DI MUSEUM YOGYAKARTA', '71160118', 'T', 50, 130, 'T'),
(2290, '2020-04-02 08:57:13', '<p>N = 240</p>\r\n\r\n<ul>\r\n	<li>Fitur-fitur sudah ada di LMS modern seperti Moodle, Canvas, Blackboard, dsb.</li>\r\n	<li>Lebih baik menyebutkan e-Learning apa yang tidak ada fitur tersebut. eClass misalnya? Menjadi perbaikan tampilan eClass UKDW misalnya?</li>\r\n	<li>Landasan teori sangat minim, tidak ada contoh kasus yang menggambarkan masalah?</li>\r\n</ul>\r\n', '2020-04-24 14:16:10', 642, 'R', 9, NULL, 2381, 'DESAIN ANTARMUKA LEARNING MANAGEMENT SYSTEM UNTUK MAHASISWA BERBASIS WEB', 'DESAIN ANTARMUKA LEARNING MANAGEMENT SYSTEM UNTUK MAHASISWA BERBASIS WEB', '71160097', 'Y', 2, 129, 'T'),
(2291, '2020-04-02 08:57:52', '<p>N = 305</p>\r\n\r\n<p>Lihat catatan pada file proposal (PDF), terutama bagian dasar teori, jangan cuma satu paragraf saja per masing-masing bagian.</p>\r\n', '2020-04-23 11:15:38', 642, 'R', 50, NULL, 2382, 'PEMBUATAN MIDDLEWARE UNTUK MENGHUBUNGKAN APLIKASI CHATTING TELEGRAM DENGAN APLIKASI CHATTING MODIFIKASI ', 'PEMBUATAN MIDDLEWARE UNTUK MENGHUBUNGKAN APLIKASI CHATTING TELEGRAM DENGAN APLIKASI CHATTING MODIFIKASI ', '71160066', 'Y', 17, 129, 'T'),
(2292, '2020-04-02 10:37:26', '<p>N = 220</p>\r\n\r\n<ul>\r\n	<li>Rating 4.4 untuk 100.000 orang apakah kurang sehingga perlu merancang ulang antarmukanya? Kurang jelas dikemukakan urgensinya merancang ulang antarmuka.</li>\r\n	<li>Perumusan masalah tidak bisa dijawab di Bab V (Kesimpulan).</li>\r\n	<li>Batasan masalah responden kurang rinci.</li>\r\n	<li>Identifikasi kendala SehatQ harusnya tidak di Tujuan Penelitian. Sebaiknya diisi tujuan akhir saja.</li>\r\n	<li>Insecure lansia menggunakan SehatQ apakah sudah diteliti?</li>\r\n	<li>Referensi ada yang terlalu tua. Apakah masih valid? Apalagi ini tentang desain interface. Mestinya ada teori yang lebih baru.</li>\r\n	<li>Perhatikan format penulisan masih berbeda-beda di beberapa bagian.</li>\r\n</ul>\r\n', '2020-04-24 14:57:00', 642, 'R', 9, NULL, 2383, 'EVALUASI DAN PERANCANGAN ULANG TAMPILAN ANTARMUKA APLIKASI SEHATQ TERHADAP LANSIA', 'EVALUASI DAN PERANCANGAN ULANG TAMPILAN ANTARMUKA APLIKASI SEHATQ TERHADAP LANSIA', '71150128', 'Y', 39, 129, 'T'),
(2293, '2020-04-02 11:52:14', '<p>&quot;Latar belakang masih belum menjelaskan secara spesifik apa yang menjadi sebuah persoalan dari GKJ Perlu dipertegas bahwa yang akan dibangun adalah aplikasi Android dan bukan aplikasi web agar tidak ambigu. Apa relasi antara model pengujian yang digunakan dengan tujuan penelitian? Apa sebenarnya yang mau diukur? Metodologi dan dasar teori untuk mengukurnya masih kurang jelas&quot;</p>\r\n\r\n<p>Skor 225</p>\r\n', '2020-04-15 14:05:14', 625, 'R', 8, NULL, 2385, 'PEMBUATAN APLIKASI ANDROID SINODE GKJ BERBASIS PROGRESSIVE WEB APPS DENGAN MEMANFAATKAN API WORDPRESS', 'PEMBUATAN APLIKASI ANDROID SINODE GKJ BERBASIS PROGRESSIVE WEB APPS DENGAN MEMANFAATKAN API WORDPRESS', '71160036', 'Y', 15, 130, 'T'),
(2294, '2020-04-02 11:55:06', '<p>N = 220</p>\r\n\r\n<ol>\r\n	<li>Penentuan fitur dari SIA apakah setelah proses UCD atau sudah ditentukan sebelumnya? Pada proposal UCD hanya berfokus pada perancangan antar muka.</li>\r\n	<li>Rumusan masalah: Jelaskan maksud berbasis web yang sederhana dan mudah digunakan.&nbsp;Indikatornya apa?</li>\r\n	<li>Tujuan Penelitian: silakan sebutkan permasalahan yang muncul ?</li>\r\n	<li>Manfaat Penelitian: indikator pengolahan lebih cepat itu bagaimana ?</li>\r\n	<li>Landasan teori diperkuat ?</li>\r\n	<li>Silakan perhatikan yang sudah dicoret diprosoal</li>\r\n</ol>\r\n', '2020-04-03 10:48:30', 642, 'R', 9, NULL, 2384, 'PERANCANGAN SISTEM INFORMASI AKADEMIK SMP NEGERI 5 TAGULANDANG BERBASIS WEB MENGGUNAKAN METODE UCD', 'PERANCANGAN SISTEM INFORMASI AKADEMIK SMP NEGERI 5 TAGULANDANG BERBASIS WEB MENGGUNAKAN METODE UCD', '71160067', 'T', 57, 129, 'T'),
(2295, '2020-04-02 13:38:22', '<p>Ditolak, sudah ada yang lebih dahulu mengajukan dengan kasus dan metode yang sama persis, dengan proposal yang lebih lengkap dan sudah diperbaiki dari pengajuan saat DE 1 dengan NIM 71140092 Findy Silvana</p>\r\n\r\n<p>Skor 180</p>\r\n', '2020-04-07 21:12:01', 625, 'K', 16, NULL, 2386, 'Penerapan Metode Promethee untuk Seleksi Penerima Beasiswa Scranton', 'Penerapan Metode Promethee untuk Seleksi Penerima Beasiswa Scranton', '71130003', 'T', 7, 130, 'T'),
(2296, '2020-04-02 13:39:30', '<p>Belum direvisi sesuai catatan pada form nilai DE 1</p>\r\n\r\n<p>Skor 225</p>\r\n', '2020-04-07 21:17:38', 625, 'R', 3, NULL, 2387, 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN PROGRAM STUDI DI UKDW DENGAN METODE ANALITYCAL HIERARCHY PROCESS', 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN PROGRAM STUDI DI UKDW DENGAN METODE ANALITYCAL HIERARCHY PROCESS', '71160127', 'T', 18, 130, 'T'),
(2297, '2020-04-02 13:40:02', '<p>Untuk variabel ditambahi ya.</p>\r\n\r\n<p>Skor 270</p>\r\n', '2020-04-07 21:15:43', 625, 'R', 16, NULL, 2390, 'Sistem Pendukung Keputusan dengan Algoritma Promethee untuk Menetukan Penerima Beasiswa Scranton  ', 'Sistem Pendukung Keputusan dengan Algoritma Promethee untuk Menetukan Penerima Beasiswa Scranton  ', '71140092', 'T', 7, 130, 'T'),
(2298, '2020-04-02 13:40:38', '<p>N = 205</p>\r\n\r\n<ol>\r\n	<li>Rumusan masalahnya cara mengambil dan mengolah data ? Bukan pemodelan antar muka ?</li>\r\n	<li>Validitas pengumpulan data pada fitur melalui fitru khusus tab komunitas gimana ? Batasan masalah point 3</li>\r\n	<li>Diagaram sistem yg harus dibuat untuk kasus idn manhua ?</li>\r\n	<li>Use case pengguna dan admin tidak ada bedanya ? Tolong diagram diperbaiki!</li>\r\n	<li>Point pentingnya, UCD proses berulang, bagaimana kamu yakin jika data yang kamu ambil dalam proses berulang ini tetap dengan responen yang sama ?</li>\r\n	<li>Silakan cek coretan pada file proposal</li>\r\n</ol>\r\n', '2020-04-28 10:38:03', 642, 'R', 12, NULL, 2389, 'DESAIN ANTARAMUKA SITUS IDNMANHUA  DARI KOMUNITAS YOUTUBE SALURAN REKSY LIE MENGGUNAKAN METODE USER CENTERED DESIGN', 'DESAIN ANTARAMUKA SITUS IDNMANHUA  DARI KOMUNITAS YOUTUBE SALURAN REKSY LIE MENGGUNAKAN METODE USER CENTERED DESIGN', '71160027', 'T', 57, 129, 'T'),
(2299, '2020-04-02 15:00:58', '<p>N = 315</p>\r\n\r\n<ul>\r\n	<li>Kutipan masih belum sesuai, tetapi sumber refrensi sudah oke. Ada beberapa yang outdated. Usahakan<br />\r\n	referensi 5 tahun terakhir.</li>\r\n	<li>Cek file hasil review</li>\r\n	<li>Belum ada contoh perhitungan metode SUS pada sebuah kasus</li>\r\n	<li>Beberapa paragraph formatnya tidak sesuai</li>\r\n</ul>\r\n', '2020-04-24 10:46:18', 642, 'R', 3, NULL, 2395, 'PERANCANGAN ANTARMUKA BERDASARKAN HASIL UJI USABILITAS TERHADAP PENGGUNAAN APLIKASI KLIKDOKTER UNTUK LANSIA ', 'PERANCANGAN ANTARMUKA BERDASARKAN HASIL UJI USABILITAS TERHADAP PENGGUNAAN APLIKASI KLIKDOKTER UNTUK LANSIA ', '71160042', 'Y', 54, 129, 'T'),
(2300, '2020-04-02 15:06:04', '<p>Mengapa hanya antarmuka? Karena yang akan dibuat hanyalah sistem antrian servis, maka tidak banyak fitur yang disediakan sistem, sehingga otomatis antarmuka yang dibuat juga sederhana;&nbsp;&nbsp;<br />\r\nSistem yang dibuat berbasis android sehingga tidak perlu dibatasi di batasan masalah, sistem berbasis android;&nbsp; Dalam tinjauan pustaka sudah dijelaskan sistem antrian lain berbasis android untuk pasien dan pembayaran perkuliahan, apa yang membedakan penelitian ini dengan penelitian-penelitian tersebut?</p>\r\n\r\n<p>Skor 225</p>\r\n', '2020-04-07 21:08:25', 625, 'R', 50, NULL, 2391, 'PERANCANGAN ANTARMUKA APLIKASI ANTRIAN SERVIS DEALER YAMAHA MENGGUNAKAN METODE USER CENTERED DESIGN BERBASIS ANDROID', 'PERANCANGAN ANTARMUKA APLIKASI ANTRIAN SERVIS DEALER YAMAHA MENGGUNAKAN METODE USER CENTERED DESIGN BERBASIS ANDROID', '71140035', 'T', 9, 130, 'T'),
(2301, '2020-04-02 15:29:31', '<p>&quot;Proposal ini belum menjelaskan bagaimana penelitian akan dilakukan. Bagian yang perlu dijelaskan:</p>\r\n\r\n<p>1. Karena judul mengenai visualisasi, metode visualisasi ? berikan landasan teori yang kuat, beserta contoh.</p>\r\n\r\n<p>2. Cara pengujian ? berikan landasan teori mengenai bagaimana menguji kesesuaian visualisasi yang dibuat, beserta contoh Catatan lain: Banyak typo dan alur proposal kurang runtut. Jika susah memenuhi poin 1 dan 2, mungkin dapat dipertimbangkan untuk berganti topik yang lebih dikuasai.&quot;</p>\r\n\r\n<p>Skor 199</p>\r\n', '2020-04-07 21:13:37', 625, 'K', 12, NULL, 2392, 'VISUALISASI SEBARAN MANUSKRIP JAWA DI INSTITUSI YOGYAKARTA DAN SOLO BERBASIS SISTEM INFORMASI GEOGRAFIS', 'VISUALISASI SEBARAN MANUSKRIP JAWA DI INSTITUSI YOGYAKARTA DAN SOLO BERBASIS SISTEM INFORMASI GEOGRAFIS', '71150119', 'T', 3, 130, 'T'),
(2302, '2020-04-02 15:33:26', '<p>&quot;Proposal ini belum menjelaskan bagaimana penelitian akan dilakukan.</p>\r\n\r\n<p>Bagian yang perlu dijelaskan:</p>\r\n\r\n<p>1. Karena judul mengenai visualisasi, metode visualisasi ? berikan landasan teori yang kuat, beserta contoh.</p>\r\n\r\n<p>2. Cara pengujian ? berikan landasan teori mengenai bagaimana menguji kesesuaian visualisasi yang dibuat, beserta contoh</p>\r\n\r\n<p>Catatan lain: Banyak typo dan alur proposal kurang runtut. Jika susah memenuhi poin 1 dan 2, mungkin dapat dipertimbangkan untuk berganti topik yang lebih dikuasai.&quot;</p>\r\n\r\n<p>Skor 199</p>\r\n', '2020-04-07 21:12:57', 625, 'K', 12, NULL, 2394, 'VISUALISASI PERSEBARAN MANUSKRIP JAWA DI YOGYAKARTA DAN SOLO DENGAN METODE NODE INFOGRAFIS', 'VISUALISASI PERSEBARAN MANUSKRIP JAWA DI YOGYAKARTA DAN SOLO DENGAN METODE NODE INFOGRAFIS', '71150001', 'T', 3, 130, 'T'),
