(2304, '2020-04-02 15:38:54', '<p>&quot;Latar belakang masalah mestinya merupakan data riil bukan data imajiner ( asumsi ). Perumusan masalah, metodologi penelitian perlu dperbaikii. ( Lihat catatan di proposal )&quot;</p>\r\n\r\n<p>Skor 225</p>\r\n', '2020-04-07 21:17:09', 625, 'R', 10, NULL, 2379, 'RANCANG BANGUN PROTOTYPE KEAMANAN JARINGAN KOMPUTER DENGAN METODE IPS (INTRUSION PREVENTION SYSTEM) DI UNIVERSITAS KRISTEN DUTA WACANA', 'RANCANG BANGUN PROTOTYPE KEAMANAN JARINGAN KOMPUTER DENGAN METODE IPS (INTRUSION PREVENTION SYSTEM) DI UNIVERSITAS KRISTEN DUTA WACANA', '71160102', 'T', 1, 130, 'T'),
(2305, '2020-04-03 13:22:00', '<p>&quot;- Judul terlalu panjang, max 14 kata - Tata bahasa perlu diperbaiki, karena bahasa yang digunakan sangat tidak formal - penulisan tinjauan pustaka salah - Landasan teori tidak relevan - Referensi terlalu sedikit, hanya 1 yang kurang dari 10 tahun dan relevan - Masalah dan solusi tidak ada hubungannya, dibutuhkan solusi di sisi teknis, bukan di sisi antarmuka&quot;</p>\r\n\r\n<p>Skor 200</p>\r\n', '2020-04-24 14:15:10', 625, 'R', 7, NULL, 2396, 'PERANCANGAN ANTARMUKA SISTEM HITUNG LIVE STATISTIK SEPAKBOLA BAGI DATA KOLEKTOR  MENGGUNAKAN METODE USER CENTER DESIGN', 'PERANCANGAN ANTARMUKA SISTEM HITUNG LIVE STATISTIK SEPAKBOLA BAGI DATA KOLEKTOR  MENGGUNAKAN METODE USER CENTER DESIGN', '71140032', 'Y', 50, 130, 'T'),
