(2627, '2021-02-18 13:23:51', '<p>- Jelaskan latar belakang perlu dilakukan pengujian terhadap website klatenkab.go.id terutama aspek efisiensi, memorabilitas dan efiktifivasnya. Apakah untuk mengevaluasi aspek tersebut metodologi yang digunakan cukup dengan melakukan observasi dan survey?</p>\r\n\r\n<p>- Blok diagram sistem/blok diagram penelitian?</p>\r\n', '2021-03-11 22:47:07', 1178, 'R', 50, NULL, 2636, 'EVALUASI KEBERGUNAAN WEBSITE KABUPATEN KLATEN DENGAN METODE USABILITY TESTING', 'EVALUASI KEBERGUNAAN WEBSITE KABUPATEN KLATEN DENGAN METODE USABILITY TESTING', '71140043', 'Y', 9, 142, 'T'),
(2628, '2021-02-18 20:29:36', '<ol>\r\n	<li>Rumusan masalah : tidak jelas faktor yang akan menjadi pembahasan dalam penelitian!</li>\r\n	<li>Batasan masalah : tidak memuat batasan terkait penerapan metode</li>\r\n	<li>Rumusan dan tujuan : tidak sinkron</li>\r\n	<li>Landasan teori : Tabel 1 mohon diurai, apa yang menjadi tekan pada pustaka, apa hubungan dengan penelitian yang akan dilakukan</li>\r\n	<li>Metode penelitian belum mengacu pada UCD</li>\r\n	<li>Tidak ada blok diagram, Tidak ada contoh kasus</li>\r\n	<li>Skor: 255 (rev mayor).&nbsp; Evaluator: Rosa Delima</li>\r\n</ol>\r\n\r\n<p><br />\r\n<br />\r\n&nbsp;</p>\r\n', '2021-02-25 11:26:19', 625, 'R', 54, NULL, 2638, 'IMPLEMENTASI USER-CENTERED DESIGN PADA SISTEM INFORMASI GEREJA GBI MIRACLE SERVICE YOGYAKARTA', 'IMPLEMENTASI USER-CENTERED DESIGN PADA SISTEM INFORMASI GEREJA GBI MIRACLE SERVICE YOGYAKARTA', '71150072', 'T', 19, 141, 'T'),
(2629, '2021-02-19 07:12:09', '<p>Usulan saya: ganti fokus masalah yang diselesaikan. Saya melihat sebaiknya diarahkan ke pengembangan metode web scrapping atau sejenis untuk mengkoleksi lowongan kerja dan disimpan dalam satu database dan disediakan aplikasi pencarian dan pengkategorian informasi lowongan kerja. Sangat tidak cocok jika diselesaikan dengan pendekatan Data Warehouse.</p>\r\n\r\n<p>Skor: 125 (tolak).&nbsp; Evaluator: Budi Susanto</p>\r\n', '2021-02-27 10:56:56', 625, 'K', 15, NULL, 2637, 'IMPLEMENTASI DATA WAREHOUSE MENGENAI LOWONGAN PEKERJAAN UNTUK MAHASISWA', 'IMPLEMENTASI DATA WAREHOUSE MENGENAI LOWONGAN PEKERJAAN UNTUK MAHASISWA', '71170168', 'T', 8, 143, 'T'),
(2630, '2021-02-19 09:42:19', '<p>1. Rumusan masalah pada penelitian ini tidak tepat sebaiknya diganti</p>\r\n\r\n<p>2.Dalam proposal belum disebutkan proses evaluasinya akan dilakukan berapa kali</p>\r\n\r\n<p>3.Sebaiknya disebutkan berapa responden yang digunakan untuk wawancara</p>\r\n\r\n<p>4.Selain warta jemaat apa lagi yang akan ditampilkan pada website . Mengapa hanya ada Warta Jemaat ?</p>\r\n\r\n<p>Skor: 220.&nbsp; Rev mayor.&nbsp; Evaluator: Gunawan</p>\r\n', '2021-02-25 10:48:48', 625, 'R', 50, NULL, 2641, 'Perancangan Dan Implementasi Website Gereja Kristen Jawa Gombong Dengan Pendekatan User Centered Design', 'Perancangan Dan Implementasi Website Gereja Kristen Jawa Gombong Dengan Pendekatan User Centered Design', '71150075', 'T', 16, 141, 'T'),
(2631, '2021-02-19 10:27:19', '<p>- Penulisan daftar pustaka masih belum mengikuti format APA</p>\r\n\r\n<p>- Apa beda dengan PoS lain? bahkan PoS Lain sudah menggunakan barcode tapi ini tidak.</p>\r\n', '2021-02-26 09:33:10', 1178, 'R', 17, NULL, 2645, 'PEMBUATAN APLIKASI POINT OF SALES UTNUK TOKO BECABANG DENGAN METODE STRUCTURAL ANALYSIS AND DESIGN', 'PEMBUATAN APLIKASI POINT OF SALES UTNUK TOKO BECABANG DENGAN METODE STRUCTURAL ANALYSIS AND DESIGN', '71160075', 'T', 54, 142, 'T'),
(2632, '2021-02-19 10:33:15', '<p>- Latar belakang belum menjelaskan masalah yang dihadapi. APakah antar muka website yang ada sekarang cukup jelek atau ada masalah sehingga perlu dievaluasi?</p>\r\n\r\n<p>- Rumusan dan batasan keliru, tinjauan pustakan hanya berisi rangkuman singkat</p>\r\n\r\n<p>- Saya merasa jarak antar spasi konten tidak sesuai template, sehingga konten kurang padat.</p>\r\n\r\n<p>- Belum ada gambaran bagaimana heuristic evaluation akan diterapkan, keterangan yang ada masih berupa teori saja.</p>\r\n', '2021-02-26 09:39:26', 1178, 'R', 9, NULL, 2639, 'ANALISIS USER INTERFACE PADA WEBSITE BERITA MENGGUNAKAN METODE HEURISTIC EVALUATION\r\n(STUDI KASUS : KRJOGJA.COM)', 'ANALISIS USER INTERFACE PADA WEBSITE BERITA MENGGUNAKAN METODE HEURISTIC EVALUATION\r\n(STUDI KASUS : KRJOGJA.COM)', '71170158', 'T', 50, 142, 'T'),
(2633, '2021-02-19 10:35:01', '<ul>\r\n	<li>Perbanyak sumber pustaka dalam bentuk jurnal yang usianya dibawah 10 tahun</li>\r\n	<li>Informasi pada use case diagram sebaiknya disesuaikan dengan kebutuhan fungsional yang ada</li>\r\n	<li>Perlu ada korelasi antara tinjauan pustaka yang Anda pilih dengan apa yang akan dikerjakan. Bukan cuma sekedar asal ambil penelitian yang sudah ada.</li>\r\n	<li>Skor : 280 (rev mayor).&nbsp; Ev: Willy SR</li>\r\n</ul>\r\n', '2021-03-11 10:33:23', 625, 'R', 50, NULL, 2644, 'PERANCANGAN SISTEM INFORMASI PUSKESMAS KALOSI BERBASIS WEBSITE MENGGUNAKAN METODE USER CENTERED DESIGN', 'PERANCANGAN SISTEM INFORMASI PUSKESMAS KALOSI BERBASIS WEBSITE MENGGUNAKAN METODE USER CENTERED DESIGN', '71160108', 'Y', 15, 143, 'T'),
(2634, '2021-02-19 10:38:11', '<p>- Pada judul tidak perlu menyebutkan tujuan penelitian, justru seharusnya menyebtukan metode</p>\r\n\r\n<p>- rumusan masalah harusnya berisi masalah bukan solusinya</p>\r\n\r\n<p>- format proposal salah, yang digunakan adalah format skripsi</p>\r\n\r\n<p>- cara membuat daftar pustaka salah</p>\r\n', '2021-03-12 12:47:58', 1178, 'R', 9, NULL, 2643, 'PERANCANGAN website INFORMASI ALAT MUSIK TRADISIONAL BATAK UNTUK MELESTARIKAN BUDAYA BATAK', 'PERANCANGAN website INFORMASI ALAT MUSIK TRADISIONAL BATAK UNTUK MELESTARIKAN BUDAYA BATAK', '71170241', 'Y', 50, 142, 'T'),
(2635, '2021-02-19 10:41:53', '<p>- untuk menunjukkan urgensi penelitian yang dilakukan, pada latar belakang harus dijelaskan permasalahan yang ada saat ini (lebih baik disertai data/refrensi)</p>\r\n\r\n<p>- pada judul tidak usah dituliskan &#39;dengan metode usabiliti testing&#39;. karena metode tersebut hanyalah salah satu metode yang digunakan pada salah satu langkah dalam proses perancangan ulang website</p>\r\n\r\n<p>- Bedakana antara batasan dengan subjek penelitian, metodologi, dan spesifikasi sistem, yang dituliskan di prosposal bukan batasan masalah.</p>\r\n', '2021-02-26 10:11:51', 1178, 'R', 13, NULL, 2647, 'ANALISIS DAN EVALUASI WEBSITE UKM KOTA YOGYAKARTA DENGAN METODE USABILITY TESTING', 'ANALISIS DAN EVALUASI WEBSITE UKM KOTA YOGYAKARTA DENGAN METODE USABILITY TESTING', '71170192', 'T', 9, 142, 'T'),
(2636, '2021-02-19 10:44:15', '<p>Penekanan terkait dengan &quot;kegiatan&quot; apa dengan KPI seperti apa, sumber data transaksi seperti apa, dashboard strategic seperti apa masih belum jelas.</p>\r\n\r\n<p>skor 260 (rev mayor).&nbsp; Evaluator: Budi Susanto</p>\r\n', '2021-02-27 10:46:43', 625, 'R', 13, NULL, 2646, 'DESAIN DAN IMPLEMENTASI DASHBOARD DATA PELAKSANAAN KEGIATAN BPTP NTT BERBASIS WEB', 'DESAIN DAN IMPLEMENTASI DASHBOARD DATA PELAKSANAAN KEGIATAN BPTP NTT BERBASIS WEB', '71170180', 'T', 8, 143, 'T'),
(2637, '2021-02-19 10:56:23', '<p>- butuh parkir? padahal PSBB harunya mall sepi ya?</p>\r\n', '2021-03-12 08:34:09', 1178, 'R', 13, NULL, 2649, 'PEMBUATAN WEBSITE RESERVASI LAHAN PARKIR DI PUSAT PERBELANJAAN DI SURAKARTA (SOLO GRAND MALL)', 'PEMBUATAN WEBSITE RESERVASI LAHAN PARKIR DI PUSAT PERBELANJAAN DI SURAKARTA (SOLO GRAND MALL)', '71170243', 'Y', 54, 142, 'T'),
(2638, '2021-02-19 10:58:13', '<p>- saat ini aplikasi sudah ada belum? tidak ada penjelasan sama sekali, fiturnya apa saja?</p>\r\n\r\n<p>- Batasan 4, awalau belum pernah pakai aplikasi pasar beringharjo, boleh jadi responden?</p>\r\n\r\n<p>- daftar pustaka tidak menggunakan format APA, bahkan semua dianggap artikel dari website.</p>\r\n', '2021-02-26 09:45:36', 1178, 'R', 9, NULL, 2648, 'EVALUASI DAN PENGEMBANGAN ANTARMUKA PENGGUNA APLIKASI PASAR BERINGHARJO', 'EVALUASI DAN PENGEMBANGAN ANTARMUKA PENGGUNA APLIKASI PASAR BERINGHARJO', '71170176', 'T', 54, 142, 'T'),
(2639, '2021-02-19 11:37:43', '<p>1. Rumusan masalah pada penelitian ini tidak tepat sebaiknya diganti spy lebih kongkrit</p>\r\n\r\n<p>2.Dalam proposal belum disebutkan proses evaluasinya akan dilakukan berapa kali</p>\r\n\r\n<p>3.Sebaiknya disebutkan berapa responden yang digunakan untuk wawancara</p>\r\n\r\n<p>4. Perlu dijelaskan lebih detail tentang Metode simpleks dan variabel-variabel utk kasus ini</p>\r\n\r\n<p>5. Perlu diberikan contoh kongkrit yang sederhana untuk aplikasi perhitungannya</p>\r\n\r\n<p>6.Berkan daftar metodologi yang digunakan untuk memodelkan dan mengevaluasi sistem</p>\r\n\r\n<p>Evaluator: Gunawan.&nbsp; Skor: 205 (rev mayor)</p>\r\n', '2021-03-12 12:36:56', 625, 'R', 18, NULL, 2653, 'PEMBUATAN SISTEM OPTIMALISASI PEMANFAATAN DAN EFISIENSI LAHAN PERTANIAN SAYUR MAYUR MENGGUNAKAN METODE SIMPLEX', 'PEMBUATAN SISTEM OPTIMALISASI PEMANFAATAN DAN EFISIENSI LAHAN PERTANIAN SAYUR MAYUR MENGGUNAKAN METODE SIMPLEX', '71170174', 'Y', 16, 141, 'T'),
(2640, '2021-02-19 11:39:49', '<p>Proposal sebaiknya diperbaiki mayor, karena penekanan pada pengembangan sistem informasi yang tidak nampak. Pengembangan dengan Android adalah hanya salah satu alat saja untuk mewujudkan sistem informasi tersebut. Saya menilai bahwa proposal ini lebih contong ke Sistem Informasi.</p>\r\n\r\n<p>Skor 220 rev mayor.&nbsp; Ev: Budi Susanto</p>\r\n', '2021-02-27 10:45:21', 625, 'R', 50, NULL, 2652, 'RANCANG BANGUN SISTEM PENGADUAN MASYARAKAT BERBASIS ANDROID DI DINAS PEKERJAAN UMUM \r\n', 'RANCANG BANGUN SISTEM PENGADUAN MASYARAKAT BERBASIS ANDROID DI DINAS PEKERJAAN UMUM \r\n', '71170214', 'T', 8, 143, 'T'),
(2641, '2021-02-19 11:43:37', '<ul>\r\n	<li>Tidak ada penekanan mengenai metode/pendekatan yang akan digunakan/diteliti.</li>\r\n	<li>Latar belakang :Permasalahan belum jelas, mengapa tiba-tiba mucul solusi aplikasi android?</li>\r\n	<li>Pada akhir paragraf permasalahan malah melebar.</li>\r\n	<li>Rumusan masalah : tidak jelas, apa maksudnya ? efektif atau efisien atau sesuai kebutuhan, atau semuanya?&nbsp;</li>\r\n	<li>Batasan masalah : tidak membatasi masalah.</li>\r\n	<li>Tujuan Penelitian tidak jelas. Manfaat penelitian hanya menyatakan &quot;membantu&quot; apakah betul hanya itu manfaatnya?</li>\r\n	<li>Tinjauan pustaka dan landasan teori : belum ada tinjauan pustaka dan landasan teori, yang ada katalog karya ilmiah dan daftar definisi.</li>\r\n	<li>Blok diagram : tidak bisa dibaca.</li>\r\n	<li>Hanya gambar yang tidak ada keterangan maksudnya apa. format penulisan tidak sesuai (spasi, ukuran margi, dll)</li>\r\n	<li>Banyak tata bahasa yang tidak sesuai EYD.</li>\r\n	<li>Tidak ada contoh kasus</li>\r\n	<li>skor : 185 (TOLAK).&nbsp; Evaluator: Rosa Delima.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<br />\r\n&nbsp;</p>\r\n', '2021-02-25 11:23:49', 625, 'K', 39, NULL, 2656, 'Perancangan Aplikasi Gereja GPIB PNIEL Pasuruan Sebagai Media Informasi dan Buku Lagu berbasis Android', 'Perancangan Aplikasi Gereja GPIB PNIEL Pasuruan Sebagai Media Informasi dan Buku Lagu berbasis Android', '71170184', 'T', 19, 141, 'T'),
(2642, '2021-02-19 11:44:50', '<p>Metode muncul dijudul tapi tidak ada penjelasan metode dari latar belakang sampai manfaat penelitian.</p>\r\n\r\n<p>Tidak diketahui relevansi antara metode dengan permasalahan.</p>\r\n\r\n<p>Pada latar belakang tidak mencantumkan metode yang akan digunakan.</p>\r\n\r\n<p>Batasan masalah tidak jelas.</p>\r\n\r\n<p>Pada manfaat muncul kata &quot;kualitas&quot;, &quot;kemudahan&quot;, &quot;kustomisasi&quot;, bgmn cara mengukurnya?</p>\r\n\r\n<p>Apa metode/pendekatan yang digunakan?</p>\r\n\r\n<p>Tinjauan pustaka dan landasan teori sebagian besar berisi daftar istilah. Belum ada tinjauan pustaka.</p>\r\n\r\n<p>Blok diagram : hanya gambar tanpa penjelasan.</p>\r\n\r\n<p>Metode penelitian : tidak jelas, bagaimana tahapan penelitian dilakukan. Tidak ada contoh kasus</p>\r\n\r\n<p>Skor 210 (rev mayor).&nbsp; Evaluator: Rosa Delima</p>\r\n\r\n<p><br />\r\n<br />\r\n&nbsp;</p>\r\n', '2021-02-25 11:21:47', 625, 'R', 3, NULL, 2655, 'PEMBUATAN APLIKASI KUSTOM APPAREL BERBASIS WEB DENGAN MENGGUNAKAN METODE USER CENTERED DESIGN \r\n', 'PEMBUATAN APLIKASI KUSTOM APPAREL BERBASIS WEB DENGAN MENGGUNAKAN METODE USER CENTERED DESIGN \r\n', '71170237', 'T', 19, 141, 'T'),
(2643, '2021-02-19 11:58:45', '<p>Proposal ini mencoba untuk menjelaskan tentang pembangunan sebuah sistem, namun menggunakan pendekatan yang biasa digunakan dalam pembangunan desain antar muka, yaitu UCDMetode UCD, menurut saya, tidak cocok untuk diterapkan, karena pengguna dari sistem sangat luas.Penulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. kata &#39;di beritahukan&#39; harus ditulis &#39;diberitahukan&#39; karena merupakan kata berimbuhan. Sedangkan kata &#39;diatas&#39; ditulis &#39;di atas&#39; karena &#39;di&#39; di sana merupakan kata depan.<br />\r\nRumus:<br />\r\n- &quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu<br />\r\n- &quot;di/ke + kata_tempat&quot; ditulis terpisahSemua gambar, tabel, dan rumus harus memiliki label, disebutkan dalam teks, dan dijelaskan.Semua kata berbahasa asing perlu dicetak miring.Ada banyak <em>typographical error </em>di berbagai tempat. Silakan lihat catatan di proposal yang telah dinilai.Perhatikan format penulisan.Ada kalimat-kalimat yang sangat panjang, karena 1 kalimat terdiri dari banyak topik.Di beberapa tempat, proposal ini sulit dibaca, karena kalimat-kalimat yang digunakan tidak menggunakan tata cara penulisan Bahasa Indonesia yang baik dan benar. Ada banyak kalimat yang membingungkan karena kehilangan subyek, predikat, objek, atau tidak menggunakan tanda baca dengan baik.</p>\r\n\r\n<p>Latar Belakang-Permasalahan dari penelitian ini belum disebutkan dan dijelaskan.-Seberapa penting penelitian ini perlu dilakukan?-Ada banyak kesalahan ketik.<br />\r\n<br />\r\nRumusan Masalah-Permasalahan belum dijelaskan di latar belakang.-Bagian ini lebih baik ditulis dalam bentuk pernyataan dari pada pertanyaan.<br />\r\n<br />\r\nBatasan Masalah-Nomor 1, 3, dan 4 bukan batasan masalah, karena itu adalah hal yang memang akan dilakukan.-No 2 perlu dijelaskan mengapa itu menjadi batasan. Dan mengapa jumlahnya hanya 15? Mengingat pengguna dari sistem bisa siapa saja.<br />\r\n<br />\r\nTujuan penelitian-Tujuan penelitian cukup 1 saja. Yang lain kemungkinan adalah sub judul atau tahapan dalam rangka mencapai tujuan.-Yang disebutkan itu bukan tujuan penelitian, tapi lebih menjadi bagian dari &lsquo;manfaat penelitian&rsquo;.<br />\r\n<br />\r\nManfaat penelitian--<br />\r\n<br />\r\nTinjauan Pustaka-Cara penulisan perlu mengikuti standar penulisan APA Style!-Tidak perlu menyebutkan judul penelitian dalam teks.-Gunakan Bahasa Indonesia yang baik dan benar. Mohon kalimat yang sudah ditulis dibaca kembali, untuk memastikan bahwa kalimat yang ditulis bisa dimengerti dengan baik dan sesuai dengan kaidah penulisan yang baik dan benar dalam Bahasa Indonesia.<br />\r\n<br />\r\nLandasan Teori-Ada banyak kesalahan tulis.-Perhatikan penulisan sitasi untuk setiap literatur yang dicantumkan. Ikuti APA Style yang baik dan benar.-Tidak ada bagan yang menggambarkan proses UCD, yang merupakan metode utama yang akan diimplementasikan.-Kesan yang saya tangkap, bagian ini mengkopi dari tulisan yang lain. Karena tidak ada satu pun sitasi yang ada di bagian ini dicantumkan dalam Daftar Pustaka.<br />\r\n<br />\r\nBlok Diagram-Bagian ini tidak lengkap.-Diagram perlu disebutkan di teks, misalnya &quot;Gambar 1 adalah .... &quot; dan dijelaskan di dalam teks.<br />\r\n<br />\r\nMetodologi Penelitian-&quot;Dalam &#39;Metodologi Penelitian&#39;, minimal menjelaskan 3 hal, yaitu: terkait data yang digunakan, tahapan/kegiatan yang dilakukan dalam pengembangan sistem/aplikasi/penelitian, dan metode evaluasi &amp; analisis yang akan dilakukan.&quot;-Bagian ini lebih seperti &#39;landasan teori&#39; yang menjelaskan tahapan dalama UCD.-Setiap tahap dalam metodologi penelitian perlu merujuk langsung ke topik atau kasus yang dibicarakan.<br />\r\n<br />\r\nDaftar Pustaka-Masih ada penulisan literatur yang tidak mengikuti cara penulisan APA Style.-Ada banyak literatur yang disebutkan dalam teks proposal yang tidak tercantum dalam Daftar Pustaka.-Ada literatur dalam Daftar Pustaka yang tidak digunakan dalam teks proposal.</p>\r\n\r\n<p>EVALUATOR: Gloria Virginia</p>\r\n\r\n<p>SKOR: 135 (DITOLAK)</p>\r\n', '2021-03-01 13:25:17', 772, 'K', 9, NULL, 2650, 'PERANCANGAN SISTEM INFORMASI WEB PARIWISATA KABUPATEN DELI SERDANG MENGGUNAKAN METODE USER CENTERED DESIGN (UCD)', 'PERANCANGAN SISTEM INFORMASI WEB PARIWISATA KABUPATEN DELI SERDANG MENGGUNAKAN METODE USER CENTERED DESIGN (UCD)', '71160132', 'T', 13, 143, 'T'),
(2644, '2021-02-19 12:00:33', '<p>Jika sistem benar-benar dibangun, akan sangat berguna bagi mitra penelitianPenulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. kata &#39;di unduh harus ditulis &#39;diunduh&#39; karena merupakan kata berimbuhan. Sedangkan kata &#39;dikota&#39; dan &#39;diatas&#39;, ditulis &#39;di kota&#39; dan &#39;di atas&#39; karena &#39;di&#39; di sana merupakan kata depan.<br />\r\nRumus:<br />\r\n- &quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu<br />\r\n- &quot;di/ke + kata_tempat&quot; ditulis terpisahSemua gambar, tabel, dan rumus harus memiliki label, disebutkan dalam teks, dan dijelaskan.Semua kata berbahasa asing perlu dicetak miring.Laporan perlu dilengkapi dengan nomor halaman.Ada <em>typographical error </em>di beberapa tempat. Silakan lihat catatan di proposal yang telah dinilai.Perhatikan format penulisan.&quot;XP menekankan pada keterkaitan antar tim&quot; : Tim pengembang (developer team) milikmu terdiri dari siapa saja?<br />\r\n<br />\r\nLatar Belakang-Permasalahan dari penelitian ini belum disebutkan dan dijelaskan.-Seberapa penting penelitian ini perlu dilakukan?-Ada kalimat yang membingungkan.<br />\r\n<br />\r\nRumusan Masalah-Permasalahan belum dijelaskan di latar belakang.-Bagian ini lebih baik ditulis dalam bentuk pernyataan dari pada pertanyaan.<br />\r\n<br />\r\nBatasan Masalah-Beri kalimat pengantar sebelum masuk ke penomoran.-Nomor 1 &amp; 2 bukan batasan masalah karena itu adalah hal yang akan dibuat.<br />\r\n<br />\r\nTujuan penelitian-Tujuan penelitian cukup 1 saja. Yang lain kemungkinan adalah sub judul atau tahapan dalam rangka mencapai tujuan.<br />\r\n<br />\r\nManfaat penelitian-Jika hanya terdiri dari 1 hal, tidak perlu dibuat bernomor. Ditulis saja dalam bentuk paragraf.<br />\r\n<br />\r\nTinjauan Pustaka-Cara penulisan perlu mengikuti standar penulisan APA Style!-Tidak perlu menyebutkan judul penelitian dalam teks.<br />\r\n<br />\r\nLandasan Teori-Ada beberapa kesalahan tulis.-Perhatikan penulisan sitasi untuk setiap literatur yang dicantumkan. Ikuti APA Style yang baik dan benar.<br />\r\n<br />\r\nBlok Diagram-Diagram perlu dijelaskan.<br />\r\n<br />\r\nMetodologi Penelitian-Jika metode XP akan digunakan, bagaimana metode ini diimplementasikan? Tahapan dalam XP khusus untuk penelitian ini, dengan kasus GKE Imanuel Bengkayang, belum tampak di metodologi penelitian.-Tahap &#39;Maintenance&#39; tidak ada.-Hasil/output dari setiap tahapan belum didefinisikan.-Cara evaluasi perlu disesuaikan dengan &#39;rumusan masalah&#39;-Secara khusus, bagaimana cara dokumentasi akan dilakukan? Dan apa bentuk dokumentasi yang akan dihasilkan?<br />\r\n<br />\r\nDaftar Pustaka-Masih ada penulisan literatur yang tidak mengikuti cara penulisan APA Style.-Ada literatur yang digunakan di teks namun tidak dicantumkan di Daftar Pustaka.</p>\r\n\r\n<p>Evaluator: Gloria Virginia</p>\r\n\r\n<p>Skor: 185 (DITOLAK)</p>\r\n', '2021-03-01 13:23:00', 772, 'K', 19, NULL, 2657, 'PENERAPAN METODE EXTREME PROGRAMMING PADA PEMBUATAN SISTEM INFORMASI GEREJA GKE IMANUEL BENGKAYANG ', 'PENERAPAN METODE EXTREME PROGRAMMING PADA PEMBUATAN SISTEM INFORMASI GEREJA GKE IMANUEL BENGKAYANG ', '71170246', 'T', 13, 143, 'T'),
(2645, '2021-02-19 12:25:41', '<p>Agar berkonsultasi kembali dengan dosbing yang diusulkan karena banyak point ynag belum dicantumkan.</p>\r\n\r\n<p>pada proposal terutama, alur perancangan dan evaluasi serta keistimwaaan dan kebaruan dari penelitian yang akan dilakukan. setelah itu perbaiki proposal.</p>\r\n', '2021-03-12 13:18:34', 1178, 'R', 14, NULL, 2660, 'Perancangan Aplikasi Informasi Kegiatan Gereja Pantekosta di Indonesia Hagios Family Berbasis Android', 'Perancangan Aplikasi Informasi Kegiatan Gereja Pantekosta di Indonesia Hagios Family Berbasis Android', '71170178', 'Y', 3, 142, 'T'),
(2646, '2021-02-19 12:34:24', '<p>Penilaian dan komentar ini berdasarkan point-point sesuai rubrik penilaian proposal kolokium:</p>\r\n\r\n<p>1. Sudah ada layanan GoFood/GrabFood, seberapa dibutuhkan aplikasi seperti ini lagi?&nbsp;</p>\r\n\r\n<p>2. Akan baik jika juga menunjukkan gambar antarmuka saat ini.&nbsp;</p>\r\n\r\n<p>3. Batasan masalah kurang detail, ada istilah yang tidak dijelaskan (special request, additional)&nbsp;</p>\r\n\r\n<p>4. Pemaparan landasan teori kebanyakan terlalu pendek, ada yang 1 alinea 1 kalimat saja.&nbsp;</p>\r\n\r\n<p>5. Ok&nbsp;</p>\r\n\r\n<p>6. Blok diagram di sini baru blok diagram aplikasi. Sedangkan untuk penelitian belum ada.&nbsp;</p>\r\n\r\n<p>7. Desain baru yang diusulkan belum terlalu jelas. Apakah ybs memiliki latar belakang desain? Atau ada tim ahli desain yang mungkin &nbsp; akan dilibatkan?&nbsp;</p>\r\n\r\n<p>8. Ok&nbsp;</p>\r\n\r\n<p>9. Gambar diagram usahakan ukuran font besar dan tidak banyak buang-buang space. Daftar pustaka font bukan TNR?</p>\r\n\r\n<p>10. Ok</p>\r\n\r\n<p>Evaluator: Lukas.&nbsp; Skor: 300 (rev minor)</p>\r\n', '2021-03-11 20:15:38', 625, 'R', 9, NULL, 2662, 'Peningkatan Usabilitas Antarmuka Web Pemesanan Makanan Studi Kasus : E-Commerce PT KDM', 'Peningkatan Usabilitas Antarmuka Web Pemesanan Makanan Studi Kasus : E-Commerce PT KDM', '71170169', 'Y', 39, 141, 'T'),
(2647, '2021-02-19 12:36:32', '<p>Topik yang diangkat sebenarnya bagus jika dikerjakan dengan tepat dan terarah. silahkan konsul dengan dosbing/doseb dibidang tersebut.</p>\r\n\r\n<p>untuk melengkapi landasan teori yg akan digunakan dalam perancangan antar muka, contoh rancangan antar muka dan alur penelitian yang lebih rinci, setelah itu lengkapi proposalnya.</p>\r\n', '2021-02-26 09:40:58', 1178, 'R', 9, NULL, 2658, 'USER INTERFACE BERBEDA DALAM SEBUAH SMARTPHONE', 'USER INTERFACE BERBEDA DALAM SEBUAH SMARTPHONE', '71170160', 'T', 3, 142, 'T'),
(2648, '2021-02-19 12:38:03', '<p>Mohon konsultasi kembali pada calon dosbing yang dipilih dan diskusikan hal hal berikut unutk melengkapi proposal:</p>\r\n\r\n<p>Aspek design game yang akan diterapkan, rancangan kasar design game, serta metode evaluasi yagn akan dipakai selain itu. coba cari pustakan lain selain artikel internet/halaman web</p>\r\n', '2021-02-26 09:37:07', 1178, 'R', 57, NULL, 2661, 'Perancangan Game Edukasi Pengenalan Peraturan Lalu Lintas dan Etika Berkendara Berbasis HTML', 'Perancangan Game Edukasi Pengenalan Peraturan Lalu Lintas dan Etika Berkendara Berbasis HTML', '71160103', 'T', 3, 142, 'T'),
(2649, '2021-02-19 12:39:20', '<ol>\r\n	<li>Skripsi ini mirip seperti kerja praktek (level KP). Yang penting bukan pada sistem/program tapi pada penelitiannya. Metode yg digunakan apa? bagaimana dengan security? saran lebih baik ke security.</li>\r\n	<li>Sudah banyak yg menggunakan QR code? lalu bedanya apa? data apa yg diperlukan untuk membangun sistem ini?</li>\r\n	<li>Sumber referensinya belum ditulis pada teks / proposal.&nbsp; Ini penting agar tidak plagiarisme.</li>\r\n	<li>Waterfall sdh sangat banyak digunakan, gunakan metode lain.&nbsp; Bisa konsultas dengan dosen RPL.</li>\r\n	<li>Feferensi menggunakan APA, diurutkan berdasarkan abjad.</li>\r\n	<li>Silahkan diperbaiki untuk periode 2.</li>\r\n	<li>Skor 170 (tolak)<br />\r\n	&nbsp;</li>\r\n</ol>\r\n', '2021-02-25 10:01:25', 625, 'K', 10, NULL, 2663, 'PERANCANGAN SISTEM PRESENSI KELAS      BERBASIS WEB SMP NEGRI 1 HALMAHERA UTARA MENGGUNAKAN QR CODE', 'PERANCANGAN SISTEM PRESENSI KELAS BERBASIS WEB SMP NEGRI 1 HALMAHERA UTARA MENGGUNAKAN QR CODE', '71160054', 'T', 17, 141, 'T'),
(2650, '2021-02-19 12:41:09', '<ol>\r\n	<li>Idenya boleh digunakan, tapi cara menuliskan konsep, ide, dan pembahasannya di proposalnya masih sangat kurang.</li>\r\n	<li>Bagaimana perancangan pembuatan gamenya? RPG seperti apa? Hrs dituliskan: rancangan karakternya, model permainannya secara lengkap agar pembaca jelas.&nbsp; Mata pelajaran yang akan digunakan apa?</li>\r\n	<li>Bagaimana mengevaluasi sistemnya setelah jadi? Sebaiknya pakai perbandingan antara yg tidak pakai game itu dengan yg pakai game itu dalam pembelajaran, Apakah ada peningkatan pembealjaran?</li>\r\n	<li>bagaiamana teknis struktur datanya? basis datanya? rancangan pertanyaan untuk pembelajaran?</li>\r\n	<li>Dasar teori dan tinjauan pustaka masih sangat kurang, Bukan cuma pengertian tapi seperti anda membuat sub bab di buku, harus ada penjelasan-penjelasan setiap sub topik.</li>\r\n	<li>Skor 205 (rev mayor)</li>\r\n	<li>Evaluator: Anton<br />\r\n	&nbsp;</li>\r\n</ol>\r\n', '2021-02-25 10:04:57', 625, 'R', 57, NULL, 2665, 'Gamifikasi Permainan Role-Playing Game Edukasi Sejarah Siswa Sekolah Dasar Berbasis Rule Based System', 'Gamifikasi Permainan Role-Playing Game Edukasi Sejarah Siswa Sekolah Dasar Berbasis Rule Based System', '71170194', 'T', 17, 141, 'T'),
(2651, '2021-02-19 12:42:29', '<p>Belum adanya tinjauan pustaka yang mendasari penelitian ini, sehingga belum terlihat pengembangan apa yang akan didapatkan dari proses penelitian ini.</p>\r\n\r\n<p>Pada proposal belum dijelaskan bagaimana metodologi penelitian dapat dilakukan untuk mencapai tujuan penelitian yang ditulis pada BAB 1</p>\r\n\r\n<p>Proposal masih belum dapat menjelaskan secara detail apa yang ingin dilakukan dan dikerjakan, dan pemahaman terkait lingkup penelitian masih kurang, terlihat dari apa yang dituliskan masih kurang</p>\r\n\r\n<p>skor 185 (tolak).&nbsp; Ev: Kuncoro</p>\r\n', '2021-02-27 10:40:24', 625, 'K', 33, NULL, 2664, 'Implementasi Dan Analisis Keamanan jaringan Menggunakan Protokol Voip (Voice Internet Protocol) Call Private Network Dan VPN Untuk Keamanan Antar Client', 'Implementasi Dan Analisis Keamanan jaringan Menggunakan Protokol Voip (Voice Internet Protocol) Call Private Network Dan VPN Untuk Keamanan Antar Client', '71170208', 'T', 53, 143, 'T'),
(2652, '2021-02-19 12:45:13', '<p>Proposal ini mencoba untuk menjelaskan tentang pembangunan sebuah sistem, namun menggunakan pendekatan yang biasa digunakan dalam pembangunan desain antar muka, yaitu UCDPenulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. kata &#39;di beritahukan&#39; harus ditulis &#39;diberitahukan&#39; karena merupakan kata berimbuhan. Sedangkan kata &#39;dibidang&#39;, &#39;diperusahaan&#39;, &#39;diwebsite&#39;, &#39;diatas&#39;, dan &#39;dibagian&#39; ditulis &#39;di bidang&#39;, &#39;di perusahaan&#39;, &#39;di website&#39;, &#39;di atas&#39;, dan &#39;di bagian&#39; karena &#39;di&#39; di sana merupakan kata depan.<br />\r\nRumus:<br />\r\n- &quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu<br />\r\n- &quot;di/ke + kata_tempat&quot; ditulis terpisahSemua gambar, tabel, dan rumus harus memiliki label, disebutkan dalam teks, dan dijelaskan.Semua kata berbahasa asing perlu dicetak miring.Ada <em>typographical error </em>di beberapa tempat. Silakan lihat catatan di proposal yang telah dinilai.Perhatikan format penulisan.Ada kalimat-kalimat yang sangat panjang, karena 1 kalimat terdiri dari banyak topik.Di beberapa tempat, proposal ini sulit dibaca, karena kalimat-kalimat yang digunakan tidak menggunakan tata cara penulisan Bahasa Indonesia yang baik dan benar. Ada banyak kalimat yang membingungkan karena kehilangan subyek, predikat, objek, atau tidak menggunakan tanda baca dengan baik.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Latar Belakang-Permasalahan dari penelitian ini belum disebutkan dan dijelaskan.-Seberapa penting penelitian ini perlu dilakukan?-Ada kalimat yang sangat membingungkan.<br />\r\n<br />\r\nRumusan Masalah-Permasalahan belum dijelaskan di latar belakang.-Bagian ini lebih baik ditulis dalam bentuk pernyataan dari pada pertanyaan.-Jawaban pertanyaan No. 1 adalah isi dari Latar Belakang Masalah.<br />\r\n<br />\r\nBatasan Masalah-Nomor 1 &amp; 3 bukan batasan masalah. Itu lebih menjadi bagian dari &#39;manfaat aplikasi yang dikembangkan&#39;.-No 2 perlu dijelaskan mengapa itu menjadi batasan.<br />\r\n<br />\r\nTujuan penelitian-Tujuan penelitian cukup 1 saja. Yang lain kemungkinan adalah sub judul atau tahapan dalam rangka mencapai tujuan.-Yang disebutkan itu bukan tujuan penelitian, tapi lebih menjadi bagian dari &lsquo;manfaat penelitian&rsquo;.<br />\r\n<br />\r\nManfaat penelitian--<br />\r\n<br />\r\nTinjauan Pustaka-Cara penulisan perlu mengikuti standar penulisan APA Style!-Tidak perlu menyebutkan judul penelitian dalam teks.-Gunakan Bahasa Indonesia yang baik dan benar. Mohon kalimat yang sudah ditulis dibaca kembali, untuk memastikan bahwa kalimat yang ditulis bisa dimengerti dengan baik dan sesuai dengan kaidah penulisan yang baik dan benar dalam Bahasa Indonesia.<br />\r\n<br />\r\nLandasan Teori-Ada beberapa kesalahan tulis.-Perhatikan penulisan sitasi untuk setiap literatur yang dicantumkan. Ikuti APA Style yang baik dan benar.-Tidak ada bagan yang menggambarkan proses UCD, yang merupakan metode utama yang akan diimplementasikan.<br />\r\n<br />\r\nBlok Diagram-Bagian ini tidak ada di proposal.<br />\r\n<br />\r\nMetodologi Penelitian-Diagram perlu disebutkan di teks, misalnya &quot;Gambar 1 adalah .... &quot;.-Tabel di halaman 14 itu tabel apa? Tidak ada label dan keterangannya.-Semua gambar, tabel, dan rumus harus memiliki label, disebutkan dalam teks, dan dijelaskan.-&quot;Dalam &#39;Metodologi Penelitian&#39;, minimal menjelaskan 3 hal, yaitu: terkait data yang digunakan, tahapan/kegiatan yang dilakukan dalam pengembangan sistem/aplikasi/penelitian, dan metode evaluasi &amp; analisis yang akan dilakukan.&quot;-Setiap tahap dalam metodologi penelitian perlu merujuk langsung ke topik atau kasus yang dibicarakan.<br />\r\n<br />\r\nDaftar Pustaka-Masih ada penulisan literatur yang tidak mengikuti cara penulisan APA Style.-Ada literatur yang disebutkan dalam teks proposal yang tidak tercantum dalam Daftar Pustaka.-Ada literatur dalam Daftar Pustaka yang tidak digunakan dalam teks proposal.</p>\r\n\r\n<p>EVALUATOR: Gloria Virginia</p>\r\n\r\n<p>SKOR: 125 (DITOLAK)</p>\r\n', '2021-03-01 13:24:08', 772, 'K', 50, NULL, 2667, 'PERANCANGAN SISTEM INFORMASI WEBSITE GEREJA MENGGUNAKAN METODE USER CENTERED DESIGN (STUDI KASUS: GEREJA KRISTEN TUHAN INDONESIA BATU PENJURU NGABANG)', 'PERANCANGAN SISTEM INFORMASI WEBSITE GEREJA MENGGUNAKAN METODE USER CENTERED DESIGN (STUDI KASUS: GEREJA KRISTEN TUHAN INDONESIA BATU PENJURU NGABANG)', '71160133', 'T', 13, 143, 'T'),
(2653, '2021-02-19 12:46:19', '<p>Tinjauan pustakan dideskripsikan tidak hanya tabel saja, lalu tunjukan kebaruan dan apa yang akan dilakukan dalam penelitian</p>\r\n\r\n<p>Penulisan sumber penelitian diperbaiki, karena ada sumber yang berlum di reference pada paragraf, tetapi ada pada daftar pustaka</p>\r\n\r\n<p>Bagaimana proses untuk mendapatkan informasi yang dibutuhkan oleh pengguna sistem atau aplikasi ini, masih perlu diperjelas.</p>\r\n\r\n<p>Skor 300 (rev minor).&nbsp; Ev: Kuncoro</p>\r\n', '2021-02-27 10:41:14', 625, 'R', 15, NULL, 2659, 'PERANCANGAN & PEMBANGUNAN FORUM DISKUSI MUSIC PRODUCTION & AUDIO ENGINEERING PADA JOGJA AUDIO SCHOOL', 'PERANCANGAN & PEMBANGUNAN FORUM DISKUSI MUSIC PRODUCTION & AUDIO ENGINEERING PADA JOGJA AUDIO SCHOOL', '71150131', 'T', 53, 143, 'T'),
(2654, '2021-02-19 12:49:03', '<p>1. Jika melakukan klasifikasi,maka sebaiknyaukuran evaluasinya adalah presisi, recall dan F-score</p>\r\n\r\n<p>2. Judul proposal menekankan ke fitur lagu, namun dalam isi proposal belummenunjukkan fitur apa yang akan digunakan untuk melakukan pencarian, pembobotan fitur juga belum dijelaskan.</p>\r\n\r\n<p>3. Skor 270 (rev mayor).&nbsp; Evaluator: Lucia Dwi</p>\r\n', '2021-03-12 13:07:59', 625, 'R', 39, NULL, 2668, 'FITUR KATEGORISASI LAGU LITURGI KATOLIK BERDASARKAN ANALISIS LIRIK LAGU', 'FITUR KATEGORISASI LAGU LITURGI KATOLIK BERDASARKAN ANALISIS LIRIK LAGU', '71160115', 'Y', 12, 141, 'T'),
(2655, '2021-02-19 13:20:50', '<p>- batasan masalah yang benar hanya 2 point terakhir, sisanya bukan batasan masalah - landasan teori masih kurang, sensor sensor yang akan dipakai seharusnya ada di landasan teori, kemudian bahas juga mengenai library yang akan dipakai di landasan teori.</p>\r\n\r\n<p>- blok diagram sistem perlu dijelaskan, tidak hanya gambar saja</p>\r\n\r\n<p>- pada bagian blok diagram sistem perlu dibahas juga mengenai skala implementasi yang akan dilakukan, ada beberapa sawah dan bada beberapa pintu irigasi yang akan dibuat? apakah hanya 1 pintu?</p>\r\n\r\n<p>- Pada bagian blok diagram perlu ditambahkan mengenai arsitektur sistem ayng akan dikembangkan. ada berapa device? ada berapa aplikasi? apa protokol komunikasi antara device IoT dengan aplikasi android?</p>\r\n', '2021-02-26 10:45:17', 1178, 'R', 53, NULL, 2654, 'PROTOTYPE SISTEM MONITORING IRIGASI SAWAH BERBASIS INTERNET OF THINGS DENGAN MENGGUNAKAN NODEMCU ESP8266', 'PROTOTYPE SISTEM MONITORING IRIGASI SAWAH BERBASIS INTERNET OF THINGS DENGAN MENGGUNAKAN NODEMCU ESP8266', '71170226', 'T', 2, 142, 'T'),
(2656, '2021-02-19 13:22:37', '<p>- dari latar belakang masalah tidak ada hubungan antara kebutuhan dashboard dengan situasi yang ada di balai PMD. lebih tepat jika dibutuhkan aplikasi pencatatan kegiatan bukan dashboard.</p>\r\n\r\n<p>- tinjauan pustaka masih sangat kurang sekali, tidak ada pembahasan mengenai penelitian sejenis, padahal penelitian tentnang dashboartd sudah banyak sekali, apa beda dnegnan yang akan dilakukan?</p>\r\n\r\n<p>- metodologi penelitian belum selesai, baru apda tahap pengumpulan data studi literatur. setelah itu akan melakukan apa?</p>\r\n\r\n<p>- landasan teori sangat kurang sekali, hanya berisi satu kalimat saja untuk menjelaskan dashboard?</p>\r\n\r\n<p>- daftar psitaka masih mengaju pada sumber blogspot, seharusnya mengambil dari sumber yang lebih valid</p>\r\n', '2021-02-26 10:47:51', 1178, 'K', 13, NULL, 2651, 'Dashboard Pengelolaan Data Pelatihan di Balai PMD Yogyakarta Kemendagri', 'Dashboard Pengelolaan Data Pelatihan di Balai PMD Yogyakarta Kemendagri', '71170235', 'T', 2, 142, 'T'),
(2657, '2021-02-19 13:25:24', '<p>- Daftar pustaka kurang, tertutama mengenai dashboard. pelu dijelaskan berbagai mecam dashboard dan penelitian ini akan menggunakan dashboard yang mana/</p>\r\n\r\n<p>- perlu memberikan contoh tampilan dasjboard yang akan dibuat seperti apa, kemudian data apa saja yang akan ditampilkan.</p>\r\n\r\n<p>- Perlu menambahkan beberapa refrensi mengenai dashboard data tingkat kemiskinan yang sudah ada. (milik pemerintah daerah dan swasta sudah ada yang punya dashboard seperti ini), apa beda dengan yang dibuat?</p>\r\n\r\n<p>- Contoh kasus bisa ditambahkan contoh beberapa data yang relevan dan ditampilkan juga proses pengelolaan data akan seperti apa, sehingga bisa memberikan gambaran yang lebih jelas</p>\r\n\r\n<p>- batasan masalah salah, yang anda tuliskan bukan batasan masalah.</p>\r\n', '2021-02-26 10:38:13', 1178, 'R', 15, NULL, 2642, 'IMPLEMENTASI DATA WAREHOUSE UNTUK ANALISIS TINGKAT KEMISKINAN DI YOGYAKARTA', 'IMPLEMENTASI DATA WAREHOUSE UNTUK ANALISIS TINGKAT KEMISKINAN DI YOGYAKARTA', '71170179', 'T', 2, 142, 'T');
