(2658, '2021-02-19 13:28:29', '<p>1. Rumusan masalah pada penelitian ini tidak tepat sebaiknya diganti spy lebih kongkrit</p>\r\n\r\n<p>2.Dalam proposal belum disebutkan proses evaluasinya akan dilakukan berapa kali</p>\r\n\r\n<p>3.Sebaiknya disebutkan siapa responden dan berapa banyak yang digunakan untuk wawancara</p>\r\n\r\n<p>4. Perlu dijelaskan lebih detail tentang Metode UCD dan teori yang berhubungan dengan itu</p>\r\n\r\n<p>5. Perlu diberikan contoh kongkrit yang sederhana untuk aplikasi perhitungannya</p>\r\n\r\n<p>6.Berkan daftar metodologi yang digunakan untuk memodelkan dan mengevaluasi sistem</p>\r\n\r\n<p>7. Judul perlu diubah menjadi PEMBUATAN SISTEM INFORMASI DINAS PERTANIAN DAN PERIKANAN MELAWI DENGAN</p>\r\n\r\n<p>8. Kesannya judulnya hanya merancang saja tidak ada membuat</p>\r\n\r\n<p>Evaluator: Gunawan.&nbsp; Skor : 210 (rev mayor)</p>\r\n', '2021-03-29 10:42:34', 625, 'R', 50, NULL, 2666, 'RANCANGAN SISTEM INFORMASI DINAS PERTANIAN DAN PERIKANAN MELAWI DENGAN METODE USER CENTERED DESIGN', 'RANCANGAN SISTEM INFORMASI DINAS PERTANIAN DAN PERIKANAN MELAWI DENGAN METODE USER CENTERED DESIGN', '71170228', 'T', 16, 141, 'T'),
(2659, '2021-02-19 13:50:16', '<p>tidak ada proposal yang dibuat, masih berupa template.</p>\r\n\r\n<p>skor: 100 (tolak)</p>\r\n', '2021-02-25 09:47:51', 625, 'K', 16, NULL, 2669, '-', '-', '71150118', 'T', 17, 141, 'T'),
(2660, '2021-02-19 13:53:59', '<p>- UNtuk memperkuat argumentasi pentingnya dibuat aplikasi penjadwalan anak berkebutuhakn khusus dapat disertakan bukti (data/refrensi) pendukung</p>\r\n\r\n<p>- Batasan masalah bukan penjelasan subjek penelitian maupun spesifikasi program</p>\r\n\r\n<p>- Karena pendekatan perancangan menggunakan UCD, maka sebaiknya metodologinya disesuaikan sesuai dengan tahapan tahapan UCD</p>\r\n', '2021-02-26 10:09:48', 1178, 'R', 50, NULL, 2670, 'PERANCANGAN APLIKASI PENJADWALAN KEGIATAN\r\nUNTUK ANAK BERKEBUTUHAN KHUSUS \r\nDAN ORANG TUA\r\n', 'PERANCANGAN APLIKASI PENJADWALAN KEGIATAN\r\nUNTUK ANAK BERKEBUTUHAN KHUSUS \r\nDAN ORANG TUA\r\n', '71170186', 'T', 9, 142, 'T'),
(2661, '2021-02-19 13:55:42', '<p>Tinjauan pustaka masih perlu ditambahkan sebagai referensi dalam pelaksanaan pembuatan dashboard dan bentuk2 pengujian yang dapat digunakan untuk melakukan validasi hasil yang didaptakan</p>\r\n\r\n<p>skor 310 rev minor.&nbsp; Ev: Kuncoro</p>\r\n', '2021-03-12 14:36:41', 625, 'R', 13, NULL, 2672, 'PEMBUATAN DASHBORD SEBAGAI INFORMASI PENILAIAN KINERJA KARYAWAN PERUSAHAAN\r\nCV ANDI GLOBAL SOFT', 'PEMBUATAN DASHBORD SEBAGAI INFORMASI PENILAIAN KINERJA KARYAWAN PERUSAHAAN\r\nCV ANDI GLOBAL SOFT', '71170200', 'Y', 53, 143, 'T'),
(2662, '2021-02-19 13:57:21', '<ul>\r\n	<li>Perlu dipastikan ulang daftar pustaka dan sitasi pada teks</li>\r\n	<li>Belum adanya landasan teori yang mendukung</li>\r\n	<li>Use case diagram dan rancangan ERD perlu diperbaiki ulang</li>\r\n	<li>Perlu ada evaluasi awal tentang kebutuhan dari jemaat HKBP Dame Duri</li>\r\n	<li>Skor 200, rev mayor. Ev: Willy SR</li>\r\n</ul>\r\n', '2021-03-12 12:07:10', 625, 'R', 17, NULL, 2671, 'RANCANG BANGUN ANTARMUKA WEBSITE GEREJA HKBP DAME DENGAN METODE USER CENTERED DESIGN', 'RANCANG BANGUN ANTARMUKA WEBSITE GEREJA HKBP DAME DENGAN METODE USER CENTERED DESIGN', '71160089', 'Y', 15, 143, 'T'),
(2663, '2021-02-19 14:06:15', '<ul>\r\n	<li>Penomoran tabel dan formula perlu disesuaikan format penulisan yang baku</li>\r\n	<li>Perlu diperbanyak jurnal yang usianya kurang dari 10 tahun</li>\r\n	<li>Skor: 285, rev mayor. EV: Willy SR</li>\r\n</ul>\r\n', '2021-02-27 10:36:55', 625, 'R', 3, NULL, 2673, 'SISTEM PENDUKUNG KEPUTUSAN DALAM PENENTUAN PEMBELIAN RUMAH ATAU LAHAN DI AREA YOGYAKARTA', 'SISTEM PENDUKUNG KEPUTUSAN DALAM PENENTUAN PEMBELIAN RUMAH ATAU LAHAN DI AREA YOGYAKARTA', '71160127', 'T', 15, 143, 'T'),
(2664, '2021-02-19 14:20:56', '<p>- Topik tidak ada hal yang baru. Coba gali dengan penambahan fitur yang unik/fresh. - Dengan mengulik kebutuhan fitur khusus, latar belakang bisa lebih menarik.&nbsp;</p>\r\n\r\n<p>- Landasan teori terlalu pendek/kurang detail.&nbsp;</p>\r\n\r\n<p>- Blok diagram penelitian tidak ada, blok diagram aplikasi terlalu sederhana.&nbsp;</p>\r\n\r\n<p>- Metodologi penelitian kok malah cerita landasan teori, mestinya cerita detail langkah-langkah penelitian&nbsp; yang akan dilakukan&nbsp;</p>\r\n\r\n<p>- Typo dicek lagi. Kata ulang tidak dispasi (cek-cek).</p>\r\n\r\n<p>- Skor 250 (rev mayor).&nbsp; Evaluator: Lukas.</p>\r\n', '2021-02-25 10:40:40', 625, 'R', 9, NULL, 2674, 'METODE RAPID APPLICATION DEVELOPMENT DAN FRAMEWORK BOOTSRAP DALAM PEMBUATAN SISTEM INFORMASI PERPUSTAKAAN BERBASIS WEB (STUDI SD N 027 TANJUNG SELOR)\r\n', 'METODE RAPID APPLICATION DEVELOPMENT DAN FRAMEWORK BOOTSRAP DALAM PEMBUATAN SISTEM INFORMASI PERPUSTAKAAN BERBASIS WEB (STUDI SD N 027 TANJUNG SELOR)\r\n', '71160027', 'T', 39, 141, 'T'),
(2665, '2021-02-19 14:38:50', '<p>Proposal jauh dari kata selesai, masih banyak sekali bagian yang kosong tidak bisa saya nilai.</p>\r\n', '2021-02-26 09:50:07', 1178, 'K', 54, NULL, 2675, 'PERANCANGAN APLIKASI AGENDA KEGIATAN MAHASISWA DENGAN FITUR PUSH NOTIFICATION DAN REMINDER BERBASIS ANDROID', 'PERANCANGAN APLIKASI AGENDA KEGIATAN MAHASISWA DENGAN FITUR PUSH NOTIFICATION DAN REMINDER BERBASIS ANDROID', '71170210', 'T', 50, 142, 'T'),
(2666, '2021-02-19 14:41:05', '<p>- Topik OK namun agak kedodoran dalam perumusan masalah, batasan, tujuan dan manfaat penelitian.</p>\r\n\r\n<p>- Ada dashboard mestinya ada laman input data. Apakah hanya via GSheet? Berarti ada admin atau&nbsp; ada aplikasi utk grab data dari GSheet?&nbsp;&nbsp;</p>\r\n\r\n<p>- Adakah KPI?&nbsp;</p>\r\n\r\n<p>- Layout agak berantakan</p>\r\n\r\n<p>- Skor 345 (rev minor).&nbsp; Evaluator: Lukas.</p>\r\n', '2021-03-12 14:41:19', 625, 'R', 9, NULL, 2677, 'OPTIMASI MONITORING DAN ANALISIS KINERJA PERUSAHAAN MENGGUNAKAN DASHBOARD (STUDI KASUS: PT. ALFAOMEGA SEHATI MITRA)', 'OPTIMASI MONITORING DAN ANALISIS KINERJA PERUSAHAAN MENGGUNAKAN DASHBOARD (STUDI KASUS: PT. ALFAOMEGA SEHATI MITRA)', '71170162', 'Y', 39, 141, 'T'),
(2667, '2021-02-19 15:12:03', '<p>1. Penulisan sumber pustaka di daftar pustaka belum sesuai dengan gaya selingkung APA yang ditentukan Prodi INF (tdk ada nama penulis), sumber referensidari jurnal dan prosiding tidak ada.</p>\r\n\r\n<p>2. Objek AR yang akan diintegrasikan dengan gamebelum jelas.</p>\r\n\r\n<p>3. Sistematika penulisanjuga masih belum tepat, khususnya untuk subbahasan block diagram. Landasan teori hanya berisi definisi-definisidan sangat superfisial sekali.</p>\r\n\r\n<p>4. Block diagram belum menggambarkan proses pembangunan sistem, integrasi A star dgn Ar di game</p>\r\n\r\n<p>5. Skor 205 (rev mayor).&nbsp; Evaluator: Lucia Dwi</p>\r\n', '2021-02-25 19:20:01', 625, 'R', 3, NULL, 2678, 'PENGEMBANGAN BOT GIM PENGUMPUL ASTEROID AUGMENTED REALITY INSTAGRAM BERBASIS ALGORITMA A STAR ', 'PENGEMBANGAN BOT GIM PENGUMPUL ASTEROID AUGMENTED REALITY INSTAGRAM BERBASIS ALGORITMA A STAR ', '71150033', 'T', 12, 141, 'T'),
(2668, '2021-02-19 16:00:07', '<p>1. landasan teori hal 8-12 menunjukkan ada indikasi CoPas dan plagiasi, yang tidak mencantumkan sumbernya.</p>\r\n\r\n<p>2. Belum ada penjelasan tentang pemetaan antara bagian proposal, peran pengguna, penulis ke desain antarmuka,dan perkiraan menu yang dibutuhkan dalam kolaborasi penulisan proposal.</p>\r\n\r\n<p>3. skor 240 (rev mayor).&nbsp; Evaluator: Lucia Dwi</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2021-02-25 19:23:25', 625, 'R', 9, NULL, 2640, 'ANALISIS DAN PERANCANGAN APLIKASI WEBSITE \r\nE-PROPOSAL DENGAN MENGGUNAKAN METODE HEURISTIC EVALUATION DAN WEBUSE\r\n', 'ANALISIS DAN PERANCANGAN APLIKASI WEBSITE E-PROPOSAL DENGAN MENGGUNAKAN METODE HEURISTIC EVALUATION DAN WEBUSE\r\n', '71170211', 'T', 12, 141, 'T'),
