(2680, '2021-03-12 14:41:19', '<p>OK</p>\r\n', '2021-03-16 08:25:53', 625, 'T', 9, 39, 2691, 'OPTIMASI MONITORING DAN ANALISIS KINERJA PERUSAHAAN MENGGUNAKAN DASHBOARD (STUDI KASUS: PT. ALFAOMEGA SEHATI MITRA)', 'OPTIMASI MONITORING DAN ANALISIS KINERJA PERUSAHAAN MENGGUNAKAN DASHBOARD (STUDI KASUS: PT. ALFAOMEGA SEHATI MITRA)', '71170162', 'T', 17, 145, 'T'),
(2682, '2021-03-29 10:46:48', '<ul>\r\n	<li>Pendahuluan: belum ada sama sekali ttg referensi penelitian sejenis sebelumnya. Apa kamu satu-satunya yg meneliti seperti ini?</li>\r\n	<li>Mengapa harus menggunakan REST? Intinya harus ada penjelasan di pendahuluan, termasuk metode pengembangannya gimana? Metode apa? Pengujianya apa? Jelaskan juga</li>\r\n	<li>Apa bedanya dengan sistem pengelola restoran/kopi lainnya?harus dijelaskan</li>\r\n	<li>Tinjauan pustaka terdiri: referensi 3 jurnal, sedangkan landasarn teori terdiri dari teori dari buku. Urutannya: tinjauan pustaka dulu baru teori</li>\r\n	<li>Teorinya berisi: metode pengembangan sistemnya pakai apa? Trus web services REST, black box testing</li>\r\n	<li>Daftar pustaka dan sitasi menggunakan APA, hrs diurutkan berdasarkan abjad pengarang</li>\r\n	<li>SKOR: 250 REV MAYOR</li>\r\n	<li>EV: ANTON</li>\r\n</ul>\r\n', '2021-04-23 12:01:31', 625, 'R', 8, NULL, 2695, 'PENGEMBANGAN BACKEND PADA APLIKSASI MEMBERSHIP KEDAI KOPI MELCOSH', 'PENGEMBANGAN BACKEND PADA APLIKSASI MEMBERSHIP KEDAI KOPI MELCOSH', '71170184', 'Y', 17, 146, 'T'),
(2683, '2021-03-29 10:46:59', '<p>Skor: 200<br />\r\nEvaluator: Kristian Adi Nugraha, S.Kom., M.T.</p>\r\n\r\n<p>- Tata bahasa sangat berantakan seperti kata sambung tidak boleh di depan, serta gunakan bahasa baku / formal, dll, tolong diperbaiki. Formating juga kacau, spasi tidak sama, banyak space kosong, dll.</p>\r\n\r\n<p>- Apa kelebihan aplikasi ini dibandingkan dengan aplikasi&nbsp; yang sudah ada seperti aplikasi reminder, Google Calendar dan sejenisnya? Karena saya lihat tujuannya sama</p>\r\n\r\n<p>- Tinjauan pustaka tidak berhubungan dengan apa yang akan diteliti</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2021-04-23 11:33:23', 636, 'R', 9, NULL, 2694, 'PERANCANGAN APLIKASI AGENDA KEGIATAN DENGAN FITUR PUSH NOTIFICATION DAN REMINDER BERBASIS ANDROID (Studi Kasus: Gereja Katholik Maria Assumpta)', 'PERANCANGAN APLIKASI AGENDA KEGIATAN DENGAN FITUR PUSH NOTIFICATION DAN REMINDER BERBASIS ANDROID (Studi Kasus: Gereja Katholik Maria Assumpta)', '71170210', 'Y', 50, 147, 'T'),
(2684, '2021-03-29 11:27:53', '<p>Tanggapan umum:</p>\r\n\r\n<p>-Topik dan judul proposal ini sama persis dengan topik dan judul proposal pada DE1.<br />\r\n-Ada banyak kesalahan di DE1 yang tidak diperbaiki.<br />\r\n-Proposal ini mencoba untuk menjelaskan tentang pembangunan sebuah sistem, namun menggunakan pendekatan yang biasa digunakan dalam pembangunan desain antar muka, yaitu UCD.<br />\r\n-Tidak ada Daftar Isi.<br />\r\n-Penulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. kata &#39;di beritahukan&#39; harus ditulis &#39;diberitahukan&#39; karena merupakan kata berimbuhan. Sedangkan kata &#39;dibidang&#39;, &#39;diperusahaan&#39;, &#39;diwebsite&#39;, &#39;diatas&#39;, dan &#39;dibagian&#39; ditulis &#39;di bidang&#39;, &#39;di perusahaan&#39;, &#39;di website&#39;, &#39;di atas&#39;, dan &#39;di bagian&#39; karena &#39;di&#39; di sana merupakan kata depan.<br />\r\nRumus:<br />\r\n- &quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu<br />\r\n- &quot;di/ke + kata_tempat&quot; ditulis terpisah<br />\r\n-Semua gambar, tabel, dan rumus harus memiliki label, disebutkan dalam teks, dan dijelaskan.<br />\r\n-Semua kata berbahasa asing perlu dicetak miring.<br />\r\n-Ada <em>typographical error </em>di beberapa tempat. Silakan lihat catatan di proposal yang telah dinilai.<br />\r\n-Perhatikan format penulisan.<br />\r\n-Ada kalimat-kalimat yang sangat panjang, karena 1 kalimat terdiri dari banyak topik.<br />\r\n-Di beberapa tempat, proposal ini sulit dibaca, karena kalimat-kalimat yang digunakan tidak menggunakan tata cara penulisan Bahasa Indonesia yang baik dan benar. Ada banyak kalimat yang membingungkan karena kehilangan subyek, predikat, objek, atau tidak menggunakan tanda baca dengan baik.<br />\r\n<br />\r\nTanggapan khusus:</p>\r\n\r\n<p>1.Latar Belakang<br />\r\n-Perlu ditambahkan data atau dikaitkan dengan literatur hasil penelitian yang pernah dilakukan<br />\r\n-Ada beberapa kesalahan ketik.<br />\r\n<br />\r\n2.Rumusan Masalah<br />\r\n--<br />\r\n<br />\r\n3.Batasan Masalah<br />\r\n-Perlu dijelaskan alasan pemilihan setiap batasan masalah yang disebutkan.<br />\r\n<br />\r\n4.Tujuan penelitian<br />\r\n-Pernyataan &#39;... yang dapat membantu jemaat-jemaat dan pengurus gereja.&quot; maksudnya bagaimana? Pernyataan ini tidak jelas, sehingga ukurannya (bahwa jemaat dan pengurus gereja dibantu) juga jadi tidak jelas.<br />\r\n<br />\r\n5.Manfaat penelitian<br />\r\n--<br />\r\n<br />\r\n6.Tinjauan Pustaka<br />\r\n-Bagian ini masih serupa dengan proposal di DE1. Kesalahan yang sama, diulangi lagi di DE1.<br />\r\n-Cara penulisan perlu mengikuti standar penulisan APA Style!<br />\r\n-Tidak perlu menyebutkan judul penelitian dalam teks.<br />\r\n<br />\r\n7.Landasan Teori<br />\r\n-Kesan yang saya tangkap, bagian ini banyak mengkopi dari tulisan lain. Karena, ada beberapa literatur yang terncantum di teks tapi tidak ada di Daftar Pustaka.<br />\r\n-Ada beberapa kesalahan tulis.<br />\r\n-Perhatikan penulisan sitasi untuk setiap literatur yang dicantumkan. Ikuti APA Style yang baik dan benar.<br />\r\n-Kesalahan yang dilakukan di proposal DE1 masih banyak dilakukan di proposal DE2 ini.<br />\r\n<br />\r\n8.Blok Diagram<br />\r\n-Diagram perlu disebutkan di teks, misalnya &quot;Gambar 3 adalah .... &quot;.<br />\r\n-Semua gambar, tabel, dan rumus harus memiliki label, disebutkan dalam teks, dan dijelaskan.<br />\r\n<br />\r\n9.Metodologi Penelitian<br />\r\n-Bagian ini tidak ada di proposal.<br />\r\n-&quot;Dalam &#39;Metodologi Penelitian&#39;, minimal menjelaskan 3 hal, yaitu: terkait data yang digunakan, tahapan/kegiatan yang dilakukan dalam pengembangan sistem/aplikasi/penelitian, dan metode evaluasi &amp; analisis yang akan dilakukan.&quot;<br />\r\n-Setiap tahap dalam metodologi penelitian perlu merujuk langsung ke topik atau kasus yang dibicarakan. Apa yang akan Anda lakukan?<br />\r\n<br />\r\n10.Daftar Pustaka<br />\r\n-Masih ada penulisan literatur yang tidak mengikuti cara penulisan APA Style.<br />\r\n-Ada literatur yang disebutkan dalam teks proposal yang tidak tercantum dalam Daftar Pustaka.</p>\r\n\r\n<p>SKOR 180 TOLAK</p>\r\n\r\n<p>EV: GLORIA VIRGINIA</p>\r\n', '2021-04-12 13:56:56', 625, 'K', 50, NULL, 2696, 'PERANCANGAN SISTEM INFORMASI WEBSITE GEREJA MENGGUNAKAN METODE USER CENTERED DESIGN (STUDI KASUS: GEREJA KRISTUS TUHAN INDONESIA BATU PENJURU NGABANG)', 'PERANCANGAN SISTEM INFORMASI WEBSITE GEREJA MENGGUNAKAN METODE USER CENTERED DESIGN (STUDI KASUS: GEREJA KRISTUS TUHAN INDONESIA BATU PENJURU NGABANG)', '71160133', 'T', 13, 146, 'T'),
(2685, '2021-03-29 11:29:56', '<p>- Sumber data dan format data operasional masih belum jelas, padahal jika ini tidak tersedia tidak akan dapat selesai skripsi ini. Jika data sumbernya dalam bentuk satu tabel statistik dari BPS misalnya, menjadi pertanyaan adalah dimensi seberapa komplek, dimensi waktu pasti sangatlah terbatas, dsb.<br />\r\n- Perlu dipertimbangkan juga KPI yang juga masih belum disampaikan, karena ini menjadi dasar penting untuk mempertimbangkan bentuk struktur dashboard.<br />\r\n- OLAP yang akan digunakan untuk menjawab kebutuhan apa?<br />\r\n- proposal ini seperti merangkum materi kuliah</p>\r\n\r\n<p>SKOR 200 REV MAYOR</p>\r\n\r\n<p>EV: BUDI SUSANTO</p>\r\n', '2021-04-09 11:19:23', 625, 'R', 15, NULL, 2697, 'IMPLEMENTASI DATA WAREHOUSE UNTUK ANALISIS TINGKAT KEMISKINAN DI YOGYAKARTA', 'IMPLEMENTASI DATA WAREHOUSE UNTUK ANALISIS TINGKAT KEMISKINAN DI YOGYAKARTA', '71170179', 'T', 8, 146, 'T'),
(2686, '2021-03-29 11:31:18', '<p>- latar belakang baru menyatakan bahwa website masih baru sehingga belum diketahui kebergunaannya. Jika demikian maka cukup melakukan evaluasi website. Tetapi jika ternyata hasilnya baik, maka webiste tidak perlu dirancang ulang! Kecuali memang sudah ada data awal yang menunjukkan adanya masalah kebergunaan pada webiste saat ini (ada data / referensi)<br />\r\n- Perhatikan koherensi proposal, mis manfaat penelitian akan menjawab permasalahan yang dijelaskan di latar belakang jika rumusan masalah telah bisa diselesaikan / terjawab.<br />\r\nDalam kasus ini : rumusan masalahnya adalah bagaimana mengevaluasi dan merancang ulang website UKM Yogyakarta .. jika hal ini telah dilaksanakan apakah manfaatnya tercapai? 1. User dapat mendapatkan informasi 2. Dinas perdagangan dapat mengontrol dan mengawasi UKM. Apakah hal tersebut dapat tercapai hanya dengan mengevaluasi antarmuka? Atau harus diteliti juga kebutuhan user<br />\r\n(informasi yang dibutuhkan user dan hal apa saja yang harus dikontrol dan diawasi Dinas Perdagangan)</p>\r\n\r\n<p>SKOR: 310 REV MINOR</p>\r\n\r\n<p>EV: RESTYANDITO</p>\r\n', '2021-04-23 11:33:40', 625, 'R', 13, NULL, 2698, 'ANALISIS DAN EVALUASI WEBSITE UKM KOTA YOGYAKARTA', 'ANALISIS DAN EVALUASI WEBSITE UKM KOTA YOGYAKARTA', '71170192', 'Y', 9, 147, 'T'),
(2687, '2021-03-29 11:33:19', '<p>Skor: 200</p>\r\n\r\n<p>Evaluator: Kristian Adi Nugraha, S.Kom., M.T.</p>\r\n\r\n<p>- Judul skripsi maksimal 14 kata, di sini terdapat 17 kata</p>\r\n\r\n<p>- Tata bahasa banyak yang keliru, kalimat yang digunakan tidak baku, penggunaan huruf kapital untuk nama kota/tempat, kata tunjuk, awalan, akhiran, dll</p>\r\n\r\n<p>- Tolong dijelaskan lebih konkrit mengenai konten dari website yang akan dibuat, pada proposal hanya menyebutkan secara umum sebagai sarana komunikasi dan penyebaran informasi. Kalau sekedar untuk itu, kenapa tidak menggunakan aplikasi chatting atau media sosial saja?</p>\r\n\r\n<p>- Pada rumusan masalah, apakah anda yakin akan mengukur keakuratan informasi serta mempercepat efektivitas pertanian menggunakan sistem informasi? Bagaimana caranya?</p>\r\n', '2021-04-23 12:16:22', 636, 'R', 9, NULL, 2699, 'PEMBUATAN SISTEM INFORMASI KOMUNITAS PERTANIAN DESA CINTA DAME 4 BALIMBINGAN SUMATERA UTARA MENGGUNAKAN METODE USER CENTERED DESIGN', 'PEMBUATAN SISTEM INFORMASI KOMUNITAS PERTANIAN DESA CINTA DAME 4 BALIMBINGAN SUMATERA UTARA MENGGUNAKAN METODE USER CENTERED DESIGN', '71170208', 'Y', 50, 147, 'T'),
(2688, '2021-03-29 11:35:40', '<p>Tanggapan umum:</p>\r\n\r\n<p>topik proposal ini serupa dengan topik proposal pada DE1, namun ada perkembangan yang baik.<br />\r\n-Penulisan &quot;di&quot; sebagai imbuhan atau &quot;di&quot; sebagai kata depan, perlu diperhatikan. Mis. kata &#39;di unduh harus ditulis &#39;diunduh&#39; karena merupakan kata berimbuhan. Sedangkan kata &#39;dikota&#39; dan &#39;diatas&#39;, ditulis &#39;di kota&#39; dan &#39;di atas&#39; karena &#39;di&#39; di sana merupakan kata depan.<br />\r\nRumus:<br />\r\n- &quot;imbuhan di/ke + kata_dasar&quot; ditulis jadi satu<br />\r\n- &quot;di/ke + kata_tempat&quot; ditulis terpisah<br />\r\n-Semua gambar, tabel, dan rumus harus memiliki label, disebutkan dalam teks, dan dijelaskan. Label gambar diletakkan di bawah gambar, sedangkan label tabel diletakkan di atas tabel.<br />\r\n-Semua kata berbahasa asing perlu dicetak miring.<br />\r\n-Ada <em>typographical error </em>di beberapa tempat. Silakan lihat catatan di proposal yang telah dinilai.<br />\r\n-Perhatikan format penulisan.</p>\r\n\r\n<p>Tanggapan khusus:</p>\r\n\r\n<p>1.Latar Belakang<br />\r\n-OK<br />\r\n<br />\r\n2.Rumusan Masalah<br />\r\n-OK<br />\r\n<br />\r\n3.Batasan Masalah<br />\r\n-OK<br />\r\n<br />\r\n4. .Tujuan penelitian<br />\r\n-OK<br />\r\n<br />\r\n5.Manfaat penelitian<br />\r\n-OK</p>\r\n\r\n<p><br />\r\n6.Tinjauan Pustaka<br />\r\n-OK<br />\r\n-Perhatikan penulisan sitasi untuk setiap literatur yang dicantumkan. Ikuti APA Style yang baik dan benar.<br />\r\n<br />\r\n7.Landasan Teori<br />\r\n-Ada beberapa kesalahan tulis.<br />\r\n-Perhatikan penulisan sitasi untuk setiap literatur yang dicantumkan. Ikuti APA Style yang baik dan benar.<br />\r\n-Perlu ditambahkan teori terkait Risk Index, Story Point, dan Velocity.<br />\r\n<br />\r\n8.Blok Diagram<br />\r\n-Bagian ini tidak ada di proposal.<br />\r\n<br />\r\n9.Metodologi Penelitian<br />\r\n-Contoh kurang lengkap. Contoh dapat diberikan dengan cara membuat sebuah kasus sederhana, sehingga tabel-tabel tersebut bisa diisi dan dijelaskan.<br />\r\n-Proses testing juga perlu diberikan contohnya.<br />\r\n<br />\r\n10.Daftar Pustaka<br />\r\n-Masih ada penulisan literatur yang tidak mengikuti cara penulisan APA Style.</p>\r\n\r\n<p>SKOR: 250 REV MAYOR</p>\r\n\r\n<p>EV: GLORIA VIRGINIA</p>\r\n', '2021-04-23 11:30:42', 625, 'R', 19, NULL, 2700, 'PEMBUATAN DAN IMPLEMENTASI SISTEM INFORMASI GKE IMANUEL BENGKAYANG MENGGUNAKAN METODE PERSONAL EXTREME PROGRAMMING ', 'PEMBUATAN DAN IMPLEMENTASI SISTEM INFORMASI GKE IMANUEL BENGKAYANG MENGGUNAKAN METODE PERSONAL EXTREME PROGRAMMING ', '71170246', 'Y', 13, 146, 'T'),
(2689, '2021-03-29 11:38:05', '<ul>\r\n	<li>Belum ada referensi di bagian pendahuluan sama sekali, apakah kamu satu satunya peneliti yg meneliti hal ini?</li>\r\n	<li>Tinjauan pustaka harus dari jurnal minimal 3 artikel: isinya adalah jurnal ttg game, ttg pengukuran efektivitas, ttg game untuk pembelaljaran dll</li>\r\n	<li>Dasar teori berisi ttg semua teori ttg game, ttg efektivitas, ttg game play, ttg sejarah juga dari buku</li>\r\n	<li>Pengujian sistem game ok, tapi pengujian ttg efektivitas game belum ada sama sekali, tidak bisa hanya menggunakan kuisioner begitu</li>\r\n	<li>Bagaimana menguji hasil penggunaan game di pelajarannya? Apa bedanya dengan yg tidak menggunakan game itu untuk belajar?</li>\r\n	<li>Daftar pustaka menggunakan sitasi APA (American Pyschological Association), masih salah, termasuk cara membuat daftar pustakanya</li>\r\n	<li>SKOR: 205 REV MAYOR</li>\r\n	<li>EV: Anton</li>\r\n</ul>\r\n', '2021-04-07 17:46:40', 625, 'R', 57, NULL, 2702, 'GAMIFIKASI PERMAINAN ROLE-PLAYING GAME EDUKASI SEJARAH SISWA SEKOLAH DASAR BERBASIS RULE BASED SYSTEM', 'GAMIFIKASI PERMAINAN ROLE-PLAYING GAME EDUKASI SEJARAH SISWA SEKOLAH DASAR BERBASIS RULE BASED SYSTEM', '71170194', 'T', 17, 146, 'T'),
(2690, '2021-03-29 11:43:12', '<p>Tanggapan umum:</p>\r\n\r\n<p>-Proposal ini serupa dengan proposal yang dikumpulkan pada DE1, namun dengan metode yang berbeda, yaitu GDD (di DE1 menggunakan metode UCD).<br />\r\n-Semua gambar, tabel, dan rumus harus memiliki label, disebutkan dalam teks, dan dijelaskan.<br />\r\n-Semua kata berbahasa asing perlu dicetak miring.<br />\r\n-Ada banyak <em>typographical error </em>di berbagai tempat. Silakan lihat catatan di proposal yang telah dinilai.<br />\r\n-Perhatikan format penulisan.<br />\r\n-Ada kalimat-kalimat yang sangat panjang, karena 1 kalimat terdiri dari banyak topik.<br />\r\n-Di beberapa tempat, proposal ini sulit dibaca, karena kalimat-kalimat yang digunakan tidak menggunakan tata cara penulisan Bahasa Indonesia yang baik dan benar. Ada banyak kalimat yang membingungkan karena kehilangan subyek, predikat, objek, atau tidak menggunakan tanda baca dengan baik.<br />\r\n-Judul di &#39;Halaman Persetujuan&#39; masih sama dengan proposal di DE1.<br />\r\n-Penanda paragraf baru ada yang ditandai dengan spasi yang lebih besar, ada pula yang ditandai dengan penulisan yang menjorok masuk ke dalam. Masalahnya, pada proposal ini penanda paragraf baru tidak konsisten digunakan. Kadang kala menggunakan penanda spasi, kadang kala menggunakan cara menjorok masuk ke dalam.<br />\r\n-Gunakan Bahasa Indonesia yang baik dan benar. Mohon kalimat yang sudah ditulis dibaca kembali, untuk memastikan bahwa kalimat yang ditulis bisa dimengerti dengan baik dan sesuai dengan kaidah penulisan yang baik dan benar dalam Bahasa Indonesia.<br />\r\n-Saran saya: diskusikan ide ini dengan dosen, supaya proposal menggambarkan apa yang akan dikerjakan.<br />\r\n&nbsp;</p>\r\n\r\n<p>Tanggapan khusus:</p>\r\n\r\n<p>1.Latar Belakang<br />\r\n-Permasalahan dari penelitian ini belum disebutkan dan dijelaskan.<br />\r\n-Seberapa penting penelitian ini perlu dilakukan?<br />\r\n-Ada banyak kesalahan ketik.<br />\r\n-Tidak ada penjelasan, alasan menggunakan metode GDD.<br />\r\n<br />\r\n2.Rumusan Masalah<br />\r\n-Ada beberapa kesalahan ketik.<br />\r\n<br />\r\n3.Batasan Masalah<br />\r\n-Perlu dijelaskan alasan pemilihan setiap batasan masalah yang disebutkan.<br />\r\n<br />\r\n4.Tujuan penelitian<br />\r\n-Pernyataan &#39;... yang dapat membantu wisatawan ...&quot; maksudnya bagaimana? Pernyataan ini tidak jelas, sehingga ukurannya (bahwa wisatawan dibantu) juga jadi tidak jelas.<br />\r\n<br />\r\n5.Manfaat penelitian<br />\r\n--<br />\r\n<br />\r\n6.Tinjauan Pustaka<br />\r\n-Bagian ini masih serupa dengan proposal di DE1. Kesalahan yang sama, diulangi lagi di DE1.<br />\r\n-Cara penulisan perlu mengikuti standar penulisan APA Style!<br />\r\n-Tidak perlu menyebutkan judul penelitian dalam teks.<br />\r\n<br />\r\n7.Landasan Teori<br />\r\n-Ada banyak kesalahan tulis.<br />\r\n-Perhatikan penulisan sitasi untuk setiap literatur yang dicantumkan. Ikuti APA Style yang baik dan benar.<br />\r\n-Teori tentang &quot;Sistem&quot; dan &quot;Informasi&quot; tidak ada gunanya.<br />\r\n-Tidak ada teori terkait dengan alat ukur atau metode evaluasi yang akan digunakan.<br />\r\n<br />\r\n8.Blok Diagram<br />\r\n-&quot;Gambar 2&quot; dibuat sendiri atau diambil dari tempat lain?<br />\r\n<br />\r\n9.Metodologi Penelitian<br />\r\n-&quot;Dalam &#39;Metodologi Penelitian&#39;, minimal menjelaskan 3 hal, yaitu: terkait data yang digunakan, tahapan/kegiatan yang dilakukan dalam pengembangan sistem/aplikasi/penelitian, dan metode evaluasi &amp; analisis yang akan dilakukan.&quot;<br />\r\n-Metode SUS yang disebutkan, dijelaskan di Landasan Teori.<br />\r\n-&quot;Data&quot; adalah bentuk plural; bentuk singular-nya adalah &#39;datum&#39;.<br />\r\n-Metode yang digunakan adalah GDD, tapi tidak ada penjelasan kapan dan bagaimana &#39;Goal&#39; dibangun.<br />\r\n-Setiap tahap dalam metodologi penelitian perlu merujuk langsung ke topik atau kasus yang dibicarakan.<br />\r\n<br />\r\n10.Daftar Pustaka<br />\r\n-Penulisan literatur tidak mengikuti cara penulisan APA Style.<br />\r\n-Ada banyak literatur yang disebutkan dalam teks proposal yang tidak tercantum dalam Daftar Pustaka.<br />\r\n-Ada literatur dalam Daftar Pustaka yang tidak digunakan dalam teks proposal.</p>\r\n\r\n<p>SKOR 155 TOLAK</p>\r\n\r\n<p>EV: GLORIA VIRGINIA</p>\r\n', '2021-04-12 13:54:46', 625, 'K', 9, NULL, 2701, 'PERANCANGAN SISTEM INFORMASI WEB PARIWISATA KABUPATEN DELI SERDANG MENGGUNAKAN METODE GOAL DIRECTED DESIGN', 'PERANCANGAN SISTEM INFORMASI WEB PARIWISATA KABUPATEN DELI SERDANG MENGGUNAKAN METODE GOAL DIRECTED DESIGN', '71160132', 'T', 13, 146, 'T'),
(2691, '2021-03-29 12:05:40', '<p>- use case diagram SALAH!<br />\r\n- tidak melakukan konsultasi, sudah saya ajak bertemu, pas waktunya mhs ybs ada kuliah, lalu tidak ada lagi tindak lanjut<br />\r\n- diagram flow chart SALAH! seperti tidak pernah mendapat matakuliah untuk buat flowchart<br />\r\n- alur penelitian hanya mengkuti dari waterfall, tidak ada penekanan sesuai dengan judulnya.<br />\r\n- saya tidak dapat memberi review lebih lanjut!</p>\r\n\r\n<p>SKOR: 250 REV MAYOR</p>\r\n\r\n<p>EV: Budi Susanto</p>\r\n', '2021-04-23 12:23:00', 625, 'R', 50, NULL, 2703, 'RANCANG BANGUN SISTEM PENGADUAN MASYARAKAT BERBASIS ANDROID MENGGUNAKAN METODE PENGUJIAN BOUNDARY VALUE ANALYSIS DI DINAS PEKERJAAN UMUM \r\n', 'RANCANG BANGUN SISTEM PENGADUAN MASYARAKAT BERBASIS ANDROID MENGGUNAKAN METODE PENGUJIAN BOUNDARY VALUE ANALYSIS DI DINAS PEKERJAAN UMUM \r\n', '71170214', 'Y', 8, 146, 'T'),
(2692, '2021-03-29 12:11:40', '<p>Skor: 220<br />\r\nEvaluator: Kristian Adi Nugraha, S.Kom., M.T.</p>\r\n\r\n<p>- Pada latar belakang menyebutkan desain saat ini &quot;terbilang masih sangat sederhana&quot;. Sederhana diukur berdasarkan apa? Apakah ada datanya?</p>\r\n\r\n<p>- Rumusan masalah keliru, kekurangan website seharusnya sudah ditemukan terlebih dahulu sebelum penelitian sehingga sudah jelas apa yang menjadi masalah pada antarmuka website</p>\r\n\r\n<p>- Belum ada gambaran bagaimana heuristic evaluation akan diterapkan, keterangan yang ada masih berupa teori saja.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2021-04-23 11:52:33', 636, 'R', 9, NULL, 2704, 'ANALISIS USER INTERFACE PADA WEBSITE BERITA MENGGUNAKAN METODE HEURISTIC EVALUATION\r\n(STUDI KASUS : KRJOGJA.COM)', 'ANALISIS USER INTERFACE PADA WEBSITE BERITA MENGGUNAKAN METODE HEURISTIC EVALUATION\r\n(STUDI KASUS : KRJOGJA.COM)', '71170158', 'Y', 50, 147, 'T'),
(2693, '2021-03-29 12:13:25', '<ul>\r\n	<li>Perlu diperjelas aspek yang akan diteliti, cara evaluasi dan bagimana penelitian dijalankan</li>\r\n	<li>Perlu mencantumkan sumber dari pernyataan yang dikemukakan pada latar belakang</li>\r\n	<li>Landasan teori dilengkapi dengan metode evaluasi dan sisi apa yang akan diteliti</li>\r\n	<li>Silakan berkonsultasi dengan calon dosen pembimbing untuk memperbaiki proposal, setelah itu silakan kembali pada evaluator.</li>\r\n	<li>SKOR: 205, REV MAYOR</li>\r\n	<li>EV: MAHAS</li>\r\n</ul>\r\n', '2021-04-11 07:26:39', 625, 'R', 57, NULL, 2705, 'PERANCANGAN GAME EDUKASI PENGENALAN PERATURAN LALU LINTAS DAN ETIKA BERKENDARA BERBASIS WEBSITE', 'PERANCANGAN GAME EDUKASI PENGENALAN PERATURAN LALU LINTAS DAN ETIKA BERKENDARA BERBASIS WEBSITE', '71160103', 'T', 3, 147, 'T'),
(2694, '2021-03-29 12:15:03', '<p>Rumusan masalah tidak jelas. Sebenarnya bgmn posisi metode GDD pada penelitian?</p>\r\n\r\n<p>Kata &ldquo;mudah&rdquo; muncul di rumusan dan tujuan penelitian, apakah ini yang akan dicapai pada penelitian? Apakah metode GDD dapat menjamin aplikasi yang mudah ?</p>\r\n\r\n<p>Penelitian masih berupa katalog penelitian. Landasan teori masih kurang. Landasan teori mencakup teori usablity, mohon diperjelas posisi metede usability pada penelitian, krn metode tidak disinggung pada bagian sebelumnya.</p>\r\n\r\n<p>SKOR: 260 REV MAYOR</p>\r\n\r\n<p>EV: ROSA DELIMA</p>\r\n', '2021-04-23 11:27:47', 625, 'R', 54, NULL, 2708, 'Pembuatan Aplikasi Kustom T-shirt Berbasis Website Menggunakan Metode Goal Directed Design', 'Pembuatan Aplikasi Kustom T-shirt Berbasis Website Menggunakan Metode Goal Directed Design', '71170237', 'Y', 19, 146, 'T'),
(2695, '2021-03-29 12:18:27', '<p>Latar belakang bisa dipersingkat. Rumusan masalah diperjelas. Apa yang diamksud dengan batasan masalah no. 4. Apakah penelitian ini tidak mengembangkan sistem?</p>\r\n\r\n<p>Mohon diperjelas siapa user yang akan dilibatkan pada pendekatan UCD</p>\r\n\r\n<p>Tujuan penelitian &ldquo;hanya&rdquo;merancang, mohon diperjelas!Manfaat penelitian mohon diperjelas peruntukannya. Apakah betul sistem akan memberi manfaat sprt yang tuliskan. Bgmn menjamin hal tersebut? Tinjauan Pustaka berbentuk katalog buku, harap diperbaiki !</p>\r\n\r\n<p>Tidak ada blok diagram sistem!</p>\r\n\r\n<p>SKOR: 200 REV MAYOR</p>\r\n\r\n<p>EV: ROSA DELIMA</p>\r\n', '2021-04-23 11:10:10', 625, 'R', 54, NULL, 2706, 'IMPLEMENTASI USER-CENTERED DESIGN PADA SISTEM INFORMASI GEREJA GBI MIRACLE SERVICE YOGYAKARTA', 'IMPLEMENTASI USER-CENTERED DESIGN PADA SISTEM INFORMASI GEREJA GBI MIRACLE SERVICE YOGYAKARTA', '71150072', 'Y', 19, 146, 'T'),
(2696, '2021-03-29 12:19:12', '<p>Silakan menghubungi salah satu dosen yang berkompeten dalam bidang ini (desain antar muka) dan berkonsultasi untuk memperbaiki proposalnya. Secara keseluruhan belum terlihat benang merah mengenai bagaimana penelitian ini akan dikerjakan.</p>\r\n\r\n<p>Setelah perbaikan dengan dosen tersebut, silakan menemui evaluator.</p>\r\n\r\n<p>SKOR: 215 REV MAYOR</p>\r\n\r\n<p>EV: MAHAS</p>\r\n', '2021-04-11 07:23:15', 625, 'R', 13, NULL, 2707, 'PERANCANGAN WEBSITE PERCETAKAN DI YOGYAKARTA', 'PERANCANGAN WEBSITE PERCETAKAN DI YOGYAKARTA', '71170176', 'T', 3, 147, 'T'),
(2697, '2021-03-29 12:37:56', '<ul>\r\n	<li>Deskripsi mengenai aplikasi layanan darurat masih kurang, sebaiknya ditambahkan dengan pembahasan aplikasi-aplikasi sejenis yang sudah ada</li>\r\n	<li>Metodologi untuk pengujian usabilitas tidak ada, sehingga perlu ditambahkan</li>\r\n	<li>Perlu penjelasan mengenai kompleksitas masalah yang diangkat, karena kesannya hanya membuat aplikasi yang berisi tombol-tombol, lalu susahnya dimana? Padahal ini adalah tugas akhir (skripsi).</li>\r\n	<li>SKOR: 225 REV MAYOR</li>\r\n	<li>EV: YUAN LUKITO</li>\r\n</ul>\r\n', '2021-04-23 14:44:15', 625, 'R', 9, NULL, 2710, 'PERANCANGAN USER INTERFACE APLIKASI LAYANAN DARURAT UNTUK LANSIA ', 'PERANCANGAN USER INTERFACE APLIKASI LAYANAN DARURAT UNTUK LANSIA ', '71170168', 'Y', 2, 147, 'T'),
(2698, '2021-03-29 13:20:23', '<p>- masih belum ada perbaikan yang sesuai dengan hasil review DE pertama<br />\r\n- belum pernah berkonsultasi lebih jauh sejak DE 1<br />\r\n- use case dipandang diperlu dibuat<br />\r\n- yang menjadi sorotan saya adalah, dalam proposal sama sekali tidak diuraikan kesiapan data operasional yang perlu dimasukkan dalam database historis untuk siap ditampilkan dalam dashboard<br />\r\n- saya tidak dapat memberikan review selanjutnya.</p>\r\n\r\n<p>SKOR 235 REV MAYOR</p>\r\n\r\n<p>EV: BUDI SUSANTO</p>\r\n', '2021-04-23 12:13:07', 625, 'R', 55, NULL, 2712, 'DESAIN DAN IMPLEMENTASI DASHBOARD DATA PELAKSANAAN KEGIATAN BPTP NTT BERBASIS WEB', 'DESAIN DAN IMPLEMENTASI DASHBOARD DATA PELAKSANAAN KEGIATAN BPTP NTT BERBASIS WEB', '71170180', 'Y', 8, 146, 'T'),
(2699, '2021-03-29 13:22:38', '<p>- Judul dibuat lebih spesifik, karena pembuatan proposal banyak konteksnya, jika memang diperuntukkan untuk proposal kegiatan Gereja bisa dijelaskan di judul, demikian pula satu organisasi dengan organisasi lain dapat memiliki aturan yang berbeda terkait proposal (mis prosedur pengajuan, format proposal, dll)<br />\r\n- Dituliskan bahwa aplikasi yang dibuat bersifat responsive, mesti dijelaskan apakah aplikasi meliputi pembuatan proposal atau hanya upload proposal?<br />\r\n- Yang dituliskan di point 3 bukan batasan masalah, tetapi spesifikasi sistem, alat yang digunakan untuk membuat prototipe dan metode analisa.<br />\r\n- Penulisan latar belakang, rumusan masalah, tujuan dan manfaat hendaknya koheren. Mis dibagian manfaat disebutkan Gereja Maria Assumpta sebagai pengguna, tapi tidak dijelaskan di bagian lain.<br />\r\nTujuan penelitian adalah menganalisis, mengevaluasi dan menguji website e-proposal, apakah ini sudah ada sistemnya atau baru akan dibuat, juga tidak dijelaskan di latar belakang masalah. dll</p>\r\n\r\n<p>SKOR: 320 REV MINOR</p>\r\n\r\n<p>EV: RESTYANDITO</p>\r\n', '2021-09-24 12:54:58', 625, 'R', 9, NULL, 2709, 'ANALISIS DAN PERANCANGAN APLIKASI WEBSITE \r\nE-PROPOSAL DENGAN MENGGUNAKAN METODE HEURISTIC EVALUATION DAN WEBUSE\r\n', 'ANALISIS DAN PERANCANGAN APLIKASI WEBSITE E-PROPOSAL DENGAN MENGGUNAKAN METODE HEURISTIC EVALUATION DAN WEBUSE\r\n', '71170211', 'T', 9, 147, 'T'),
(2700, '2021-03-29 17:36:20', '<p>- Karena menyangkut implementasi, seharusnya ada diagram arsitektur aplikasi dan penjelasannya<br />\r\n- Perlu juga menjelaskan bagaimana integrasi dengan eclass, langkah-langkah yang harus dilakukan apa saja?<br />\r\n- Apakah sudah dipelajari mengenai kemungkinan penggunaan API WA? Apakah bisa dipakai seperti halnya API Telegram? Library apa yang akan dipakai untuk konektivitas ke WA?<br />\r\n- Pada metodologi penelitian juga tidak ada penjelasan mengenai bagaimana akan melakukan evaluasi? Parameter apa saja yang dipakai sebagai ukuran evaluasi?<br />\r\n- Penulisan daftar pustaka dalam format APA masih salah<br />\r\n- Karena penjelasan sangat kurang, bobot pekerjaan yang akan dilakukan masih kurang untuk Tugas Akhir</p>\r\n\r\n<p>SKOR: 185 TOLAK</p>\r\n\r\n<p>EV: YUAN LUKITO</p>\r\n', '2021-04-11 07:21:02', 625, 'K', 54, NULL, 2711, 'PERANCANGAN SISTEM PUSH NOTIFICATIONS TUGAS E- CLASS MELALUI WHATSAPPS', 'PERANCANGAN SISTEM PUSH NOTIFICATIONS TUGAS E- CLASS MELALUI WHATSAPPS', '71170218', 'T', 2, 147, 'T'),
(2701, '2021-03-29 17:38:06', '<p>1.Dalam proposal belum disebutkan proses evaluasinya akan dilakukan berapa kali</p>\r\n\r\n<p>2.Sebaiknya responden yang digunakan untuk wawancara diperbanyak</p>\r\n\r\n<p>3. Metode UCD dan teori yang berhubungan perlu diberikan lebih kongkrit</p>\r\n\r\n<p>4. Perlu diberikan contoh kongkrit yang sederhana untuk aplikasi perhitungannya</p>\r\n\r\n<p>5.Berikan daftar metodologi yang digunakan untuk memodelkan dan mengevaluasi sistem</p>\r\n\r\n<p>6. Perlu diberi keterangan mengapa menggunakan UCD ? Apakah ada metode selain UCD ?</p>\r\n\r\n<p>7.Perlu diberikan bagan organisasi Dinas pertanian dan perikanan beserta dengan tugasnya.</p>\r\n\r\n<p>SKOR: 215 (REV MAYOR)</p>\r\n\r\n<p>EV: GUNAWAN</p>\r\n', '2021-04-23 13:00:55', 625, 'R', 50, NULL, 2713, 'PEMBUATAN SISTEM INFORMASI DINAS PERTANIAN DAN PERIKANAN MELAWI DENGAN METODE USER CENTERED DESIGN', 'PEMBUATAN SISTEM INFORMASI DINAS PERTANIAN DAN PERIKANAN MELAWI DENGAN METODE USER CENTERED DESIGN', '71170228', 'Y', 16, 146, 'T'),
(2702, '2021-03-29 17:40:36', '<p>1. Pada batasan masalah perlu ditambahkan juga informasi dengan komisi-komisi yang ada di GKJ Gombong</p>\r\n\r\n<p>2.Dalam proposal belum disebutkan proses evaluasinya akan dilakukan berapa kali</p>\r\n\r\n<p>3.Responden sbg UCD perlu ditentukan sesuai dengan jenis kelamin dan usia</p>\r\n\r\n<p>4.Pada proposal ini perlu ditambahkan daftar komisi yang ada di GKJ</p>\r\n\r\n<p>5. Pelu ditambahkan komisi-komisi yang ada , kegiatannya, daftar pengurusnya</p>\r\n\r\n<p>6. Perlu ditambahkan renungan dan catatan rangkuman kotbah setiap minggu utk tiap komisi</p>\r\n\r\n<p>SKOR 225 REV MAYOR</p>\r\n\r\n<p>EV: GUNAWAN</p>\r\n\r\n<p>CATATAN: Bu Agatha tidak bisa menjadi dosen pembimbing 1</p>\r\n', '2021-04-07 17:34:22', 625, 'R', 58, NULL, 2715, 'Perancangan Dan Implementasi Website Gereja Kristen Jawa Gombong Dengan Pendekatan User Centered Design', 'Perancangan Dan Implementasi Website Gereja Kristen Jawa Gombong Dengan Pendekatan User Centered Design', '71150075', 'T', 16, 146, 'T'),
(2703, '2021-03-29 17:42:24', '<p>Pendahuluan: perlu dituliskan pengantar ttg Black Box Testing untuk pengujian, diberikan referensinya juga</p>\r\n\r\n<p>Untuk membangun sistem ini berbasis web dan mobile mungkin diperlukan web services sebagai perantara, jadi perlu ada penjelasan di pendahuluan ttg web servicenya digunakan dimana? Buat apa?</p>\r\n\r\n<p>Untuk teori yg perlu masuk:</p>\r\n\r\n<p>1. web development system,</p>\r\n\r\n<p>2. web services,</p>\r\n\r\n<p>3. sistem presensi dan QR code,</p>\r\n\r\n<p>4. RAD,</p>\r\n\r\n<p>5. black box testing</p>\r\n\r\n<p>Metode penelitian disesuaikan dengan tahapan metode RAD saja, pengujiannya menggunakan metode black box testing</p>\r\n\r\n<p>SKOR: 305 rev minor</p>\r\n\r\n<p>EV: Anton</p>\r\n', '2021-04-22 14:24:11', 625, 'R', 6, NULL, 2714, 'PERANCANGAN SISTEM PRESENSI KELAS MENGGUNAKAN QR CODE DENGAN METODE RAD\r\nSTUDI KASUS: SMP N 1 HALMAHERA UTARA \r\n', 'PERANCANGAN SISTEM PRESENSI KELAS MENGGUNAKAN QR CODE DENGAN METODE RAD\r\nSTUDI KASUS: SMP N 1 HALMAHERA UTARA \r\n', '71160054', 'Y', 17, 146, 'T'),
(2704, '2021-03-29 17:43:10', '<p>- Penulisan kutipan masih salah, tidak mengikuti format APA. Penulisan daftar pustaka juga masih salah, seharusnya diurutkan berdasarkan nama penulis<br />\r\n- Perbedaan dengan penelitian-penelitian sebelumnya seharusnya dijelaskan dalam bentuk paragraf, tidak hanya dalam bentuk tabel. Perbedaan dengan penelitian (Icheberlyanti, Viva Arifin) bukan termasuk perbedaan karena tidak bisa dibandingkan<br />\r\n- Metodologi penelitian perlu ditambahkan bagian pengujian (usability testing)</p>\r\n\r\n<p>SKOR: 255 REV MAYOR</p>\r\n\r\n<p>EV: YUAN LUKITO</p>\r\n', '2021-04-23 14:54:20', 625, 'R', 13, NULL, 2716, 'Dokumentasi dan Perancangan Halaman Kegiatan Pelatihan Berbasis Website di Balai PMD Yogyakarta Kemendagri', 'Dokumentasi dan Perancangan Halaman Kegiatan Pelatihan Berbasis Website di Balai PMD Yogyakarta Kemendagri', '71170235', 'Y', 2, 147, 'T'),
(2705, '2021-03-29 17:45:21', '<ul>\r\n	<li>Batasan masalah diperjelas, format dokumen yang hendak dikenali, jenis karakter hangul dsb.</li>\r\n	<li>Landasan teori dilengkapi yang untuk karakter hangul, bahasa korea dan OCR. Diberi contoh OCR untuk aksara korea atau sejenisnya</li>\r\n	<li>Silakan berkonsultasi dengan dosen yang berkompeten dalam bidang ini untuk memperbaiki proposal.</li>\r\n	<li>Setelah perbaikan, silakan kembali pada evaluator.</li>\r\n	<li>SKOR: 240 REV MAYOR</li>\r\n	<li>EV: MAHAS</li>\r\n</ul>\r\n', '2021-04-11 07:24:21', 625, 'R', 12, NULL, 2717, 'PENGENALAN POLA TULISAN HANGUL DENGAN ADAPTIVE THRESHOLDING DAN FREEMAN CHAIN CODE ', 'PENGENALAN POLA TULISAN HANGUL DENGAN ADAPTIVE THRESHOLDING DAN FREEMAN CHAIN CODE ', '71160075', 'T', 3, 147, 'T'),
(2706, '2021-03-29 17:46:45', '<p>Tujuan penelitian dapat dirumuskan menjadi satu tujuan penelitian.</p>\r\n\r\n<p>Manfaat penelitian dapat diperjelas dan dispesifikan peruntukannya</p>\r\n\r\n<p>Tinjauan pustaka dapat ditambahkan relasi antar penelitian yang sudah dilakukan dengan penelitian yg akan dilakukan.</p>\r\n\r\n<p>Landasan teori belum selesai dikerjakan.</p>\r\n\r\n<p>Harap dilengkapi sesuai dengan ketentuan.Blok diagram dan metodologi penelitian harap diselesaikan.</p>\r\n\r\n<p>Proposal belum selesai dan belum siap untuk diajukan</p>\r\n\r\n<p>SKOR: 180 TIDAK DITERIMA</p>\r\n\r\n<p>EV: ROSA DELIMA</p>\r\n', '2021-04-09 17:30:28', 625, 'K', 9, NULL, 2718, 'OPTIMALISASI VISIBILITAS TATA LETAK ANTARMUKA SITUS WEB BERITA MENGGUNAKAN \r\nSIX GOLDEN RULES\r\n', 'OPTIMALISASI VISIBILITAS TATA LETAK ANTARMUKA SITUS WEB BERITA MENGGUNAKAN SIX GOLDEN RULES\r\n', '71160027', 'T', 19, 146, 'T'),
(2707, '2021-03-29 17:49:10', '<p>1.Dalam proposal belum dijelaskan cara merancang BOT gim.</p>\r\n\r\n<p>2.Sebaiknya perlu didefinisikan BOT gim yang efektif itu seperti apa ?</p>\r\n\r\n<p>3. Untuk mengukur efektifitas BOT gim itu menggunakan rumus apa ?</p>\r\n\r\n<p>4. Perlu diberikan contoh kongkrit yang sederhana untuk aplikasi perhitungannya</p>\r\n\r\n<p>5.Berikan daftar metodologi yang digunakan untuk memodelkan dan mengevaluasi sistem</p>\r\n\r\n<p>6. Perlu diberi keterangan mengapa menggunakan A* star ?</p>\r\n\r\n<p>7. Untuk mengukur efektifitas Algoritma A* dalam BOT gim tsb digunakan model apa ?</p>\r\n\r\n<p>SKOR 230 (REV MAYOR))</p>\r\n\r\n<p>EV: GUNAWAN</p>\r\n', '2021-04-23 13:13:15', 625, 'R', 3, NULL, 2692, 'PENGEMBANGAN BOT GIM PENGUMPUL ASTEROID AUGMENTED REALITY INSTAGRAM BERBASIS ALGORITMA A STAR ', 'PENGEMBANGAN BOT GIM PENGUMPUL ASTEROID AUGMENTED REALITY INSTAGRAM BERBASIS ALGORITMA A STAR ', '71150033', 'Y', 16, 146, 'T'),
(2708, '2021-03-29 17:51:26', '<p>- Dengan adanya tool-tool pembelajaran yang sudah ada (mis google class room), apakah yang menjadi urgensi dibuat aplikasi sendiri untuk SMP ... , adakah keterbatasan dari tool-tool tersebut sehingga tidak sesuai dengan kebutuhan SMP ... ? hal itu harusnya dijelaskan di latar belakang permasalahan.<br />\r\n- Rumusan masalah berfokus pada bagaimana &lsquo;cara membuat aplikasi&rsquo; apakah yang akan diteliti betul bagaimana cara membuat aplikasinya?<br />\r\n- Rumusan masalah : apakah ada perbedaan fitur/desain jika aplikasi digunakan oleh siswa selain kelas VII dan mapel selain matematika, IPA, Bhs Inggris dan Bhs Indonesia? Pada judul sudah dituliskan berbasis Android jadi tidak usah ditulis ulang dalam rumusan masalah.<br />\r\n- Koherensi terhadap tujuan, latar belakang, rumusan masalah ... sebetulnya masalahnya itu pembelajaran tidak efektif? Membuat situasi yang nyaman dalam kelas? Kendala proses belajar mengajar selama pandemi? Membuat aplikasi sebagai sarana tambahan/pelengkap dari proses tatap muka?</p>\r\n\r\n<p>SKOR: 285 REV MAYOR</p>\r\n\r\n<p>EV: RESTYANDITO</p>\r\n', '2021-04-23 13:19:36', 625, 'R', 50, NULL, 2719, 'RANCANG BANGUN APLIKASI E-LEARNING BERBASIS ANDROID (STUDI KASUS SMP ...)', 'RANCANG BANGUN APLIKASI E-LEARNING BERBASIS ANDROID (STUDI KASUS SMP ...)', '71170226', 'Y', 9, 147, 'T'),
(2709, '2021-03-29 17:52:40', '<p>Skor: 170</p>\r\n\r\n<p>Evaluator: Kristian Adi Nugraha, S.Kom., M.T.</p>\r\n\r\n<p>- Pada proposal sama sekali tidak terdapat metode yang digunakan untuk melakukan penelitian</p>\r\n\r\n<p>- Tinjauan pustaka hanya asal merangkum penelitian-penelitian berbau UI, namun secara keseluruhan tidak ada korelasinya sama sekali.</p>\r\n\r\n<p>- Sebetulnya konsep ini sudah ada pada smartphone Samsung, di dalamnya terdapat tombol Kids Mode yang dapat mengubah UI agar diesuaikan untuk anak-anak. Lalu bedanya apa? Karena di proposal tidak ada gambaran sama sekali mengenai penelitian yang akan dilakukan.</p>\r\n\r\n<p>- Tata cara penulisan tolong diperbaiki, banyak kekeliruan imbuhan dan akhiran kata</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2021-04-09 10:57:53', 636, 'K', 9, NULL, 2720, 'USER INTERFACE BERBEDA DALAM SEBUAH SMARTPHONE ', 'USER INTERFACE BERBEDA DALAM SEBUAH SMARTPHONE ', '71170160', 'T', 50, 147, 'T');
