(2710, '2021-03-29 17:56:26', '<p>- Bahasa yang digunakan masih gaya penulisan ilmiah populer (mis ada penggunaan kata &lsquo;anda&rsquo; , &lsquo;saya&rsquo;)<br />\r\n- Dalam pendahuluan sebaiknya langsung dijelaskan mengapa diperlukan suatu forum diskusi (khususnya untuk kasus sekolah musik). Penjelasan mengenai Jogja Audio School dapat dijelaskan dibagian objek penelitian. Jelaskan masalah yang ada, dan mengapa forum diskusi menjadi solusi / hal-hal yang harus diperhatikan dalam membuat forum diskusi<br />\r\n- Tinjauan pustaka sudah disajikan dalam bentuk tabel, oleh karena itu yang mesti dijelaskan dalam paragraf dibawahnya adalah keterkaitan antara penelitian sebelumnya dengan penelitian yang akan dilaksanakan yang menjadi &lsquo;pembeda&rsquo; dengan penelitian-penelitian yang sudah ada / novelty penelitiannya (mis, studi kasus sama metode beda, metode sama tapi disempurnakan, metode sama tapi studi kasus beda, dst)<br />\r\n- Dalam sistematika penulisan jika sub-bab hanya terdiri dari 1 kalimat tidak usah dibuat menjadi sub-bab terpisah mis 6.2.2, 6.23, dll. Jika merupakan suatu sub bab minimal ada 1 paragraf.</p>\r\n\r\n<p>SKOR: 330 REV MINOR</p>\r\n\r\n<p>EV: RESTYANDITO</p>\r\n', '2021-04-23 14:31:46', 625, 'R', 15, NULL, 2721, 'PERANCANGAN & PEMBANGUNAN FORUM DISKUSI MUSIC PRODUCTION & AUDIO ENGINEERING PADA JOGJA AUDIO SCHOOL', 'PERANCANGAN & PEMBANGUNAN FORUM DISKUSI MUSIC PRODUCTION & AUDIO ENGINEERING PADA JOGJA AUDIO SCHOOL', '71150131', 'Y', 9, 147, 'T'),
