(3104, '2022-05-11 20:36:24', '<p>- Rumusan masalah terlalu banyak, sepertinya yang paling cocok dengan judulnya hanya rumusan masalah no 3<br />\r\n- Daftar pustaka ada 3 acuan yang tidak pernah dikutip.&nbsp; Terdapat beberapa kesalahan penulisan/ejaan (seperti:<br />\r\n&nbsp; meperdulikan, seharusnya memperdulikan.. dsb)<br />\r\n- Metode DevOps masih kurang jelas bagaimana detailnya, dan bagaimana rencana implementasinya dalam<br />\r\n&nbsp; tugas akhir ini?<br />\r\n- Profil sepertinya tidak sesuai dengan topik skripsi ini, lebih cocok untuk profil UI/UX<br />\r\n- Proposal ini hanya diubah sedikit saja dari proposal yang ditolak saat DE1</p>\r\n\r\n<p>NILAI = 230</p>\r\n', '2022-07-15 07:01:28', 625, 'R', 50, NULL, 3127, 'PERANCANGAN APLIKASI MARKETPLACE BERBASIS ANDROID UNTUK PRALANSIA DAN LANSIA', 'PERANCANGAN APLIKASI MARKETPLACE BERBASIS ANDROID UNTUK PRALANSIA DAN LANSIA', '71180365', 'T', 2, 170, 'T'),
(3105, '2022-05-12 07:47:23', '<ol>\r\n	<li>Latar Belakang: Latar belakang anda perlu dijabarkan kembali</li>\r\n	<li>Mohon dijelaskan lebih detail, saat KP sistem apa yang dibangun? Sistem KP anda menyelesaikan masalah apa saja?</li>\r\n	<li>Tambahkan alasan kenapa tiga hal tersebut penting untuk perusahaan ini.\r\n	<ul>\r\n		<li>Kenapa kok harus cepat untuk membuat surat permohonan?</li>\r\n		<li>Apa yang terjadi jika ada penolakan? Dampaknya apa?</li>\r\n		<li>Kenapa kacab membutuhkan monitoring.&nbsp;</li>\r\n	</ul>\r\n	</li>\r\n	<li>Untuk fitur penambahan memorandum itu apa ya? Perlu dijelaskan, membuatnya otomatis atau bagaimana?</li>\r\n	<li>Rumusan masalah: Untuk rumusan masalah no 1 nanti bagaimana cara membuktikannya?</li>\r\n	<li>Batasan masalah: Untuk poin (d) tidak perlu karena sudah ditentukan pada poin (a)</li>\r\n	<li>Tujuan dan manfaat: Harus lebih spesifik karena yang anda tulis masih terlalu general</li>\r\n	<li>Penelitian terkait:&nbsp;Tambahkan tinjauan pustaka terkait sistem yang ada fitur monitoringnya, metodenya yang dipakai apa dan kendalanya apa?&nbsp;Di bagian ini harus berkaitan dengan penelitian anda ya, tidak sekedar menuliskan untuk &ldquo;syarat&rdquo; saja.&quot;</li>\r\n	<li>Blok sistem diagram: Mohon baca lagi tentang extend dan include. Contoh:\r\n	<ul>\r\n		<li>Pemberian komentar itu apakah wajib? Kalau tidak wajib mengapa pakai include?</li>\r\n		<li>Cetak Crew List itu apakah wajib dan dilakukan saat membuat crew list?</li>\r\n	</ul>\r\n	</li>\r\n	<li>Melalui use case ini, mohon dijelaskan mana yang sudah dilakukan saat KP dan mana yang akan jadi tambahan pada skripsi ini.&nbsp;</li>\r\n	<li>Font pada daftar pustaka perlu disamakan.</li>\r\n</ol>\r\n\r\n<p>N=255</p>\r\n', '2022-06-02 22:19:38', 642, 'R', 55, NULL, 3128, 'FITUR MONITORING DOKUMEN PADA WEBSITE ADMINISTRASI KANTOR DENGAN METODE WATERFALL', 'FITUR MONITORING DOKUMEN PADA WEBSITE ADMINISTRASI KANTOR DENGAN METODE WATERFALL', '71180288', 'Y', 58, 169, 'T'),
(3106, '2022-05-12 07:49:42', '<p>1 Di Latar Belakang bisa diceritakan sedikit proyek di Satunama itu apa, Mitra itu apa.<br />\r\n2 Diagram pada block diagram sistem, terdapat diagram2 yang jika dibaca agak rancu dan sulit dimengerti. Bisa ditambahkan ketererangan<br />\r\nBisa ditambahkan untuk alur kamu melakukan pembuatan datamart. dari data yg mau diambil sampai dengan visualisasi data</p>\r\n\r\n<p>3.&nbsp; Ada kalimat &quot;Pembentukan Dashboard bertujuan untuk pengambilan keputusan yang menyediakan informasi sesuai kebutuhan pengguna berdasarkan KPI.&quot; Dashboard bukan pengambil keputusan, tapi membantu pimpinan dalam pengambilan keputusan</p>\r\n\r\n<p>SKOR 345 (Nila)</p>\r\n', '2022-05-31 12:33:10', 625, 'R', 58, NULL, 3129, 'PEMBANGUNAN DATA MART KEUANGAN PROYEK YAYASAN SATUNAMA\r\n', 'PEMBANGUNAN DATA MART KEUANGAN PROYEK YAYASAN SATUNAMA\r\n', '71190433', 'Y', 55, 167, 'T'),
(3107, '2022-05-12 07:50:42', '<ol>\r\n	<li>Pada landasan teori tambahkan teori tentang UCD (user-centered design) karena hanya disebut saja pada bagian landasan teori.</li>\r\n	<li>Perlu adanya contoh kasus dalam pencariannya di sistem E-Katalog. Bagaimana bentuk sistem pencariannya.</li>\r\n	<li>Tambahakan beberapa literatur untuk memperlengkapi daftar pustaka.</li>\r\n	<li>Tambahkan tentang teori e-katalog yang ada selain e-katalog untuk motor.</li>\r\n	<li>Berilah contoh website yang berkaitan dengan e-katalog yang sudah pernah dibuat dan sdh pernah ada .</li>\r\n	<li>Perlu dijelaskan permasalahan yang ada pada penelitian ini, mengapa perlu dibuat sistem E-Katalog.</li>\r\n</ol>\r\n\r\n<p>NILAI : 215</p>\r\n', '2022-06-03 11:19:33', 1486, 'R', 9, NULL, 3132, 'MEMBANGUN E-KATALOG MODIFIKASI MOTOR SPORT BERBASIS WEBSITE', 'MEMBANGUN E-KATALOG MODIFIKASI MOTOR SPORT BERBASIS WEBSITE', '71170160', 'Y', 16, 170, 'T'),
(3108, '2022-05-12 07:57:21', '<ul>\r\n	<li>Diupayakan berorientasi pada hasil, jadi untuk rumusan masalah, apakah nanti hasil penelitian ini membantu/memberi solusi dan sejauh apa?</li>\r\n	<li>Pengutipan landasan teori yang digunakan kurang tepat. Hindari mengacu dari penelitian terapan.</li>\r\n	<li>Referensi perlu ditambah.</li>\r\n	<li>Silakan konsultasi dengan Evaluator terlebih dahulu.</li>\r\n</ul>\r\n\r\n<p>N=305</p>\r\n', '2022-06-03 10:32:17', 642, 'R', 58, NULL, 3130, 'Membangun Data Mart Unit Kesehatan Jiwa Yayasan Satunama', 'Membangun Data Mart Unit Kesehatan Jiwa Yayasan Satunama', '71190416', 'Y', 39, 169, 'T'),
(3109, '2022-05-12 08:43:09', '<ul>\r\n	<li>Permasalahan pada latar belakang diperjelas. Belum jelas masalah yang terjadi dan akan diselesaikan.</li>\r\n	<li>Diperjelas bagaimana mengukur, apa variabel pengukur untuk rumusan masalah</li>\r\n	<li>Tujuan tidak sesuai dengan latar belakang, dan rumusan masalah. - Batasan masalah diperbaiki</li>\r\n	<li>Semua istilah asing pada metode penelitian harap ditejemahkan dalam Bahasa Indonesia, agar dipahami apa pekerjaan yang harus dilakukan.</li>\r\n	<li>Pustaka dan sitasi tidak sesuai.</li>\r\n</ul>\r\n\r\n<p>NILAI 265</p>\r\n', '2022-06-02 16:52:15', 1486, 'R', 9, NULL, 3131, 'ANALISIS DAN PERANCANGAN ULANG ANTARMUKA WEBSITE SCRIPTI', 'ANALISIS DAN PERANCANGAN ULANG ANTARMUKA WEBSITE SCRIPTI', '71180320', 'Y', 19, 170, 'T'),
(3110, '2022-05-12 11:22:09', '<ol>\r\n	<li>Pendahuluan: anda ingin membuatkan POS untuk CV Anita karena saat ini pencatatan transaksi dan stok masih manual. Disebutkan akan dibuatkan POS dengan fitur payment gateway, namun fitur ini tidak lagi disebutkan di blok diagram maupun metode penelitian anda. Kenapa kok CV Anita butuh fitur ini? Bukannya semuanya masih manual? Lalu bagaimana dengan transaksi yang via cash? Ini sudah dibahas di DE1, jika anda ingin melakukan pencatatan transaksi dan stok yang berhubungan dengan validitas, maka transaksi cash juga harus dipertimbangkan.</li>\r\n	<li>Batasan masalah: Ada beberapa poin yang tidak perlu, seperti menggunakan RAD, ya kan dari judulnya juga sudah tahu jadi tidak perlu dimasukkan. Di sini lagi-lagi disebut tentang payment gateway, apakah anda hanya membatasi untuk transaksi cashless saja? (Jika ya, lihat poin 1)</li>\r\n	<li>Landasan teori: Di awal payment gateway disebut-sebut, namun di landasan teorinya pun tidak ada.</li>\r\n	<li>Blok sistem diagram:&nbsp;\r\n	<ul>\r\n		<li>Bagian &quot;Bayar&quot;? Kok hanya ada 1 pilihan? Bagaimana jika akan batal/tidak jadi belanja?</li>\r\n		<li>Bagaimana jika ingin membayar secara tunai?</li>\r\n		<li>Bagimana jika pembayaran tidak terkonfirmasi atau terjadi kegagalan? Flowchart ini berasumsi semua akan berhasil.</li>\r\n		<li>Bagaimana dengan stok? Di sini tidak ada perubahan pada stok jika barang berhasil dibeli.</li>\r\n		<li>Banyak typo pada flowchart anda, silahkan diperbaiki.</li>\r\n		<li>Lalu bagaimana dengan payment gateway yang anda sebut di awal? Masuk ke mana?</li>\r\n	</ul>\r\n	</li>\r\n	<li>Metode penelitian:&nbsp;\r\n	<ul>\r\n		<li>Bagian ini berisi apa saja yang akan anda lakukan untuk penelitian anda, dari awal. Jadi tidak menurut Tom Agency, tetapi menurut anda.&nbsp;</li>\r\n		<li>Sebutkan tahap2nya dari awal, RAD hanya satu dari sekian langkah tahap penelitian yang anda lakukan. Bagian RAD pun spesifik dengan penelitian anda.&quot;</li>\r\n	</ul>\r\n	</li>\r\n</ol>\r\n\r\n<p>N=230</p>\r\n', '2022-06-02 14:23:31', 642, 'R', 16, NULL, 3134, 'RANCANG BANGUN APLIKASI POINT OF SALES (POS) MENGGUNAKAN METODE RAPID APPLICATION DEVELOPMENT (RAD) (STUDI KASUS: CV ANITA)', 'RANCANG BANGUN APLIKASI POINT OF SALES (POS) MENGGUNAKAN METODE RAPID APPLICATION DEVELOPMENT (RAD) (STUDI KASUS: CV ANITA)', '71160075', 'Y', 58, 169, 'T'),
(3111, '2022-05-12 11:49:54', '<ul>\r\n	<li>Catatan saya masih sama dengan DE 1</li>\r\n	<li>Tidak terlihat kenapa harus meningkatkan visibilitas dari website scripti.</li>\r\n	<li>Nantinya, bagaimana cara mengukur visibilitas? karna tujuan penelitian nya adalah meningkatkan visibilitas.</li>\r\n</ul>\r\n\r\n<p>NILAI 300</p>\r\n', '2022-06-03 13:58:48', 1486, 'R', 9, NULL, 3135, 'ANALISIS DESAIN WEBSITE SCRIPTI MENGGUNAKAN LAYANAN FENG GUI DALAM MENINGKATKAN VISIBILITAS WEBSITE\r\n', 'ANALISIS DESAIN WEBSITE SCRIPTI MENGGUNAKAN LAYANAN FENG GUI DALAM MENINGKATKAN VISIBILITAS WEBSITE\r\n', '71170233', 'Y', 54, 170, 'T'),
(3112, '2022-05-12 14:20:14', '<ol>\r\n	<li><strong>Latar belakang </strong>dituliskan permasalahan yang mendasari pelaksanaan penelitian ini:\r\n	<ul>\r\n		<li>Mengapa proses penelitian ini perlu dilakukan dan dapat menyelesaikan permasalahan</li>\r\n		<li>Bagian yang menjelaskan secara teknis pengembangan sistem, metode perancangan pengujian dan framework yang digunakan diletakan pada metode penelitian</li>\r\n	</ul>\r\n	</li>\r\n	<li><strong>Rumusan masalah: </strong>Tingkat&nbsp;efisiensi yang dimaksud seperti apa?</li>\r\n	<li><strong>Batasan Masalah: </strong>Mengapa responden hanya 20? berikan referensi yang mendukung bahwa 20 responden itu valid untuk memvalidasi pengujian anda.</li>\r\n</ol>\r\n\r\n<p>N=345</p>\r\n', '2022-05-20 12:56:07', 642, 'R', 39, NULL, 3137, 'RANCANGAN WEBSITE PORTAL UMAT GEREJA SANTA MARIA ASSUMPTA KLATEN ', 'RANCANGAN WEBSITE PORTAL UMAT GEREJA SANTA MARIA ASSUMPTA KLATEN ', '71170214', 'T', 53, 169, 'T'),
(3113, '2022-05-12 14:22:30', '<ol>\r\n	<li>Latar belakang masih kurang jelas, berikan alasan dan sumber2 pustaka yang menyatakan pendapat anda. 1</li>\r\n	<li>Berikan argument pada Batasan masalah data yang ditampilkan, mengapa tidak data terkini?</li>\r\n	<li>Tujuan penelitian sebagai syarat menyelesaian dihilangkan, focus pada topik penelitian saja.</li>\r\n	<li>Belum ada block diagram system, alur penelitian dimasukkan pada metodologi penelitian dan metode penelitian dilengkapi</li>\r\n	<li>Mengapa tiba mucul UCD dan webusa? Berikan langakah2 ini pada metodologi penelitian</li>\r\n</ol>\r\n\r\n<p>nilai : 215</p>\r\n', '2022-06-03 14:26:39', 1486, 'R', 12, NULL, 3136, 'Perancangan Website Data Kegiatan Pertanian Komunitas Desa Cinta Dame 4 Balimbingan', 'Perancangan Website Data Kegiatan Pertanian Komunitas Desa Cinta Dame 4 Balimbingan', '71170208', 'Y', 57, 170, 'T'),
(3114, '2022-05-12 14:23:23', '<p>Evaluator: Kristian Adi Nugraha</p>\r\n\r\n<p>Skor: 245</p>\r\n\r\n<p>-&nbsp;Topik cukup menarik, hanya saja jika saya cari di Google sudah banyak penelitian dengan judul dan isi yang sama persis</p>\r\n\r\n<p>-&nbsp;Perlu dicari pembeda dengan penelitian lain yang serupa, misal animasinya akan dibuat seperti apa, dengan menggunakan metode apa, dll. supaya kelihatan unsur kebaruan yang dimiliki penelitian ini</p>\r\n', '2022-06-03 10:49:03', 636, 'R', 7, NULL, 3138, 'PENGEMBANGAN WEBSITE EDUKASI PENGENALAN RAMBU DAN PERATURAN LALU LINTAS KENDARAAN BERMOTOR BERBASIS ANIMASI', 'PENGEMBANGAN WEBSITE EDUKASI PENGENALAN RAMBU DAN PERATURAN LALU LINTAS KENDARAAN BERMOTOR BERBASIS ANIMASI', '71160103', 'Y', 50, 168, 'T'),
(3115, '2022-05-12 14:25:15', '<p>Dari DE1 tidak ada perubahan besar, tidak semua catatan revisi yang diberikan dilakukan<br />\r\n- Kenapa tahap validasi malah dihilangkan? Padahal itu tahapan penting dalam penelitian ini?<br />\r\n- Masih belum ada pembahasan mengenai ruang lingkup layanan akademik apa yang akan dibuat, strukturnya<br />\r\nseperti apa?<br />\r\n- Masih belum ada perbaikan pada blok diagram sistem, padahal sudah ditulis pada catatan revisi DE1.&nbsp; Coba<br />\r\ndijelaskan bagaimana arsitektur sistem (client-nya apa, servernya apa, komunikasi melalui apa, dsb)</p>\r\n\r\n<p>NILAI = 190</p>\r\n', '2022-05-23 10:12:43', 625, 'K', 19, NULL, 3139, 'Penerapan User Experience Questionnaire Dalam Aplikasi Chatbot Inforamsi Akademik UKDW', 'Penerapan User Experience Questionnaire Dalam Aplikasi Chatbot Inforamsi Akademik UKDW', '71180382', 'T', 2, 170, 'T'),
(3116, '2022-05-12 14:31:54', '<p>1 Pada latar belakang, bisa lebih dijelaskan lagi untuk arti kesehatan department dan kegunaannya</p>\r\n\r\n<p>2 Masalah dirumuskan dengan kalimat tanya. Sehingga rumusan masalah inilah yang akan kamu bahas dan jawab di kesimpulan nanti</p>\r\n\r\n<p>3 Batasan Masalah sepertinya belum detail, batasan yang akan digunakan dalam penelitian. Misal range tahun data.<br />\r\nUntuk data keuangan, hrd, dll apa bedanya dengan datamart khusus keuangan yang akan dilakukan teman kamu. Lebih baik kamu jelaskan di latar belakng, kira2 yg akan dikerjakan di skema ini itu apa . Soalnya domainnya banyak sekali</p>\r\n\r\n<p>4 Pada manfaat penelitian, lebih baik diberikan kalimat pembuka sebelum menuliskan poin-poin.</p>\r\n\r\n<p>5 Teori mengenai metode nine step Kimball belum ada.</p>\r\n\r\n<p>6 Kenapa disini disebutkan: &quot; dashboard strategic&quot;, apakah akan benar2 membuat dashboard strategic atau visualisasi data dengan dashboard?</p>\r\n\r\n<p>SKOR 330 (Nila)</p>\r\n', '2022-06-02 13:28:01', 625, 'R', 58, NULL, 3142, 'PERANCANGAN DATA MART UNTUK MANAGERIAL DI  YAYASAN SATUNAMA', 'PERANCANGAN DATA MART UNTUK MANAGERIAL DI  YAYASAN SATUNAMA', '71190414', 'Y', 55, 167, 'T'),
(3117, '2022-05-12 14:33:30', '<p>Proses revisi sudah berjalan dengan baik dengan hasil akhir implementasi hasil desain dalam bentuk prototipe website</p>\r\n\r\n<p>N=355</p>\r\n', '2022-05-24 08:42:48', 625, 'T', 10, 3, 3141, 'PERANCANGAN SISTEM INFORMASI GEREJA TORAJA JEMAAT TAL-PEN BERBASIS WEB', 'PERANCANGAN SISTEM INFORMASI GEREJA TORAJA JEMAAT TAL-PEN BERBASIS WEB', '71180339', 'T', 53, 169, 'T'),
(3118, '2022-05-12 14:36:06', '<ul>\r\n	<li>Rumusan masalah diperjelas, Bagaimana membuat...? Bagaimana mengukur ....? Apakah hal yang tidak diketahui oleh peneliti?</li>\r\n	<li>Batasan masalah tidak lengkap. Tujuan: bagaimana memastikan tujuan terpenuhi? .... Sesuai tujuan pengguna dan .... mudah digunakan &rarr; penyataan tidak terdapat pada rumusan masalah. Bgmn mengukurnya?</li>\r\n	<li>Penulisan rumus diperbaiki! Sitasi diperbaiki. Standar APA</li>\r\n</ul>\r\n\r\n<p>NILAI 250</p>\r\n', '2022-06-03 10:29:50', 1486, 'R', 9, NULL, 3143, 'PEMBANGUNAN WEBSITE LAYANAN PEMESANAN PERCETAKAN DIGITAL', 'PEMBANGUNAN WEBSITE LAYANAN PEMESANAN PERCETAKAN DIGITAL', '71170176', 'Y', 19, 170, 'T'),
(3119, '2022-05-12 14:38:26', '<ul>\r\n	<li>Bagaimana mengukur nilai kebergunaan dari aplikasi ini?</li>\r\n	<li>Sudah ada mahasiswa lain yg mengerjakan topik ini (Merry). Perlu dijelaskan apa yang membedakan dengan apa yang dikerjakan Merry</li>\r\n	<li>Konsep tanda tangan digital bukan hanya gambar yang tersimpan dalam bentuk digital lalu dijadikan tanda tangan. Itu bisa dengan mudah dipalsukan. Harus dalam bentuk cryptographic-based signature</li>\r\n	<li>Tidak ada dasar teori tentang digital signature sama sekali</li>\r\n	<li>Tidak ada informasi tentang gambar atau tabel yang digunakan didalam teks</li>\r\n	<li>Sumber pustaka juga masih perlu ditambah jurnal ilmiah, bukan artikel, terutama yang berkaitan dengan digital signature</li>\r\n</ul>\r\n\r\n<p>N=165</p>\r\n', '2022-05-20 13:13:58', 642, 'K', 39, NULL, 3144, 'IMPLEMENTASI LARAVEL PADA WEBSITE E-PROPOSAL PAROKI St.MARIA ASSUMPTA KLATEN', 'IMPLEMENTASI LARAVEL PADA WEBSITE E-PROPOSAL PAROKI St.MARIA ASSUMPTA KLATEN', '71170211', 'T', 15, 169, 'T'),
(3120, '2022-05-12 14:39:13', '<ul>\r\n	<li>Di level pemerintahan, sudah banyak aplikasi yang dibangun oleh Kementrian/Dinas/Pemda</li>\r\n	<li>Sudah ada SIAK, DTKS, Siskeudes dari Kemendes, Prodeskel dari Kemendagri, dll.</li>\r\n	<li>Mengapa masih bersikeras membawakan judul ini?</li>\r\n	<li>Wajib konsultasi dengan Evaluator terlebih dahulu.</li>\r\n</ul>\r\n\r\n<p>N=215</p>\r\n', '2022-05-20 13:03:22', 642, 'R', 3, NULL, 3153, 'PENGEMBANGAN WEBSITE PEMERINTAH DESA KAPUAK', 'PENGEMBANGAN WEBSITE PEMERINTAH DESA KAPUAK', '71160047', 'T', 39, 169, 'T'),
(3121, '2022-05-12 14:40:33', '<p>- Judul dan profil sepertinya tidak nyambung, judul di atas lebih cocok untuk profil DA atau NSS dibanding UID, sebaiknya judul dan arah penelitian diganti sesuai profil<br />\r\n- Kutipan dan format daftar pustaka masih keliru, jumlah referensi masih kurang</p>\r\n\r\n<p>SKOR 205 (Adi)<br />\r\n&nbsp;</p>\r\n', '2022-06-03 13:02:39', 625, 'R', 8, NULL, 3145, 'Penerapan Pattern Saga Dalam Arsitektur Microservices Untuk Prototipe Sistem Multi Klinik', 'Penerapan Pattern Saga Dalam Arsitektur Microservices Untuk Prototipe Sistem Multi Klinik', '71180368', 'Y', 50, 168, 'T'),
(3122, '2022-05-12 14:41:55', '<p>Evaluator: I Kadek Dendy S</p>\r\n\r\n<p>Skor: 215</p>\r\n\r\n<p>Belum mendefinisikan protokol yang akan digunakan untuk menerapkan proses autentikasi dan otorisasi<br />\r\nmetode penelitian belum menjelaskan cara/metode unuk menguji efektivitas implementasi autentikasi dan<br />\r\notorisasi pada arsitektur Microservices dalam memanajemen dan menangani akses ke sumber daya di<br />\r\nsistem informasi layanan kesehatan multi klinik</p>\r\n\r\n<p>Format penulisan belum rapi<br />\r\nLandasan teori harus dilengkapi dengan metode-metode yang digunakan dalam penelitian.<br />\r\nBlok diagram penelitian bukan flowchart arsitektur sistem</p>\r\n', '2022-06-03 21:41:08', 636, 'R', 8, NULL, 3146, 'PENERAPAN AUTENTIKASI DAN OTORISASI PADA ARSITEKTUR MICROSERVICES UNTUK SISTEM MULTI KLINIK', 'PENERAPAN AUTENTIKASI DAN OTORISASI PADA ARSITEKTUR MICROSERVICES UNTUK SISTEM MULTI KLINIK', '71180350', 'Y', 59, 168, 'T'),
(3123, '2022-05-12 14:43:23', '<p>1.&nbsp; Kenapa berubah dari judul DE1?? perbaikan website malah justru sangat tidak jelas, karena website purworejonews itu punya siapa?.&nbsp; kenapa harus diperbaiki? alasan perbaikan itu biasanya terjadi kalau anda adalah tim programmer atau tim nya purworejonews.</p>\r\n\r\n<p>2.&nbsp; Metode UCD kenapa tidak disebutkan diawal? harus dijelaskan di awal metode yg digunakan dan evaluasi yg digunakan nantinya.</p>\r\n\r\n<p>3.&nbsp; Tinjuan pustaka masih perlu diperbaiki, teori juga demikian.</p>\r\n\r\n<p>4.&nbsp; Metode penelitian langkah2nya masih sangat salah, tidak jelas, cuma berupa template penulisan saja.</p>\r\n\r\n<p>5.&nbsp; Lihat detail pada pdf proposal.</p>\r\n\r\n<p>Skor 230 (ARC)</p>\r\n', '2022-06-03 10:43:08', 625, 'R', 19, NULL, 3148, 'ANALISA USABILITY DAN PERBAIKAN WEBSITE BERITA PURWOREJONEWS MENGGUNAKAN METODE USER CENTERED DESIGN', 'ANALISIS USABILITY DAN PERBAIKAN WEBSITE BERITA PURWOREJONEWS MENGGUNAKAN METODE USER CENTERED DESIGN', '71180385', 'Y', 17, 167, 'T'),
(3124, '2022-05-12 14:45:05', '<p>N=100</p>\r\n', '2022-05-20 12:52:09', 642, 'K', 9, NULL, 3147, 'Perancangan User Interface Website Lowongan Kerja Dengan Menggunakan Metode User Centered Design', 'Perancangan User Interface Website Lowongan Kerja Dengan Menggunakan Metode User Centered Design', '71170206', 'T', 14, 169, 'T'),
(3125, '2022-05-12 14:47:32', '<p>Evaluator: I Kadek Dendy S</p>\r\n\r\n<p>Skor: 210</p>\r\n\r\n<p>Hilangkan statemen &quot;Skripsi merupakan karangan ilmiah yang wajib ditulis ....&quot;. Sebuah penelitian ilmiah itu<br />\r\nbukanlah karangan belaka.<br />\r\nbatasan masalah ditambahkan, harus lebih spesifik dan definitif. Kalau terlalu sedikit artinya penelitian anda<br />\r\nmemiliki scope yang luas.<br />\r\nBlok diagram penelitian tidak sama dengan flowchart desain sistem<br />\r\nMetode dengan blackbox testing harus lebih spesifik, karena ada beberapa metode yang bisa digunakan<br />\r\nuntuk membuat testcasenya. Metrik pengujian juga harus didefinisikan dan disesuaikan dengan rumusan<br />\r\ndan tujuan penelitian.</p>\r\n', '2022-06-03 12:48:21', 636, 'R', 55, NULL, 3149, 'Perancangan Sistem Booking Konsultasi Dosen berbasis website dengan metode Rapid Aplication Development studi kasus UKDW', 'Perancangan Sistem Booking Konsultasi Dosen berbasis website dengan metode Rapid Aplication Development studi kasus UKDW', '71160012', 'Y', 59, 168, 'T'),
(3126, '2022-05-12 14:48:57', '<p>Evaluator: Nugroho Agus H</p>\r\n\r\n<p>Skor: 255</p>\r\n\r\n<p>Skripsi diterima dengan catatan benar benar sampai ke pembuatan website dan diimplemtasikan.<br />\r\nTinjuan pustaka bisa ditambah lagi sebagai sarana pembelajaran pengusul</p>\r\n', '2022-06-03 14:49:47', 636, 'R', 6, NULL, 3150, 'RANCANGAN SISTEM INFORMASI KEGIATAN SEKOLAH BERBASIS WEBSITE MENGGUNAKAN METODE USER CENTERED DESIGN (STUDI KASUS: SEKOLAH SMP N 1 MENYUKE)', 'RANCANGAN SISTEM INFORMASI KEGIATAN SEKOLAH BERBASIS WEBSITE MENGGUNAKAN METODE USER CENTERED DESIGN (STUDI KASUS: SEKOLAH SMP N 1 MENYUKE)', '71170161', 'Y', 7, 168, 'T'),
(3127, '2022-05-12 14:50:38', '<p>- Judul terlalu umum, karena e-learning sudah cukup banyak tersedia, sehingga perlu dicari hal baru yang membedakan e-learning ini dengan e-learning yang sudah ada<br />\r\n- Belum terdapat metode atau pendekatan yang digunakan untuk membangun e-learning, sehingga elearning yang akan dibangun terlalu abstrak<br />\r\n- Format penulisan banyak keliru</p>\r\n\r\n<p>REV MAYOR (200 - ADI)<br />\r\n&nbsp;</p>\r\n', '2022-05-21 09:19:10', 625, 'R', 3, NULL, 3154, 'PERANCANGAN DESAIN ANTARMUKA E-LEARNING \r\nBERBASIS WEBSITE UNTUK ANAK SEKOLAH DASAR', 'PERANCANGAN DESAIN ANTARMUKA E-LEARNING  BERBASIS WEBSITE UNTUK ANAK SEKOLAH DASAR', '71180318', 'T', 50, 168, 'T'),
(3128, '2022-05-12 14:53:44', '<p>1 Pendahuluan:<br />\r\n- Perlu dipertajam, khususnya permasalahan yang dihadapi dengan adanya situs web sekolah yang ada saat ini.<br />\r\n- Jika sudah ada pra-survei, maka sebaiknya dijelaskan pra-survei dilakukand gn metode apa, dengan jumlah responden berapa, data apa yang dikumpulkan kemudian baru disebutkan sekian persen hasilnya bla..bla.. tidak seperti di halaman 3 paragarf terakhir yang tiba-tiba menyatakan 70% responden.... Ini responden dan angka 70% didapatkan dari mana?<br />\r\n- Sebaiknya pendahuluan hanya berisi 3 pokok pikiran saja yakni: a) permasalhan umum yang dihadapi oleh sekolah-sekolah di maa kini, b) permasalah khusus yang dihadapi oleh sekolah yang menjadi studi kasus, c) solusi sementara yang ditawarkan penelitian ini untuk menyelesaikan permasalhan tersebut.</p>\r\n\r\n<p>2&nbsp; Rumusan masalah masih terlalu umum, belum spesifik ke permasalahan yang dituju. Perlu dispesifikkan!</p>\r\n\r\n<p>3&nbsp; Batasan masalah juga perlu dipertajam kembali</p>\r\n\r\n<p>4&nbsp; Landasan Teori:<br />\r\n- penelitian ini masuk ranah Ui/UX dengan merancang ulang situs web sekolah X, kan? Lalu apa keterkaitannya densn Sistem Informaasi? Mengapa ada subbahasan Sistem informasi di Landasan Teori? Saya rasa ini adalah dua area siet yang berbeda dan Sistem Informasi tidak relvan dengan judul yang diambil. Sebaiknya dibuang saja dari landasan teori, karena saya mensinyalir adanya kerancuan pemahaman tentang Sistem Informasi<br />\r\n- Perhatikan juga bahwa perlu sitasi dan pencantuman sumber sitasi di bagian-bagian landasan teori.<br />\r\n- kedalaman teori di landasna teori juga perlu diperhatikan ya... perlu investasi waktu untuk membaca dan menulisakn di proposal, karena membaca itu adalah bagian dari riset yang akan memberi pengetahuan. Tanpa banyak membaca, maka isi tulisan hanya berada dipermukaan karena memang pengetahuannya belum didadapatkan, sehingga tidak bisa menulis dengan baik.... atau minimalnya sesuai standard sajalah.<br />\r\n- perlu juga dilengkapi dengan ukuran evaluasi yang digunakan, cantumkan rumus, bila ada, dan berikan contoh, pengujiannya dengan kasus hiotetis</p>\r\n\r\n<p>5&nbsp; Block Diagram:<br />\r\n- jelaskan langkah-langkah yang dijelaskan dalam diagram. deskripsikan dalam beberapa paragraf</p>\r\n\r\n<p>6&nbsp; Metode Penelitian:<br />\r\n- ada repetisi penulisan isi yang ada di landaan teori. Di metode penelitian, hanya mencantumkan nama metode yang digunakan saja. Penjelasans ecara teoritis tentang metode tersebut diletakkan di Landasan Teori.</p>\r\n\r\n<p>SKOR 210 (Lucia)</p>\r\n', '2022-06-03 15:30:43', 625, 'R', 58, NULL, 3152, 'ANALISIS DAN EVALUASI DESAIN ANTARMUKA WEBSITE SEKOLAH (STUDI KASUS SMA5TEBO.SCH.ID)', 'ANALISIS DAN EVALUASI DESAIN ANTARMUKA WEBSITE SEKOLAH (STUDI KASUS SMA5TEBO.SCH.ID)', '71180363', 'Y', 12, 167, 'T'),
(3129, '2022-05-12 14:56:11', '<p>Tanggapan umum:</p>\r\n\r\n<p>-Proposal ini berusaha menjelaskan tentang implementasi dari Wit.AI untuk mengembangkan sebuah Chatbot di Telegram dengan <em>use case</em> Penerimaan Mahasiswa Baru (PMB) di UKDW<br />\r\n-Semua kata berbahasa asing perlu dicetak miring.<br />\r\n-Ada banyak <em>typographical error </em>di berbagai tempat.<br />\r\n-&quot;Penulisan &quot;&quot;di&quot;&quot; sebagai imbuhan atau &quot;&quot;di&quot;&quot; sebagai kata depan, perlu diperhatikan. Mis. kata &#39;di ekstrak&#39; dan &#39;di navigasikan&#39; harus ditulis &#39;diekstrak&#39; dan &#39;dinavigasikan&#39; karena merupakan kata berimbuhan. Sedangkan kata &#39;didalam&#39; ditulis &#39;di dalam&#39; karena &#39;di&#39; di sana merupakan kata depan.</p>\r\n\r\n<p>Rumus:<br />\r\n- &quot;&quot;imbuhan di/ke + kata_dasar&quot;&quot; ditulis jadi satu<br />\r\n- &quot;&quot;di/ke + kata_tempat&quot;&quot; ditulis terpisah&quot;<br />\r\n-Perhatikan format penulisan.<br />\r\n-Lihat dokumen proposal hasil <em>review </em>DE1 dan DE2<br />\r\n&nbsp;</p>\r\n\r\n<p>Tanggapan khusus:</p>\r\n\r\n<p>1.Latar Belakang<br />\r\n-Tidak ada perubahan dari DE1<br />\r\n-Perlu ditambahkan, alasan pemilihan kasusnya<br />\r\n<br />\r\n2.Rumusan Masalah<br />\r\n-Penulisannya dibuat menjadi paragraf.<br />\r\n<br />\r\n3.Batasan Masalah<br />\r\n--<br />\r\n<br />\r\n4.Tujuan penelitian<br />\r\n-Lihat catatan saya di proposal Anda.<br />\r\n<br />\r\n5.Manfaat penelitian<br />\r\n-Manfaat penelitian bisa dilihat dari beberapa sudut pandang, misalnya: manfaat bagi peneliti, bagi (admisi) UKDW, bagi masyarakat luas, dll.<br />\r\n<br />\r\n6.Tinjauan Pustaka<br />\r\n-Format penulisan salah. Nomor &quot;6.1&quot; rata kiri. Paragraf rata kiri.<br />\r\n<br />\r\n7.Landasan Teori<br />\r\n-Format penulisan salah. Nomor &quot;6.2&quot; dan &quot;6.2.1&quot; rata kiri. Paragraf rata kiri.<br />\r\n-Perlu diberi contoh pembuatannya<br />\r\n-Belum ada informasi tentang metode pengembangan dan metode evaluasi yg akan digunakan<br />\r\n<br />\r\n8.Blok Diagram<br />\r\n-Penomoran gambar: Gambar 1, Gambar 2, dst.<br />\r\n<br />\r\n9.Metodologi Penelitian<br />\r\n-&quot;Data&quot; bersifat plural, singular-nya &quot;datum&quot;<br />\r\n-Kalau sudah memilih metode pengembangan, setiap tahap yang akan dilakukan terkait penelitian ini bisa dijelaskan di sini<br />\r\n<br />\r\n10.Daftar Pustaka<br />\r\n-Cara menulis nama <em>author</em> berbeda-beda.<br />\r\n-Cara penulisan perlu mengikuti standar penulisan APA Style!</p>\r\n\r\n<p>SKOR 235 (GV)</p>\r\n', '2022-05-19 11:12:23', 625, 'R', 12, NULL, 3151, 'PENGEMBANGAN CHATBOT TELEGRAM INFORMASI PENERIMAAN MAHASISWA BARU MENGGUNAKAN INTERFACE  WIT.AI', 'PENGEMBANGAN CHATBOT TELEGRAM INFORMASI PENERIMAAN MAHASISWA BARU MENGGUNAKAN INTERFACE  WIT.AI', '71170186', 'T', 13, 167, 'T'),
(3130, '2022-05-12 14:58:30', '<p>- Rincian komponen data yang akan diolah dan ditampilkan belum jelas.</p>\r\n\r\n<p>- Tata penulisan belum memenuhi kaidah dan format baku.</p>\r\n\r\n<p>- Wajib konsultasi dengan Evaluator terlebih dahulu.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>N=210</p>\r\n', '2022-06-03 14:01:07', 642, 'R', 58, NULL, 3155, 'Peracangan Data Mart untuk Manager pada Hotel: \r\nStudi Kasus pada Hotel Brothers Inn', 'Peracangan Data Mart untuk Manager pada Hotel: \r\nStudi Kasus pada Hotel Brothers Inn', '71190435', 'Y', 39, 169, 'T'),
(3131, '2022-05-12 15:00:15', '<p>Cara menulis sitasi pada tinjauan pustaka landasan teori harus konsisten. Ada kesan dicopy dari beberapa sumber yg berbeda sehinga tidak konsisten</p>\r\n\r\n<p>SKOR 300 (SriS)</p>\r\n', '2022-06-03 11:25:41', 625, 'R', 54, NULL, 3156, 'RANCANG BANGUN APLIKASI KASIR BERBASIS WEB MENGGUNAKAN FRAMEWORK CODEIGNITER 4 PADA UMKM XYZ', 'RANCANG BANGUN APLIKASI KASIR BERBASIS WEB MENGGUNAKAN FRAMEWORK CODEIGNITER 4 PADA UMKM XYZ', '71170226', 'Y', 6, 168, 'T'),
(3132, '2022-05-12 15:03:03', '<ul>\r\n	<li>Bisa dijelaskan di latar belakang apa keurangan dari Zoom. Idenya bisa dipahami tapi penyusunan argumentasi kurang. Mis; website interaaktif memungkinkan interaksi 2 arah (hal ini juga dilakukan di zoom), alasan pembuatan website adalah karena pembelajaran dilaksanakan secara zoom, ini juga kurang meyakinkan karena zoom juga dapat diakses melalui piranti bergerak, jadi seabiknya berikan alasan latar belakang yang lebih baik.</li>\r\n	<li>Perbaiki: Tinjauan Puastaka (hubungan antar penelitian yang dikutip + penelitian yang dikutip dengan penelitian yang akan dilakukan (perbedaanya)), tambahkan landasan teori tentang website dan website interaktif, blok digram sistem, refrensi perbanyak dari 5 tahun terakhir</li>\r\n</ul>\r\n\r\n<p>NILAI 240</p>\r\n', '2022-06-03 13:50:16', 1486, 'R', 6, NULL, 3158, 'PERANCANGAN DAN IMPLEMENTASI WEBSITE INTERAKTIF PEMBELAJARAN SEKOLAH MINGGU GMIT GETSEMANI ASAM TIGA', 'PERANCANGAN DAN IMPLEMENTASI WEBSITE INTERAKTIF PEMBELAJARAN SEKOLAH MINGGU GMIT GETSEMANI ASAM TIGA', '71180371', 'Y', 9, 170, 'T'),
(3133, '2022-05-12 15:06:52', '<p>1 topik bisa, sudah lebih baik, namun judul perlu didiskusikan tentang &quot;penerapan&quot;.</p>\r\n\r\n<p>2 tinjauan pustaka: Kenapa Hutabarat tidak ada? tambahkan disini juga<br />\r\nLalu tambahkan 1 paragraf lagi untuk menjelaskan apa perbedaan dari yang<br />\r\nanda buat dengan pustaka2 yg sudah diacu....</p>\r\n\r\n<p>3 teori AIML sangat kurang, perlu diberi contoh, rumus pada jaro dan rabin karp harus ada dan diberi contoh perhitungan sederhana</p>\r\n\r\n<p>4 confusion matrix blm ada gambar tabelnya, trus apa yg mau diukur akurasinya? bagimana mana? ditulis</p>\r\n\r\n<p>5 bagian metode belum jelas implementasi metodenya, tolong dijelaskan dengan detail bagaimana penerapan metode koreksi ejaannya</p>\r\n\r\n<p>6 flowchartnya jgn cuma keseluruhan, tapi yg penting bagian koreksi ejaan dan bagian evaluasinya gmn?</p>\r\n\r\n<p>7. judulnya sepertinya agak aneh kenapa penerapan ya? biasanya kan penelitian2 yg pada umumnya jg menerapkan hal pre-processing dan spell checker, lalu kalau ditulis di judul rasanya jadi aneh... Atau mau ditulis pengaruh penerapan.... atau efek penerapan ....</p>\r\n\r\n<p>SKOR: 275 (ARC)</p>\r\n', '2022-06-03 10:40:00', 625, 'R', 12, NULL, 3157, 'PENERAPAN TEXT-PREPROCESSING DAN SPELL CHECKER PADA CHATBOT SEPUTAR INFORMASI PENERIMAAN MAHASISWA BARU UKDW', 'PENERAPAN TEXT-PREPROCESSING DAN SPELL CHECKER PADA CHATBOT SEPUTAR INFORMASI PENERIMAAN MAHASISWA BARU UKDW', '71180369', 'Y', 17, 167, 'T'),
(3134, '2022-05-12 15:09:31', '<p>1 Tinjauan Pustaka sudah cukup untuk penelitian yang bertema pengingat. Namun untuk aplikasi mobile untuk pengingat belum ada</p>\r\n\r\n<p>2 Pada tinjauan pustaka kedua, oleh Alvian dan Putra, bukannya mengenai obat diabetes. Mengapa ada kalimat: &quot;intervensi yang dilakukan adalah pemasangan aplikasi digital pengingat penggunaan narkoba pada handphone&quot;</p>\r\n\r\n<p>3 Teori dan perhitungan untuk mengukur efektivitas sistem tersebut dengan pendekatan sasaran (Goals Approach), belum ada. Bagaimana cara perhitungan tingkat efektifitas dengan Goals Approach</p>\r\n\r\n<p>4 Blok diagram sistem kok seperti itu? bukankan yg digambarkan adalah alur penelitian?</p>\r\n\r\n<p>5 Tiba-tiba muncul UCD di alur penelitian? UCD bukan hanya untuk analisis kebutuhan dan perancangan desain UI saja, namun sudah sampai pada pembuatan prototype dan diujikan ke pengguna.</p>\r\n\r\n<p>6 Jika dibaca di point 7.2, manakah metode yg akan digunakan? UCD atau prototyping?</p>\r\n\r\n<p>SKOR 295 (Nila)</p>\r\n', '2022-06-02 12:23:47', 625, 'R', 8, NULL, 3160, 'SISTEM PENGELOLAAN KONSUMSI OBAT PASIEN MULTI KLINIK MEMANFAATKAN FIREBASE IN-APP MESSAGING', 'SISTEM PENGELOLAAN KONSUMSI OBAT PASIEN MULTI KLINIK MEMANFAATKAN FIREBASE IN-APP MESSAGING', '71180362', 'Y', 55, 167, 'T'),
(3135, '2022-05-12 15:11:07', '<p>Evaluator: I Kadek Dendy S</p>\r\n\r\n<p>Skor: 200</p>\r\n\r\n<p>Rumusan masalah dan tujuan penelitian belum mencerminkan urgensi kenapa penelitian perlu dilakukan<br />\r\nmetode penelitian yang ditulis masih belum lengkap. Seharusnya menjelaskan test environment pengujian,<br />\r\nset data pengujian, workload pengujian, dll. Metrik pengujian untuk mengevaluasi hasil akhir juga belum<br />\r\ndidefinisikan dengan jelas.<br />\r\nLandasan teori masih kurang dan belum ada yg menjelaskan tentang mengapa tools pengujian digunakan.<br />\r\nSumber pustaka untuk metode benchmarking masih kurang.<br />\r\nFormat proposal banyak yang perlu dirapikan.</p>\r\n', '2022-05-20 10:57:34', 636, 'R', 15, NULL, 3159, 'ANALISIS PERBANDINGAN PERFORMA DATABASE MYSQL DAN MARIADB', 'ANALISIS PERBANDINGAN PERFORMA DATABASE MYSQL DAN MARIADB', '71180377', 'T', 59, 168, 'T'),
(3136, '2022-05-12 15:12:34', '<p>Evaluator: Kristian Adi Nugraha</p>\r\n\r\n<p>Skor: 245</p>\r\n\r\n<p>- format proposal di beberapa bagian masih belum sesuai dengan template</p>\r\n', '2022-06-03 01:02:43', 636, 'R', 16, NULL, 3161, 'Penerapan Metode Goal Directed Design Dalam Pembuatan Website PT Tunas Dwipa Matra\r\n', 'Penerapan Metode Goal Directed Design Dalam Pembuatan Website PT Tunas Dwipa Matra\r\n', '71160024', 'Y', 50, 168, 'T'),
(3137, '2022-05-12 15:13:50', '<ul>\r\n	<li>Di latar belakang disebut sebagai BELUM memiliki website dan akan dibuatkan website E-class nya. Tapi di judul hanya Perancangan Desain Antarmuka?</li>\r\n	<li>Saya rasa latar belakang jadi tidak masuk akal/tidak sinkron dengan judul - konten - apa yang hendak dibuat.</li>\r\n	<li>Di Latar belakang ada menyebut agar dapat efisien dan efektif. bagaimana kamu menguji efisien dan efektif?</li>\r\n	<li>Responden 32 &gt; semua akan dijadikan dasar UCD?</li>\r\n	<li>tabel 1 dan 2 rangkuman, tapi masing-masing hanya 1 tinjauan pustaka?</li>\r\n	<li>tinjauan pustaka sangat kurang</li>\r\n	<li>daftar pustaka banyak, tetapi tidak banyak dituliskan sebagai tinjauan pustaka.</li>\r\n	<li>format proposal seperti copy paste. perhatikan format.</li>\r\n</ul>\r\n\r\n<p>NILAI : 175</p>\r\n', '2022-05-20 11:09:01', 1486, 'K', 6, NULL, 3163, 'PERANCANGAN DESAIN ANTARMUKA SITUS E-CLASS SMK NEGERI 2 TANJUNG SELOR DENGAN METODE USER CENTERED DESIGN', 'PERANCANGAN DESAIN ANTARMUKA SITUS E-CLASS SMK NEGERI 2 TANJUNG SELOR DENGAN METODE USER CENTERED DESIGN', '71180360', 'T', 54, 170, 'T'),
(3138, '2022-05-12 15:15:24', '<ol>\r\n	<li><strong>Latar belakang: </strong>Anda fokusnya pada seminar atau skripsi atau dua2nya? Jabarkan secara lengkap kondisi saat ini seperti apa, email ke siapa, langkah-langkahnya itu seperti apa dan data apa saja yang harus tercantum pada email.&nbsp;</li>\r\n	<li><strong>Rumusan masalah: </strong>Bagaimana cara pembuktikan nilai efisiensi dengan e-collect vs dengan email? Berarti kan harus ada nilai pembanding untuk yang email. Dan karena anda masukkan ke dalam rumusan masalah maka harus ada jawabannya pada penelitian anda.</li>\r\n	<li><strong>Batasan masalah: </strong>Yang akan mengakses sistem ini apakah semua dosen? Kalau saat ini pengumpulan skripsi dan seminar kan hanya koordinator skripsi saja.</li>\r\n	<li><strong>Manfaat penelitian: </strong>Tidak sinkron dengan latar belakang. Kok tiba2 ada tugas mata kuliah. Jadi sistem pengumpulan anda itu untuk apa? Tadi di awal disebutkan untuk seminar/skripsi..?</li>\r\n	<li><strong>Landasan teori dan tinjauan pustaka: </strong>\r\n	<ul>\r\n		<li>Hasil plagiarisme, anda hanya copy paste dari situs website</li>\r\n		<li>Apakah anda memakai model WELS? Hubungannya apa dengan penelitian anda?</li>\r\n		<li>Apakah sistem anda ada pelabelan yang memakai Levenshtein distance juga? Kenapa ada tinjauan pustaka ini?&quot;</li>\r\n	</ul>\r\n	</li>\r\n	<li><strong>Blok sistem diagram:</strong>\r\n	<ul>\r\n		<li>&quot;Pilihan&quot; itu apa maksudnya? Pilihan apa? Tidak ada pernyataan pilihannya, tidak ada label yes dan no untuk hasil pilihannya.</li>\r\n		<li>Pada bagian dosen, setelah add komen lalu apa yang terjadi? Apakah berhenti di situ saja?&nbsp;</li>\r\n		<li>Bagian set daftar pengumpulan dan set jadwal rancu, tidak jelas alurnya</li>\r\n		<li>Diagram proses bisnisnya perlu diperbaiki karena banyak hal yang tidak jelas.&quot;</li>\r\n	</ul>\r\n	</li>\r\n	<li><strong>Daftar pustaka: </strong>Rapikan tulisannya</li>\r\n</ol>\r\n\r\n<p>N=205</p>\r\n', '2022-06-03 14:10:37', 642, 'R', 17, NULL, 3162, 'Pengembangan Sistem E-Collect untuk Pengumpulan Dokumen Menggunakan Metode Fast', 'Pengembangan Sistem E-Collect untuk Pengumpulan Dokumen Menggunakan Metode Fast', '71180381', 'Y', 58, 169, 'T'),
(3139, '2022-05-12 18:02:57', '<p>1 Bagian latar belakang masih melompat-lompat, lihat file pdf pada catatan</p>\r\n\r\n<p>2 Metodenya OK, yang mau dilakukan OK, tapi kurang detail langkah2nya, evaluasinya juga belum jelas</p>\r\n\r\n<p>3 Tujuan penelitian adalah apa yg akan diteliti bukan membantu organisasi</p>\r\n\r\n<p>4 TInjauan pustaka perlu menambah paragraf lagi, lihat di file pdf</p>\r\n\r\n<p>5 Keterangan gambar dan acuan gambar tidak ada</p>\r\n\r\n<p>SKOR 275 (ARC)</p>\r\n', '2022-06-03 14:18:33', 625, 'R', 58, NULL, 3140, 'SISTEM REPOSITORI KESEHATAN JIWA WARGA DAMPINGAN YAYASAN SATUNAMA', 'SISTEM REPOSITORI KESEHATAN JIWA WARGA DAMPINGAN YAYASAN SATUNAMA', '71190441', 'Y', 17, 167, 'T'),
