(3303, '2022-11-25 08:23:37', '<p><strong>REVISI MAYOR 200</strong></p>\r\n\r\n<ul>\r\n	<li>LATAR BELAKANG<br />\r\n	Belum jelas apa yang menjadi masalah .. informasi yang tidak bisa diakses, informasi yang tidak akurat, pengolahan data akademik? -&gt; yang akan dibuat website / sistem informasi berbasis web? Karena UCD diletakkan di judul, latar belakang sebaiknya menjelaskan kenapa metode itu yang dianggap paling cocok (dibandingkan metode lain seperti GDD, design thinking, dll).</li>\r\n	<li>RUMUSAN MASALAH<br />\r\n	Dalam membuat naskah proposal harus koheren (saling terkait), jika yang akan dibuat penjadwalan kegiatan, maka latar belakang menjelaskan kondisi dan masalah apa yang ada saat ini terkait penjadwalan kegiatan</li>\r\n	<li>BATASAN MASALAH =? METODE PENELITIAN</li>\r\n	<li>TUJUAN PENELITIAN</li>\r\n	<li>Apa beda tujuan penelitian dengan rumusan masalah?</li>\r\n	<li>TINJAUAN PUSTAKA<br />\r\n	Belum terlihat keterkaitan antar penelitian yang dikutip dan keterkaitan antara penelitian- penelitian tersebut dengan penelitian yang akan dilakukan -&gt; menunjukkan novelty dan kebaruan masalah.</li>\r\n	<li>METODE PENELITIAN<br />\r\n	UCD adalah metode yang digunakan dalam pengembangan suatu sistem/aplikasi dari awal, perancangan hingga pengujiannya bukan hanya metode untuk perancangan desain.</li>\r\n	<li>KOMENTAR PENULISAN<br />\r\n	Perhatikan ejaan dan penggunaan EYD yang benar, mis penggunaan huruf besar, singkatan dsb. Untuk sub bab, jika hanya terdiri dari 1 paragraf apalagi hanya 1 kalimat tidak usah dibuat menjadi sub bab. Untuk pengutipan jangan menggunakan copy-paste yang mungkin terpotong, sebaiknya menggunakan parafrase .. mis 6.2.3 Sistem informasi adalah sebagai suatu sistem ... dst bukanlah suatu kalimat yang lengkap/benar. Penulisan rumus variabelnya hilang / tidak tertulis.</li>\r\n</ul>\r\n', '2022-12-16 14:38:14', 625, 'R', 7, NULL, 3339, 'RANCANGAN SISTEM INFORMASI KEGIATAN SEKOLAH BERBASIS WEBSITE MENGGUNAKAN METODE USER CENTERED DESIGN (STUDI KASUS: SDN 09 ENGKALONG)', 'RANCANGAN SISTEM INFORMASI KEGIATAN SEKOLAH BERBASIS WEBSITE MENGGUNAKAN METODE USER CENTERED DESIGN (STUDI KASUS: SDN 09 ENGKALONG)', '71170161', 'Y', 9, 182, 'T'),
