(3325, '2022-11-25 12:47:54', '<p><strong>REVISI MAYOR 220</strong></p>\r\n\r\n<p>Judul skripsi pengembangan sistem informasi umum diteliti, dilakukan pengujian dg UCD;</p>\r\n\r\n<p>Latar Belakang =&gt; Perlu dipertegas</p>\r\n\r\n<p>*masalah apa sehingga perlu dikembangkan sistem ini;</p>\r\n\r\n<p>** lalu solusi masalah tersebut dengan apa, &amp;</p>\r\n\r\n<p>*** dianalisis/dievaluasi dengan metode UCD terkait dengan siapa saja, bagian apa, dst.</p>\r\n\r\n<p>Rumusan masalah dan batasan masalah oke, cukup =&gt; perlu ditambahkan yang mau menguji siapa saja.</p>\r\n\r\n<p>Manfaat Penelitian =&gt; bisa diuraikan untuk lembag apa; untuk pengguna apa dan bagi mahasiswa sendiri.</p>\r\n\r\n<p>Tinjauan pustaka PERLU ditambahkan terkait dengan skripsi semacam dan atau metode UCD, dan landasan teori silahkan dilengkapi dengan variabel untuk menguji, rumusan yang dipergunakan untuk menguji dan mohon ditulis dengan rapi dan sesuai dengan panduan penulisan proposal/skripsi.&nbsp;</p>\r\n\r\n<p>Blok Diagram sistem, mohon dijelaskan secara terstruktur per bagian dalam proses alur diagramnya. ==&gt; 1. bla-bla 2. bla-bla, dst (jangan satu paragraf saja) dan gambar bisa agak diperbesar agar kelihatan.&nbsp;</p>\r\n\r\n<p>Noted. Perlukah ada proses beta tes dan alfa tes? Mulai dari prototipe, desain awal, diuji, desain akhir diuji. Struktur penulisan proposal &amp; terutama kerapian mohon bisa diperhatikan.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2022-12-16 15:00:42', 625, 'R', 55, NULL, 3362, 'PERANCANGAN SISTEM INFORMASI INPUT DAILY LOG-BOOK KESEHATAN JIWA YAYASAN SATUNAMA', 'PERANCANGAN SISTEM INFORMASI INPUT DAILY LOG-BOOK KESEHATAN JIWA YAYASAN SATUNAMA', '71190486', 'Y', 10, 182, 'T'),
(3326, '2022-11-25 12:48:51', '<p><strong>REVISI MAYOR 200</strong></p>\r\n\r\n<p>1. Latar belakang (dan sub bab lainnya) harusnya menyajikan fakta, bukan asumsi.<br />\r\n2. jika hanya berisi jadwal acara, naskah ceramah, dan topik ceramah kegiatan geraja kenapa tidak menggunakan medsos seperti facebook, youtube atau bloggers saja ? Apa keunggulan website warta jemaat yang akan dibuat dibandingkan aplikasi-aplikasi itu?<br />\r\n3. masalah penelitian belum terlihat didalam proposal ini.</p>\r\n', '2022-12-07 12:09:57', 625, 'R', 3, NULL, 3363, 'PERANCANGAN SISTEM INFORMASI WARTA JEMAAT GEREJA BATAK KARO PROTESTAN (GBKP) BERBASIS WEB STUDI KASUS: GBKP RUNGGUN TANJUNG RAJA', 'PERANCANGAN SISTEM INFORMASI WARTA JEMAAT GEREJA BATAK KARO PROTESTAN (GBKP) BERBASIS WEB STUDI KASUS: GBKP RUNGGUN TANJUNG RAJA', '71160132', 'T', 59, 182, 'T'),
(3327, '2022-11-25 12:50:47', '<p>N=300&nbsp;DITERIMA DENGAN REVISI MINOR</p>\r\n\r\n<p>Review:&nbsp;https://drive.google.com/file/d/1EnjTz0Kd2aFWE0ryMOGO5EXs8O3Szf6p/view?usp=share_link</p>\r\n', '2022-12-16 12:18:44', 642, 'R', 12, NULL, 3366, 'EVALUASI DAN PERBAIKAN DESAIN\r\nDASHBOARD SITUS WEB SISTEM KERJASAMA\r\n(SIKERMA) UNIVERSITAS KRISTEN DUTA\r\nWACANA (UKDW) MENGGUNAKAN METODE\r\nGOAL-DIRECTED DESIGN (GDD)', 'EVALUASI DAN PERBAIKAN DESAIN DASHBOARD SITUS WEB SISTEM KERJASAMA (SIKERMA) UNIVERSITAS KRISTEN DUTA WACANA (UKDW) MENGGUNAKAN METODE GOAL-DIRECTED DESIGN (GDD)						', '71190516', 'Y', 39, 180, 'T'),
(3328, '2022-11-25 12:51:50', '<p>N=100 DITOLAK</p>\r\n\r\n<p>Review:&nbsp;https://drive.google.com/file/d/1_Hq8Wacgi2LwC6oR8gA6VWdzBE7jO-1s/view?usp=share_link</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2022-12-06 15:38:31', 642, 'K', 9, NULL, 3365, 'Analisis dan Perancangan Ulang Desain Web SMKSIP.COM', 'Analisis dan Perancangan Ulang Desain Web SMKSIP.COM', '71190479', 'T', 19, 180, 'T'),
(3329, '2022-11-25 12:53:44', '<p>N=100&nbsp;DITOLAK</p>\r\n\r\n<p>Review:&nbsp;https://drive.google.com/file/d/1vFqfGZAcef3wspqyuYpMEkByGspQNhoh/view?usp=share_link</p>\r\n', '2022-12-06 15:33:39', 642, 'K', 12, NULL, 3367, 'EVALUASI DAN PERBAIKAN RANCANGAN ANTARMUKA WEBSITE SEKOLAH (STUDI KASUS: SMA5TEBO.SCH.ID)', 'EVALUASI DAN PERBAIKAN RANCANGAN ANTARMUKA WEBSITE SEKOLAH (STUDI KASUS: SMA5TEBO.SCH.ID)', '71180363', 'T', 12, 180, 'T'),
(3330, '2022-11-25 13:19:54', '<p><strong>CATATAN KETUA (JIKA ADA):</strong></p>\r\n\r\n<ol>\r\n	<li><strong>HARAP berproses dengan dosen evaluator</strong></li>\r\n</ol>\r\n', '2022-12-17 09:35:14', 1315, 'R', 10, NULL, 3372, 'PERANCANGAN WEBSITE DATA KEGIATAN PERTANIAN KOMUNITAS DESA CINTA DAME 4 BALIMBINGAN', 'PERANCANGAN WEBSITE DATA KEGIATAN PERTANIAN KOMUNITAS DESA CINTA DAME 4 BALIMBINGAN', '71170208', 'Y', 15, 181, 'T'),
(3331, '2022-11-25 13:20:49', '<p>CATATAN KETUA (JIKA ADA):</p>\r\n\r\n<ul>\r\n	<li>Terlalu sederhana jika hanya menampilkan data dan website sudah cukup bagus</li>\r\n	<li>user-nya siapa. harap dijabarkan</li>\r\n	<li>WAJIB konsultasi dengan Pak Sri, selaku evaluator.</li>\r\n</ul>\r\n', '2022-12-16 12:00:31', 1315, 'R', 9, NULL, 3370, 'PERANCANGAN ULANG DESAIN ANTARMUKA WEBSITE GEREJA IMMANUEL PALU', 'PERANCANGAN ULANG DESAIN ANTARMUKA WEBSITE GEREJA IMMANUEL PALU', '71190430', 'Y', 6, 181, 'T'),
(3332, '2022-11-25 13:21:38', '<ol>\r\n	<li>\r\n	<p>Aplikasi ini hanya memiliki fitur untuk menggantikan buku panduan alat fitness menjadi bentuk video saja.&nbsp; Jika demikian, bagaimana cara mengukur apakah aplikasi ini membantu / tidak? apakah menggunakan kuesioner? di bagian mana ya akan melakukan kuesioner?</p>\r\n	</li>\r\n	<li>\r\n	<p>Manfaat di bab 1 tidak perlu manfaat untuk penulis.</p>\r\n	</li>\r\n	<li>\r\n	<p>Bab 2 teori: tolong teori tentang fitness tidak perlu karena intinya pada aplikasi fitness dan metode desain serta pengembangannya.&nbsp; Bagian tinjauan pustaka harus berisi jurnal2 yang juga membahas ttg aplikasi sejenis, apa bedanya dengan penelitian yang anda buat dengan yang sudah ada?</p>\r\n	</li>\r\n	<li>\r\n	<p>Untuk pengujian aplikasi berarti ada 2 ya? pengujian apakah berguna / bermanfaat? (ini belum ada metodenya) dan yang kedua metode functional testing (ini sudah ada).&nbsp; Siapa yang akan mengetest?</p>\r\n	</li>\r\n	<li>\r\n	<p>Untuk gambar2 perlu di acu di teks dan juga diberi penjelasan, bukan hanya gambar saja</p>\r\n	</li>\r\n	<li>\r\n	<p>Alternatif aplikasi ini:</p>\r\n\r\n	<ol>\r\n		<li>\r\n		<p>Aplikasi tutorial pengggunaan alat fitness</p>\r\n		</li>\r\n		<li>\r\n		<p>Aplikasi pencatatan history latihan fitness agar dapat dilihat history</p>\r\n		</li>\r\n		<li>\r\n		<p>Aplikasi tentang digital aset management tentang repo video</p>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n	<li>\r\n	<p>Disarankan tidak fokus pada user interface desain saja, bisa ke arah prototyoping</p>\r\n	</li>\r\n	<li>\r\n	<p>DIterima dengan revisi mayor (225)</p>\r\n	</li>\r\n</ol>\r\n', '2022-12-01 13:40:31', 625, 'R', 59, NULL, 3371, 'APLIKASI PANDUAN PENGGUNAAN ALAT FITNESS BERBASIS ANDROID ', 'APLIKASI PANDUAN PENGGUNAAN ALAT FITNESS BERBASIS ANDROID ', '71170167', 'T', 17, 183, 'T'),
(3333, '2022-11-25 13:22:32', '<p>&gt; Pada latar belakang mengapa tiba-tiba muncul saga pattern? Mungkin anda dapat menjelaskan secara singkat saga pattern itu apa baru kemudian diceritakan dalam kasus anda.<br />\r\n&bull; Pada latar belakang perlu menambahkan kutipan yang sesuai dengan data / fakta yang anda kutip.<br />\r\n&bull; Pada tujuan penelitian, menghitung scalabe bagaimana?<br />\r\n&bull; Beberapa gambar berikan caption yang sesuai.<br />\r\n&bull; Apakah diagram blok penelitian sudah fix? Ada penambahan?<br />\r\n&bull; Pada subbab metodologi penelitian, silakan anda jelaskan detail masing-masing yang anda tuliskan dalam diagram blok penelitian, termasuk metode setiap tahapnya dan luaran tiap tahapannya sesuai dengan kasus yang anda angkat.</p>\r\n\r\n<p>Metode penelitian belum jelas</p>\r\n\r\n<p>DITOLAK (190)</p>\r\n', '2022-12-01 13:44:37', 625, 'K', 8, NULL, 3368, 'Penerapan Pattern Saga Dalam Arsitektur Microservices Untuk Prototipe Sistem Multi Klinik', 'Penerapan Pattern Saga Dalam Arsitektur Microservices Untuk Prototipe Sistem Multi Klinik', '71180368', 'T', 57, 183, 'T'),
(3334, '2022-11-25 13:23:18', '<ul>\r\n	<li>Hal yang perlu diujikan perlu disesuaikan kembali. Karena dari sisi akurasi sudah sangat baik dari beberapa referensi yang ada, yaitu bisa mencapai 99%. Lalu sampai akurasi berapa yang mau anda ujikan di penelitian anda ini.</li>\r\n	<li>Penulisan lebih difokuskan pada pengembanga aplikasinya dan pengujian aplikasi</li>\r\n	<li>Pengujian bisa lebih difokuskan pada fungsi aplikasi yang dikembangkan. Tidak lagi pada pengujian akurasi model.</li>\r\n	<li>Catatan lebih ada pada proposal</li>\r\n</ul>\r\n\r\n<p>Rekomendasi: Diterima dengan revisi mayor<br />\r\nHubungi Evaluator untuk mendapatkan file proposal yang sudah direview dan konsultasi lebih lanjut</p>\r\n', '2022-12-16 16:32:22', 1061, 'R', 59, NULL, 3369, 'PENGEMBANGAN APLIKASI PRESENSI WAJAH MENGGUNAKAN MODEL MOBILEFACENET', 'PENGEMBANGAN APLIKASI PRESENSI WAJAH MENGGUNAKAN MODEL MOBILEFACENET', '71170186', 'Y', 53, 184, 'T'),
(3335, '2022-11-25 13:24:26', '<ul>\r\n	<li>Implementasi LSTM perlu memperhatikan hasil tugas akhir serupa tentang saham dengan metode LSTM juga. Jangan sampai mengulangi kesalahan serupa.</li>\r\n	<li>Bisa dicek di katalog.ukdw.ac.id dengan keyword LSTM dengan penulis Vincent Arlen Santoso</li>\r\n	<li>Silahkan baca di perpustakan untuk versi cetaknya</li>\r\n</ul>\r\n\r\n<p>Rekomendasi proposal: DITERIMA</p>\r\n', '2022-12-07 19:22:22', 625, 'T', 2, 17, 3373, 'IMPLEMENTASI ALGORITMA STACKED LONG SHORT-TERM MEMORY UNTUK PREDIKSI HARGA SAHAM PADA INDEKS KOMPAS100', 'IMPLEMENTASI ALGORITMA STACKED LONG SHORT-TERM MEMORY UNTUK PREDIKSI HARGA SAHAM PADA INDEKS KOMPAS100', '71190448', 'T', 2, 184, 'T'),
(3336, '2022-11-25 13:25:20', '<p><strong>REVISI MAYOR 220</strong></p>\r\n\r\n<p>Proposal sudah cukup lengkap, hanya hal-hal berikut harus diperbaiki:</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Arah penggunaan metode-metode yang disebutkan dalam landasan teori, untuk apa saja dalam penelitian ini, mohon diperjelas</p>\r\n\r\n<p>Arah pengujian, apa yang akan diuji dapat lebih diperjelas&nbsp;</p>\r\n', '2022-12-16 10:32:59', 625, 'R', 57, NULL, 3374, 'RANCANG BANGUN APLIKASI PENGENALAN PENYAKIT USUS BERDASARKAN GEJALA AWAL BERBASIS WEB ', 'RANCANG BANGUN APLIKASI PENGENALAN PENYAKIT USUS BERDASARKAN GEJALA AWAL BERBASIS WEB ', '71180377', 'Y', 3, 182, 'T'),
(3337, '2022-11-25 13:36:19', '<p><strong>REVISI MAYOR 220</strong></p>\r\n\r\n<p>Judul Skripsi umum diteliti dan dikerjakan terkait Usabilitas;</p>\r\n\r\n<p>Latar Belakang =&gt; perlu difokuskan kenapa perlu dikembangkan dan rencana evaluasi terhadap Sistem melibatatkan responden siapa saja.</p>\r\n\r\n<p>Rumusan masalah dan batasan masalah oke, cukup jelas {a. pengembangan sistem &amp; b. uji usabilitas.</p>\r\n\r\n<p>Manfaat Penelitian =&gt; bisa diuraikan untuk sekolah apa; untuk pengguna apa dan bagi mahasiswa sendiri.</p>\r\n\r\n<p>Tinjauan pustaka dan landasan teori cukup, perlu ditambahkan proses evaluasi selain SUS menggunakan apa untuk melihat efisiensi dan efektif-nya [rumus perhitungan, jika ada].</p>\r\n\r\n<p>Diagram sistem, mohon dijelaskan secara terstruktur per bagian dalam proses alur diagramnya.</p>\r\n\r\n<p>==&gt; 1. bla-bla 2. bla-bla, dst (jangan satu paragraf saja).</p>\r\n\r\n<p>Noted. Perlukah ada proses beta tes dan alfa tes? Mulai dari prototipe, desain awal, diuji, desain akhir diuji.</p>\r\n', '2022-12-16 12:02:43', 625, 'R', 58, NULL, 3375, 'PENGEMBANGAN DAN PENGUJIAN USABILITAS ANTARMUKA SISTEM PENJADWALAN DAN LAPORAN PENILAIAN DI SMPN 2 TUMPAAN', 'PENGEMBANGAN DAN PENGUJIAN USABILITAS ANTARMUKA SISTEM PENJADWALAN DAN LAPORAN PENILAIAN DI SMPN 2 TUMPAAN', '71190466', 'Y', 10, 182, 'T'),
(3338, '2022-11-25 13:48:41', '<p>Silakan bertemu dengan dosen evaluator</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2022-12-16 12:06:22', 1315, 'R', 19, NULL, 3378, 'PEMBUATAN ANTARMUKA STRUKTUR ORGANISASI INTERAKTIF WEBSITE DESA JAMBUWULUK MENGGUNAKAN METODE USER CENTERED DESIGN', 'PEMBUATAN ANTARMUKA STRUKTUR ORGANISASI INTERAKTIF WEBSITE DESA JAMBUWULUK MENGGUNAKAN METODE USER CENTERED DESIGN', '71160070', 'Y', 55, 181, 'T'),
(3339, '2022-11-25 21:07:29', '<p><strong>CATATAN KETUA (JIKA ADA):</strong></p>\r\n\r\n<ul>\r\n	<li><strong>?Harap berproses dengan dosen evaluator</strong></li>\r\n</ul>\r\n', '2022-12-15 21:22:36', 1315, 'R', 13, NULL, 3390, 'Perancangan Desain Antarmuka Sistem Informasi ISAI Berbasis Website ', 'Perancangan Desain Antarmuka Sistem Informasi ISAI Berbasis Website ', '71180318', 'Y', 15, 181, 'T'),
(3340, '2022-11-25 21:08:57', '<p><strong>REVISI MAYOR 200</strong></p>\r\n\r\n<p>1. Apa perbedaan aplikasi yang dibuat dengan aplikasi-aplikasi bank sampah seperti banksampah.id, smash.id, dll ?<br />\r\n2. Masalah peneliitan tidak berhubungan dengan metode evaluasi yang akan digunakan. Apa hubungan tingkat edukasi pengelolaan sampah masyarakat dengan UCD?<br />\r\n3. tambahkan implementasi konsep2 AI, machine learning, data warehouse atau AR/VR, daripada hanya sekedar merepilkasi applikasi yang sudah ada pada lokasi yang berbeda.<br />\r\n&nbsp;</p>\r\n', '2022-12-07 12:14:25', 625, 'R', 14, NULL, 3357, 'PERANCANGAN APLIKASI E-TRASH BERBASIS ANDROID DI KOTA DENPASAR', 'PERANCANGAN APLIKASI E-TRASH BERBASIS ANDROID DI KOTA DENPASAR', '71170231', 'T', 59, 182, 'T'),
(3341, '2022-11-25 21:11:41', '<p><strong>REVISI MAYOR 200</strong></p>\r\n\r\n<ul>\r\n	<li>LATAR BELAKANG<br />\r\n	Jelaskan masalah, kondisi dan solusi yang ditawarkan. Siapa target user/penggunanya? Karena metode sudah dimentioned di latar belakang, jelaskan mengapa untuk kasus ini metode tersebut dianggap cocok (mis dibandingkan UCD, design thinking, dll). Jika metode yg digunakan tidak spesifik dengan permasalahan yang ada, bisa dijelaskan saja di bab 3 bagian metodologi.<br />\r\n	Apa beda website / sistem informasi / sistem informasi berbasis web? Dari ketiga hal tersebut yang mana yang akan dibuat? Website berbasis mobile vs responsif design?</li>\r\n	<li>RUMUSAN MASALAH<br />\r\n	Agar tidak bingung, saya usulkan menggunakan problem statement dibandingkan dengan research question. Contoh menggunakan RQ, maka pertanyaan apakah website membantu memahami informasi yang disampaikan? Misalnya jawabannya tidak, maka penelitian sudah selesai karena sudah terjawab.</li>\r\n	<li>BATASAN MASALAH<br />\r\n	Jangan rancu dengan spesifikasi / fitur sistem, subjek penelitian (metodologi)</li>\r\n	<li>TINJAUAN PUSTAKA<br />\r\n	Belum tampak keterkaitan antar penelitian yang diacu, dan penelitian yang diacu dengan penelitian yang akan dilakukan. Tinjauan pustaka berfungsi untuk menunjukkan novelty (perbedaan dari penelitian-penelitian sebelumnya) dan kebaruan (terlihat dari pustaka yang digunakan kurang dari 5 tahun, artinya topik tersebut masih relevan saat ini)</li>\r\n	<li>BLOK DIAGRAM SISTEM =? BLOK DIAGRAM PENELITIAN</li>\r\n	<li>METODE PENELITIAN<br />\r\n	Terlalu singkat, kemungkinan ditulis terburu-buru</li>\r\n</ul>\r\n', '2022-12-16 14:57:56', 625, 'R', 13, NULL, 3387, 'Perancangan Sistem Informasi Website ISAI Berbasis Mobile Menggunakan Metode Goal Directed Design', 'Perancangan Sistem Informasi Website ISAI Berbasis Mobile Menggunakan Metode Goal Directed Design', '71180298', 'Y', 9, 182, 'T'),
(3342, '2022-11-25 21:13:21', '<p><strong>DITOLAK 170</strong></p>\r\n\r\n<p>1. Proposal masuk ke ranah Sistem Informasi.<br />\r\n2. Apa perbedaan sistem yang dibuat dengan sistem-sistem Point of sale seperti sultan POS, Mekari, dll.<br />\r\n3. Metode penelitian harusnya berisi bagaimana langkah-langkah penelitian akan dilaksanakan, bukan berisi rancangan sistem.</p>\r\n', '2022-12-07 12:11:27', 625, 'K', 7, NULL, 3393, 'Perancangan User Interface Sistem Informasi Kasir Berbasis Web di Toko Bintang Utama', 'Perancangan User Interface Sistem Informasi Kasir Berbasis Web di Toko Bintang Utama', '71170206', 'T', 59, 182, 'T'),
(3343, '2022-11-25 21:15:07', '<p>Pada latar belakang perlu anda jelaskan mengapa blockchain menjadi solusi? Kira-kira hipotesa<br />\r\nanda mengenai impelmentasi blockchain seperti apa? Pada bagian mana?<br />\r\n&bull; Pada rumusan masalah, memastikan model validasinya itu seperti apa? ada model/metode/perhitungannya?<br />\r\n&bull; Apa maksudnya tanpa mempertimbangkan sisi UX?<br />\r\n&bull; Pada tujuan, belum menjawab konsep validasi dalam rumusan masalah.<br />\r\n&bull; Tinjauan Pustaka dan landasan teori silakan ditambahkan dengan Pustaka atau teori yang terkait dengan penelitian anda.<br />\r\n&bull; Block diagram sistem apakah hanya itu? Silakan berikan keterangan mengenai block diagram yang<br />\r\nanda gambar.<br />\r\n&bull; Metode penelitian yang anda lakukan seperti apa?<br />\r\n&gt; Tambahkan blok diagram penelitian<br />\r\n&gt; Tuliskan dan jelaskan step by step penelitian yang anda kerjakan, termasuk metode dari tiap langkah yang anda gunakan dan juga luaran dari tiap langkah tersebut</p>\r\n\r\n<p>Metode penelitian masih sangat tidak jelas</p>\r\n\r\n<p>DITOLAK (100)</p>\r\n', '2022-12-01 14:08:31', 625, 'K', 39, NULL, 3394, 'IMPLEMENTASI KONSEP TEKNOLOGI BLOCKCHAIN GUNA MENINGKATKAN INTEGRITAS DATA DALAM PENGELOLAAN HISTORI PENGGARAPAN LAHAN', 'IMPLEMENTASI BLOCKCHAIN GUNA MENINGKATKAN INTEGRITAS DATA DALAM PENGELOLAAN HISTORI PENGGARAPAN LAHAN', '71190456', 'T', 57, 183, 'T'),
(3344, '2022-11-25 21:17:53', '<ul>\r\n	<li>Proposal skripsi perlu diperbaiki sehingga menjadi tulisan yang original tulisan anda, karena hasil dari DE didapati kesamaan dengan tulisan proposal Joyce, seperti pada gambar, topologi yang mau dibuat. Intinya semua harus keluar dari pemikiran anda sendiri meskipun anda bekerja sebagai satu tim.</li>\r\n	<li>Skenario pengujian diperjelas, seperti penjelasan skenario 1 2 dst seperti.</li>\r\n	<li>Pengujian 1 dan 2 mau dibuat seperti apa pemberian bebannya.</li>\r\n	<li>Latar belakang bisa disisipkan dari tinjauan pustaka yang anda pelajari untuk memperkuat bahwa riset anda diperlukan</li>\r\n	<li>Bila ada pertanyaan silahkan hub. Evaluator.</li>\r\n</ul>\r\n', '2022-12-16 13:01:37', 1061, 'R', 1, NULL, 3392, 'TINJAUAN PERFORMA LOAD BALANCING ECMP DENGAN NTH PADA IMPLEMENTASI BEBERAPA JALUR INTERNET', 'TINJAUAN PERFORMA LOAD BALANCING ECMP DENGAN NTH PADA IMPLEMENTASI BEBERAPA JALUR INTERNET', '71190512', 'Y', 7, 184, 'T'),
(3345, '2022-11-25 21:19:55', '<p>WAJIB bertemu dengan dosen evaluator.</p>\r\n', '2022-12-15 21:59:45', 1315, 'R', 13, NULL, 3391, 'Visualisasi Data Mahasiswa Program MBKM di Prodi Informatika UKDW\r\n', 'Visualisasi Data Mahasiswa Program MBKM di Prodi Informatika UKDW\r\n', '71160047', 'Y', 58, 181, 'T'),
(3346, '2022-11-25 21:22:00', '<p><strong>REVISI MAYOR 200</strong></p>\r\n\r\n<p><strong>Latar Belakang:</strong> Permsalahaan secara detil tidak disebutkan, hanya disebutkan banyak terjadi kesalahan laporan. Sehingga apa yang akan dibangun juga masih bias, saya tidak bisa mendapatkan gambaran mengenai website seperti apa yang akan dibangun dan untuk menyelesaikan masalah seperti apa.</p>\r\n\r\n<p><strong>Batasan Masalah: </strong>Tidak menyebutkan Batasan masalah, justru yang disebutkan adalah spesifikasi sistem.</p>\r\n\r\n<p><strong>Metode:</strong> Single-Page Application tidak cocok untuk dijadikan metode penelitian. Karena website yang dibangun dengan Single-Page atau Multi-Page tidak ada perbedaan untuk menyelesaikan kasus ini. Kecuali yang diteliti adalah perbedaan performa saat menggunakan Single-Page dan Multi-Page.</p>\r\n', '2022-12-07 12:13:42', 625, 'R', 3, NULL, 3388, 'RANCANG BANGUN APLIKASI KASIR BERBASIS WEB MENGGUNAKAN METODE SINGLE PAGE APPLICATION STUDI KASUS: SUER COFFEE COMBI', 'RANCANG BANGUN APLIKASI KASIR BERBASIS WEB MENGGUNAKAN METODE SINGLE PAGE APPLICATION STUDI KASUS: SUER COFFEE COMBI', '71170226', 'T', 50, 182, 'T'),
(3347, '2022-11-25 21:23:33', '<p>CATATAN KETUA (JIKA ADA):</p>\r\n\r\n<ul>\r\n	<li>Ditambahkan untuk petakan desa-nya. Lokasi yang menarik (point of interest) dari desa buahan bali bisa lihat contoh disini: https://www.visitsingapore.com/see-do-singapore/neighbourhoods/</li>\r\n	<li>Turis biasanya mencari via HP, website juga harus bisa responsif. Gunakan teknologi PWA.</li>\r\n</ul>\r\n', '2022-12-16 13:38:20', 1315, 'R', 50, NULL, 3386, 'RANCANG BANGUN UI/UX DENGAN METODE USER CENTERED DESIGN PADA WEBSITE DESA WISATA BUAHAN', 'RANCANG BANGUN UI/UX DENGAN METODE USER CENTERED DESIGN PADA WEBSITE DESA WISATA BUAHAN', '71190444', 'Y', 55, 181, 'T'),
(3348, '2022-11-25 21:25:03', '<p>N=300&nbsp;DITERIMA DENGAN REVISI MINOR</p>\r\n\r\n<p>Review:&nbsp;</p>\r\n\r\n<p>https://drive.google.com/file/d/1tq-Zdz0qHFP9EeDri0X0vPZWqFylueSt/view?usp=share_link</p>\r\n\r\n<p>https://drive.google.com/file/d/1IbqQaU5ZwH5dwQfbcIjBinhvKlitzNRA/view?usp=share_link</p>\r\n', '2022-12-16 13:00:29', 642, 'R', 50, NULL, 3385, 'PERANCANGAN UI/UX E-LERNING DENGAN METODE USER CENTERED DESIGN STUDI KASUS BUTA WARNA SLBN KANATANG', 'PERANCANGAN UI/UX E-LERNING DENGAN METODE USER CENTERED DESIGN STUDI KASUS BUTA WARNA SLBN KANATANG', '71190476', 'Y', 13, 180, 'T'),
(3349, '2022-11-25 21:26:11', '<p>CATATAN KETUA (JIKA ADA):</p>\r\n\r\n<ul>\r\n	<li>Fokus pada website responsive dan monitoring armada. Sehingga tidak hanya merancang ulang namun menambahkan fitur-fitur lain</li>\r\n	<li>WAJIB konsultasi ke dosen Evaluator</li>\r\n</ul>\r\n', '2022-12-16 14:33:24', 1315, 'R', 50, NULL, 3389, 'PERANCANGAN ULANG WEBSITE PT. SWASTIKA JAYADI MANDIRI DENGAN MENGGUNAKAN METODE USER CENTERED DESIGN', 'PERANCANGAN ULANG WEBSITE PT. SWASTIKA JAYADI MANDIRI DENGAN MENGGUNAKAN METODE USER CENTERED DESIGN', '71180348', 'Y', 55, 181, 'T'),
(3350, '2022-11-25 21:27:35', '<p>CATATAN KETUA (JIKA ADA):</p>\r\n\r\n<ul>\r\n	<li>Batasan dan rumusan masalah bertolak belakang. akan membuat warta gereja atau administrasi gereja. Akan lebih baik, jika fokus ke administrasi gereja.</li>\r\n	<li>Harap konsultasi dengan Dosen Evaluator</li>\r\n</ul>\r\n', '2022-12-15 15:38:35', 1315, 'R', 58, NULL, 3384, 'PERANCANGAN SITUS WEB UNTUK INFORMASI PELAYANAN JEMAAT GPIN  BUKIT ASAM TANJUNG ENIM', 'PERANCANGAN SITUS WEB UNTUK INFORMASI PELAYANAN JEMAAT GPIN  BUKIT ASAM TANJUNG ENIM', '71180397', 'Y', 6, 181, 'T'),
(3351, '2022-11-25 21:29:14', '<ul>\r\n	<li>Penjelasan proposal tidak sesuai dengan judul yang menggunakan metode Deep Learning. Metode yang dijelaskan masih pada arsitekur neural network</li>\r\n	<li>Disarankan untuk menggunakan algoritma yang lebih sederhana saja, seperti Na&iuml;ve Bias, Decision Tree, atau metode ML yang masih tergolong sederhana</li>\r\n	<li>Proses persiapan data dan pengelohan selanjutnya sampai pada penggunaan algoritma dan evaluasi belum dijelaskan</li>\r\n	<li>Masih banyak tulisan yang tiba2 muncul tanpa penjelasan sebelumnya.</li>\r\n	<li>Catatan detail ada pada file proposal</li>\r\n	<li>Judul disesuaikan dengan penjelasan di laporan</li>\r\n</ul>\r\n\r\n<p>Rekomendasi: Revisi Mayor.<br />\r\nHubungi Evaluator untuk mendapatkan revisi pada file proposal dan konsultasi lebih lanjut</p>\r\n', '2022-12-16 19:34:13', 1061, 'R', 12, NULL, 3382, 'PERANCANGAN CHATBOT INFORMASI MAHASISWA DENGAN ALGORITMA DEEP LEARNING', 'PERANCANGAN CHATBOT INFORMASI MAHASISWA DENGAN ALGORITMA DEEP LEARNING', '71170138', 'Y', 53, 184, 'T'),
(3352, '2022-11-25 21:30:44', '<p>N=300&nbsp;DITERIMA DENGAN REVISI MINOR</p>\r\n\r\n<p>Review:&nbsp;https://drive.google.com/file/d/1ae-YApKsTxh6gHmOOq2ScdUOHdandUMk/view?usp=share_link</p>\r\n', '2022-12-16 13:41:58', 642, 'R', 3, NULL, 3381, 'Perancangan Aplikasi System for Medical Logistic Delivery Berbasis Mobile dengan Metode User Centered Design', 'Perancangan Aplikasi System for Medical Logistic Delivery Berbasis Mobile dengan Metode User Centered Design', '71190491', 'Y', 14, 180, 'T'),
(3353, '2022-11-25 21:33:06', '<p>&nbsp;</p>\r\n\r\n<p>Proposal DE 2 ini sama persis dengan proposal DE 1. Sudah diberikan catatan sepanjang ini tetapi belum dilakukan / diperbaiki. Maka direkomendasikan ditolak.<br />\r\n<br />\r\nMohon diperhatikan dan diperbaiki sesuai hasil review berikut, seperti DE 1.<br />\r\n<br />\r\nCatatan Evaluator:<br />\r\n1. Ada ketidaksesuaian judul dengan isi proposal. Yang belum jelas adalah yang akan dibuat apakah aplikasi untuk BELAJAR bentuk alat musik, atau simulator alat musik yang bisa mengeluarkan suara? Dari judulnya dapat disimpulkan tujuannya adalah simulator alat musik, tetapi isi proposal tidak sesuai. Terlihat dari Rumusan masalah yang hanya dapat menampilkan alat musik berdasarkan marker. Jika demikian, maka judulnya harusnya diganti menjadi: &quot;.... Perancangan Aplikasi Pembelajaran Alat Musik Tradisional ......&quot;<br />\r\n2. JIka akan diarahkan ke pembelajaran, maka perlu disertakan perkiraan materi-materi dan sumbernya yang akan dimasukkan dalam aplikasi pembelajaran.<br />\r\n3. Tujuan dan Manfaat penelitian tidak sesuai, karena membicarakan dua hal yang berbeda.<br />\r\n4. Pada blok diagram sistem terlihat ada proses validasi yang bisa saja kembali ke tahap sebelumnya. Tetapi pada penjelasan yang diberikan tidak ada kriteria seperti apa dari hasil validasi, sehingga harus mengulang kembali tahap perancangan sistem<br />\r\n5. Pada tinjauan pustaka dikatakan bidang alat musik tradisional masih belum banyak ditemukan, tetapi pada tinjauan pustaka sudah ada beberapa yang membuat alat musik tradisional. Lalu bedanya di mana? Bisakah dijelaskan dengan lebih lengkap, mengapa alat musik tradisional maluku utara berbeda dengan alat musik tradisional lainnya?<br />\r\n6. Apa kaitan beberapa pustaka di tinjauan pustaka dengan yang akan anda lakukan? Sepertinya tidak ada hubungannya, karena anda tidak mencoba menjelaskan hubungannya.<br />\r\n7. Judul penelitian ini termasuk menarik dan bisa jadi layak untuk tugas akhir, tetapi masih banyak yang harus diperbaiki pada proposal ini</p>\r\n', '2022-12-05 10:53:23', 1061, 'K', 50, NULL, 3351, 'PERANCANGAN APLIKASI PEMBELAJARAN ALAT MUSIK TRADISIONAL MALUKU UTARA DENGAN AUGMENTED REALITY BERBASIS ANDROID', 'PERANCANGAN APLIKASI PEMBELAJARAN ALAT MUSIK TRADISIONAL MALUKU UTARA DENGAN AUGMENTED REALITY BERBASIS ANDROID', '71180382', 'T', 2, 184, 'T'),
(3354, '2022-11-25 21:34:44', '<p><strong>REVISI MAYOR 200</strong></p>\r\n\r\n<ul>\r\n	<li>LATAR BELAKANG<br />\r\n	Latar belakang sebaiknya terdiri dari permasalahan, kondisi saat ini dan solusinya. Perkembangan teknologi yg pesat bukan berarti dibutuhkan suatu situs web. Jelaskan secara spesifik, kebutuhan dari UKK UKDW tersebut apa sehingga dibutuhkan suatu sistem informasi.</li>\r\n	<li>BATASAN MASALAH<br />\r\n	Batasan masalah dituliskan supaya hal yang dikerjakan tidak terlalu luas. (1) bukan batasan masalah, karena sudah jelas judulnya berbasis web (2) bukan batasan masalah itu adalah metodologi pengembangan sistem, dijelaskan di bab 3 bagian metodologi (3) bukan batasan masalah itu adalah subjek penelitian yang dijelaskan di bab 3</li>\r\n	<li>Apa yang dijelaskan di Latar Beakang, Rumusan Masalah, Tujuan Penelitian dan Manfaat Penelitian harus saling terkait (koheren)</li>\r\n	<li>TINJAUAN PUSTAKA<br />\r\n	adalah penelitian2 sebelumnya yang terkait dengan penelitian yang akan dilakukan untuk menunjukkan kebaruan dan novelty topik (perbedaan dari penelitian2 yg sebelumnya), oleh sebab itu tinjauan pustaka juga sangat terkait dengan latar belakang, rumusan masalah, tujuan dan manfaat penelitian. Mis, mengapa tinjauan pustaka fokus pada usability testing, padahal itu bukan masalah yang akan diteliti (berdasarkan latar belakang masalah)</li>\r\n	<li>BLOK DIAGRAM SISTEM =? BLOK DIAGRAM PENELITIAN</li>\r\n	<li>METODE PENELITIAN<br />\r\n	Tidak dijelaskan metodenya apa, tapi hanya list perangkat keras dan perangkat lunak</li>\r\n</ul>\r\n', '2022-12-16 15:06:11', 625, 'R', 3, NULL, 3380, 'PERANCANGAN SISTEM INFORMASI UNIT KEGIATAN KEBUDAYAAN UNIVERSITAS  DUTA WACANA BERBASIS WEB', 'PERANCANGAN SISTEM INFORMASI UNIT KEGIATAN KEBUDAYAAN UNIVERSITAS  DUTA WACANA BERBASIS WEB', '71180366', 'Y', 9, 182, 'T'),
(3355, '2022-11-25 21:36:39', '<p>CATATAN KETUA:</p>\r\n\r\n<p>Pada batasan masalah poin1, dashboard apa yang anda maksud? dashboard awal, bukankan masih dengan excel</p>\r\n\r\n<p>Nilai = 300 REVISI MINOR</p>\r\n', '2022-12-16 09:40:35', 625, 'R', 9, NULL, 3379, 'ANALISA DAN PERANCANGAN DESAIN ANTARMUKA SISTEM PENDUKUNG KEPUTUSAN KELAYAKAN BIAYA  PELAYANAN  GKJ WIROBRAJAN  ', 'ANALISA DAN PERANCANGAN DESAIN ANTARMUKA SISTEM PENDUKUNG KEPUTUSAN KELAYAKAN BIAYA  PELAYANAN  GKJ WIROBRAJAN  ', '71190500', 'Y', 6, 181, 'T'),
(3356, '2022-11-25 21:40:05', '<p>Secara ide menarik dan berguna apabila benar bisa selesai dan benar benar digunakan. Tapi kemungkinannya kecil? Apakah karyawan/toko di kafet memungkinkan untuk implementasi?</p>\r\n\r\n<p>Rumusan masalah:</p>\r\n\r\n<p>Pemesanan terlalu lama? Apakah ini bisa selesai apabila menggunakan e-kafet? Wait, ini proses pesan atau proses layanan?</p>\r\n\r\n<p>Batasan masalah tidak mencerminkan batasan. Pelajari lagi cara menentukan batasan permasalahan.</p>\r\n\r\n<p>Cth: Mau buat sebuah gelas. Penelitian ini tidak membuat/meneliti warna gelas. Penelitian focus pada bentuk gelas.</p>\r\n\r\n<p>Tujuan:</p>\r\n\r\n<p>Merancang e-kafet saja?</p>\r\n\r\n<p>Menumpuknya pelanggan ini karena apa? Apakah dengan aplikasi e-kafet bisa solve? Padahal sepertinya banyak juga yang mengerjakan tugas di kafet?</p>\r\n\r\n<p>Umum:</p>\r\n\r\n<p>Bagaimana cara topup?</p>\r\n\r\n<p>Proses umum e-kafet tidak terlihat. Bagaimana proses kalau saya mau pesan makanan sampai bayar? Apakah langsung duduk? Pesan dulu, pilih nomor meja, atau bagaimana? Kalau saldo nya kurang? &gt;&gt; menggunakan usecase diagram tapi tidak menggunakan usecase deskripsi</p>\r\n\r\n<p>Proses pengujiannya akan seperti apa?</p>\r\n\r\n<p>Format:</p>\r\n\r\n<p>Daftar pustaka</p>\r\n\r\n<p>Beberapa tabel tidak menggunakan justify</p>\r\n\r\n<p>Nomor gambar</p>\r\n\r\n<p>Metode belum ada, harus ditambahkan dengan metode pengembangan perangkat lunak atau metode prototyping (sampai dengan level high fidelity) dan pengujian menggunakan kuesioner juga harus jelas.&nbsp; Harus ada looping pengembangan protototipe.</p>\r\n\r\n<p>Stakeholders: harus ada siapa, usernya harus tetap untuk digunakan mulai dari desain sampai pengembangan prototipe.&nbsp;&nbsp;</p>\r\n\r\n<p>Judul menggunakan metode prototyping.</p>\r\n\r\n<p>SKOR 225 (REV MAYOR)</p>\r\n', '2022-12-01 13:38:50', 625, 'R', 9, NULL, 3377, 'PERANCANGAN APLIKASI E-KAFET BERBASIS MOBILE', 'PERANCANGAN APLIKASI E-KAFET BERBASIS MOBILE', '71170160', 'T', 54, 183, 'T'),
(3358, '2022-12-07 20:48:23', '<p>REVISI MAYOR, NILAI = 200</p>\r\n\r\n<ul>\r\n	<li>Apakah sudah mendapatkan user yang akan membantu dalam penelitian ini?</li>\r\n	<li>Karena berkaitan dengan jual beli, bagaimana dengan proses pembayaran yang mungkin agak rumit untuk tuna aksara? Mengingat juga bahwa proses pembayaran berhubungan dengan uang, berarti harus aman bagi mereka yang tuna aksara.</li>\r\n	<li>Penulisan sitasi tidak benar, contoh: Menurut (Amelia, 2021) &ndash; seharusnya Menurut Amelia (2021).</li>\r\n	<li>Tinjauan pustaka kurang banyak, yang dua pertama hanya membahas design thinking. Tambahkan tinjauan pustaka yang berhubungan dengan penelitian Anda ini.</li>\r\n	<li>Pada landasan teori, XAMPP, VS Code tidak perlu dibahas karena hanya tool</li>\r\n	<li>Bagaimana anda bisa menerapkan SUS yang menggunakan kalimat bagi mereka yang tuna aksara??</li>\r\n	<li>Pada metodologi penelitian masih kurang spesifik apa yang akan dilakukan. Pembahasan terlalu general seperti template saja. Lalu, pada bagian SUS dan Usability testing mirip dengan landasan teori.</li>\r\n	<li>Class Diagram untuk saat ini tidak perlu</li>\r\n	<li>Penjelasan tentang flutter yg lebih detil dan mendalam, karena dari proposal tidak terlihat penguasaan materi terkait flutter</li>\r\n</ul>\r\n', '2022-12-16 10:21:25', 625, 'R', 19, NULL, 3376, 'PENGEMBANGAN FREE-TEXT UI UNTUK APLIKASI MOBILE MONDU FARM DI SUMBA TIMUR', 'PENGEMBANGAN FREE-TEXT UI UNTUK APLIKASI MOBILE MONDU FARM DI SUMBA TIMUR', '71190487', 'Y', 58, NULL, 'T'),
