(3541, '2023-07-18 11:40:59', '<ul>\r\n	<li>Rumusan no 2 itu sudah menjadi keharusan, sehingga bisa dihilangkan saja,&nbsp;</li>\r\n	<li>Batasan masalah masih terlalu umum, perlu diperjelas lagi, misalnya apakah sistem yang akan dibangun juga mengelola data-data keuangan? Menggunakan single-sign-on ?</li>\r\n	<li>Model evaluasinya apakah cukup hanya dengan kuisioner SUS?</li>\r\n	<li>Daftar pustaka ada baiknya ditambah, minimal 10 jurnal/publikasi dalam rentang 10 tahun terakhir.</li>\r\n	<li>Apakah sudah mendapatkan persetujuan dari SDN 09 untuk melakukan penelitian ini? Hal ini terkait dengan pengambilan data dan juga pengujian nantinya.</li>\r\n</ul>\r\n', '2023-07-21 09:48:31', 625, 'R', 57, NULL, 3582, 'RANCANGAN SISTEM INFORMASI KEGIATAN SEKOLAH\r\nBERBASIS WEBSITE (STUDI KASUS: SDN 09 ENGKALONG)', 'RANCANGAN SISTEM INFORMASI KEGIATAN SEKOLAH\r\nBERBASIS WEBSITE (STUDI KASUS: SDN 09 ENGKALONG)', '71170161', 'T', 15, 0, 'T'),
(3542, '2023-07-18 13:52:46', '<p>Secara umum:</p>\r\n\r\n<p>Heatmap tidak begitu cocok untuk mengevaluasi sistem ini. Jelaskan dengan detail bagaimana heatmap bisa digunakan untuk mendapatkan evaluasi sistem ini. Lalu kompleksitas perlu ditambah, tidak boleh hanya berupa informasi gereja saja... eksplorasi hal-hal lain yang dinamis yang diperlukan gereja.</p>\r\n\r\n<p>Bagian pendahuluan: Tidak ada referensi penelitian sebelumnya, apa itu analisis heatmap? Mengapa menggunakan GDD? Bagian batasan masalah: Mengapa Cuma Indonesia Timur? Berapa jumlah alat musiknya? Kalau Cuma sedikit tidak bisa digambarkan dalam bentuk visualisasi Harus ada cara menambah data pada sistem yg dibuat, tidak boleh statis dan Cuma seperti kalkulator Darimana akan dapat responden? Jelaskan&hellip;</p>\r\n\r\n<p>Bagian tujuan&nbsp; Menggunakan GDD tapi penggunanya siapa? Defisinikan dengan jelas, bagaimana cara mendapatkan responden? Apa yang menjadi ukuran bahwa sistem dikatakan berhasil / mendapat nilai bagus?</p>\r\n\r\n<p>Manfaat : Bagaimana bisa mengenali alat musik kalau Cuma Indonesia Timur? sekomplit apa informasi yang akan ditampilkan kalau Cuma Indonesia Timur saja?</p>\r\n\r\n<p>Tinjauan dan Teori: Semua tinjauan belum ada kaitan antara satu dan lainnya.</p>\r\n\r\n<p>Tinjauan ttg heatmap sangat sedikit. Teori juga sangat tidak lengkap. Teori bukan Cuma 1 paragraf tapi harus lengkap dan detaill. Rumus menghitung heatmap dimana? Diagram sankey sangat sedikit dan tidak jelas. Gamifikasi digunakan untuk apa pada sistem ini?</p>\r\n\r\n<p>Metodologi Penelitian Harus ditulis dengan detail sesuai konteks bukan Cuma teori saja<br />\r\n&nbsp;</p>\r\n\r\n<p>SKOR: 265 REV MAYOR</p>\r\n', '2023-07-20 08:52:38', 625, 'R', 12, NULL, 3583, 'Analisis Heatmap pada perancangan situs informasi alat musik tradisional Indonesia Timur', 'Analisis Heatmap pada perancangan situs informasi alat musik tradisional Indonesia Timur', '71180382', 'T', 17, 198, 'T'),
(3543, '2023-07-18 13:53:50', '<p>Penulisan:Untuk use case tidak perlu include login. tidak dijelaskan apa saja requirement/kebutuhan tiba2 ada use case.</p>\r\n\r\n<p>The Five Planes itu sebenarnya untuk apa? sampai tahap desain saja? atau sampai dengan aplikasi?</p>\r\n\r\n<p>User persona dilakukan pada saat tahap apa dari 5 planes?</p>\r\n\r\n<p>Apa itu Design Evaluation? Sepertinya tidak terlalu dijelaskan di proposal? digunakan dimana di metodologi penelitian?</p>\r\n\r\n<p>Bagaimana caramu nanti membuat &ldquo;sensory design&rdquo;?</p>\r\n\r\n<p>Lain-lain:Matkul pendukung hanya 1 (Desain Eksperimental)</p>\r\n\r\n<p>Metodologi penelitian dituliskan SETELAH landasan teori</p>\r\n\r\n<p>SKOR 290 REV MAYOR<br />\r\n&nbsp;</p>\r\n', '2023-07-31 14:01:53', 625, 'R', 15, NULL, 3585, 'RANCANG BANGUN UI/UX WEBSITE PELATIHAN BALAI PEMERINTAHAN DESA DI YOGYAKARTA KEMENDAGRI', 'RANCANG BANGUN UI/UX WEBSITE PELATIHAN BALAI PEMERINTAHAN DESA DI YOGYAKARTA KEMENDAGRI', '71170235', 'Y', 55, 198, 'T'),
(3544, '2023-07-18 14:19:58', '<p>- Perlu dijelaskan karakteristik yang membedakan Kota Denpasar dibanding kota lain dalam hal pengelolaan sampah, sehingga aplikasi ini dibuat spesifik khusus di Kota Denpasar</p>\r\n\r\n<p>- Bali Waste Cycle kok disingkat BWL ya?</p>\r\n\r\n<p>- Belum terdapat penjelasan mengenai pemilihan metode &amp; teknologi yang ada, karena daftar kebutuhan sendiri belum disebutkan, misalnya mengapa menggunakan MVC, NoSQL, dan lain-lain.</p>\r\n\r\n<p>- Tinjauan pustaka masih kurang, terutama sumber utama seperti jurnal.</p>\r\n\r\n<p>REV MAYOR (210)</p>\r\n', '2023-07-31 13:32:54', 625, 'R', 39, NULL, 3586, 'PERANCANGAN APLIKASI E-TRASH BERBASIS ANDROID DI KOTA DENPASAR', 'PERANCANGAN APLIKASI E-TRASH BERBASIS ANDROID DI KOTA DENPASAR', '71170231', 'Y', 50, 198, 'T'),
(3545, '2023-07-18 14:20:46', '<p>REV MAYOR: 285</p>\r\n\r\n<p>Penulisan:Sepertinya profilnya adalah UI/UX, tapi fokus sistem adalah pemberian rekomendasi</p>\r\n\r\n<p>Menggunakan metode UCD, tp yg dibahas waterfall dan prototype&nbsp;Banyak hal dituliskan di landasan teori, tp tidak digunakan di bab metodologi penelitian</p>\r\n\r\n<p>Apakah pada penelitian ini akan mengadakan berbagai jenis pengujian dari unit testing sampai validation testing?</p>\r\n\r\n<p>Apakah semua metode di blackbox testing akan digunakan?</p>\r\n\r\n<p>High-order testing sebenarnya sudah cukup kompleks, dan semua yg kamu sebutkan di proposal ada di dalam high-order testing http://diranieh.com/Testing/HigherOrderTesting.htm</p>\r\n\r\n<p>Intinya sih, sebenarnya apa sih yang ingin dilakukan dari penelitian ini?&nbsp;</p>\r\n\r\n<p>Format Penulisan:Banyak typo</p>\r\n\r\n<p>Cara sitasi masih salah</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n', '2023-07-31 13:51:20', 625, 'R', 19, NULL, 3584, 'PENGEMBANGAN APLIKASI FITNESS HELPER DENGAN METODE ANALYTHYCAL HIERARCHI PROCESS (AHP)  UNTUK PEMILIHAN PROGRAM LATIHAN', 'PENGEMBANGAN APLIKASI FITNESS HELPER DENGAN METODE ANALYTHYCAL HIERARCHI PROCESS (AHP)  UNTUK PEMILIHAN PROGRAM LATIHAN', '71170167', 'Y', 55, 198, 'T'),
(3546, '2023-07-18 14:21:44', '<p>Secara umum proposal sudah dapat ditulis dengan baik, tetapi ada beberapa perbaikan dalam beberapa hal:</p>\r\n\r\n<p>1. Judul: Hindari penulisan judul dengan kata singkatan</p>\r\n\r\n<p>2. Latar belakang: perlu adanya penjelasan terkait urgensi penilitian yang akan dikerjakan. Perlu dicantukan referensi pada penulisan data di latar belakang</p>\r\n\r\n<p>3. Rumusan masalah: merupakan permasalahan yang akan anda selesaikan dengan kegiatan penelitian, buka permasalahan yang anda hadapi saat melakukan penelitian ini</p>\r\n\r\n<p>4. Tujuan Penelitian: perlu diperbaiki penulisannya</p>\r\n\r\n<p>5. Tinjauan Pustaka: perlu ditambahkan refernsi terbaru Selebihnya dapat dilihat pada proposal.</p>\r\n\r\n<p>SKOR 310 REV MINOR<br />\r\n&nbsp;</p>\r\n', '2023-07-20 08:49:46', 625, 'R', 57, NULL, 3587, 'PERANCANGAN GAME 3D MIX GENRE FPS TOWER DEFENSE', 'PERANCANGAN GAME 3D MIX GENRE FPS TOWER DEFENSE', '71180372', 'T', 53, 198, 'T'),
(3547, '2023-07-18 14:57:11', '<p>- karena ini dokumen ilmiah, maka tata bahasa seharusnya dibuat lebih formal, masih banyak kata-kata tidak baku seperti &#39;ruwet&#39;, &#39;belum lagi&#39;, dll.</p>\r\n\r\n<p>- permasalahan yang diangkat berdasarkan opini personal, bukan berdasarkan data, sehingga tidak dapat dipastikan apakah betul website jarang diakses karena faktor-faktor yang disebutkan.<br />\r\n<br />\r\n- improvement yang akan dilakukan juga tidak jelas dan tidak berkaitan dengan permasalahan yang diangkat.</p>\r\n\r\n<p>SKOR: 200 rev mayor</p>\r\n', '2023-07-31 14:21:54', 625, 'R', 57, NULL, 3588, 'REDESIGN DAN EVALUASI WEBSITE DINAS PARIWISATA DAN EKONOMI KREATIF PROVINSI NUSA TENGGARA TIMUR', 'REDESIGN DAN EVALUASI WEBSITE DINAS PARIWISATA DAN EKONOMI KREATIF PROVINSI NUSA TENGGARA TIMUR', '71170212', 'Y', 50, 198, 'T'),
(3548, '2023-07-18 14:58:46', '<p>Secara umum: Penbuatan sistem seperti ini sudah sangat banyak, apa bedanya?<br />\r\nLalu teori yang digunakan dan evaluasi yang akan digunakan tidak dituliskan dengan lengkap.<br />\r\n<br />\r\nBagian pendahuluan: Tidak ada referensi penelitian sebelumnya, belum ada informasi mengenai metode penelitian dan evaluasi yg akan digunakan<br />\r\nTinjauan dan Teori: Semua tinjauan belum ada kaitan antara satu dan lainnya. Tinjauan pustaka tambahkan 1 paragraf lagi tentang apa yang akan dilakukan penulis dan perbedaan dengan penelitian sebelumnya. Teori semuanya harus direvisi!!! Tuliskan semua teori dengan lengkap bukan Cuma 1 paragraf saja. Bagian yang tidak perlu bisa dibuang.<br />\r\nMetodologi Penelitian Harus ditulis dengan detail sesuai konteks bukan cuma teori saja. Jangan ada bagian yang berulang.</p>\r\n\r\n<p>SKOR: 220 REV MAYOR<br />\r\n&nbsp;</p>\r\n', '2023-07-31 14:39:16', 625, 'R', 50, NULL, 3589, 'PEMBUATAN APLIKASI INFORMASI KEGIATAN GEREJA HAGIOS FAMILY BERBASIS MOBILE', 'PEMBUATAN APLIKASI INFORMASI KEGIATAN GEREJA HAGIOS FAMILY BERBASIS MOBILE', '71170178', 'Y', 17, 198, 'T'),
(3549, '2023-07-18 15:43:18', '<p>1 Perlu diperhatikan KPI yang akan dijadikan tolak ukur dalam data yang akan ditampilkan pada dashboard</p>\r\n\r\n<p>2 Bagaimana dengan integrasi data dengan sistem data warehouse yang ada untuk meminimalkan redundansi data pada data dosen?</p>\r\n\r\n<p>SKOR 330 rev minor</p>\r\n', '2023-07-31 12:17:29', 625, 'R', 9, NULL, 3590, 'IMPLEMENTASI DASHBOARD UNTUK BEBAN TUGAS DOSEN PADA FAKULTAS TEKNOLOGI INFORMASI UNIVERSITAS KRISTEN DUTA WACANA', 'IMPLEMENTASI DASHBOARD UNTUK BEBAN TUGAS DOSEN PADA FAKULTAS TEKNOLOGI INFORMASI UNIVERSITAS KRISTEN DUTA WACANA', '71170162', 'Y', 15, 198, 'T'),
