(3799, '2024-05-11 20:31:01', '<p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pendahuluan<br />\r\n-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pendahuluan terlalu melompat-lompat, tuliskan secara urut latar belakang lalu muncul maslaah.&nbsp; Masalahnya tidak jelas, apa yg jadi masalah sebenarnya? Mengapa harus menggunakan SOA? Lalu mengapa mengambil case virtual classroom? Virtual classroom belum banyak dibahas<br />\r\n-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Rumusan masalah masih belum tepat karena belum jelas masalahnya apa<br />\r\n-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tujuan penelitian fokus 1 atau 2 saja yang mau dibuat apa dan bagaimana evaluasinya<br />\r\n-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Evaluasinya harus ada evaluasi SOA nya jangan Cuma black box testing saja (BVA), gunakan matrix evaluasi SOA yg anda bangun dengan referensi dari jurnal<br />\r\n-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sitasi menggunakan APA harus ada di bagian pendahuluan untuk mendukung tulisan Anda<br />\r\n-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Manfaat penelitian fokus saja di pendidikan<br />\r\n2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tinjauan Pustaka:<br />\r\n-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sitasi salah tidak menggunakan APA, diperbaiki!<br />\r\n-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Referensi ttg virtual classroom dan SOA masih kurang, ditambah<br />\r\n-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tambah 1 paragraf lagi ttg rangkuman persamaan dan perbedaan dengan referensi, apa yg anda teliti<br />\r\n3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Teori<br />\r\n-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Teori jangan Cuma 1 paragraf saja, harus lengkap dan detail<br />\r\n-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Arsitektur SOA harus ada dan penjelasannya<br />\r\n-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Matrix evaluasi SOA juga belum ada<br />\r\n-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Virtual classroom jg belum ada teorinya<br />\r\n-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Gunakan APA yg benar dan otomatis<br />\r\n-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Gambar yg digunakan pada teori harus diacu dari referensi mana<br />\r\n-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Black box testing blm ada contoh kuesioner / test casenya<br />\r\n4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Block diagram<br />\r\n-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Belum ada bagian ttg case studi virtualclassroomnya<br />\r\n5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Metode penelitian koq terkesan teori, padahal ini metode yg anda lakukan secara detail dan sesuai dengan kasus, bukan teori formalitas saja<br />\r\n6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Daftar pustaka : gunakan APA secara otomatis dan formatnya diperbaiki, hanging paragraf bukan Cuma mepet kiri semua</p>\r\n\r\n<p>SKOR: 285 REV MAYOR</p>\r\n', '2024-05-31 14:47:28', 625, 'R', 59, NULL, 3844, 'RANCANG BANGUN METAVERSE VIRTUAL CLASSROOM DENGAN SERVICE ORIENTED ARCHITECTURE  ', 'RANCANG BANGUN METAVERSE VIRTUAL CLASSROOM BERBASIS SERVICE ORIENTED ARCHITECTURE  ', '71200660', 'Y', 17, 216, 'T'),
(3800, '2024-05-11 20:35:38', '<ul>\r\n	<li>Apakah memang perlu ada rumusan masalah yang kedua? kalau ada berarti dalam tujuan penelitian perlu ditambahkan juga untuk mengukut dampak positif dampak positif dari penggunaan website sebagai alat komunikasi dan manajemen informasi terkait jadwal pelayan ibadah terhadap partisipasi aktif umat.</li>\r\n	<li>Landasan Teori masih salah penempatan, misal informasi GKI di dalam sub bab Laravel, mestinya yang diangkat laravel nya bukan GKI nya.</li>\r\n	<li>Dalam sub bab matching graph bisa ditambahkan contoh kasus pembuatan matching graph secara manual</li>\r\n	<li>Daftar pustaka masih banyak yang terlalu lama waktunya, bisa ditambahkan porsi artikel yang di bawah 5 tahun</li>\r\n	<li>Skor 270 REV MAYOR</li>\r\n</ul>\r\n', '2024-05-31 14:53:43', 625, 'R', 39, NULL, 3842, 'PERANCANGAN DAN IMPLEMENTASI WEBSITE JADWAL PELAYAN IBADAH UNTUK GEREJA SANTA MARIA ASUMPTA KLATEN', 'PERANCANGAN DAN IMPLEMENTASI WEBSITE JADWAL PELAYAN IBADAH UNTUK GEREJA SANTA MARIA ASUMPTA KLATEN', '71200598', 'Y', 7, 216, 'T'),
(3801, '2024-05-11 20:37:44', '<ul>\r\n	<li>Mohon konsultasi dengan calon dosen pembimbing untuk memantapkan arah penelitian, terlebih mengenai metode pengukuran dan aspek-aspek yang diperlukan untuk user experience (kalau memang akan mengarah ke sana)</li>\r\n	<li>Sesuaikan landasan teori dengan hasil konsultasi dengan calon dosen pembimbing.</li>\r\n	<li>Komentar bagian per bagian masih sama dengan DE yang sebelumnya saya evaluasi.</li>\r\n	<li>SKOR 205 REV MAYOR</li>\r\n</ul>\r\n', '2024-05-13 15:20:26', 625, 'R', 57, NULL, 3845, 'PERANCANGAN GAME 3D MIX GENRE FIRST PERSON SHOOTER TOWER DEFENSE', 'PERANCANGAN GAME 3D MIX GENRE FIRST PERSON SHOOTER TOWER DEFENSE', '71180372', 'T', 3, 216, 'T'),
(3802, '2024-05-11 20:39:09', '<p>1.Pada Rumusan Masalah tertulis &ldquo;Bagaimana sistem inventaris barang dapat mengurangi kemungkinan kesalahan yang mungkin terjadi ketika menggunakan cara manual?&rdquo; .. maka dalam metodologi perlu dituliskan metode-metode yg digunakan untuk mengurangi kesalahan itu.. Metode apa yang akan digunakan untuk merancang Web ?<br />\r\n2. Pada judul perlu ditambahkan juga pembuatan sehingga tidak hanya melakukan perancangan pada Web. Sehingga judulnya menjadi PERANCANGAN DAN PEMBUATAN APLIKASI WEBSITE PENJUALAN DAN INVENTARIS BARANG TOKO MENGGUNAKAN PHP DAN MYSQL<br />\r\n3. Dalam skripsi ini juga harus dicantumkan BARANG TOKO apa ?? Supaya lebih fokus dan lebih kongkrit dalam pembuatannya.<br />\r\n4. Pada Landasan Teori perlu diberikan &ldquo;Sistem Informasi PENJUALAN DAN INVENTARIS BARANG&rdquo; itu seperti apa ?? Penambahan landasan teori perlu dilakukan dengan mengacu pada beberapa jurnal yang terkait dengan itu, jadi perlu penambahan referensi yang sesuai. Referensinya masih sangat sedikit.<br />\r\n5. Pada Landasan Teorinya perlu ditambahkan bagan alir Metode Waterfall.<br />\r\n6. Diagram alir dari penelitian perlu dijelaskan dan dijabarkan lagi.. Tiap tahap itu dilaksanakan kapan ?? dan tiap tahap itu menghasilkan outcome apa ??</p>\r\n\r\n<p>Level skripsi ini masih KP, perlu ditambah kompleksitas dan metodologi.</p>\r\n\r\n<p>SKOR: 215 REV MAYOR</p>\r\n', '2024-05-13 15:22:28', 625, 'R', 19, NULL, 3846, 'PERANCANGAN APLIKASI WEBSITE PENJUALAN DAN INVENTARIS BARANG TOKO MENGGUNAKAN PHP DAN MYSQL', 'PERANCANGAN APLIKASI WEBSITE PENJUALAN DAN INVENTARIS BARANG TOKO MENGGUNAKAN WATERFALL', '71190461', 'T', 16, 216, 'T'),
(3803, '2024-05-11 20:41:17', '<p>1. Penulisan belum mengikuti template.</p>\r\n\r\n<p>2. Rumusan masalah adalah sesuatu yang akan diteliti, diukur, dan disimpulkan. Hindari membuat rumusan masalah dengan kata &quot;bagaimana&quot;, karena akan kesulitan untuk menyimpulkan secara ringkas.<br />\r\nContoh rumusan untuk kasus ini:<br />\r\n- Apa saja yang menyebabkan penjualan toko anjlok?<br />\r\n- Apakah solusi yang diberikan mampu meningkatkan penjualan?<br />\r\n- Seberapa tingkat kepuasan pemilik toko terhadap solusi yang diberikan?<br />\r\n- Seberapa tingkat customer retention untuk kembali berbelanja melalui sistem baru yang ditawarkan?</p>\r\n\r\n<p>3. Hindari kata &quot;sehingga&quot; di Tujuan Penelitian. Apa yang akan Anda lakukan, itu saja. Kata &quot;sehingga&quot; akan membingungkan Anda sendiri ketika kemudian menulis Manfaat Penelitian.</p>\r\n\r\n<p>4. Manfaat Penelitian dilihatnya dari sisi mitra. Bukan dari Anda atau civitas akademika.</p>\r\n\r\n<p>5. Awali Tinjauan Pustaka dengan kalimat: &quot;Dalam membangun solusi terhadap permasalahan ini, penulis akan menggunakan metode A..B..C.. Kajian terhadap metode A antara lain dari penelitian X...&quot;</p>\r\n\r\n<p>6. Beberapa hal yang perlu menjadi concern: payment gatewaynya bagaimana? Hostingnya di mana?</p>\r\n\r\n<p>SKOR: 200 REV MAYOR</p>\r\n', '2024-05-13 15:24:52', 625, 'R', 19, NULL, 3847, 'PERANCANGAN APLIKASI PENJUALAN BERBASIS WEB PADA TOKO BUNGA SUNFLOWER', 'RANCANG BANGUN APLIKASI PENJUALAN BERBASIS WEB PADA TOKO BUNGA SUNFLOWER', '71190442', 'T', 39, 216, 'T'),
(3804, '2024-05-11 20:42:54', '<p><strong>Penulisan:</strong><br />\r\n- Ada cukup banyak typo<br />\r\n- Font dan spacing yang berbeda-beda</p>\r\n\r\n<p><strong>Latar Belakang:</strong><br />\r\n- Masalah yang dihadapi terlalu simple fokus pada pengelolaan inventarisasi obat.<br />\r\n- Apa hubungannya antara inventari obat dengan kualitas layanan pelanggan.<br />\r\n- Di Teori dijelaskan berbagai macam jenis obat, mungkin bisa ditambahkan untuk pembelian obat. Jika obat yg tidak dapat dijual bebas, maka perlu resep dokter.<br />\r\n- Sepertinya PERLU ADA PENAMBAHAN FITUR lain</p>\r\n\r\n<p><strong>Rumusan Masalah</strong><br />\r\n- Gimana cara kamu nanti mengukur akurasi dan efisiensi?</p>\r\n\r\n<p><strong>Metode Penelitian</strong><br />\r\n- Ada yang aneh pada Metode Pengembangan Sistem. Dijelaskan bahwa &quot; Membuat desain sistem melibatkan pembuatan use case,activity diagram,database design.&quot; Nah, seteah itu desain akan dujikan ke user. Mengapa desain yang diujikan?<br />\r\n- Ka[an bikin aplikasinya? Karena setelah itu dilakukan usability testing<br />\r\n- Tidak diberitahu metode apa yang akan digunakan untuk pengembangan aplikasi? Tidak ada di manapun yang mengatakan akan menggunakan metode apa. di Teori hanya menyebutkan obat-obatan saja<br />\r\n- TIDAK ada diagram alir penelitian</p>\r\n\r\n<p>SKOR: 200 REV MAYOR</p>\r\n', '2024-05-31 11:09:42', 625, 'R', 8, NULL, 3848, 'Perancangan Sistem Untuk Manajeman Persedian Stok Obat Berbasis Web Di Apotek Sartika Farma', 'Rancang Bangun Sistem Manajeman Persedian Stok Obat Berbasis Web Di Apotek Sartika Farma', '71200648', 'Y', 55, 216, 'T'),
(3805, '2024-05-11 20:45:42', '<ul>\r\n	<li>Pada bagian latar belakang masalah, tidak terlalu jelas apa permasalahan yang akan diangkat dalam penelitian ini.&nbsp; Masalah tidak adanya koneksi internet di zaman seperti sekarang sepertinya sudah tidak relevan, kecuali misalnya untuk daerah terpencil.&nbsp; Jadi kebutuhan aplikasi yang akan anda buat sebenarnya tidak ada/tidak terlalu penting.&nbsp; Game guide atau walkthrough sebenarnya bisa disimpan sebagai PDF, sehingga bisa dibaca offline kalau diperlukan.&nbsp; Untuk apa dibuat aplikasi? Aplikasinya juga perlu koneksi internet untuk meng-update datanya.</li>\r\n	<li>Penggunaan istilah aplikasi kamus sepertinya tidak sesuai.&nbsp; Lebih baik jika menggunakan istilah aplikasi game guidebook misalnya.</li>\r\n	<li>Rumusan masalah yang diberikan kurang tepat, karena pada latar belakang tidak dibahas tentang masalah database, feedback, tampilan, dsb.</li>\r\n	<li>Batasan masalah juga tidak sesuai, seharusnya berisi tentang batasan permasalahan yang akan diangkat dibatasi sampai mana.&nbsp; Misalnya hanya berisi guide dari game-game console.</li>\r\n	<li>Tinjauan pustaka terpotong dan hanya ada 1 saja (di file pdf), seharusnya minimal 3.</li>\r\n	<li>Pada landasan teori seharusnya dibahas tentang bentuk guide game / walkthrough itu apa, bentuknya apa saja, biasa diakses bagaimana. Apakah sudah ada aplikasi sejenis?</li>\r\n	<li>Pada latar belakang masalah dibahas tentang masalah koneksi internet, tapi pada skema jaringan internet kenapa ada internet-nya?</li>\r\n	<li>Blok diagram sistem tidak ada gambarnya (Gambar 6)?</li>\r\n	<li>Pada bagian metode penelitian ada membahas tentang metode Prototype (Prototyping), tapi tidak ada di landasan teori?</li>\r\n	<li>Metode pengujian dengan Black Box mustinya dibahas di Landasan Teori</li>\r\n	<li>Mungkin bisa lebih dijelaskan apa maksud dari data primer dan data sekunder (pada bagian penyusunan laporan), data seperti apa yang akan dikumpulkan?</li>\r\n	<li>Daftar pustaka banyak tetapi sepertinya yang dikutip hanya beberapa saja.&nbsp; Kalau tidak dikutip, tidak perlu dimasukkan ke Daftar Pustaka.</li>\r\n	<li>Gambar-gambar yang diambil dari Internet / tempat lain, bukan buatan sendiri, mustinya diberikan sumbernya.</li>\r\n	<li>SKOR 165 DITOLAK</li>\r\n</ul>\r\n', '2024-05-13 18:04:10', 625, 'K', 3, NULL, 3850, 'RANCANG BANGUN APLIKASI OFFLINE DICTIONARY FOR GAMES BERBASIS DESKTOP', 'RANCANG BANGUN APLIKASI OFFLINE DICTIONARY FOR GAMES BERBASIS DESKTOP', '71180266', 'T', 2, 216, 'T'),
(3806, '2024-05-12 06:19:42', '<p>Bagaimana mengukur efisiensi, integritas, dan efektivitas database dalam konteks ini?</p>\r\n\r\n<p>Kompleksitas topik yang diusulkan masih belum seimbang dengan beban 6 SKS yang diberikan</p>\r\n\r\n<p>Pembuatan use case diagram juga masih keliru, salon itu bukan entitas</p>\r\n\r\n<p>Activity diagram yang dibuat juga masih salah. Activity diagram itu melibatkan entitas yang terlibat, bukan untuk menggambarkan alur penelitian</p>\r\n\r\n<p>Metodologi evaluasi pengujian tidak dituliskan dengan jelas</p>\r\n\r\n<p>Teori yang digunakan sangat minim dan tidak ada referensi yang jelas</p>\r\n\r\n<p>Daftar pustaka belum diurutkan secara alphabetik</p>\r\n\r\n<p>Sebaiknya konsultasi dulu dengan salah satu dosen terkait judul yang akan dibuat untuk menghemat waktu Anda dalam membuat laporan</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>SKOR: 160 (DITOLAK)</strong></p>\r\n', '2024-05-13 18:20:16', 625, 'K', 39, NULL, 3849, 'PERANCANGAN DAN IMPLEMENTASI SISTEM BASIS DATA UNTUK MANAJEMEN PENYEWAAN BARANG PADA SALON AMI: STUDI KASUS DI TANA TORAJA', 'PERANCANGAN DAN IMPLEMENTASI SISTEM BASIS DATA UNTUK MANAJEMEN PENYEWAAN BARANG PADA SALON AMI: STUDI KASUS DI TANA TORAJA', '71200610', 'T', 15, 216, 'T'),
